INSERT INTO `activities` (`id`, `site_id`, `location_id`, `parent_id`, `title`, `description`, `map_link`, `map_label`, `map_labelalt`, `map_link2`, `map_label2`, `map_labelalt2`, `info_link`, `activity_type`, `highlights`, `wildlife`, `facilities`, `parking`, `cost`, `distance`, `difficulty`, `elevation`, `season`, `public_transportation`, `trail_type`, `user_id`, `view_count`, `published_flag`, `approved_flag`, `deleted_flag`, `created_at`, `updated_at`) VALUES
(1, 1, 4, 1, 'Seattle Waterfront to Lake Union via Ship Canal', 'This 8.5 mile Hike or Bike loop starts at the Olympic Sculpture Park at the entrance to Myrtle Edwards Park (Broad Street and Elliot Avenue). From the Elliot Bay Trail there is a protected bike trail that connects with the South Ship Canal Trail, then joins the Lake Union Loop Trail.', 'https://www.google.com/maps/d/embed?mid=1nQgyjs8LTmg3s8rUhpqtJyspKl_cONkg', 'Google Map:', 'Click here to open in Google Maps', 'https://www.wikiloc.com/wikiloc/spatialArtifacts.do?event=view&id=28227405&measures=off&title=off&near=off&images=off&maptype=S', 'Wikiloc Map:', 'Click here to open in Wikiloc', NULL, NULL, 'Fantastic views of Downtown Seattle, Elliot Bay, Puget Sound, the Olympic Mountains.', NULL, 'Bathrooms, Benches, Picnic Tables', 'Paid Street Parking, There is a free parking lot on the north end of Myrtle Edwards Park on 16th Ave W', NULL, '8.5 miles / 13.7 km', 'Easy', 'None', 'Year-round', 'Many options', 'Hike or Bike', 1, 3, 1, 1, 0, '2018-05-16 20:27:59', '2018-09-29 14:52:39'),
(2, 1, 4, 2, 'Burke-Gilman Trail', 'The Burke-Gilman Trail is a popular 27 mile (43 km) recreational trail for walkers, runners, cyclists, skaters and commuters. Built in the 1970s as one of the first rail trails, it starts north of downtown Seattle in Ballard goes north along Lake Washington and ends in the suburb of Bothel. There it connects to the East Lake Sammamish Trail which continues all the way to Issaquah.\r\n\r\nThere are many access points to this trail, such as:\r\n- The Ship Canal and Lake Union in Fremont\r\n- The University of Washington Link Rail stop', 'https://www.google.com/maps/d/embed?mid=1trdy11SsAlrshU2zhzvoJlSFbpmqd3dq', NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'This is the classic Seattle hike/bike/walking trail with connections to downtown, Lake Washington, and many other trails.', NULL, 'Park benches, a few bathrooms', 'Many options', NULL, '27 miles / 43 kms', 'Easy', 'None', 'Year-round', 'Many options', 'Out and Back', 1, 2, 1, 1, 0, '2018-05-16 22:34:28', '2018-06-01 23:40:25'),
(3, 1, 7, 3, 'West Seattle: California Ave', 'California Ave is the main street of West Seattle. With plenty of bars, restaurants, the ubiquitous coffee and cupcake shops, a movie theater, a weed shop, and many other small stores, this is a unique and delightful place to wander around in. The main cluster of businesses is at \"The Junction\" which is the intersection of California Ave and Alaska Street.', 'https://www.google.com/maps/d/embed?mid=1IuIhRBev5aEMfguG2DeH8ymL-ck6_qu4', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'Coffee Shops, Restaurants, Stores, Bars', 'Free street parking in the surrounding neighborhoods.', NULL, '2.5 miles, one-way', 'Easy', NULL, 'Year-round', 'RapidRide Bus C', NULL, 1, 3, 1, 1, 0, '2018-05-16 22:47:20', '2018-07-14 10:59:28'),
(4, 1, 7, 4, 'Lincoln Park Hike', 'With views of the snow-capped Olympic Mountains and the San Juan Islands, this 2 mile partially paved, out and back or loop trail follows the Pacific coastline. \r\n\r\nTo make it a loop, follow the ocean front trail and return by going up to the bluff through the old growth forest with more ocean views.', 'https://www.google.com/maps/d/embed?mid=1DCC6Grd1QN9n_vAdYMMJCgy5h8Hegfa5', 'Google Map:', 'Click here to open in Google Maps', 'https://www.wikiloc.com/wikiloc/spatialArtifacts.do?event=view&id=28227156&measures=off&title=off&near=off&images=off&maptype=S', 'Wikiloc Map:', 'Click here to open in Wikiloc', NULL, NULL, 'Epic views of Elliot Bay and the Olympic Mountains.', 'waterfowl (always) seals (frequently can be seen sunning themselves on a platform in front of the first house on the far end of the coast) bald eagles (rare) dolphins (rare) whales (very rare)', 'Bathrooms, Park Benches, Picnic tables, BBQ Grills, Pavilions', 'Free in the parking lots along Fauntleroy Ave', NULL, '2 miles', 'Easy', '200 ft.', 'Year-round', 'RapidRide Bus C connects to downtown Seattle', NULL, 1, 4, 1, 1, 0, '2018-05-16 22:49:19', '2019-01-27 22:10:18'),
(5, 1, 7, 5, 'Alki Beach Trail', 'Alki Trail and Alki Beach Park is a 3 mile long ocean front promenade that runs from Alki Point to Duwamish Head on Elliott Bay. It\'s a great spot for a walk or bike ride any time of year, and in the summer draws joggers, roller-bladers, volleyball players, beachcombers, sunbathers, bicyclists and strollers out to enjoy the sun.', 'https://www.google.com/maps/d/embed?mid=1n1bbV3bRJEL6KAl3H5Gbr8cpo6cv7qiJ', 'Google Map:', 'Click here to open in Google Maps', 'https://www.wikiloc.com/wikiloc/spatialArtifacts.do?event=view&id=28227688&measures=off&title=off&near=off&images=off&maptype=S', 'Wikiloc Map:', 'Click here to open in Wikiloc', NULL, NULL, 'Best day and night views of downtown Seattle. Popular bar, restaurant, and coffee shop scene, lively at night', 'waterfowl, sea lions (occasionally), bald eagles (rare)', 'Bathrooms, Park Benches, Picnic tables, Boat dock, Fire Pits, Volleyball net posts (nets not included)', 'Free street parking along Alki Ave', NULL, '5 miles', 'Easy', 'None', 'Year-round', 'Bus 56 connects to downtown Seattle. Bus 50 connects to California Ave, West Seattle', 'Point to point', 1, 6, 1, 1, 0, '2018-05-16 22:52:24', '2018-11-14 01:17:59'),
(6, 1, 7, 6, 'West Seattle Water Taxi', 'The West Seattle Water Taxi connects downtown with West Seattle and provides some of the best views of downtown Seattle. \r\n\r\nThe Water Taxi connects downtown with the Alki Beach Trail, a 2.5 mile promenade with fantastic views of Downtown Seattle, Puget Sound, and the Olympic mountains.\r\n\r\n[Prices and schedule information](https://www.kingcounty.gov/depts/transportation/water-taxi/west-seattle.aspx)\r\n\r\nDue to construction at the Seattle waterfront, the entrance to the King County Water Taxis is currently between Ivar\'s Seafood and the Subway Restaurant.', 'https://www.google.com/maps/d/embed?mid=19XbdJ_BHu7KJ2x1ErCAVwhWee4YKVMlM', NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'Best views of downtown Seattle especially in the evening and at night.', NULL, NULL, NULL, NULL, '2 miles / 3.2 kms each way', NULL, NULL, 'Year-round', 'Many options', NULL, 1, 2, 1, 1, 0, '2018-05-16 22:54:32', '2018-06-01 23:40:17'),
(7, 1, 5, 7, 'Olympic National Park - Madison Falls', 'Created where Madison Creek meets the Elwha River, Madison Falls is located within the Olympic National Park, west of Port Angeles, Washington. The falls is about 50 feet high with a light flow.  The paved trail to the falls is very short (less than 100 meters) and is child-friendly and wheelchair accessible.\r\n\r\nThere is a beautiful stretch of the Elwha River right in front of the parking area.', 'https://www.google.com/maps/embed?pb=!1m18!1m12!1m3!1d2710.2920584038284!2d-123.59216456366225!3d48.04113304754778!2m3!1f0!2f0!3f0!3m2!1i1024!2i768!4f13.1!3m3!1m2!1s0x548e4ce6eddc41e1%3A0x9df3fc8f82751726!2sMadison+Falls+Trailhead!5e0!3m2!1sen!2sus!4v1526504863648', NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'Easily accessible waterfall but not very spectacular.  The Elwha River in front of the parking lot is more interesting.', NULL, 'None', 'Free, no passes required', NULL, '100 meters', 'Easy', 'None', 'Year-round', NULL, 'Out and Back', 1, 3, 1, 1, 0, '2018-05-17 02:08:53', '2018-06-05 21:34:02'),
(8, 1, 5, 8, 'Olympic National Park - Hurricane Ridge Visitors Center', 'Hurricane Ridge is the most easily accessed mountain area within Olympic National Park. In clear weather, fantastic views can be enjoyed throughout the year.\r\n\r\nHurricane Ridge is located 17 miles south of Port Angeles on Hurricane Ridge Road, off Mount Angeles Road.\r\n\r\nThe road is open throughout summer. During the winter season, the road is scheduled to be open Friday through Sunday and holiday Mondays, weather and road conditions permitting, and closed all other days. All vehicles must carry tire chains during the winter season.\r\n\r\n[Hurricane Ridge Web Cams](https://www.nps.gov/olym/learn/photosmultimedia/hurricane-ridge-webcam.htm)', 'https://www.google.com/maps/embed?pb=!1m18!1m12!1m3!1d2671.306286801456!2d-123.50058658442354!3d47.96913727921039!2m3!1f0!2f0!3f0!3m2!1i1024!2i768!4f13.1!3m3!1m2!1s0x548e4aec9a9ce0a7%3A0x406b3943986bc515!2sHurricane+Ridge+Visitor+Center!5e0!3m2!1sen!2sus!4v1526505187075', NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'Beautiful views of the Olympic Mountains.  The drive up to Hurricane Ridge is interesting and has frequent wildlife.', 'Deer, Marmot', 'Parking lot, Restaurant (seasonal), Gift shop, Bathrooms', NULL, NULL, NULL, NULL, '5,242 feet / 1,598 m', 'Limited access in the winter', NULL, NULL, 1, 4, 1, 1, 0, '2018-05-17 02:17:54', '2018-06-11 20:51:21'),
(9, 1, 5, 9, 'Olympic National Park - Rialto Beach and Hole in the Wall', 'Rialto Beach is a spectacular example of the Pacific Northwest coast.  Featuring small, rugged offshore islands and sea stacks, this is a great place to experience the grandeur and wildness of the Pacific Ocean.', 'https://www.google.com/maps/d/embed?mid=1iAa7U57lZ4dnyBpSNf1wf2zi3XHvx2FV', 'Google Map:', 'Click here to open in Google Maps', 'https://www.wikiloc.com/wikiloc/spatialArtifacts.do?event=view&id=28227453&measures=off&title=off&near=off&images=off&maptype=S', 'Wikiloc Map:', 'Click here to open in Wikiloc', NULL, NULL, 'Fantastic views of the rugged Pacific coast, including the hole in the wall rock formation at the northern end of the beach.', 'Waterfowl, Eagles, etc.', 'Bathrooms, picnic area', 'No permits required', NULL, '3.6 miles round-trip to Hole-In-The-Wall', 'Easy', 'Sea level, Flat', 'Year-round', NULL, 'Out and Back', 1, 5, 1, 1, 0, '2018-05-17 02:41:06', '2018-09-29 15:02:37'),
(10, 1, 5, 10, 'Olympic National Park - Second Beach', 'Another beach with a hole in the wall feature.  Similar to Rialto Beach, second beach is a little farther south of La Push and Rialto Beach.\r\n\r\n[For camping information, please click here](https://www.nps.gov/olym/planyourvisit/second-beach-trail.htm)', 'https://www.google.com/maps/d/embed?mid=1XTc3GrFuJGWVbj7EvvXQEyk5tNdU1j3m', 'Google Map:', 'Click here to open in Google Maps', 'https://www.wikiloc.com/wikiloc/spatialArtifacts.do?event=view&id=28227127&measures=off&title=off&near=off&images=off&maptype=S', 'Wikiloc Map:', 'Click here to open in Wikiloc', NULL, NULL, NULL, 'Opportunities to view bald eagles and seals. Bird life is common on sea stacks. Whale migration occurs in March/April and October.', NULL, NULL, NULL, '.7 miles / 1.1 km each way', 'Easy', NULL, 'Year-round', NULL, 'Out and Back', 1, 4, 1, 1, 0, '2018-05-17 03:00:20', '2018-10-26 01:07:39'),
(11, 1, 6, 11, 'Olympic Discovery Trail', 'The Olympic Discovery Trail is a non-motorized, multi-use trail spanning the north end of the Olympic Peninsula in the state of Washington. \r\n\r\nThe trail runs about 140 miles between Port Townsend and La Push. \r\n\r\nAs of August 2017, 80 miles of this trail have been completed and additional miles under construction. The remainder of the route can be ridden on public roads.\r\n\r\n[Official Website](https://olympicdiscoverytrail.org)', 'https://widgets.scribblemaps.com/sm/?d=true&z=true&l=true&id=OlympicDiscoveryTrail', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'There are many trail heads and access locations with parking', NULL, '140 miles', 'Easy', NULL, 'Year-round', NULL, 'End to End', 1, 3, 1, 1, 0, '2018-05-17 03:03:03', '2018-06-04 19:04:09'),
(12, 1, 4, 12, 'Little Si Hiking Trail', 'Located in the southern reaches of the Cascade Mountains, Little Si is about 30 miles east of Seattle in the town of North Bend, Washington. Due to its proximity to Seattle it is heavily hiked especially on the week-ends.\r\n\r\nThe hike features a decent work-out and some nice forest scenery, very green and mossy. The steepest part is at the beginning of the trail.\r\n\r\nThe trail can be extended by taking the boulder field loop, but the extra 1.5 mile trail isn\'t very interesting. It also connects to the Mount Si trail.\r\n\r\n[Public Transportation Schedule](https://trailheaddirect.wordpress.com/#post-132)', 'https://www.google.com/maps/d/embed?mid=1GR_td1Ynzn3_grbLHf4bjq-lQcCV9M95', NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'Nice views of the surrounding area.', 'Mountain goats, Squirrels', 'Bathrooms in the main parking lot.', 'Two areas, the main trail-head and an overflow area. Discover Pass required.', 'Free entry, Discover Pass required for parking.', '4.7 miles, round trip', 'Moderate', 'Elevation Change: 1300 ft. / Maximum Altitude: 1500 ft.', 'Year-round, heavy traffic in the summer', 'Seasonal, see link in description', 'Out and Back', 1, 8, 1, 1, 0, '2018-05-17 03:08:10', '2018-09-02 08:21:07'),
(13, 1, 4, 13, 'Gas Works Park', 'Gas Works Park is a 19 acre park close to downtown on the north side of Lake Union. \r\n\r\nSome remains of the former Seattle City Gas Light Company gas plant which converted carbon materials into usable gases such as carbon dioxide, carbon monoxide, hydrogen, are preserved at the park.\r\n\r\nAnother notable feature of the park is the kite flying hill with panoramic views of downtown Seattle and the Space Needle.', 'https://www.google.com/maps/embed?pb=!1m18!1m12!1m3!1d2687.996709440583!2d-122.33654188443522!3d47.64563077918731!2m3!1f0!2f0!3f0!3m2!1i1024!2i768!4f13.1!3m3!1m2!1s0x54901502b25bb07f%3A0x1e6e55abec496196!2sGas+Works+Park!5e0!3m2!1sen!2sus!4v1526509219015', NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'Fantastic views of downtown Seattle and Lake Union especially at night.', 'Waterfowl, Peregrine Falcons', 'Park benches, Kite flying hill', NULL, NULL, NULL, 'Easy', NULL, 'Year-round', 'Many options', NULL, 1, 4, 1, 1, 0, '2018-05-17 03:21:29', '2018-09-20 04:30:47'),
(14, 1, 4, 14, 'Snoqualmie Falls', 'Snoqualmie Falls observation deck and little trail down to the river.', 'https://www.google.com/maps/d/embed?mid=1wyUHedc1dwLx75R7nLlDuC3AjywyUxyV', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'Bathrooms, observation decks', 'Free parking on the far side of the road, access via the foot bridge.', 'Free', NULL, 'Easy', NULL, 'Year-round', NULL, NULL, 1, 3, 1, 1, 0, '2018-05-17 03:41:07', '2018-06-02 02:02:55'),
(15, 1, 4, 15, 'Seattle Downtown Walking Tour', 'Seattle is known for several iconic tourist attractions, the Space Needle and Pike Place Market.  \r\n\r\nThis walking tour takes you on a nice loop which covers the highlights of downtown Seattle.  \r\n\r\nStop 1: Pike Place Market (Pike St and 1st Ave) is a 3 square block area featuring the market itself and surrounding stores, coffee shops, bars, and restaurants, and dessert places.  This is a fun area to explore for an hour or two.  The highlights include:\r\n\r\nThe original Starbucks coffeeshop.\r\n\r\nThe fish market where they throw the fish.\r\n\r\nThe actual market stalls and small stores.\r\n\r\nStop 2: Two blocks down to the Elliot Bay waterfront, the Seattle Great Wheel, Wings Over Washington, and the Seattle Aquarium, are located.\r\n\r\nStop 3: Westlake Mall\r\n\r\nStop 4: The Space Needle and the surrounding area includes the following highlights:\r\n\r\n- Museum of Pop Culture\r\n\r\n- Pacific Science Center\r\n\r\n- Key Arena\r\n\r\n- Memorial Stadium\r\n\r\n- Seattle Children\'s Museum \r\n\r\n- PACCAR IMAX Theater', 'https://www.google.com/maps/d/embed?mid=1aiuJhzUUPz6GNOadK6xfpKyjEU_KbUNU', 'Google Map:', 'Click here to open in Google Maps', 'https://www.wikiloc.com/wikiloc/spatialArtifacts.do?event=view&id=28227184&measures=off&title=off&near=off&images=off&maptype=S', 'Wikiloc Map:', 'Click here to open in Wikiloc', NULL, NULL, NULL, NULL, NULL, 'Paid Street Parking', NULL, '4 miles / 6.5 kms', 'Easy', NULL, 'Year-round', 'Many options', 'Loop', 1, 7, 1, 1, 0, '2018-05-17 23:39:03', '2018-09-29 14:57:22'),
(19, 1, 4, 19, 'Space Needle to Queen Anne, Lake Union Loop', 'This is a nice walk from the Space Needle, up Queen Anne Hill to the shops, restaurants, theaters, and coffee shops of Lower and Upper Queen Anne.  <br /><br />The walk continues down the other side of the hill almost to the Ship Canal and then goes right to join the Lake Union Trail.  <br /><br />The Lake Union Trail continues past the house boats and the huge Aurora Bridge and on to downtown Seattle.  <br /><br />A few blocks later it ends where it began at the Space Needle.', 'https://www.google.com/maps/d/embed?mid=1XXtcJ96UrEPfgzQLZcpqx1N-fSXdHd84', NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'Nice walk up Queen Anne Hill and down the other side to Lake Union and back to downtown.', NULL, NULL, 'Paid Street Parking', NULL, '5 miles / 8 kms', 'Easy', 'Elevation change of 456 feet (139 m)', 'Year-round', 'Many options', 'Loop', 1, 4, 1, 1, 0, '2018-05-24 21:04:33', '2018-06-12 23:36:54'),
(20, 1, 4, 20, 'Fremont to Ballard Locks Loop', 'This hike/bike route is a loop that passes by the iconic Fremont Troll and the Statue of Lenin and then follows the Burke-Gilman Trail between Fremont and Ballard to the Chittenden Locks and then returns on the Ship Canal Trail on the other side of the Lake Union Ship Canal.\r\n\r\nThe Fremont Troll was created under the Aurora Bridge in 1990 and is clutching an actual, full size, Volkswagen Beetle with California license plates that it grabbed off of the bridge.\r\n\r\nThe Statue of Lenin is a 16 ft (5m) bronze sculpture made in Czechoslovakia in 1988 and removed during the democratic revolution of 1989 and brought to Seattle.  It is for sale and frequently decorated and vandalized.\r\n\r\nSegments:\r\n\r\nFremont Troll to Statue of Lenin\r\n\r\nBurke-Gilman Trail: Fremont to Ballard \r\n\r\nBallard to Chittenden Locks\r\n\r\nBallard Chittenden Locks back to Fremont on the Ship Canal Trail', 'https://www.google.com/maps/d/embed?mid=1MI3Tg8B5vVMSRjpMWv_4jRYJ6H7a0u7H', 'Google Map:', 'Click here to open in Google Maps', 'https://www.wikiloc.com/wikiloc/spatialArtifacts.do?event=view&id=28227561&measures=off&title=off&near=off&images=off&maptype=S', 'Wikiloc Map:', 'Click here to open in Wikiloc', NULL, NULL, 'Passes through the funky areas of Fremont and Ballard.  Crosses the ship canal at the Hiram M. Chittenden Locks.  Nice views of boats on the Ship Canal Trail.', NULL, 'Bathrooms in Gas Works Park and at the Ballard Locks', 'Paid Street Parking', NULL, '7 miles / 11 kms', 'Easy', 'Flat', 'Year-round', 'Many Options', 'Hike/Bike Loop', 1, 6, 1, 1, 0, '2018-05-26 00:05:29', '2018-09-29 14:55:48'),
(22, 1, 4, 22, 'Fremont to Gas Works Park Loop', 'This self-guided walking route starts in the heart of Fremont, passes by the iconic Fremont Troll and the Statue of Lenin, and then follows the Burke-Gilman Trail to Gas Works Park on the North side of Lake Union.<br /><br />Gas Works Park is a 19 acre park that offers spectacular views across Lake Union to downtown Seattle, especially at night.<br /><br />The Fremont Troll was created under the Aurora Bridge in 1990 and is clutching an actual, full size, Volkswagen Beetle with California license plates that it grabbed off of the bridge.<br /><br />The Statue of Lenin is a 16 ft (5m) bronze sculpture made in Czechoslovakia in 1988 and removed during the democratic revolution of 1989 and brought to Seattle. It is for sale and frequently decorated and vandalized.', 'https://www.google.com/maps/d/embed?mid=1jYX67cLjcSvN9EL330cBgt6-tnv32PQG', 'Google Map:', 'Click here to open in Google Maps', 'https://www.wikiloc.com/wikiloc/spatialArtifacts.do?event=view&id=28227669&measures=off&title=off&near=off&images=off&maptype=S', 'Wikiloc Map:', 'Click here to open in Wikiloc', NULL, NULL, 'This hike passes the Fremont Troll, the Statue of Lenin, and offers fantastic views of downtown Seattle and Lake Union from Gas Works Park.', NULL, NULL, 'Paid Street Parking', NULL, '2.4 mile loop', 'Easy', NULL, 'Year-round', 'Many options', 'Hike/Bike Loop', 1, 5, 1, 1, 0, '2018-05-26 21:16:22', '2018-09-29 14:54:21'),
