(10, 1, NULL, 553, 'Bob', 'This place was huge and has a huge variety of antiques and other stuffs to sell.  It\'s better to go as early as possible before the crowds arrive on the weekends.', -1, 1, 0, '2019-02-17 19:38:32', '2019-02-17 19:57:26'),
(11, 1, NULL, 0, 'Era el ltimo da de mi viaje de seis meses, as q', 'Era el ltimo da de mi viaje de seis meses, as que compr algunos recuerdos pesados que haba estado retrasando ya que no quera agregar peso a mi equipaje.\r\n\r\nPrimero fui a unas pocas tiendas en la calle Wangfujing y luego tom el metro hasta el Mercado de Pulgas de Panjiayuan. Una vez que llegu me di cuenta de que haba estado all antes.\r\n\r\nEl mercado de pulgas es enorme. Es principalmente para locales, no para turistas, por lo que no hay tiendas de souvenirs tpicas, sino muchas cosas de ti', -1, 1, 1, '2019-02-17 23:16:28', '2019-02-18 20:55:17'),
(12, 1, NULL, 0, 'Vonn T.', 'The amount of research and massive variety of photos you put into this site blows my mind. Keep up the good work!', -1, 1, 0, '2019-02-21 19:44:38', '2019-02-21 19:45:03');
INSERT INTO `entries` (`id`, `site_id`, `location_id`, `parent_id`, `photo_id`, `title`, `permalink`, `description_short`, `description`, `user_id`, `type_flag`, `view_count`, `published_flag`, `approved_flag`, `deleted_flag`, `display_date`, `color_foreground`, `color_background`, `created_at`, `updated_at`) VALUES
(1, 1, 4, NULL, 19, 'Seattle Waterfront to Lake Union via Ship Canal', 'Seattle-Waterfront-to-Lake-Union-via-Ship-Canal', 'Fantastic views of Downtown Seattle, Elliot Bay, Puget Sound, the Olympic Mountains.', 'This 8.5 mile Hike or Bike loop starts at the Olympic Sculpture Park at the entrance to Myrtle Edwards Park (Broad Street and Elliot Avenue). From the Elliot Bay Trail there is a protected bike trail that connects with the South Ship Canal Trail, then joins the Lake Union Loop Trail.', 1, 2, 220, 1, 1, 0, NULL, NULL, NULL, '2018-05-30 22:27:45', '2019-02-24 03:42:16'),
(2, 1, 4, NULL, NULL, 'Burke-Gilman Trail', 'Burke-Gilman-Trail', 'This is the classic Seattle hike/bike/walking trail with connections to downtown, Lake Washington, and many other trails.', 'The Burke-Gilman Trail is a popular 27 mile (43 km) recreational trail for walkers, runners, cyclists, skaters and commuters. Built in the 1970s as one of the first rail trails, it starts north of downtown Seattle in Ballard goes north along Lake Washington and ends in the suburb of Bothel. There it connects to the East Lake Sammamish Trail which continues all the way to Issaquah.\r\n\r\nThere are many access points to this trail, such as:\r\n- The Ship Canal and Lake Union in Fremont\r\n- The University of Washington Link Rail stop', 1, 2, 223, 1, 1, 0, NULL, NULL, NULL, '2018-05-30 22:28:23', '2019-02-23 17:34:39'),
(3, 1, 7, NULL, NULL, 'West Seattle: California Ave', 'West-Seattle-California-Ave', NULL, 'California Ave is the main street of West Seattle. With plenty of bars, restaurants, the ubiquitous coffee and cupcake shops, a movie theater, a weed shop, and many other small stores, this is a unique and delightful place to wander around in. The main cluster of businesses is at \"The Junction\" which is the intersection of California Ave and Alaska Street.', 1, 2, 221, 1, 1, 0, NULL, NULL, NULL, '2018-05-30 22:28:46', '2019-02-22 11:25:27'),
(4, 1, 7, NULL, 347, 'Lincoln Park Hike', 'Lincoln-Park-Hike', 'Epic views of Elliot Bay and the Olympic Mountains.', 'With views of the snow-capped Olympic Mountains and the San Juan Islands, this 2 mile partially paved, out and back or loop trail follows the Pacific coastline. \r\n\r\nTo make it a loop, follow the ocean front trail and return by going up to the bluff through the old growth forest with more ocean views.', 1, 2, 226, 1, 1, 0, NULL, NULL, NULL, '2018-05-30 22:44:50', '2019-02-25 17:43:15'),
(5, 1, 7, NULL, 32, 'Alki Beach Trail', 'Alki-Beach-Trail', 'Best day and night views of downtown Seattle. Popular bar, restaurant, and coffee shop scene, lively at night.', 'Alki Trail and Alki Beach Park is a 3 mile long ocean front promenade that runs from Alki Point to Duwamish Head on Elliott Bay. It\'s a great spot for a walk or bike ride any time of year, and in the summer draws joggers, roller-bladers, volleyball players, beachcombers, sunbathers, bicyclists and strollers out to enjoy the sun.', 1, 2, 238, 1, 1, 0, NULL, NULL, NULL, '2018-05-30 22:46:00', '2019-02-23 13:57:16'),
(6, 1, 7, NULL, NULL, 'West Seattle Water Taxi', 'West-Seattle-Water-Taxi', 'Best views of downtown Seattle especially in the evening and at night.', 'The West Seattle Water Taxi connects downtown with West Seattle and provides some of the best views of downtown Seattle. \r\n\r\nThe Water Taxi connects downtown with the Alki Beach Trail, a 2.5 mile promenade with fantastic views of Downtown Seattle, Puget Sound, and the Olympic mountains.\r\n\r\n[Prices and schedule information](https://www.kingcounty.gov/depts/transportation/water-taxi/west-seattle.aspx)\r\n\r\nDue to construction at the Seattle waterfront, the entrance to the King County Water Taxis is currently between Ivar\'s Seafood and the Subway Restaurant.', 1, 2, 197, 1, 1, 0, NULL, NULL, NULL, '2018-05-30 22:46:47', '2019-02-21 16:19:56'),
(7, 1, 5, NULL, 100, 'Olympic National Park - Madison Falls', 'Olympic-National-Park-Madison-Falls', 'Easily accessible waterfall but not very spectacular. The Elwha River in front of the parking lot is more interesting.', 'Created where Madison Creek meets the Elwha River, Madison Falls is located within the Olympic National Park, west of Port Angeles, Washington. The falls is about 50 feet high with a light flow. The paved trail to the falls is very short (less than 100 meters) and is child-friendly and wheelchair accessible.\r\n\r\nThere is a beautiful stretch of the Elwha River right in front of the parking area.', 1, 2, 193, 1, 1, 0, NULL, NULL, NULL, '2018-05-30 22:47:33', '2019-02-25 01:47:58'),
(8, 1, 5, NULL, 101, 'Olympic National Park - Hurricane Ridge Visitors Center', 'Olympic-National-Park-Hurricane-Ridge-Visitors-Center', 'Beautiful views of the Olympic Mountains. The drive up to Hurricane Ridge is interesting and has frequent wildlife.', 'Hurricane Ridge is the most easily accessed mountain area within Olympic National Park. In clear weather, fantastic views can be enjoyed throughout the year.\r\n\r\nHurricane Ridge is located 17 miles south of Port Angeles on Hurricane Ridge Road, off Mount Angeles Road.\r\n\r\nThe road is open throughout summer. During the winter season, the road is scheduled to be open Friday through Sunday and holiday Mondays, weather and road conditions permitting, and closed all other days. All vehicles must carry tire chains during the winter season.\r\n\r\n[Hurricane Ridge Web Cams](https://www.nps.gov/olym/learn/photosmultimedia/hurricane-ridge-webcam.htm)', 1, 2, 177, 1, 1, 0, NULL, NULL, NULL, '2018-05-30 22:48:20', '2019-02-20 06:02:54'),
(9, 1, 5, NULL, 104, 'Olympic National Park - Rialto Beach and Hole in the Wall', 'Olympic-National-Park-Rialto-Beach-and-Hole-in-the-Wall', 'Fantastic views of the rugged Pacific coast, including the hole in the wall rock formation at the northern end of the beach.', 'Rialto Beach is a spectacular example of the Pacific Northwest coast. Featuring small, rugged offshore islands and sea stacks, this is a great place to experience the grandeur and wildness of the Pacific Ocean.', 1, 2, 232, 1, 1, 0, NULL, NULL, NULL, '2018-05-30 22:48:56', '2019-02-22 14:07:14'),
(10, 1, 5, NULL, 110, 'Olympic National Park - Second Beach', 'Olympic-National-Park-Second-Beach', '', 'Another beach with a hole in the wall feature. Similar to Rialto Beach, second beach is a little farther south of La Push and Rialto Beach.\r\n\r\n[For camping information, please click here](https://www.nps.gov/olym/planyourvisit/second-beach-trail.htm)', 1, 2, 210, 1, 1, 0, NULL, NULL, NULL, '2018-05-30 22:49:28', '2019-02-25 03:49:26'),
(11, 1, 6, NULL, NULL, 'Olympic Discovery Trail', 'Olympic-Discovery-Trail', NULL, 'The Olympic Discovery Trail is a non-motorized, multi-use trail spanning the north end of the Olympic Peninsula in the state of Washington. \r\n\r\nThe trail runs about 140 miles between Port Townsend and La Push. \r\n\r\nAs of August 2017, 80 miles of this trail have been completed and additional miles under construction. The remainder of the route can be ridden on public roads.\r\n\r\n[Official Website](https://olympicdiscoverytrail.org)', 1, 2, 170, 1, 1, 0, NULL, NULL, NULL, '2018-05-30 22:50:16', '2019-02-22 13:45:53'),
(12, 1, 4, NULL, 113, 'Little Si Hiking Trail', 'Little-Si-Hiking-Trail', 'Nice work-out and excellent views of the surrounding area especially at the top.', 'Located in the southern reaches of the Cascade Mountains, Little Si is about 30 miles east of Seattle in the town of North Bend, Washington. Due to its proximity to Seattle it is heavily hiked especially on the week-ends.\r\n\r\nThe hike features a decent work-out and some nice forest scenery, very green and mossy. The steepest part is at the beginning of the trail.\r\n\r\nThe trail can be extended by taking the boulder field loop, but the extra 1.5 mile trail isn\'t very interesting. It also connects to the Mount Si trail.\r\n\r\n[Public Transportation Schedule](https://trailheaddirect.wordpress.com/#post-132)', 1, 2, 185, 1, 1, 0, NULL, NULL, NULL, '2018-05-30 22:51:35', '2019-02-25 06:14:41'),
(13, 1, 4, NULL, NULL, 'Gas Works Park', 'Gas-Works-Park', 'Fantastic views of downtown Seattle and Lake Union especially at night.', 'Gas Works Park is a 19 acre park close to downtown on the north side of Lake Union. \r\n\r\nSome remains of the former Seattle City Gas Light Company gas plant which converted carbon materials into usable gases such as carbon dioxide, carbon monoxide, hydrogen, are preserved at the park.\r\n\r\nAnother notable feature of the park is the kite flying hill with panoramic views of downtown Seattle and the Space Needle.', 1, 2, 213, 1, 1, 0, NULL, NULL, NULL, '2018-05-30 22:52:04', '2019-02-24 04:16:13'),
(14, 1, 4, NULL, NULL, 'Snoqualmie Falls', 'Snoqualmie-Falls', NULL, 'Snoqualmie Falls is an interesting place for a quick stop to look around.  The falls are fairly impressive.  There is an observation deck and a trail down to the river.', 1, 2, 188, 1, 1, 0, NULL, NULL, NULL, '2018-05-30 22:52:34', '2019-02-25 13:15:42'),
(15, 1, 4, NULL, NULL, 'Seattle Downtown Walking Tour', 'Seattle-Downtown-Walking-Tour', '', 'Seattle is known for several iconic tourist attractions, the Space Needle and Pike Place Market. \r\n\r\nThis walking tour takes you on a nice loop which covers the highlights of downtown Seattle. \r\n\r\nStop 1: Pike Place Market (Pike St and 1st Ave) is a 3 square block area featuring the market itself and surrounding stores, coffee shops, bars, and restaurants, and dessert places. This is a fun area to explore for an hour or two. The highlights include:\r\n\r\nThe original Starbucks coffeeshop.\r\n\r\nThe fish market where they throw the fish.\r\n\r\nThe actual market stalls and small stores.\r\n\r\nStop 2: Two blocks down to the Elliot Bay waterfront, the Seattle Great Wheel, Wings Over Washington, and the Seattle Aquarium, are located.\r\n\r\nStop 3: Westlake Mall\r\n\r\nStop 4: The Space Needle and the surrounding area includes the following highlights:\r\n\r\n- Museum of Pop Culture\r\n\r\n- Pacific Science Center\r\n\r\n- Key Arena\r\n\r\n- Memorial Stadium\r\n\r\n- Seattle Children\'s Museum \r\n\r\n- PACCAR IMAX Theater', 1, 2, 210, 1, 1, 0, NULL, NULL, NULL, '2018-05-30 22:53:07', '2019-02-22 07:31:23'),
(19, 1, 4, NULL, NULL, 'Space Needle to Queen Anne, Lake Union Loop', 'Space-Needle-to-Queen-Anne-Lake-Union-Loop', 'Nice walk up Queen Anne Hill and down the other side to Lake Union and back to downtown.', 'This is a nice walk from the Space Needle, up Queen Anne Hill to the shops, restaurants, theaters, and coffee shops of Lower and Upper Queen Anne. \r\n\r\nThe walk continues down the other side of the hill almost to the Ship Canal and then goes right to join the Lake Union Trail. \r\n\r\nThe Lake Union Trail continues past the house boats and the huge Aurora Bridge and on to downtown Seattle. \r\n\r\nA few blocks later it ends where it began at the Space Needle.', 1, 2, 185, 1, 1, 0, NULL, NULL, NULL, '2018-05-30 22:55:14', '2019-02-24 10:09:25'),
(20, 1, 4, NULL, NULL, 'Fremont to Ballard Locks Loop', 'Fremont-to-Ballard-Locks-Loop', 'Passes through the funky areas of Fremont and Ballard. Crosses the ship canal at the Hiram M. Chittenden Locks. Nice views of boats on the Ship Canal Trail.', 'This hike/bike route is a loop that passes by the iconic Fremont Troll and the Statue of Lenin and then follows the Burke-Gilman Trail between Fremont and Ballard to the Chittenden Locks and then returns on the Ship Canal Trail on the other side of the Lake Union Ship Canal.\r\n\r\nThe Fremont Troll was created under the Aurora Bridge in 1990 and is clutching an actual, full size, Volkswagen Beetle with California license plates that it grabbed off of the bridge.\r\n\r\nThe Statue of Lenin is a 16 ft (5m) bronze sculpture made in Czechoslovakia in 1988 and removed during the democratic revolution of 1989 and brought to Seattle. It is for sale and frequently decorated and vandalized.', 1, 2, 220, 1, 1, 0, NULL, NULL, NULL, '2018-05-30 22:55:41', '2019-02-25 09:31:58'),
(22, 1, 4, NULL, 186, 'Fremont to Gas Works Park Loop', 'Fremont-to-Gas-Works-Park-Loop', 'This hike passes the Fremont Troll, the Statue of Lenin, and offers unsurpassed views of downtown Seattle and Lake Union from Gas Works Park.', 'This self-guided walking route starts in the heart of Fremont, passes by the iconic Fremont Troll and the Statue of Lenin, and then follows the Burke-Gilman Trail to Gas Works Park on the North side of Lake Union.\r\n\r\nGas Works Park is a 19 acre park that offers spectacular views across Lake Union to downtown Seattle, especially at night.\r\n\r\nThe Fremont Troll was created under the Aurora Bridge in 1990 and is clutching an actual, full size, Volkswagen Beetle with California license plates that it grabbed off of the bridge.\r\n\r\nThe Statue of Lenin is a 16 ft (5m) bronze sculpture made in Czechoslovakia in 1988 and removed during the democratic revolution of 1989 and brought to Seattle. It is for sale and frequently decorated and vandalized.', 1, 2, 215, 1, 1, 0, NULL, NULL, NULL, '2018-05-30 22:56:15', '2019-02-24 04:12:38'),
(23, 1, NULL, NULL, NULL, 'Dev To Do', 'dev-to-do', NULL, '[SEO Webmaster Tools](https://www.google.com/webmasters/tools/home?hl=en)\r\n\r\nFIRST\r\n- Add photo descriptions and permalinks to search\r\n- Add location to blog entry permalink\r\n- Show location on view blog entry\r\n\r\nBUGS\r\n- Bug: no way to remove main photo when it\'s set to a gallery photo\r\n- Bug: tours - no way to add/edit display date from tour views only from entry views\r\n- Bug: can\'t rotate receipt images, folder is entries instead of receipts\r\n- Bug: if permalink is changed then referrer doesn\'t work, need to use new permalink\r\n- Bug: transaction filter, date filter doesn\'t wrap year\r\n\r\nNEXT\r\n- Auto-Generate SiteMap when an entry or photo changes\r\n- Add permalinks to tour locations, blogs and photos\r\n- Articles show location pills\r\n- Add comments \r\n- Add \'highlighted\' flag (show on front page) to entries\r\n- add order flag to entries\r\n- Entries: Implement events in entries\r\n- Tours: don\'t center photos unless there are more than 3 photos?\r\n- Locations: add display name to locations\r\n- Tours: show photo alt text as title below photos\r\n- create photo path and title with sql for all photos\r\n- More SEO\r\n- set prod version to non debug \r\n- Trim all text entries (check entries, tours)\r\n- Photo Viewer: fix portrait photo sizes, set max height\r\n- Try to view a non-existing entry by id, shows too much info\r\n\r\nSITES\r\n- Add theme\r\n- add current location\r\n\r\nPHOTOS\r\n- Add types to photos\r\n- Add location to photos\r\n- Add display date\r\n- Add order field to photos\r\n- Add location to all alt text on images\r\n- Fix photo view from index admin\r\n\r\nLATER\r\n- Look at horizontal scrolling\r\n- Change small size to phone horiz\r\n- Content\r\n- SEO\r\n- About page\r\n\r\nNOTES\r\n\r\nTo track routes, use GPSLogger. It only tracks, and isnt used for navigation.  the generated xml file can be uploaded to Google Maps to create the map.\r\n\r\n[Middleware user roles](https://medium.com/justlaravel/how-to-use-middleware-for-content-restriction-based-on-user-role-in-laravel-2d0d8f8e94c6)\r\n\r\n[Css horizontal scrolling](https://codepen.io/bassta/pen/gLXWKm)\r\n\r\n[Seo](https://searchengineland.com/seo-requirements-new-website-platform-254237)', 1, 1, 4, 0, 0, 0, NULL, NULL, NULL, '2018-05-30 22:57:54', '2019-01-26 21:32:27'),
