(124, 1, NULL, 31, NULL, 'Day 72: To the Eiffel Tower and Saw the Sights of Paris', 'day-72-to-the-eiffel-tower-and-saw-the-sights-of-paris-2010-06-16', NULL, 'Slept late and headed to Paris to see the sights. First had lunch at the McDs by the hotel. \r\n\r\nIn Paris, first we went to the Eiffel Tower.  The line was extremely long so we didn\'t try to go up the tower.\r\n\r\nLater walked to the Arc de Truimph and Champs Elysee both of which were huge and impressive.\r\n\r\nGot back to the hotel pretty early and bought dinner at the big super market and ate in the hotel dining room and watched tv.', 1, 4, 49, 1, 1, 0, '2010-06-16', NULL, NULL, '2018-06-18 05:38:26', '2019-02-23 17:31:44'),
(122, 1, 10, NULL, NULL, 'Beijing MTR Metro Card (Yikatong Card)', 'beijing-mtr-metro-card-yikatong-card-2018-06-27', NULL, 'Each card requires a CNY20 refundable deposit. Generally, it is suggested to buy CNY100 for a one-week stay.\r\n\r\nSucceeding top-up amounts must be in multiples of CNY10, and the maximum is CNY1,000. One can buy and use the card without registration. Once lost, it is hard to get it back. Therefore, storing a large sum on the card should be avoided.\r\n\r\nWhere to Buy & Top Up Yikatong Card\r\n\r\n1. Customer Service Center of all subway stations\r\n\r\n2. Ticket windows of the Airport Express Train: \r\nT3: 06:20 - 22:50; \r\nT2: 06:35 - 23:10 (also for card-return service)\r\n\r\nThe Beijing Subway operates from 5am and 11pm.  First and last trains have different schedules depending on the line.\r\n\r\n The Airport Express operates from approximately 6 am until 11 pm depending on the direction.', 1, 5, 111, 1, 1, 0, '2018-06-27', NULL, NULL, '2018-06-14 08:29:28', '2019-02-25 11:09:59'),
(24, 1, NULL, NULL, NULL, 'Olympic National Park Hikes', 'Seattle-Olympic-National-Park-Hikes', NULL, 'Port Angeles\r\n- Marymere Falls nature trail, 1.8 miles\r\n- Sol duc falls trail, 1.6 miles, 1 hr from Port Angeles\r\n\r\n- Hoh Rain Forest Visitor Center / approximately 31 miles south of Forks off Highway 101 / 2018 Season: Open Friday - Sunday March 2 - May 24; Open Daily May 25 - September 4. Closed September 5 - mid October, Open Friday - Sunday in mid October - December 2018.\r\n\r\n- July: Staircase day hike\r\n- July: Mount Walker\r\n\r\nCoast\r\n- Wedding Rock Petroglyphs: From Ozette, 4.5 miles to Petroglyphs one way, (3 miles to the beach, one way)\r\n- Ruby Beach, .5 miles\r\n- Shi Shi Beach and Point of the Arches, 8 miles r/t\r\n- Mount Ellinor', 1, 6, 0, 0, 0, 0, NULL, NULL, NULL, '2018-05-30 22:58:43', '2018-06-21 02:44:29'),
(25, 1, NULL, NULL, NULL, 'Places to go', 'places-to-go', NULL, 'San Marino (near Venice)\r\nMatera, Italy\r\nPlovdiv, Bulgaria \r\nTbilisi, Georgia\r\nThessaloniki, Greece\r\nSalta, Argentina\r\nKigali, Rwanda\r\n\r\n~~~~~~~~~~~~~~~~~~\r\n\r\nI am filled with loving kindness\r\nI am well\r\nI am peaceful\r\nI am happy\r\n\r\nTRAVEL BLOGS\r\n\r\n[Earth Trekkers](https://www.earthtrekkers.com/best-of-beijing/)\r\n\r\n[Journal of Nomads](https://www.journalofnomads.com/how-to-get-from-almaty-to-bishkek/)\r\n\r\n[More of the Road](http://www.moreoftheroad.com/five-popular-hikes-from-almaty-and-links-to-some-online-hiking-resources/)', 1, 1, 5, 0, 1, 0, NULL, NULL, NULL, '2018-05-30 23:00:31', '2019-02-22 08:52:53'),
