(28, 1, NULL, NULL, NULL, 'Test Cases - Guest (not logged in)', 'Test-Cases-Guest-not-logged-in-', '', 'Click the top links\r\n\r\nClick the Join Us button\r\n\r\nClick the footer links\r\n\r\nClick the footer affiliates\r\n\r\nOn the tour section, click each location\r\n\r\nClick on each tour\r\nFor each tour, do the following:\r\n- click on each breadcrumb\r\n- run the photo gallery\r\n- click on the map links\r\n- click on the partner links\r\n\r\nOn the locations page, click on each location\r\n\r\nOn the photos page, click each photo\r\n\r\nOn the maps page, click on each map\r\n\r\nOn the footer, click phone number and address', 1, 1, 0, 0, 0, 1, NULL, NULL, NULL, '2018-06-01 21:56:46', '2018-07-25 05:49:55'),
(27, 1, NULL, NULL, NULL, 'Sons relate Guy Wilkinsons first 80 years  June 17th, 1982', 'sons-relate-guy-wilkinsons-first-80-years-june-17th-1982', NULL, 'The year 1902 belongs to another era.  It was one of the years of the frontier epoch, fast drawing to a close in American history.  Families had followed the dream of new and free lands in the west.\r\n\r\nThe Cheyenne-Arapaho lands were opened for settlement in 1892.  Charles and Dora Wilkinson had loaded their belongings in a wagon and headed for these newly-opened lands in western Oklahoma from their home near Bethany, Missouri.\r\n\r\nThey had two daughters, Pearl and Goldie, and soon a son, Claude, was born in a dugout on the farm two miles south of Hitchcock where they settled.  The family later moved to a farm one mile east of Watonga.\r\n\r\nIt was there, on May 30, 1902, that the family heralded the birth of a second son, Guy Elgin.  The house in which he was born is part of the rock facade house still facing Hwy 33 east of Watonga.\r\n\r\nIn 1905 Dora Alice Wilkinson died of tuberculosis, despite having taken special trips to Colorado to seek relief.  Guy was three years old when his mother died and four when his father re-married.  His step-mother, the former Amelia Molly Weitz, was from a German immigrant family who had come to America from the Ukraine in southern Russia.\r\n\r\nThe family soon grew with the births of Opal, Thelma, Melvin and Beatrice.\r\n\r\nGuy first attended school in Watonga, then the family moved to farms in the Cordell School District southeast of Watonga for about three years.  He spent part of one grade in Collinsville, when he lived with his oldest sister, Pearl, and her husband, Lee Boughton.\r\n\r\nAs a boy Guy worked on the farm.  They lived near town, and his father sometimes contracted with townspeople to graze their milk cows.  Guys job was to move the cows out to pasture each morning and return them to their owners in the evening.\r\n\r\nThe family next moved to Hitchcock, where his father managed a livery stable owned by his brother, John.  Guy attended grades 6-7 and part of the eighth grade there.\r\n\r\nAt that point, at age 15 in 1918, he went to work on the farm of W.H. Oler in the Cordell area.  He earned $25 a month with room and board, that began a series of farm jobs over the next four years with time out for some adventures in other states.\r\n\r\nIn 1919 his brother Claude, recently discharged from the Army, worked on a ranch in Littleton, Colorado, and Guy joined him in August.  They then went to Ranger, Texas where their sister Goldie lived and her husband Clarence Rags Lewis worked as a boilermaker in the oil fields.  Guy was a boilermakers helper and he and Claude lived in a tent in the backyard of the Lewis shack.  Ranger was then a boom town.\r\n\r\nClaudes health was deteriorating from tuberculosis so they bought a team and covered wagon to go to New Mexico.  They started west on April 1, 1920, eating around the campfire and sleeping in the wagon.  Rainy, cold weather stopped them in Lubbock, Texas where they turned and headed for Watonga because of Claudes health.  The trip took over a month.  Their father was running the county poor farm at that time but he shortly moved to a farm just northeast of Watonga.  Claude died there in the spring of 1921.\r\n\r\nThat summer Guy and his father started for Colorado in a covered wagon but at Guymon decided to work the harvest at Meade, Kansas.  After a few days there they changed their minds again and headed back to Woodward.  From there Guy rode on horseback to Buffalo where he worked in the harvest while his father returned home.  \r\n\r\nThe harvest season moved to Elkhart, Kansas and after that he headed west across the plains and worked as a hand on a ranch north of Pagosa Springs, Colorado.  He herded the cattle to the grassy meadows in the higher elevations and during haying season helped fork and haul hay for winter feed.\r\n\r\nIn spring 1922 Guy left to visit Rags and Goldie Lewis, who had been farming near Delores, Colorado but he learned that they had moved to Augusta, Kansas.  He stayed with their neighbors, Pete and Clyde Solomon, originally from Watonga, and worked on road construction.  Then he worked with a flume crew on a power generator before leaving for Pueblo, Colorado.  He sold his horse for a train fare.\r\n\r\nIn Pueblo he and another former Watongan, a Mr. Sallie, hopped a freight train for Kansas.  Cold and black from riding in a coal car, Guy got off in Wichita and then went on to Augusta to stay with the Lewises while he shoveled coal in an ice plant.\r\n\r\nAfter Christmas he left for Emporia, Kansas where former Hitchcock friends were working on the railroad.  But he went on the Ridgeway, Missouri where his grandfather, John Porter Simpson and his two sons operated an 800-acrea farm.  He worked there that winter but the next summer, 1923, he returned to Blaine County and worked for Mr. Falkenstein near Hitchcock driving a Rumley one-cylinder kerosene tractor, one of the few there.\r\n\r\nGuy bought a 1923 Model-T Ford for $200 and with his father went to Casper, Wyoming in 1924.  He unloaded railroad box cars for about three months and then left for McCracken, Kansas where Rags and Goldie were working on a wildcat drilling rig.  He also worked there.\r\n\r\nIn 1925 he came back to Watonga and worked on his fathers farm southwest of town, the Phillips place.  At this time he learned that his deceased brother Claude had named him beneficiary of his veteran benefits and received a lump sum in back pay owed and also monthly checks of $56.  He used the money to buy the home farm 12 miles southwest of Watonga in December 1925.  Land prices were down after the post WWI boom as many farmers had been forced to sell their farms or face foreclosure. \r\n\r\nThe first year the farm had about 40 acres broken, planted to corn, kafir corn and hay.  A hail storm in July nearly wiped out the corn.  Guy milked about half a dozen cows and had three horses, about a dozen sheep, two or three hogs and a few chickens.\r\n\r\nGuy turned 24 in 1926 and with the purchase of a farm was ready to settle down.  A dark-haired girl who had returned with her family from Kansas moved to a farm a couple of miles away.  After a brief courtship, Guy and 18-year-old Opal Ellen Gooch were married in the Watonga Presbyterian parsonage on December 11, 1926.\r\n\r\nWithin a year a son was born.  He was named Guy Jr. but he was given a different middle name, Ernest.  He was called Junior.  In a little more than a year later a daughter was born and named for Guys mother Dora with the middle name of Jean.  Three years later came a second daughter, Geraldine Babette.  Three years later came another son, John Preston, named for Guys two grandfathers John Parsons Wilkinson and John Porter Simpson.  \r\n\r\nThe farm had a two-room house on its northeast corner.  A new house was built on a hill a quarter mile west.  This white bungalow with three bedrooms was large by comparison.  It featured a living and dining room connected by French doors, a kitchen and a bathroom where plumbing would be added later.  A screened porch was used for the milk separator and to store cream sold each week in Watonga.\r\n\r\nThe children attended the one-room Oak Grove School three miles away and later Union School until it was consolidated with Greenfield.\r\n\r\nFour years after Johns birth came another son, Garland Keith, named for Opals father Garland Vincent Gooch.  When yet another son was delivered a year and half later, Dr. Krebs again made the long trip to the Wilkinson farm.  After that sons arrival Dr. Krebs had sat down to a meal prepared by a neighbor, Opal Howry, only to be interrupted to deliver a twin daughter.  The boy was named Claude for Guys brother, with the middle name of Allen and the girl was Caren Ann allowing their initials to be the same.\r\n\r\nGuy leased a quarter section just north of him and purchased in 1947 a 160-acre farm a mile east and two miles north and also leased 40 acres of Indian land.  A few years later he acquired another 160 acres a mile south and one-half west.  Wheat was a major crop in the sandy soil but other crops as well were planted.\r\n\r\nGuy has always been a dreamer about faraway places and new horizons.  On many occasions he regaled his children with stories of the wild west, mountains, bears, and a host of other wild animals.  Though for many years he would not leave the farm, the wanderers lust reestablished itself and he and Opal have taken numerous trips to the mountains of the west.\r\n\r\nThe dream of new horizons is strongly implanted.  This perhaps as much as anything else makes Guy the young 80 year old that he is.  The story is still being written...', 1, 6, 0, 0, 0, 0, NULL, NULL, NULL, '2018-06-01 06:13:34', '2018-07-07 03:25:00'),
