(30, 1, NULL, 31, NULL, 'Day 19: Tallinn to Riga, Latvia By Bus', 'day-19-tallinn-to-riga-latvia-by-bus-2010-04-24', '', 'Got up at 5am and left the hotel at 6am with all of our gear. Walked about 5 blocks to the nearest stop for Tram 2. It finally showed up and we made it to the bus station in plenty of time. \r\n\r\nPeople in the streets were leaving the discos and heading home from the night before.\r\n\r\nFive hour ride to Riga. We slept about half the way. There was some nice scenery of mainly farm land, little towns, lakes, and some beaches.  Kate had reserved an apartment in Riga instead of a hotel. It was close to the bus station so we got there and waited for the guy who was supposed to meet us at noon. \r\n\r\nGuy showed up and helped me lug the big suitcase up about 5 flights of stairs since there was no elevator. The apartment was huge and very nice with wood floors and nice decor.\r\n\r\nIt was freezing outside so we didn\'t walk around much. Had lunch at a delicous pizza place in a mall right by the hotel. The prices are about as cheap as Estonia. \r\n\r\nDropped Kate off at the apartment since it was too cold for her and Riga was about like Tallinn and she wanted to relax in the chic apartment. \r\n\r\nI went over to the main church which was just a few blocks away and went up into the tower for views of the whole city. Since the church tower had been destroyed in WW2 and restored later there was an elevator to the top. First time that I didn\'t have to climb all the way up. Great views at the top but also a powerful freezing wind. \r\n\r\nWent back to the apt and found Kate with no electricity since she had blown the master fuse. We finally found the main fuse box out in the hallway since none of the fuses in the fuse box in the apt had been tripped.\r\n\r\nLater went to the bus station to find out about luggage storage and the overnight bus to Warsaw. \r\n\r\nWent to McDonalds to use the WiFi for a few hours to book the bus and hotel for Warsaw. Spent a few hours there with all of the people staring at us. Everybody stares at us every where that we go.', 1, 4, 66, 1, 1, 0, '2010-04-24', NULL, NULL, '2018-06-06 07:03:51', '2019-02-25 14:05:24'),
(31, 1, NULL, NULL, NULL, 'Epic Euro Trip: 21 Countries in Three Months', 'epic-euro-trip-21-countries-in-three-months', NULL, 'These are the notes from my 3 month trip around Europe in 2010.  It covers 20+ countries, including Turkey, Egypt, and Israel.  We tried to travel on the ground by bus, train, and boat as much as possible.  The only flights we took were from Belfast to Amsterdam, Athens to Cairo, round trip, and Athens to Rome.', 1, 3, 0, 1, 1, 0, NULL, NULL, NULL, '2018-06-07 17:06:50', '2018-06-17 00:51:17'),
(32, 1, NULL, NULL, NULL, 'Epic Euro Trip 2010', 'blog-epic-euro-trip-2010', '', 'These are notes from the epic euro trip that I took in 2010.', 1, 3, 0, 0, 0, 1, NULL, NULL, NULL, '2018-06-07 20:18:51', '2018-06-07 22:09:59'),
(33, 1, NULL, 31, NULL, 'Day 0: Costa Rica to Miami to London', 'day-0-costa-rica-to-miami-to-london-2010-04-05', NULL, 'Got up at 3am to go to the airport. The family got up to say goodbye. Taxi got there early since we called to confirm this time instead of hoping for the best.\r\n\r\nEverything went smoothly on the flights. Lots of people in the Miami airport. Flight to London was also smooth and uneventful.\r\n\r\nGot a nice look at London and England from the air on arrival. Bought subway tickets for 8 each direct on the Picadilly line to Picadilly Circus. \r\n\r\nFound the hostel which was really close to the stop. The hostel was a circus and some weird Africans were running security and other stuff. Great location but the hostel room was primitive and the shared bathrooms were awkward.', 1, 4, 52, 1, 1, 0, '2010-04-05', NULL, NULL, '2018-06-07 22:16:11', '2019-02-23 17:32:15'),
(34, 1, NULL, 31, NULL, 'Day 1: Buckingham Palace and Madam Tussauds', 'day-1-buckingham-palace-and-madam-tussauds-april-6-2010-tuesday', NULL, 'Got our room and then took a walk to Buckingham Palace and saw some horse guards. Tons of tourists around.\r\n\r\nI needed a bathroom so ended up eating at Pizza Hut. Went back to the room and took a nap from 1 to 3pm.\r\n\r\nLater took a tram to find Madam Toussod\'s and went on in since it was late and there wasn\'t much of a line.  Took lots of pics with the wax figures and Kate loved it. \r\n\r\nWent back to Piccadilly and had a beer in a bar close by. Went to another bar, Devonshire Inn, right by the hostel and had some Newcastle\'s and bar food for dinner.', 1, 4, 55, 1, 1, 0, '2010-04-06', NULL, NULL, '2018-06-07 22:20:16', '2019-02-23 17:30:51'),
(35, 1, NULL, 31, NULL, 'Day 2: Seeing the sights in London', 'day-2-seeing-the-sights-in-london-april-7-2010-wednesday', NULL, 'Got up a little late at 9am since we were exhausted from the trip and time change. Went to the tour office to book the train and ferry for Ireland but we just ended up using their WiFi. Found a great deal on the internet, 30 per person for a train and ferry package from London to Dublin. Took 2 hours to make arrangements and book everything on our little travel computer.\r\n\r\nHad fish and chips for lunch at the Devonshire Inn which was just opening. Later walked all over starting at Trafalgar Square, then over to Westminster Abbey, the Thames, the Parliament building, and Big Ben. Walked on the other side of the river to get good photos of everything.\r\n\r\nHad coffee in a little place behind the London Eye and then went on the London Eye which had fantastic views of downtown. \r\n Took tons of pics even though it was an overcast day.\r\n\r\nAfter that walked all the way along the river to Tower Bridge and the London Tower. Walked across the bridge and with a ton of people and cars. Went to the some gift shops and bought postcards, a flag sticker, a family crest, etc. \r\n\r\nWaited by the London Tower until dark so we could take pics of the bridge with lights. Took the subway back to Picadilly and had dinner at an Italian place.', 1, 4, 58, 1, 1, 0, '2010-04-07', NULL, NULL, '2018-06-07 22:25:12', '2019-02-23 17:31:13'),
(36, 1, NULL, NULL, NULL, 'Epic Road Trip: Bali to Portugal', 'epic-road-trip-southeast-asia-to-europe', '', 'Kuala Lumpur, Malaysia\r\nDenpasar, Bali, Indonesia\r\nUbud, Bali\r\nLovina, Bali\r\nGili Trawangan, Indonesia\r\nKuta, Bali\r\nPhnom Penh, Cambodia\r\nSiem Reap / Angkor Wat, Cambodia\r\nKrati, Cambodia\r\nHo Chi Minh City, Vietnam\r\nMui Ne, Vietnam\r\nNha Trang, Vietnam\r\nHoi An, Vietnam\r\nHue, Vietnam\r\nHanoi, Vietnam\r\nHalong Bay, Vietnam\r\nNanning, China\r\nHong Kong, China\r\nGuangzhou, China \r\nBeijing, China \r\nUlan Baatar, Mongolia \r\nGobi Desert, Mongolia \r\nUlan-Ude, Russia\r\nIrkutsk, Russia \r\nYekaterinburg, Russia\r\nMoscow, Russia \r\nKiev, Ukraine \r\nPodgorica, Slovakia \r\nInnsbruck, Austria\r\nVienna, Austria\r\nBasel, Switzerland \r\nGeneva, Switzerland \r\nLyon, France \r\nSan Sebastian, Spain\r\nBilbao, Spain \r\nLaredo, Spain \r\nSantander, Spain\r\nVigo, Spain\r\nSantiago de Sompostela, Spain\r\nPorto, Portugal\r\nLisbon, Portugal \r\nMadrid, Spain', 1, 3, 0, 0, 0, 1, NULL, NULL, NULL, '2018-06-07 22:45:22', '2019-01-11 19:08:09'),
(37, 1, NULL, 31, NULL, 'Day 9: Amsterdam to Hamburg to Copenhagen to Malmo, Sweden', 'day-9-amsterdam-to-hamburg-to-copenhagen-to-malmo-sweden-april-14-2010', '', 'Had a full breakfast at the Hotel Bellington, packed up, and checked out. Left our baggage in the reception area with\r\nthe nice Chinese lady. Used our 24 hour tram pass to go back out into the suburbs to a big supermarket to buy\r\nsome road food for the all night bus trip to Sweden.\r\n\r\nWent back to downtown Amsterdam and Kattie bought a belt at H&K. We ate lunch by the Amstel River but it\r\nwas pretty cold so we didn\'t stay long. Took our last look around downtown Amsterdam and then went back and\r\npicked up our luggage and headed by tram to the Amster Station and to the bus station which is next door. We\r\nused the crap out of those tram passes.\r\n\r\nWaited a couple of hours for the bus. There were some sketchy Africans on the bus drinking in the back. They\r\nwent to the bathroom which was right beside every few minutes to smoke. At the German border one of the Africans\r\nand one other guy were taken off of the bus since they didn\'t have proper id. Wasted an extra hour at the border\r\nwaiting on the police to decide if they could continue or not.\r\n\r\nRode all night. Had to get off of the bus for the ferry crossing from Germany to Denmark. Went up and sat in the\r\nrestaurant for 45 minutes for the trip. Stopped in Copenhagen which looked very cool at 5 in the morning. Then\r\ncontinued on for another hour to Malmo.', 1, 4, 0, 1, 1, 1, '2010-04-14', NULL, NULL, '2018-06-08 01:17:11', '2018-06-08 03:14:34'),
(38, 1, NULL, NULL, NULL, 'Add TEst', 'add-test', '', '', 1, -1, 0, 0, 0, 1, NULL, NULL, NULL, '2018-06-08 01:22:09', '2018-06-08 08:38:00'),
(39, 1, NULL, 31, NULL, 'Day 3: Train from London to Holyhead, UK, Ferry to Dublin', 'day-3-train-from-london-to-holyhead-uk-to-dublin', NULL, 'Got up at 7:30 and took the subway to Euston for 8 and one change. \r\n\r\nAt the train station got our tickets out of an automatic box by inserting our credit card.  Took Virgen Trains to Holyhead.  We had trouble finding our seats since they had a weird numbering system. Great views of England from the train and it took about 3 hours.\r\n\r\nThe ferry had restaurants, casino, movie theater, store, etc. We never found typical seats and everybody took the tables at the restaurants so we wandered around until we found space on a bench by the elevator. Bought a tiny fountain coke in the restaurant for 3!\r\n\r\nGot to the Dublin docks, got Euros from an ATM, and caught the only bus to downtown. The bus went to the Busarus bus station downtown and we had to walk quite a ways with all of our stuff. Got directions along the way and finally found the Leeson Inn. It turned out to be pretty close to everything and very nice and relaxed compared to the London hostel.\r\n\r\nThe night went to a street with restaurants, stores, and bars about 3 blocks from the Leeson. Had an expensive dinner at burger king and then found Spar our new favorite grocery store.', 1, 4, 60, 1, 1, 0, '2010-04-08', NULL, NULL, '2018-06-08 01:30:45', '2019-02-24 23:05:46'),
(40, 1, NULL, 31, NULL, 'Day 4: Sightseeing in Dublin all day', 'day-4-sightseeing-in-dublin-all-day-april-9-2010', NULL, 'Kate stayed up late on the internet so she slept in while I went down the street for coffee in the supermarket that had a little area with seats in the window. Squeezed in between the some girls and watched the working people go by. \r\n\r\nWent back to the hotel to wake  my special lady up and we got ready and left at 10:30. Bought lunch at a soup and baked potato place across the street from St Steven\'s Green and ate in the park by a lake full of ducks, geese, and sea gulls.\r\n\r\nWalked all over Dublin, went to churches, souvenir stores, etc. There were some nice pedestrian only streets.  Had ice cream and a coke in the Temple Bar area which is lively with a lot of outdoor cafes and street bands.  \r\n\r\nLater found the main wide street, O\'Connell Street where the spire sculpture is.\r\n\r\nThere was an important soccer match with a French team so there were rowdy French fans dressed in Blue and Yellow all over the place.\r\n\r\nThat evening went to our favorite super market, Spar, and bought sandwiches for dinner.', 1, 4, 58, 1, 1, 0, '2010-04-09', NULL, NULL, '2018-06-08 01:59:50', '2019-02-23 17:32:14'),
(41, 1, NULL, 31, NULL, 'Day 5: All Day Tour to Glendalough and Kilkenny', 'day-5-all-day-tour-to-glendalough-and-kilkenny-april-10-2010', NULL, 'Got up at 6 am, left hotel at 7:30 am and walked about 15 minutes over to the tourist office to catch the Paddywagon Tours bus at 8:30. \r\n\r\nThe tour was a big bus full of people for 28 per person. First stop was at a nice canyon created by glaciers. \r\n\r\nOut in the countryside everything was green with sheep everywhere. There was a wild goat at the stop at a scenic overlook. \r\n\r\nNext stop was the old monastery town of Glendalough (pronounced Glendalock). There was an ancient graveyard, and old stone building and a big huge stone tower. \r\n\r\nWalked all over and took lots of pics and then had tea in the hotel. Only had to yell at one group because I walked into their picture and they hissed at me.  \r\n\r\nThere was also a National Park there with trails to some lakes. I think Glendalough means Canyon with Lakes.\r\n\r\nNext stop on the tour was the scenic, quaint little town of Kilkenny which has the huge Kilkenny castle. \r\n\r\nFirst thing we did was find a supermarket inside a little mall and had lunch on a bench. This has become our routine because the restaurants are crappy and super-expensive. \r\n\r\nAfter lunch we walked around and went to the castle. Didn\'t take the castle tour because in was only inside the castle and you couldn\'t go outside on the towers to take pics. Took a lot of nice outside pics of the castle.\r\n\r\nAfter the tour, they dropped us off downtown, we went back to the Busarus office to buy tickets for the two hour trip to Belfast the next morning to catch our flight to Amsterdam. \r\n\r\nThen we walked back to the hotel and packed up everything for an  early departure in the morning.', 1, 4, 66, 1, 1, 0, '2010-04-10', NULL, NULL, '2018-06-08 02:08:47', '2019-02-23 17:31:11'),
(42, 1, NULL, 31, NULL, 'Day 6: Dublin to Belfast to Amsterdam', 'day-6-dublin-to-belfast-to-amsterdam-april-11-2010-sunday', NULL, 'Got up early and hiked with all of our crap to the Busarus terminal which was about 30 minutes away.\r\n\r\nThe bus to Belfast left at 8am and arrived at about 10:30am. We caught another bus to the airport for almost the same price. \r\n\r\nAt the airport, they searched every inch of our carry-ons and all of the stuff in it. We had all of the cameras and power cords which probably looked suspicious in the x-ray machine. We were joking around in Spanish while the lady dug through our stuff and glared at us suspiciously.\r\n\r\nGot to Amsterdam and after the usual confusion, bought tickets, and caught the train to Central Station.  \r\n\r\nTook a tram from in front of Central Station to the specified stop in the museum district for our hotel, and asked around and looked confused until we found the Hotel Bellington, which was pretty close to the tram stop.  \r\n\r\nThe charming hotel was located on a nice street with all of the most expensive stores but it was pretty dead.  The hotel had no elevator and an extremely steep and narrow staircase. It was almost straight up.  We had to share a bathroom on a different floor.  \r\n\r\nAfter checking in we walked around and found a really lively area behind the Hard Rock cafe.  Had expensive pancakes at a place and then walked around some more. \r\n\r\nAmsterdam is very lively and there are people riding bikes everywhere so you have to watch out for them as well as cars, buses, and trams.', 1, 4, 62, 1, 1, 0, '2010-04-11', NULL, NULL, '2018-06-08 02:12:34', '2019-02-23 17:30:51'),
(43, 1, NULL, 31, 3181, 'Day 7: Full Day Seeing the Sights in Amsterdam', 'day-7-full-day-seeing-the-sights-in-amsterdam-2010-04-12', NULL, 'Hotel Bellington had breakfast included so stocked up on it. They also had free internet which was a first.\r\n\r\nWe walked all over downtown Amsterdam, which is fantastic. The streets, buildings, and canals are all very scenic.  There are bicycles and bike paths everywhere with droves of bicyclists. \r\n\r\nWent to the Palace, Dam Square, the Red light district, coffee shops, and many souvenir shops. \r\n\r\nHad lunch at a middle eastern kabob place. First had a huge cheesy hotdog and then a lamb kabob. Kate liked it until she found out that it wasn\'t beef.  The cook was from Egypt. There were people from many different nationalities all over Amsterdam. it was the biggest mix of people that we had ever seen.\r\n\r\nHad dinner at a Mexican place because Kate wanted rice and beans. We shared a big plate and I had a few Dolmish beers and the manager or somebody bought me an extra one for some reason. One waitress was from Canada and she was excited to meet people from Costa Rica. \r\n\r\nAfter dinner we went to a coffee shop and bought one joint for 6 euros or something. It was pretty harsh and we got a little tiny buzz which was okay. Kate regretted having smoked since it burned her throat and she felt everybody would be disappointed in her for smoking again after quitting for 6 years.  We walked back to the hotel which I barely remember.', 1, 4, 56, 1, 1, 0, '2010-04-12', NULL, NULL, '2018-06-08 02:17:16', '2019-02-23 17:32:17'),
(44, 1, NULL, 31, 3182, 'Day 8: Another full day touring Amsterdam', 'day-8-another-full-day-touring-amsterdam-april-13-2010-tuesday', NULL, 'Spent all morning making travel arrangements to Sweden. Decided to go to Malmo first so the trip wouldn\'t be so long. Booked it through Eurolines buses. \r\n\r\nAlso had to switch rooms for some reason. The new room was on the same floor and had a bathroom which was a nice surprise. \r\n\r\nHad lunch at the Italian deli next door to the hotel.  Turned out to be very expensive since everything was by weight. \r\n\r\nAfter lunch we went to find the bus station. Took the tram to Amstel Station and the Eurolines bus terminal was right next door. \r\n\r\nLater rode the tram until we saw a big super market and got off to buy some sandwiches and food the the over night bus trip.\r\n\r\nLater in the afternoon we were walking around downtown and we found a tour of a church that went up into the tower for views of the city. \r\n\r\nTook the tour which was excellent. The climb up to the tower was super steep and very narrow so Kate freaked out a little. Saw the huge church bells and got a nice history of the church. \r\n\r\nTook some excellent photos from the church tower. Later Kate bought some clothes and I bought an Amstel Sterk beer to drink in the hotel.', 1, 4, 61, 1, 1, 0, '2010-04-13', NULL, NULL, '2018-06-08 02:20:17', '2019-02-22 07:34:15');
INSERT INTO `entries` (`id`, `site_id`, `location_id`, `parent_id`, `photo_id`, `title`, `permalink`, `description_short`, `description`, `user_id`, `type_flag`, `view_count`, `published_flag`, `approved_flag`, `deleted_flag`, `display_date`, `color_foreground`, `color_background`, `created_at`, `updated_at`) VALUES
(45, 1, NULL, 31, NULL, 'Day 9: Amsterdam to Hamburg to Copenhagen to Malmo, Sweden', 'day-9-amsterdam-to-hamburg-to-copenhagen-to-malmo-sweden-2010-04-14', NULL, 'Had a full breakfast at the Hotel Bellington, packed up, and checked out. Left our baggage in the reception area with the nice Chinese lady. \r\n\r\nUsed our 24 hour tram pass to go back out into the suburbs to the big supermarket to buy some road food for the all night bus trip to Sweden.\r\n\r\nWent back to downtown Amsterdam and messed around.  Kate bought a belt at H&K. We ate lunch by the Amstel River but it was pretty cold so we didn\'t stay long. \r\n\r\nTook our last look around downtown Amsterdam and then went back and picked up our luggage and headed by tram to the Amsterdam Station and to the bus station which is next door. We used the crap out of those tram passes.\r\n\r\nWaited a couple of hours for the bus. On the bus ride, there were some sketchy Africans drinking in the back. They went to the bathroom which was right beside us every few minutes to smoke. \r\n\r\nAt the border crossing into Germany, one of the Africans and one other guy were taken off of the bus since they didn\'t have proper id. Wasted an extra hour at the border waiting on the police to decide if they could continue or not.\r\n\r\nRode all night. Had to get off of the bus for the ferry crossing from Germany to Denmark. Went up and sat in the restaurant for 45 minutes for the trip. \r\n\r\nStopped in Copenhagen which looked very cool at 5 in the morning. Then continued on for another hour to Malmo, Sweden.', 1, 4, 63, 1, 1, 0, '2010-04-14', NULL, NULL, '2018-06-08 02:24:13', '2019-02-22 03:20:57'),
(46, 1, NULL, 31, NULL, 'Day 10: Full day in Malmo, Sweden', 'day-10-full-day-in-malmo-sweden-april-15-2010-thursday', NULL, 'Arrived in Malmo on the bus at 6:30 am. Walked about 15 minutes to the Central Station and got some kroner from a cash machine and figured out which bus to take to our hotel, Hotel Ibis, which is a little ways outside of the city center.\r\n\r\nFound the bus and the driver didn\'t make us pay because he didn\'t have change for 100 Kroner notes. The bus cost 18 kroner = 1.80 = $2.10 each way per person. \r\n\r\nGot directions to the hotel from the bus driver but he sent us the wrong way to a youth hostel. Asked another lady on the street and she also sent us the wrong way. Went back to the bus stop and asked some kids and they sent us the right way. \r\n\r\nWalked about 15 minutes to the hotel but coundn\'t check in until 10am so we had to hang around and kill 2 hours. We got in trouble for sleeping on a couch in the lobby. A lady woke us up and told us we couldn\'t sleep there since there was a convention and the people were coming to the lobby lounge area.\r\n\r\nFinally got to check in to the hotel and took a 2 hour nap and got up at about 12:30pm.  Hotel Ibis is Kate\'s new favorite hotel because they are modern, chic and don\'t cost a fortune.  Got ready and headed downtown to check out Malmo and find transportation to Stockholm for the next day. \r\n\r\nFirst went to a huge Walmart-like store across the street from the hotel. Then went back to Central Station by bus which didn\'t charge us again since I was asking him for a 24 hour bus pass and he didn\'t understand me or something.  \r\n\r\nAfter some research we found an overnight bus that leaves at 10pm so bought tickets for that. There was a cheap train but it left at noon and arrived at 6pm so we would also have to pay for a hotel in expensive Stockholm. \r\n\r\nSpent the rest of the afternoon walking around and shopping in downtown. Got back to the hotel at about 8pm (still light out) and uploaded some pictures. Had to pay for a day of internet access. \r\n\r\nAlso booked our hotel in Stockholm, the Hotel Ibis there for about 55 per night.', 1, 4, 54, 1, 1, 0, '2010-04-15', NULL, NULL, '2018-06-08 02:30:38', '2019-02-23 17:30:52'),
(47, 1, NULL, 31, NULL, 'Day 12: First Day in Stockholm', 'day-first-day-in-stockholm-2010-04-17', '', 'The night bus got in about an hour early at 5:15 so we killed some time at Central Station. We bought an unlimited 3 day subway which wasn\'t cheap but cheaper than buying individual passes. At about 8am we headed to the hotel which was easy to find and we didn\'t have to walk too far with all of our gear. \r\n\r\nThe hotel had a room ready so we didn\'t have to wait until check in time. Room was the same as in Malmo just not as new. We took a nap until noon and then showered and headed out.\r\n\r\nTook the subway to the Old Town area and walked around the palaces, churches, and the maze of tiny cobbled streets. Bought lunch at a super market and ate outside the Royal Apartments or something.\r\n\r\nSaw the changing of the guard and walked over to the busy harbour with nice views. Later Kattie shopped at her favorite store H&M of which there were 3 or 4 in the shopping district downtown while I waited in McDonalds and used the internet. Headed back to the hotel at about 6pm since we were exhausted. I slept from about 8pm to 8am.', 1, 4, 71, 1, 1, 0, '2010-04-17', NULL, NULL, '2018-06-08 03:39:51', '2019-02-16 00:17:52'),
(48, 1, NULL, 31, NULL, 'Day 11: All Day in Malmo, Sweden', 'day-11-one-day-in-malmo-sweden-2010-04-16', NULL, 'Got up at 8am and went downstairs to the hotel restaurant to have coffee while Kate stayed in bed.  We have to check out at 12N so we will hang around the hotel until then. Packed up, checked out, and left our bags in hotel storage. \r\n\r\nAfter checking out, took the bus back to downtown and Kate went on a shopping spree at her favorite new store, H&M, which is having a huge sale. I went next door to McDonald\'s to drink more coffee and use the free wifi. \r\n\r\nIt\'s a windy, sunny but frigid day in southerm Sweden. There are a lot of people in the street and in the sidewalk cafe\'s and coffee shops. I am in Espresso House which is across the street from the 2nd H&M writing this.  \r\n\r\nMalmo has a vibrant city center full of young people.  The style here for girls is leggings with short skirts or long blouses so that is what Kate is looking for.\r\n\r\nAt 6pm went to the movie \'The Bounty Hunter\'. The theatres had assigned seats and the movie cost about 10.  We had to leave about 10 minutes early because we didn\'t want to get to the night bus to Stockholm too late. \r\n\r\nGrabbed a bus back to the hotel to get our stuff out of their storage closet and caught the same bus back to downtown. We thought that the bus went all the way to the Central Station but it turned off and we had to hop off real quick and walk a little farther. Got to the bus early and got good seats. Sat at a table with two other people in front of us.\r\n\r\nHorrific night because we couldn\'t get comfortable and the idiot driver had the heat cranked up all the way.  In the middle of the night, I took off my sweater forgetting that my glasses were hanging on the front of it and my glasses ended up on the floor in the aisle. Somehow, I found them their the next morning and nobody had stepped on them.', 1, 4, 54, 1, 1, 0, '2010-04-16', NULL, NULL, '2018-06-08 03:43:40', '2019-02-23 17:31:13'),
(49, 1, NULL, 31, NULL, 'Day 13: Full Day Exploring Stockholm', 'day-13-full-day-exploring-stockholm-2010-04-18', '', 'Got up at 8ish and played on the Acer while Kate slept. Later went down for coffee and started planning our trop to Finland. Found out that we both needed a visa to Russia so started working on that. \r\n\r\nRelaxed in the hotel since it was Sunday and then headed downtown on the subway at about noon. Stopped at a grocery store and had salads for lunch on a park bench outside of the store in a little neighborhood.\r\n\r\nSNAPSHOT: I am sitting in a coffee shop called Moda Cafe which is an extension of Kate\'s favorite store, H&M, where she is shopping again. I am sipping on my tiny 2 euro coffee. The waitress is a typical young blond swedish girl and the manager asked me about my little Acer computer.  There are a couple of tables of Swedes who are keeping an eye on me. It\'s a sunny but chilly Sunday in Stockholm and we need to take more pictures. Most of the people in Stockholm have been super friendly since I ask for directions about every five minutes.\r\n\r\nWent to the movie theater to buy our tickets and then saw an outdoor flee market in a big plaza. We found a huge cheap suitcase on wheels so bought it for 30 euros and had to take it back to the hotel.  We needed it to replace Kate\'s huge, cheap,  cumbersome, oversized backpack that is now to heavy to lug around.\r\n\r\nOn the way back from the hotel to downtown, got off at a different stop which had views from a hillside of downtown.  Took some pictures there and then went to the movie at 6:20. \r\n\r\nThe movie was Date Night and was pretty funny.  After the movie we had dinner at kabob place and then took the metro back to the hotel just as it was getting dark.  It was raining a little when we got out of the movie. \r\n\r\nMade our reservations for a hotel in Helsinki.', 1, 4, 56, 1, 1, 0, '2010-04-18', NULL, NULL, '2018-06-08 03:54:19', '2019-02-23 17:31:13'),
(50, 1, NULL, 31, NULL, 'Day 15: Arrived in Helsinki', 'day-15-arrived-in-helsinki-2010-04-20', '', 'Got to Helsinki at about 10am and took the crowded tram to the Train Station to catch the airport bus since the hotel is by the airport. Kate was in the back of the tram and I had to go to the front to pay and couldn\'t get back to where she was. On a few of the stops I got off and got back on farther back on the train and finally got back to where she was in the last car. Was afraid that I would get caught outside the tram and loose her since she didn\'t know where to get off.\r\n\r\nFound the airport bus and went to the airport and finally found the free bus to the hotel. Hotel was great with a nice big room, TV, and bathroom. \r\n\r\nGot ourselves together and headed back to Helsinki. The only problem with the hotel is that it costs us 4 euro pp per tram to get to downtown. \r\n\r\nWalked around Helsinki and did the usual. There were only a few souvenir shops so it doesn\'t look like they have many tourists. Kate found her favorite store so she was happy.', 1, 4, 78, 1, 1, 0, '2010-04-20', NULL, NULL, '2018-06-08 04:39:58', '2019-02-24 22:41:31'),
(51, 1, NULL, 31, NULL, 'Day 16: One Full Day in Helsinki', 'day-16-one-full-day-in-helsinki-2010-04-21', '', 'Went to breakfast at the hotel (included) at about 8:30 and filled up. Kate wasn\'t feeling great so she stayed in the room while I went to Helsinki to make ferry arrangements for Estonia and look around for the last time. \r\n\r\nWent inside a church and saw a demonstration at the other, white church. Had a typical Finnish snack of herring baked into a bun, delicious.\r\n\r\nBought a postcard and a frig magnet for 7 euro. Went back to the hotel at about 2pm and then we walked over to the mall which turned out to be huge and had everything.\r\n\r\nAte burgers at Hessburger at the mall and then found two huge Walmart type stores on the bottom floor. Messed around there for a few hours and then went back to the hotel. \r\n\r\nBooked a hotel in Estonia for two nights for 29 euros per person per night, the cheapest yet.\r\n\r\nBought a CF card reader at the mall for 20 euros so we could finally see the photos from the big camera.', 1, 4, 54, 1, 1, 0, '2010-04-21', NULL, NULL, '2018-06-08 04:48:55', '2019-02-23 21:59:47'),
(64, 1, NULL, 31, NULL, 'Day 27: All Day in Budapest and the Night Train to Romania', 'day-27-all-day-in-budapest-and-the-night-train-to-romania-2010-05-02', '', 'Checked out of Ibis and left bags in storage. Went down to the other side of the river and walked up a big hill to a big thing with a church and towers with a great view of the river and the parliament building.\r\n\r\nIn the afternoon, walked all over downtown to find a movie theater that we saw on the internet. Took about 2 hours to find it. The Europeans give lousy directions.  Saw \'When in Rome\'.\r\n\r\nAfter the movie, went to the train station about an hour early and found out that the train left from a different station. Went to find a bus and then decided to take a taxi since it was about 9:30pm. The station wasn\'t very far so didn\'t have to pay too much. At the correct train station there were gypsey\'s bothering people and begging and generally lurking around and looking at people\'s luggage. Once again we had trouble getting into the right car and had to move a few times when people started getting on at later stops.', 1, 4, 48, 1, 1, 0, '2010-05-02', NULL, NULL, '2018-06-09 03:41:33', '2019-02-23 17:31:48'),
(52, 1, NULL, 31, NULL, 'Day 14: Overnight Ferry Stockholm to Helsinki', 'day-14-overnight-ferry-stockholm-to-helsinki-2010-04-19', '', 'Checked out of the hotel and put our luggage in the hotel storage. Took the subway to downtown for a final look around.\r\n\r\nBought final souvenirs and had lunch at a British place. Lunch was a delicious piece of chicken swaddled in bacon, and potatos with a cheese and wine sauce.\r\n\r\nKate made a final stop at H&M to buy some tennis shoes. Then we took subway back to the hotel to pick up the bags. Walked the 500m or so back to subway with all of our stuff and went to the ferry bus stop that we had found earlier. Lots of people on the bus and at the ferry terminal. The ferry was super efficient and we went right on board. It was a huge ferry, just like a little cruise ship with restaurants, bars, casino, entertainment, circus, pool/sauna, etc.\r\n\r\nPut out stuff in the room which was at the very bottom of the boat, under the car decks, and then went on deck outside to watch the departure from Stockholm. Later we found a couch with a big window so sat there for a few hours and watched the excellent scenery. The boat stayed really close to the bank and there were houses and villages all along the waterfront.\r\n\r\nAfter dark we went and watched a high-wire circus act that was above the main promenade and then had a few beers in a bar with live music. After that went to dinner and had some pasta and more beer, Lapin-something. The cabin was cozy with a bathroom and shower and two upper bunk beds. We started in the same bed but they were about half the size of a twin bed so I moved to the other bunk a little later.', 1, 4, 51, 1, 1, 0, '2010-04-19', NULL, NULL, '2018-06-08 04:59:13', '2019-02-23 17:30:52'),
(53, 1, NULL, 31, NULL, 'Day 17: Helsinki to Tallinn, Estonia by Ferry', 'day-17-helsinki-to-tallinn-estonia-by-ferry-2010-04-22', '', 'Got up at 7am, had a huge full breakfast at the hotel at 8am, caught the Free Bus to the airport, and caught the 615 bus to Helsinki. It\'s a brisk, overcast day in Finland. It started raining and snowing. Walked from the Train Station to H&M so Kate could buy more lovely stuff.\r\n\r\nWalked the rest of the way in the light sleet to the Linda Line Ferry Terminal about 5 blocks with all of our baggage. Ferry left right on time at 12N. It\'s a smaller high-speed boat that only takes 2 hours to cross the little arm of the baltic between Scandinavia and Estonia. Our bags are getting heavier but the huge roller suitcase we bought in Stockholm for 30 EUR is holding up great.\r\n\r\nGot to Tallinn, Estonia and walked over to the hotel which was really close and checked in. Great hotel, Tallink Express for only 29 EUR.  Went downtown and walked through the maze of little cobble-stoned streets and buildings from the 13 and 1400\'s. St Olaf\'s church was close so we paid to climb up the tower and take pictures of all of Old Town. Great views of the the other churches and the famous Gothic Town Hall.\r\n\r\nHad lunch at a restaurant in the basement of a 600 year old building which is now a hotel. The food was cheap and fantastic. Kate had a soup that she loved so obviously we will return for more.\r\n\r\nLater walked all over Old Town, which wasn\'t very big, and took lots of pictures. In the evening, returned for another soup at the Olive restaurant and the waitress thought we were a little strange.', 1, 4, 55, 1, 1, 0, '2010-04-22', NULL, NULL, '2018-06-08 05:01:47', '2019-02-25 04:53:08'),
(54, 1, NULL, 31, NULL, 'Day 19: the new entries', 'day-19-the-new-entries-2010-04-24', '', 'Day 15: Arrived in Helsinki, 2010-04-20\r\n\r\nGot to Helsinki at about 10am and took the crowded tram to the Train Station to catch the airport bus. Kate was in the back of the tram and I had to go to the front to pay and couldn\'t get back to where she was. On a few of the stops I got off and got back on in the last car where she was. Was afraid that I would get caught outside the tram and loose her since she didn\'t know where to get off.\r\n\r\nFound the airport bus and went to the airport and finally found the free bus to the hotel. Hotel was great with nice big room, TV, and bathroom. Got ourselves together and headed back to Helsinki. The only problem with the hotel is that it costs us 4 euro pp per trim to get to downtown. Walked around Helsinki and did the usual. There were only a few souvenir shops so it doesn\'t look like they have many tourists. Kate found her favorite store so she was happy.\r\n\r\nDay 16: Last Day in Helsinki\r\n\r\nWent to breakfast (included) at about 8:30 and filled up. Kate wasn\'t feeling great so she stayed in the room while I went to Helsinki to make ferry arrangements and look around for the last time. \r\n\r\nWent inside a church and saw a demonstration at the other, white church. Had a typical Finnish snack of herring baked into a bun.\r\n\r\nBought a postcard and a frig magnet for 7 euro. Went back to the hotel at about 2pm and then we walked over to the mall which turned out to be huge and had everything.\r\n\r\nAte burgers at Hessburger at the mall and then found two huge Walmart type stores on the bottom floor. Messed around there for a few hours and then went back to the hotel. Booked a hotel in Estonia for two nites for 29 euro pp pn, the cheapest yet.\r\n\r\nBought a CF card reader at the mall for 20e so we could finally see the pics from the big camera.\r\n\r\nDay 17: Helsinki to Tallinn, Estonia by Ferry 2010-04-22\r\n\r\nGot up at 7am, had a huge full breakfast at the hotel at 8am, caught the Free Bus to the airport, and caught the 615 bus to Helsinki. It\'s a brisk, overcast day in Finland. It started raining and snowing. Walked from the Train Station to H&M so Kate could buy more lovely stuff.\r\n\r\nWalked the rest of the way in the light sleet to the Linda Line terminal about 5 blocks with all of our baggage. Ferry left right on time at 12N. It\'s a smaller high-speed boat that only takes 2 hours to cross the little arm of the baltic between Scandinavia and Estonia. Our bags are getting heavier but the huge roller suitcase we bought in Stockholm for 30e is holding up great.\r\n\r\nGot to Tallinn, Estonia and walked over to the hotel which was really close and checked in. Great hotel, Tallink Express for only 29e.  Went downtown and walked through the maze of little cobblestoned streets and buildings from the 13 and 1400\'s. St Olaf\'s church was close so we paid to climb up the tower and take pictures of all of Old Town. Great views of the the other churches and the famous Gothic Town Hall.\r\n\r\nHad lunch at a restaurant in the basement of a 600 year old building which is now a hotel. The food was cheap and fantastic. Kate had a soup that she loved so obviously we will return for more.\r\n\r\nLater walked all over Old Town, which wasn\'t very big, and took lots of pictures. In the evening, returned for another soup at the Olive restaurant and the waitress thought we were a little strange.\r\n\r\nDay 18 / Apr 23 / Tallinn, Estonia\r\n\r\nGot directions to the main bus station and went by tram to find it. Bought tickets for the next morning to Riga, Latvia. Also made sure that the trams would be running at 6am on a Saturday.\r\n\r\nSpent the rest of the day walking around, going into churches, and warming up in coffee shops. It was still really cold. Had lunch at McDonalds right by the ancient gate and wall.\r\n\r\nDay 19 / Apr 24 / Riga, Latvia\r\n\r\nGot up at 5am and left the hotel at 6am with all of our gear. Walked about 5 blocks to the nearest stop for Tram 2. It finally showed up and we made it to the bus station in plenty of time. People in the streets were leaving the discos and heading home from the night before.\r\n\r\nFive hour ride to Riga. We slept about the way. There was some nice scenery of mainly farm land, little towns, lakes, and some beaches. Kate reserved an apartment instead of a hotel. It was close to the bus station so we got there and waited for the guy who was supposed to meet us at noon. Guy showed up and helped me lug the big suitcase up about 5 flights of stairs since there was no elevator. The apartment was huge and very nice with wood floors and nice decor.\r\n\r\nIt was freezing outside so we didn\'t walk around much. Had lunch at a delicous pizza place in a mall right by the hotel. The prices are about as cheap as Estonia. Dropped Kate off at the apartment since it was too cold for her and Riga was about like Tallinn. I went over to the main church which was just a few blocks away and went up into the tower for views of the whole city. Since the church tower had been destroyed in WW2 and restored later there was an elevator to the top. First time that I didn\'t have to climb all the way up. Great views at the top but also a powerful freezing wind. Went back to the apt and found Kate with no electricity since she had blown the master fuse. We finally found the main fuse box out in the passage way since none of the fuses in the fuse box in the apt had been tripped.\r\n\r\nLater went to the bus station to find out about luggage storage and the overnight bus to Warsaw. Went to McDonalds for a few hours to book the bus and hotel for Warsaw. Spent a few hours there with all of the people staring at us. Everybody stares at us every where that we go.\r\n\r\nDay 20: Overnight Bus from Riga to Warsaw, Poland 2010-04-25\r\n\r\nStayed in the apartment until noon relaxing and waiting on the guy to come and check us out and help me lug big blackie down the stairs. \r\n\r\nTook the luggage to the train station which was only a few blocks away and put it in their storage. Then went and ate lunch at Pico Pizza again but at a different location. Delicious again. \r\n\r\nAfter lunch went and bought movie tickets to see Hot Tub Time Machine. Then went and walked around old town until the movie started at 2:45pm. Movie was pretty funny and afterwards we went to McDonalds to use the internet and kill time before the night bus left at 7pm. Had to change buses in Lithuania at 11pm. Didn\'t sleep very well like usual but it wasn\'t too bad.\r\n\r\nDay 21 / Apr 26 / Warsaw\r\n\r\nArrived in Warsaw 5:30am at the central train station. Had a lot of trouble finding our bus mainly because the driver was sealed in a glass cubicle so we couldn\'t ask him any questions to confirm that we were on the right bus. We knew the number but didn\'t know which direction to get on. We tried to get info from a lot of people but they weren\'t real helpful. The Polish like to yell at people as their normal way of speaking.\r\n\r\nFinally made it to the hotel and checked in. The hotel was a huge cavernous cement number with all of the personality of a state institution.  Napped for two hours and then headed back to the center to walk around.\r\n\r\nWalked down the Royal Way past important buildings to the Old Town which was really nice. Went up a tower to take some pictures from about which is my new fun thing to do. Had a coffee and snacks in the main square of Old Town in an outdoor coffee shop. I asked the waiter to take a picture of us and he dropped the camera onto the cobblestones and it hit hard but survived somehow. The waiter was a little freaked out for having done that. We also finally started paying for buses since we found out where to buy tickets.\r\n\r\nWe really enjoyed Warsaw and the people were a lot friendlier even though they yelled at us a few times. We liked Poland better than all of the countries since Holland: Sweden, Finland, Estonia, and Latvia. Had a quick dinner at the hotel and went to the room to pack.', 1, 4, 0, 1, 1, 1, '2010-04-24', NULL, NULL, '2018-06-08 06:39:12', '2018-06-08 07:34:41'),
