(59, 1, NULL, 31, NULL, 'Day 22: Warsaw to Prague', 'day-22-warsaw-to-prague-2010-04-27', '', 'Checked out of hotel at 7:30 and took a slow bus to the bus terminal to catch our Prague bus at 9am.  It was a 12 hour slow bus ride with many stops and no border check. At the dinner stop we were able to get some Czech money for the subway when we arrive. Also had to get some more Polska money in order to buy something for dinner. \r\n\r\nGot to Prague at 9:30 and took the subway to our hotel\'s stop. There were a lot of people in the subway so it wasn\'t dangerous. The subway was on the honor system and we only bought one ticket because we didn\'t have enough change for two. It didn\'t look like many people were paying anyway. We had to walk two dark and isolated blocks with all of our stuff to get to the hotel.\r\n\r\nLuckily didn\'t get lost, asked directions and got right to the hotel. The hotel was full of kids on a field trip or something.', 1, 4, 76, 1, 1, 0, '2010-04-27', NULL, NULL, '2018-06-08 07:47:25', '2019-02-23 17:30:53'),
(60, 1, NULL, 31, NULL, 'Day 23: All Day Sightseeing in Prague', 'day-23-all-day-sightseeing-in-prague-2010-04-28', '', 'Went downtown and walked around. Went to an open air market and to a tourist info office to get a map. Went to the main square and saw the famous clock ding the hour with the saints moving around in the windows. Went up in the clock tower for views and to take pictures. \r\n\r\nLater went to the river and had coffee in a little outdoor cafe right on the water. Went to some more souvenir shops and Kate bought an egg with Mary and Jesus painted on it.\r\n\r\nAte a hotdog from a street place that turned out to be a grease bomb. Found an H&M for Kate and she bought some stuff. Went back to the hotel early. Later went back downtown to take some night pictures of the Charles Bridge. There were other people there with their tripods doing the same thing. Had dinner at McD\'s and then went to the hotel.', 1, 4, 51, 1, 1, 0, '2010-04-28', NULL, NULL, '2018-06-08 07:52:19', '2019-02-23 17:31:39'),
(61, 1, NULL, 31, NULL, 'Day 24: All Day in Prague and All Night Bus to Budapest', 'day-24-all-day-in-prague-and-all-night-bus-to-budapest-2010-04-29', '', 'I got up early and went to the bus station to find a bus to Budapest. Had coffee at the place and waited for the final bus company to open at 8 am. They were the only ones who had an overnight bus to Budapest so made those arrangements. Went back to the hotel and booked an Ibis hotel in Budapest. Packed, checked out, and went to the bus station to store our stuff and then went back downtown. Went across the famous Charles River bridge for the first time and walked up to the Prague Castle on the other side.\r\n\r\nThe whole area around the Prague Castle was fantastic including the main church. Took tons of pictures and then walked over to the Mirador in the big park. The place was full of people but we went up the stairs to the top of the Mirador and took some great pictures of downtown and the river.\r\n\r\nWent to bus station at about 9:30 to wait for the bus to leave at 11:30. The bus people were extremely rude and complained about our huge suitcase and then wouldn\'t let us take our backpack on the bus. The bus hit something in the middle of the night and stopped for about 30 minutes checking the damage.', 1, 4, 49, 1, 1, 0, '2010-04-29', NULL, NULL, '2018-06-08 07:55:38', '2019-02-23 17:32:16'),
(62, 1, NULL, 31, NULL, 'Day 25: Arrival and All Day Exploring Budapest', 'day-25-arrival-and-all-day-exploring-budapest-2010-04-30', '', 'Arrived in Budapest at about 7 am and the bus dumped us out on a street corner across the street from a Bus Terminal. It took us awhile to figure out where we were and where we were supposed to go.  Got cash from an ATM in the bus terminal and found the subway entrance and went to the Hotel Ibis in Heroes Square. Great location across the street from some museums, a big monument, the zoo, and the Hungarian Baths.\r\n\r\nSlept for a few hours and then took the subway to downtown. Had lunch at McDonald\'s and walked around for a few hours. Went by the Parliament building and some other stuff along the Danube River then had coffee at a sidewalk cafe and watched the world pass by.', 1, 4, 51, 1, 1, 0, '2010-04-30', NULL, NULL, '2018-06-08 07:59:31', '2019-02-25 20:27:14'),
(63, 1, NULL, 31, NULL, 'Day 26: The Famous Thermal Baths in Budapest', 'day-26-the-famous-thermal-baths-in-budapest-2010-05-01', '', 'Got up early to go to the thermal baths but went to the wrong place. Went back to the baths near the hotel and they turned out to be the ones we were looking for anyway. Spent a few hours there. Since it was Saturday the place was packed. There were lots of little pools with various temperatures and chemicals such as sulfur and steam rooms. The steam room we went into was so hot we could only stand it for a few minutes.\r\n\r\nTook a nap after the baths and went back downtown to mess around in the afternoon and evening. Took some night pictures of the Heroes Square monuments.\r\n\r\nBought train tickets to Sinaia, Romania in Transylvania.', 1, 4, 51, 1, 1, 0, '2010-05-01', NULL, NULL, '2018-06-08 08:06:31', '2019-02-23 17:31:40'),
(65, 1, NULL, 31, NULL, 'Day 28: Arrived in Sinaia, Transylvania, Romania', 'day-28-arrived-in-sinaia-transylvania-romania-2010-05-03', '', 'In the middle of the night, the border police mounted the train to check passports for the exit from Hungary and then the entry to Romania.\r\n\r\nIn the morning, went through some spectacular mountains and it looked like Colorado.\r\n\r\nArrived in Sinaia at around noon and took a taxi to the hotel, Pensionaia Dona, which was about 2 kms away on the other side of the little town.  Our taxi driver, Chip, offered to take us on a tour the next day for 40.\r\n\r\nSinaia is a ski resort and is close to Dracula\'s Castle and some other historic sites. Walked through town and had lunch at a restaurant in a different hotel.  After that went to the tourist office to find out about castle tours but there weren\'t any so we called Chip and arranged an all day tour for the next day.', 1, 4, 50, 1, 1, 0, '2010-05-03', NULL, NULL, '2018-06-09 03:51:14', '2019-02-23 17:32:17'),
(66, 1, NULL, NULL, NULL, 'Day 28: Romania', 'day-28-romania-2010-05-03', NULL, NULL, 1, 4, 0, 1, 1, 1, '2010-05-03', NULL, NULL, '2018-06-09 07:02:24', '2018-06-09 07:03:50'),
(67, 1, NULL, NULL, NULL, 'Day 29: Romania', 'day-29-romania-2010-05-04', NULL, NULL, 1, 4, 0, 1, 1, 1, '2010-05-04', NULL, NULL, '2018-06-09 07:05:51', '2018-06-10 17:10:28'),
