(72, 1, NULL, NULL, NULL, 'Welcome Section', 'section-welcome', 'Do not dwell in the past, do not dream of the future, concentrate the mind on the present moment - Buddha Gautama Siddhrtha', '[[site-name]] provides inspiring travel experiences that bring people further into the discovery of cultures, places, and people all around the world. Our goal is to positively impact perspectives, promote conscious travel, create global citizens, and celebrate the beauty of our world.', 1, 7, 1, 1, 1, 0, NULL, NULL, NULL, '2018-06-10 01:45:06', '2019-01-13 21:23:07'),
(73, 2, NULL, NULL, NULL, 'This is the Welcome Section', 'section-welcome', NULL, 'Welcome to the Hike, Bike, and Boat web site.  Our goal is to document self-guided tours, hikes, and other things to do in the areas that we visit.', 1, 7, 0, 1, 1, 0, NULL, NULL, NULL, '2018-06-10 06:19:41', '2018-06-20 01:09:05'),
(74, 1, NULL, 31, NULL, 'Day 29: All Day Tour Around Sinaia, Transylvania, Romania', 'day-29-all-day-tour-around-sinaia-transylvania-romania-2010-05-04', NULL, 'All day tour with Chip to Dracula castle, The Citadel, Brasov, and lunch at a different ski resort. Dracula\'s Castle was pretty boring but the other stuff was nice. Walked around Brasov and went to the Black Church and then to some stores. Chip was pretty friendly and he showed us pictures of his lady and kid.  He pulled over for some nice scenic photos of the mountains and the view from above Brasov.\r\n\r\nThe Citadel was closed but we walked up the hill to take some outside pictures. The place was roped off and there were a couple of guards at the end.  We took some funny pictires with one of them acting like he was going to whack me with his nightstick. We exchanged emails with the guard, Nicolai, since he wanted to see the pictures.  He wrote us later and asked for money.\r\n\r\nBefore heading back to Sinaia, we had Chip stop at the train station in Brasov to buy our tickets to Budapest which were about 30E each. After he dropped us off at the hotel, I walked down to the train station to buy tickets to Bucharest for 7 am the next morning.', 1, 4, 53, 1, 1, 0, '2010-05-04', NULL, NULL, '2018-06-10 17:09:48', '2019-02-23 17:31:49'),
(75, 1, NULL, 31, NULL, 'Day 30: Sinaia to Bucharest to Bulgaria to Istanbul', 'day-30-sinaia-to-bucharest-to-bulgaria-to-istanbul-2010-05-05', NULL, 'Got up early, checked out of the hotel, the hotel lady called us a taxi, and we went back to the train station. The train was a little late and the huge suitcase wouldn\'t fit anywhere. This time our seats were in a cabin with six other people. We stood between the cars by the bathroom for awhile with the big suitcase but people kept coming in there to smoke so we gave in, left the huge suitcase in the outside passage and took our seats with the other people.\r\n\r\nArrived in Bucharest and just stayed in the station to wait for our train to Istanbul at noon. Killed a few hours in McDonald\'s which was inside the station and then went to our private sleeper car in the train. The sleeper car was small but cozy and I spent hours sitting in the window and going out in the hall to the window on the other side to see the excellent views of the Romanian and then the Bulgarian countryside. \r\n\r\nRomania was interesting with herds of sheep, storks in huge nests on top of telephone poles (like the ones in Poland) and horse-drawn plows and wagons.  Bulgaria wasn\'t as interesting but had some nice mountains. It was mainly just big farms. \r\n\r\nThe train was mainly backpackers and wasn\'t very full.  That night the sleeper car was pretty cozy with the shade drawn and we slept pretty well.\r\n\r\nAt the Turkey border in the middle of the night, instead of the border police coming through the train, we had to get off and wait in line. I had to buy a tourist visa for $20 but Kate didn\'t need one. We waited in the main line about 30 minutes before the border people showed up.\r\n\r\nWe\'ve now been travelling for one month.', 1, 4, 58, 1, 1, 0, '2010-05-05', NULL, NULL, '2018-06-10 17:15:55', '2019-02-23 17:31:09'),
(76, 1, NULL, 31, NULL, 'Day 31: The Grand Bazaar and All Day Exploring Istanbul', 'day-31-the-grand-bazaar-and-all-day-exploring-istanbul-2010-05-06', NULL, 'Arrived in Istanbul about an hour late, at about 9am. At the train station, we did the usual routine, got cash, found the tourist info office to get a map, and tried to figure out the public transportation. The Tourist Info guy was useless and we glared at him. We finally figured out how to use the tram to get to our hotel which wasn\'t too far away. \r\n\r\nThe tram was packed with people so we had to shove our way in with full luggage and then try to figure out which stop to get off at. We asked some people and they gave us bad info and we got off one stop early. Figured out the problem, got back on the next packed tram and got off at the right stop. \r\n\r\nThe hotel was a couple of blocks away from the tram stop and not too hard to find by map.  After checking in to the hotel, we went to eat at a typical local buffet style place. Food was exotic and excellent. \r\n\r\nNext we went to the Grand Bizarre which was really close and started dealing with the aggressive salesmen. Kate got trapped by one guy selling really expensive fake purses in his shop and she couldn\'t escape so I had to intervene and get her out of there. The guy acted really mad just like the psycho carpet sellers.\r\n\r\nThat night we had dinner at a sidewalk kebab place which was excellent. The waiter, Murat, really really like Kate as usual and he brought me some free tea. After dinner we took some pictures with the restaurant people and they enjoyed that.', 1, 4, 59, 1, 1, 0, '2010-05-06', NULL, NULL, '2018-06-10 17:24:19', '2019-02-25 20:14:45');
INSERT INTO `entries` (`id`, `site_id`, `location_id`, `parent_id`, `photo_id`, `title`, `permalink`, `description_short`, `description`, `user_id`, `type_flag`, `view_count`, `published_flag`, `approved_flag`, `deleted_flag`, `display_date`, `color_foreground`, `color_background`, `created_at`, `updated_at`) VALUES
(77, 1, NULL, 31, NULL, 'Day 32: Exploring the Mosques around Istanbul', 'day-32-exploring-the-mosques-around-istanbul-2010-05-07', NULL, 'Walked down to the Blue Mosque and Aya Sofia but didn\'t go in since there were so many people and long lines to enter.  We took a lot of pictures from the outside.\r\n\r\nHad lunch at McD\'s by the train station and then went back to the Grand Bazaar. Kate bought a huge fake Prada bag with roller wheels. I negotiated and we got it for half of the original price. I had Kate leave the store so I could speak freely and yell a little bit at the salesman without her freaking out.\r\n\r\nThat night went back to the same sidewalk Kebob place because it was delicious with outside seating and did a repeat of the night before. There were janky stray cats everywhere around Istanbul and Kate was feeding them so they stayed around.', 1, 4, 55, 1, 1, 0, '2010-05-07', NULL, NULL, '2018-06-10 17:27:55', '2019-02-23 17:31:44'),
(78, 1, NULL, 31, NULL, 'Day 33: Another Great Day Exploring Istanbul', 'day-33-another-great-day-exploring-istanbul-2010-05-08', NULL, 'Took the tram across the water (but still in Europe) to the main pedestrian shopping street which was packed with people.  Walked all the way back to the bridge on the other side. Near the bridge was the ancient Galata Tower which is a tourist attraction. We paid to go up the elevator to the tower lookout to take some pictures. Great views of the mosques, water, bridge, etc.\r\n\r\nNext we walked across the bridge which was packed with fisherman, traffic, and the little ferry boats where buzzing around in the water below.  On the other side of the bridge there were hundreds of people in the streets and in the outdoor markets along the water.  People everywhere.\r\n\r\nTook a long trip by tram and subway to the west side bus station to buy tickets for Athens for the next day.\r\n\r\nHad dinner at a bakery near the train station which had sandwiches and pizza. Later went to a hotel with a rooftop terrace for views, drinks, and photos. Got some nice evening sunset and night shots of the fabulous Blue Mosque.', 1, 4, 56, 1, 1, 0, '2010-05-08', NULL, NULL, '2018-06-10 17:30:55', '2019-02-23 17:30:50'),
(79, 1, NULL, 31, NULL, 'Day 34: Overnight Bus from Istanbul, Turkey to Thessaloniki, Greece', 'day-34-overnight-bus-from-istanbul-turkey-to-thessaloniki-greece-2010-05-09', NULL, 'Checked out of the hotel, stored our bags in the back, and went to the Grand Bazaar one last time. The bazaar was closed but the stores around it were open.  Later took a little ferry over to the Asian side for the first time and set foot in Asia. Went back on the same ferry and then went to the movie, Remember Me.\r\n\r\nAfter the movie, waited until 8pm at a coffee shop, picked up our baggage, squeezed into the tram, which wasn\'t as full this time and walked the few blocks between the tram stop and the subway stop which included carrying the huge suitcase up an overpass and then down into an under pass. A nice young man helped me carry it up the overpass.\r\n\r\nCaught the big, comfy bus at 10 pm and headed to Greece. Once again had to get out at the border stops and stand in line. The Greek side took about an hour.  Slept pretty good on this bus and it wasn\'t very full.  Istanbul was one of our favorite places.', 1, 4, 55, 1, 1, 0, '2010-05-09', NULL, NULL, '2018-06-10 17:35:39', '2019-02-24 00:41:11'),
(80, 1, NULL, 31, NULL, 'Day 35: Bus from Thessaloniki to Athens', 'day-35--bus-from-thessaloniki-to-athens-2010-05-10', NULL, 'In the early morning, passed through some very scenic mountains in Greece. Got to Thessaloniki at 8:30 am and walked about a kilometer from where the bus dropped us off to another little bus station to catch the bus to Athens. Had to ask directions a few times because it was a little complicated. Bought tickets for the 10 am bus, found an internet cafe to make hotel reservations, and then headed to Athens.\r\n\r\nArrived in Athens at about 4pm and the bus stopped really close to the hotel but it still tooks us a while to find it about 5 blocks away. Athens was really sketchy with illegal Africans and Pakistanis all over the place. The police were running around chasing them.  Found a nice sidewalk cafe for dinner. Had kebab, a greek salad and french fries.\r\n\r\nAfter dinner found a supermarket and a hardware store to buy stuff to fix the big suitcase which is disintegrating more every day.', 1, 4, 56, 1, 1, 0, '2010-05-10', NULL, NULL, '2018-06-10 17:43:39', '2019-02-23 17:31:10'),
(81, 1, NULL, 31, NULL, 'Day 36: All Day Touring Athens, Greece', 'day-36-all-day-touring-athens-greece-2010-05-11', NULL, 'Kate slept until about noon and then we had lunch at the same place as the night before. Walked to the entrance to the ruins where there were a bunch of little stores where I bought a Greece tee shirt. \r\n\r\nWe took the subway to the ferry docks to buy tickets to Santorini. Kate got pick-pocketed on the subway and lost about 30 euro, an ATM card, and her Costa Rica ID.  Luckily I was already carrying her passport since she kept putting it in her purse.  She doesn\'t like the under-the-shirt waist pouch since it makes her look fat in the pictures.\r\n\r\nWe rushed back to the hotel to use the laptop to call the bank and cancel the ATM card.  There weren\'t any charges on it so we only lost the cash.\r\n\r\nLater bought tickets to Egypt online for after we return from Santorini on Sunday.\r\n\r\nIn the evening, had dinner at Goody\'s in Omonia Square and bought some water for the boat ride the next day. Later went to the hotel next door, Hotel Aden?, which had a rooftop terrace and bar and had a beer and took some pics.', 1, 4, 61, 1, 1, 0, '2010-05-11', NULL, NULL, '2018-06-10 17:50:01', '2019-02-23 17:31:10'),
(99, 1, NULL, 31, NULL, 'New Test Post, Not Published', 'new-test-post-not-published', NULL, 'test entry', 1, 4, 0, 0, 0, 1, '2010-05-05', NULL, NULL, '2018-06-11 06:55:08', '2018-06-11 08:00:46'),
(82, 1, NULL, 31, NULL, 'Day 37: From Athens to Santorini, Setting Sail on the Aegean Sea', 'day-37--from-athens-to-santorini--setting-sail-on-the-aegean-sea-2010-05-12', NULL, 'Got up before 6 am checked out of the hotel but left most of our luggage and took the subway back to the ferry dock to catch to boat to Santorini at 7:25. Boat was pretty full and we had to move inside because of the smokers and chilly breeze.  We sat and played on the laptop and Kate listened to her walk-man.\r\n\r\nThe boat made about 3 stops at different islands. Took some nice pics of white buildings on brown islands. The time flew by and we snuck into the comfy seats in first class and slept a little.\r\n\r\nWhen we got to Santorini we were treated to spectacular views of the white building all along the top of the mountain and coming down the side to the little harbors. Got off the boat and took a bus to the main town of Fira. Then had to wait an hour for the next bus to the beach where our hotel, the Glaros, was in Perivolos. \r\n\r\nFinally got to the hotel and had to wait while they got our room ready even though it was already past 5:00 pm. The employees were sitting around smoking and drinking beer when we got there. The main guy finally got there and we made arrangements to rent a car from him for two days.\r\n\r\nLater we went down to the beach which is about a block away.  It was black sand and then little rocks near and in the water that were hard on the feet.  I made the plunge into the chilly Mediterranean and it wasn\'t that bad. The water was completely clear and calm. I flopped around for awhile while Kate took pictures of me. Later showered and went to dinner at one of the many restaurants along the beach. We went to the busiest one that had live music. The waitress was also the MC and dance instructor and she was really nice. We did our usual and shared one meal of Greek salad, soup, and a kebab on pita.', 1, 4, 55, 1, 1, 0, '2010-05-12', NULL, NULL, '2018-06-11 03:49:45', '2019-02-23 17:31:10'),
(83, 1, NULL, 31, NULL, 'Day 38: Awesome Day Driving Around Santorini and Seeing the Sights', 'day-38--awesome-day-driving-around-santorini-and-seeing-the-sights-2010-05-13', NULL, 'Got up at 8:30 and went and had coffee with the hotel people since apparently we were the only ones there. The hotel guy had the car ready and I paid for the room and car. It looked like his personal car since it was diryt and he didn\'t ask about insurance or anything so it was a casual deal.\r\n\r\nDrove around the island and took pictures. Went all the way to the other end to Oia and then to Fira for lunch. Parking was a hassle and the little streets were tricky since there were cars illegally parked and blocking half of the road in many places. Had a good lunch and then walked down the path that had the fantastic ocean and town views and took photos. Got down to where the famous donkeys were parked to take people on down the rest of the way to the docks.\r\n\r\nWent to book our return ferry and found that we could either arrive in Athens at midnight or take a night ferry and get in early in the morning so decided to take the night boat even though we had a hotel for that night. Ferry was 34 euro per person and departs at Friday night / Saturday morning at 12:30 am or so.\r\n\r\nLater we drove around some more and then went to the hotel to relax. That night we drove back to Fira to take some night pictures with all of the lights, bought some souvenirs and then drove back to the beach for dinner at Meteorio again.', 1, 4, 57, 1, 1, 0, '2010-05-13', NULL, NULL, '2018-06-11 03:52:47', '2019-02-24 16:35:04'),
(84, 1, NULL, 31, NULL, 'Day 39: All Day in Santorini and then the Overnight Ferry to Athens', 'day-39--all-day-in-santorini-and-then-the-overnight-ferry-to-athens-2010-05-14', NULL, 'Drove to Oia to take more photos of the white buildings going down the cliffs. On the Oia side, took pictures above the churches with the blue domes that were popular in the postcards. It was blazing heat with the sun reflecting off of the white buildings so we didn\'t last too long. There were fantastic views of the cliffs, buildings, cruise ships, islands, and ocean.\r\n\r\nMessed around in the afternoon and evening. At 11pm the hotel guy took us to the port to catch our 12:40 ferry to Athens.\r\n\r\nFound some nice reclining seats in the ferry in the TV room. There were some guy snoring real loud so Kate couldn\'t sleep.', 1, 4, 53, 1, 1, 0, '2010-05-14', NULL, NULL, '2018-06-11 03:54:59', '2019-02-25 15:18:48'),
(85, 1, NULL, 31, NULL, 'Day 40: Another Great Day Exploring Athens', 'day-40--another-great-day-exploring-athens-2010-05-15', NULL, 'At 5:30 am the ferry announcer woke us up to get ready to disembark at 6am.  A bus took us from the ferry to the subway stop. We got to the hotel at about 7 am and luckily our room was ready so we slept until noon.\r\n\r\nLater walked around Athens and found Kate\'s favorite stores.  Walked by the Parliament building and the National Library and some other stuff.\r\n\r\nLaid low that night and packed for our side trip to Egypt the next day.', 1, 4, 47, 1, 1, 0, '2010-05-15', NULL, NULL, '2018-06-11 03:57:49', '2019-02-23 17:31:10'),
(86, 1, NULL, 31, NULL, 'Day 41: Side Trip from Athens to Cairo', 'day-41--side-trip-from-athens-to-cairo-2010-05-16', NULL, 'Checked out at noon and asked our friend George at the hotel if we could store our big suitcase for a week (really 10 days). Kate had already charmed him so no problemo.\r\n\r\nWent to lunch at Goodys and then headed to the airport. Lucky that we went early since it took us over an hour to get there on a confusing subway trip where we had to change trains a few times. Check in and flight were perfect with no hassles.  We had one scare when we saw the airport sign with a different name and we thought we were going to the wrong airport and almost freaked out.\r\n\r\nCairo was hazy, dusty, and exotic. We had a big hassle at the airport because the hotel van never showed up. The airport was in the middle of nowhere and there was no public transport, only taxis.  We had to borrow cell phones from random people to call the hotel and at first they told us the van was there and then they said he wasn\'t and we should take a taxi. I asked if they were going to pay for it and they said yes, up to a ridiculously low amount.\r\n\r\nWe got a taxi, Tarik, and he gave us the normal hustle for a private tour the next day. I told him that the hotel would be paying his fare so he came up with and started arguing with the hotel guy who kept telling me that we agreed to pay too much. I told him that there were no taxis for the amount he gave us, 50 pounds (about $10). I let them work it out and we went to the room which was large and comfy with strong A/C.\r\n\r\nThat night just walked down to McD\'s for snacks. The streets of Cairo are full of people all the time and there are police on almost every major corner directing traffice. It\'s as hot as an oven here even at night so far.  I think most of the people come out late at night to avoid the heat.', 1, 4, 50, 1, 1, 0, '2010-05-16', NULL, NULL, '2018-06-11 04:02:38', '2019-02-23 17:31:45'),
(87, 1, NULL, 31, NULL, 'Day 42: All Day Tour of Cairo and the Pyramids of Giza', 'day-42--all-day-tour-of-cairo-and-the-pyramids-of-giza-2010-05-17', NULL, 'Got up before 8 am to go to the passport place and get a re-entry visa so we could take a trip to Jerusalem, Israel. We had gotten directions from a guy at the airport who overheard us asking about it in immigration. We started walking to the place but it got complicated so we got a taxi for $1 to take us. The place was only about 10 blocks. We went right in and filled out a form and they passed us through various windows to pay and get stamps. We left the passports and went to breakfast at McDs and then met our private tour guy Tarik at 10am at the hotel.\r\n\r\nBlew through Cairo as Tarik drives like a maniac like most of the Egyptians. Went directly to the Pyramids of Giza which looked fantastic towering above the outskirts of Cairo as we approached. Tarik took us right to a camel guy and we negotiated a two hour lap around the whole area for about $50 total. Kate got on her camel and freaked out when it got up. To get up the camel stands up on his back legs first so the rider is thrown forward and then stands completely up as the rider is thrown backwards. She screeched during that whole thing and then was really nervous since the camel was so tall and she was high up. I mounted my beast and we walked about half a block before Kate aborted the mission. They were all telling her to calm down and relax but I knew that it was game over for her. So we asked for a horse for her and one of the guys took her camel and ran back with a little horse. I loved my camel since it was a nice smooth ride. It was hard to take pictures since the camel rocked back and forth.\r\n\r\nKate had some trouble with her horse since at first the guys just let her go with it. I told them to lead it for her since she doesn\'t know how to ride a horse so they did that the rest of the way. She was nervous the whole time since her horse was a little skittish.  It really bucked once when my huge camel almost ran over it from behind.\r\n\r\nWe got down a few times for photos and the whole desert area was extremely scenic with guys on camels, horses, and buggies running around. It was a real desert scene. One funny thing I saw was a cop on a camel chasing a kid on a camel through a parking lot. We got down at the main pyramid place and then again at the Sphinx to take a ton of photos. We got tired of Tarik and the camel guy and all the other people who were constantly asking us for money.\r\n\r\nNext Tarik took us to another pyramid with some tombs and hieroglyphs and more people bothering us for money. We also stopped at a carpet making school where they had some kids making carpets and then they would give you the hard sell. Kate shut them down pretty fast before they showed us too many carpets and got nasty. I had had enough of Tarik and we told him to take us to the hotel and end the tour which was only about half over. Had to fight with him a little too since I didn\'t want to reimburse him for some stuff that he said that he had paid for on the trip.\r\n\r\nThat evening went to Pizza Hut and more people latched onto us and took us to a store where Kate bought a papyrus painting for 5 euro. She still thinks that she has to buy everything that they show us. Took a different way home from the Pizza Hut on the major streets and got lost. The streets were packed with people and it was hard to walk fast. Crossing the streets was also a hassle since you just have to wade into traffic and hope that they stop since there are no crosswalks. We walked through a few places where there were sidewak cafes and everybody was smoking the hukas. To find our way home we had to go to an internet cafe and look up the address to the hotel and then we fould it pretty easily. We had walked right by our street on the way.', 1, 4, 47, 1, 1, 0, '2010-05-17', NULL, NULL, '2018-06-11 04:07:21', '2019-02-23 17:31:45'),
(88, 1, NULL, 31, NULL, 'Day 43: A Second Day Exploring Cairo', 'day-43-a-second-day-exploring-cairo-2010-05-19', NULL, 'Went back to Mogamma, the government complex to pick up our passports and then went to Cairo Gateway bus station to get tickets to Taba to go to Israel.\r\n\r\nIn the evening, took to subway to the Giza stop and a local guy helped us get a cheap taxi to the pyramids. As we got close to the pyramids the touts came running out and tried to stop the taxi and even get in with us. We locked the doors so they couldn\'t hop in. A horse carriage guy pulled his rig in front of the taxi to stop it and offer his horse ride.\r\n\r\nAt the pyramid gates, we found out that everything was closed for a private party and there would be no laser light show. A new taxi driver/tour guide latched onto us and we got him to drive us to the Old Market which turned out to be pretty a quick cab ride from our hotel. \r\n\r\nWent through the massive market and had a good time negotiating for stuff. We bought some stuff from a cluster of family run stalls and had a good time joking around with them. They also served us mint tea. The main guy was yelling at everyone and I was trying to get Kate to record him bargaining with me. Every time we turned on the camera he got real friendly and started laughing. I bought a tee shirt and a magnet from them.', 1, 4, 53, 1, 1, 0, '2010-05-19', NULL, NULL, '2018-06-11 04:22:01', '2019-02-20 04:10:45'),
(90, 1, NULL, 31, NULL, 'Day 45: Eilat to Jerusalem', 'day-45-eilat-to-jerusalem-2010-05-20', NULL, 'Caught our five hour bus to Jerusalem and got there at about 12pm. Went outside and caught a local bus to the Old City and had a hard time figuring out where to get off since hardly anyone spoke English and there didn\'t appear to be a hotel area anywhere around. Got off at the Jaffa Gate stop and finally found a hotel zone on Jaffa St outside of the Old City. The hotel was 300 sheckles which is $80 and was run by a friendly older Jewish guy who got to know us.\r\n\r\nAccidently found an excellent buffet style Jewish restaurant and some meatballs and other spicy stuff for lunch.\r\n\r\nIn the afternoon went to the Old City and walked around. Entered a few famous sites like Mary\'s crypt, David\'s Tomb, and Jesus\' Tomb without realising what they were until later.\r\n\r\nHad another bad night because there was a bar behind the hotel with live music until late. I slept through it because I was exhausted, like usual.', 1, 4, 80, 1, 1, 0, '2010-05-20', NULL, NULL, '2018-06-11 04:33:40', '2019-02-23 17:31:45'),
(89, 1, NULL, 31, NULL, 'Day 44: Cairo to Taba, Egypt and Crossed over to Eilat, Israel', 'day-44--cairo-to-taba--egypt-and-crossed-over-to-eilat--israel-2010-05-19', NULL, 'Got up early to take the subway back to the bus station to catch the 9:30 bus to Taba, Egypt. Bus ride was pure desert in Egypt. Stopped in the middle of nowhere for a snack and bathroom break in a nasty place with horrible toilets and aggressive flies. Went through some dramatic mountains which were pure rock. Several trucks had crashed along the road. One looked like it lost its brakes and slammed head-on into a rock wall and completely pancaked the cab.\r\n\r\nGot to the bus station in Taba and walked to the Israeli border which was about 1 km and did the exit and entrance. They were pretty strict with Kate on the Israeli side since her passport picture is way out of date and doesn\'t resemble her. There were a couple of hot Israeli girls running the check points.  Once we got through the entrance we forget to change money so we had to take a taxi who accepted dollars to the town which was about 10 km away.\r\n\r\nWe got a not too cheap hostel and it turned out to be the worst place that we had stayed because it hadn\'t been cleaned and it was super noisy. There were partiers screaming and yelling and banging on doors all night.\r\n\r\nThat night went to a burger place and had a decent meal and then went and bought bus tickets to Jerusalem at the bus station which was across the street from the hostel.', 1, 4, 44, 1, 1, 0, '2010-05-19', NULL, NULL, '2018-06-11 04:30:08', '2019-02-19 23:00:49'),
(91, 1, NULL, 31, NULL, 'Day 46: Full Day of Touring Jerusalem', 'day-46--full-day-of-touring-jerusalem-2010-05-21', NULL, 'Went to the Old City again in the morning and joined a free tour at 11 am but bailed out after about 30 minutes since we couldn\'t hear the guy because there were about 30 people. \r\n\r\nWent back to the same place for lunch and had the same meal again because it was so tasty. \r\n\r\nThen went back to the Old City and went to the Wailing Wall and walked through the four quarters: Jewish, Christian, Muslim, and Armenian.\r\n\r\nWent back to the Church of the Sepulcre so we could enter Jesus\' Tomb which we skipped the day before.\r\n\r\nFound an expensive McDs for dinner and then went back to the room and hunted mosquitos so we could sleep better.  We killed dozens of them but there were still more.', 1, 4, 48, 1, 1, 0, '2010-05-21', NULL, NULL, '2018-06-11 04:37:10', '2019-02-23 17:31:11'),
(92, 1, NULL, 31, NULL, 'Day 47: Last Day in Jerusalem', 'day-47-last-day-in-jerusalem-2010-05-22', NULL, 'Had a horrible night because the room was full of agressive mosquitos. We hunted and killed a bunch of them but there were many more. They bit the crap out of us all night and we only slept about 5 hours.\r\n\r\nI got up at about 9am and went to McDs for coffee but everything was closed for the sabbath. There was one little convenience store open so I bought cokes and chocolate cinnamon roles. Went back to the hotel and the manager helped me buy bus tickets online and then Kate and I booked rooms in Athens and Rome for the coming days. Didn\'t book a room in Cairo since we\'re not sure we can make it back in one day.\r\n\r\nAt about 3pm went back to McDs for lunch since it had opened then went to the old city to buy the rest of our souvenirs. Instead of bargaining and fighting with the store people, I started laying the money on the counter and then leaving if they didn\'t accept it. This infuriated one guy who started yelling at me. I sent Kate back to accept his price and he yelled at her and threw her out too. Later bought all of the same stuff for the same prices elsewhere.\r\n\r\nKate was feeling bad so we went back to the hotel at 5pm to relax.', 1, 4, 60, 1, 1, 0, '2010-05-22', NULL, NULL, '2018-06-11 04:39:58', '2019-02-23 17:31:11'),
(93, 1, NULL, 31, NULL, 'Day 48: Return from Jerusalem to Eilat to Taba to Cairo', 'day-48--return-from-jerusalem-to-eilat-to-taba-to-cairo-2010-05-23', NULL, 'Caught the city bus to the Central Bus Station and caught out 7 am bus to Eilat. Had some confusion at the bus station because we tried to print our online bus tickets from the machine. The hotel guy who bought the tickets for me used his id number which we didn\'t know. The bus people straightened it out for me and we got on one of the three buses that were leaving for Eilat with the gambling crowd.\r\n\r\nGot to Eilat and had to rush to the border to catch our 12:30 pm bus on the other side. Took a taxi to the border and then got mixed up paying the exit taxes so lost our place in line a few times. \r\n\r\nOn the Egyptian side we didn\'t get out in time for the bus but there were some other guys offering minibus service to Cairo. We waited in their minibus for awhile which they had to fill before we could leave. Waited about an hour and nobody else signed up so we started walking to the bus station. The minibus guy followed us and kept trying to make a deal. We got to the bus station and there was another minibus leaving from there so we took it. The first guy kept telling the second guy how much to charge so we had to speak to him directly to get a decent price.\r\n\r\nTook the long miniibus ride to Cairo. Sometimes the driver was about to doze off and other times he was in a huge hurry and driving crazy. Finally got to Cairo about 5 hours later and the minibus stopped in the outskirts but luckily it was near a metro stop. Got on the subway and met a family of Christian Egyptians who started taking care of us. It was a young couple, their five year old, twin boys, and the wife\'s sister and father. The wife and sister latched onto Kate and soon started inviting us to their house. We declined a few times since it was already 9pm and we were exhausted from the road. They persisted and we finally gave in and went off to their house. They lived in Giza so we had a long subway ride from El Marg to Giza Suburban. From the subway stop, we took a tuktuk to their house. The house was run-down but huge and there were about 10 people living there.\r\n\r\nThe family was all over us, especially Kate. The ladies took her to a bedroom to comb her hair and feel her soft skin. The father help me wash up over a sink. I thought he might wash my hair for me. We had tea and then fruit and then they brought out the main spicy chicken dish with rice and pita bread. That all took a few hours. We showed them some of our pictures and they made Kate sing some Christian songs from her MP3. We took pictures with them and they asked us a million questions. Luckily the son and the brother in law could speak decent English.\r\n\r\nThe family wanted us to spend the night but Kate had had enough so we had to insist on leaving saying that we had already paid for the hotel, which was true. Earlier on they had told us that the father would take us back to the hotel but then we found out that he just had a moped. The new plan was for the father to take us to catch a taxi and we thought it would just be a quick ride to the taxi stop. The three of us hopped on the tiny moped with our big backpack and other bag and headed off at about 1am. There was a ton of traffic and it was a hectic ride on the back roads. Then daddy surprised us by getting on what looked like a freeway. He was weaving in and out of traffice while cars whizzed all around us and he just kept on going. We thought he was taking us all the way back to the hotel which was about 30km away but he finally stopped and let us off. I was practically sitting on the brake light and I was wondering the whole time what would happen if it snapped off and I was sent onto the pavement with all of the cars buzzing around. Kate seemed calm but as soon as we got in the taxi she had to take some hits off of her inhaler. The taxi ride was just over a buck and took about 10 minutes to get to our area and 10 more to find the street and hotel since the taxi driver didn\'t know where either. He tried to old Costa Rican taxi driver trick of shutting off the meter before could see the final total so we just paid him what we had last seen on the meter and he got a little excited but we walked away.\r\n\r\nWe got the huge master suite at the hotel, probably because there were no other rooms available at 1:30am on a Sunday. It was nice to sleep without mosquitos or noise.', 1, 4, 51, 1, 1, 0, '2010-05-23', NULL, NULL, '2018-06-11 04:45:11', '2019-02-23 17:31:11'),
(94, 1, NULL, 31, NULL, 'Day 49: Last Day in Cairo and One More Trip to the Pyramids', 'day-49--last-day-in-cairo-and-one-more-trip-to-the-pyramids-2010-05-24', NULL, 'Got up a little late and went to Pizza Hut for lunch via the metro. Then walked over to the Egyptian Museum and blew through it in about an hour and a half. It\'s a huge place but there is a lot of stuff that isn\'t tagged so we didn\'t know what it was. Saw King Tut\'s stuff but they wanted an extra $20 to go into the special room to see the mummy so we skipped it.\r\n\r\nAfter the museum, Kate was feeling tired so took her back to the hotel. The hotel guy lent me his cell phone to call our Egyptian family and tell them that we couldn\'t go to dinner with them that night. Then I went to the pyramids by myself for a final look around. \r\n\r\nTook the metro back to the Giza stop and caught a taxi with a meter that turned out to be about 17 pounds. Got there at about 4:30 and they close at 6:00 so had to rush around a little. \r\n\r\nWalked around the three pyramids and took a few more pics. Each pyramid had police on all sides to keep people from climbing around on them. All of the camel guys gave me there sales pitch and followed me around. \r\n\r\nWent to the Sphynx last and found the kids to take some pictures of me kissing it and stuff. The police wouldn\'t let them in so they climbed up a rope and over a fench to get in. I oferred them a few pounds but they said they only accepted bills so I left. One of the kids was a loud mouth and followed me out the exit where the guards were. One guard grabbed him and punched him in the arm a few times. I ran up and acted like I was going to punch him too. \r\n\r\nThe loud mouth kept following me and yelling on the outside after I gave the other kid a few pounds so I threw a rock at him and almost nailed him in the head.  That shut him up.\r\n\r\nCaught a taxi back to the metro and headed home. The metro car I was in kept filling up with only women so I started looking around and realized that men and women were in different train cars. I switched to an all male car and thought that maybe that was why they were always staring at Kate on the train.\r\n\r\nPicked up Kate at the hotel and we went to Mcds for dinner and then to the same big market to buy our final souvenirs. Bought a couple of things and then Kate had an intestinal urgency so rushed out of there, grabbed a taxi, and made it back to the hotel just in time.', 1, 4, 56, 1, 1, 0, '2010-05-24', NULL, NULL, '2018-06-11 04:51:36', '2019-02-23 17:32:14'),
(95, 1, NULL, 31, NULL, 'Day 50: Return from Cairo to Athens', 'day-50--return-from-cairo-to-athens-2010-05-25', NULL, 'Took it easy in the hotel until about 11am and then took a taxi to the airport for our flight to Athens at 2:30pm. Everything went smoothly and we made it back to Hotel Elite and our friend George the Greek was working. He was happy to see us and Kate gave him the two souvenirs that we had bought in Egypt, an ash tray and a pyramid.\r\n\r\nWent to the main shopping street later and I waited outside while Kate shopped. There was a disturbance as some guy grabbed a young thief who trying to steal his backpack or something. There was a lot of yelling and the police came and took the guy away in handcuffs. I think he was saying that he did it because he didn\'t have anything to eat.\r\n\r\nLater when we got to the hotel George had bought us some gifts, a hat that said Greece and a necklace or something with beads. We felt bad because we thought that we had made him feel obligated to buy us gifts.', 1, 4, 52, 1, 1, 0, '2010-05-25', NULL, NULL, '2018-06-11 04:53:34', '2019-02-23 17:31:45'),
(96, 1, NULL, 31, NULL, 'Day 51: Flight from Athens to Rome', 'day-51--flight-from-athens-to-rome-2010-05-26', NULL, 'Took it easy in the hotel until about 11 am and then took the metro to the airport to catch our flight to Rome on EasyJet. Smooth trip, Kate waited in line so we could get good seats on the plane since EJ doesn\'t have assigned seats. \r\n\r\nLanded in Rome and made a long arduous trip to the hotel. First took the express train from the airport to the metro then the metro to our stop and then walked about a km with all our baggage to the hotel. There were little tiny sidewalks but so many cars were parked on them that we had to walk in the busy street dragging our massive luggage. The last few blocks were straight up hill so Kate got pretty frustrated and started speaking furiously. Finally made it to the hotel dripping sweat and in bad moods. Hotel Giotti was nice but had no WiFi and the room got really expensive for the week-end.\r\n\r\nWent to dinner at a nice place close to the hotel and flirted and took pictures with the cute black waitress. We had some disappointing spaghetti and a delicious fritata and a carafe of white slightly sparkly wine.', 1, 4, 53, 1, 1, 0, '2010-05-26', NULL, NULL, '2018-06-11 05:10:29', '2019-02-23 17:31:12'),
(97, 1, NULL, 31, NULL, 'Day 52: All Day Hop On Hop Off Bus Tour of Rome', 'day-52--all-day-hop-on-hop-off-bus-tour-of-rome-2010-05-27', NULL, 'Headed out at about 10 am after enjoying the large free breakfast at the hotel. Went to the Vatican first after buying a Rome Pass for 25 each which gave us unlimited public transportation and 2 entries for 3 days. Vatican was packed and we waited in line for about 20 minutes just to enter the cathedral because everybody had to pass through the metal detector and x-ray machine.\r\n\r\nThe church and plaza were fantastic and we took 100s of pictures. Next went to lunch and had more spaghetti and two 4 cokes which was more than the food, which was crap anyway. After lunch we bought tickets for the hop on hop off bus for 15 each and rode the bus to the coliseum. We got in free with the Rome Pass and we didn\'t have to wait in line because there was a special empty line for the Rome Pass. Coliseum was fantastic even though there were tons of people and we walked all around it.\r\n\r\nAfter that we rode the Hop On Hop Off bus around a few times to relax and got off at a place and took pictures. \r\n\r\nStopped at an internet cafe on the way to the metro and then headed back to the hotel at about 10 pm. There were a lot of people in the street so walking was no problem after dark.', 1, 4, 59, 1, 1, 0, '2010-05-27', NULL, NULL, '2018-06-11 05:14:36', '2019-02-23 17:31:46'),
(98, 1, NULL, NULL, 1478, 'Currently Location: Asia', 'section-current-location', NULL, 'Nepal\r\nIndia\r\nDubai\r\nKazakhstan \r\nUzbekistan \r\nTajikistan \r\nKyrgyzstan \r\nChina', 1, 7, 4, 1, 1, 0, NULL, NULL, NULL, '2018-06-11 05:35:18', '2019-01-04 19:52:58'),
(100, 1, NULL, 31, NULL, 'Day 53: All Day Exploring Fabulous Rome', 'day-53--all-day-exploring-fabulous-rome-2010-05-28', NULL, 'Headed out again and went to the Spanish Steps and Trevi Fountain which were both packed with people. We did another lap on the Hop On Hop Off bus before our tickets expired. We got off at our final stop to search for Kate\'s H&M store. It was raining and we were hungry and the store turned out to be very small.\r\n\r\nWhile we were walking around we saw a guy cross the street illegally and get hit by a motorcycle right in front of us. He got knocked down pretty hard but they were both okay. The motorcycle guy stopped to make sure that he was okay.\r\n\r\nWe took the metro back to the Vatican stop so we could have lunch at McDs and use the internet. It took us forever to find McDs and it was packed so we returned to a Chinese place that we had passed on the way. The Chinese place turned out to be supurb and better than any Italian place that we had eaten at. After that we stopped at the same internet cafe and then headed back to the hotel since we were wiped out. \r\n\r\nIn the evening returned to the same little restaurant by the hotel for a fritata and a caraffe of the sparkly wine.', 1, 4, 60, 1, 1, 0, '2010-05-28', NULL, NULL, '2018-06-11 22:05:04', '2019-02-24 17:16:57'),
(101, 1, NULL, 31, NULL, 'Day 54: Last Day in Rome', 'day-54--last-day-in-rome-2010-05-29', NULL, 'Made some more rounds in Rome to buy souvenirs and bought our train tickets to Ancona to catch the ferry to Croatia.\r\n\r\nWent to the coliseum again and walked from there to the huge Piazza Venezia Vittoriano palace. Went to the plaza behind the piazza that is up the hill a little ways. There were several brides gettings their wedding photos taken there. One was a big mama. Had a salad at a packed McDs for lunch. Had to share a table with another couple. Found out that the McDs didn\'t have internet.\r\n\r\nOn our way back to the hotel we got lost because we had taken a different route and we couldn\'t remember which way to take the bus back to our stop. We asked some guys for directions but they sent us to the Plaza Giotto instead of the Hotel Giotto. We took a nice bus tour to the outskirts of Rome and then went back to the starting point. Found the correct bus but then took it the wrong way and got off at the subway stop that we knew and walked back to the hotel.\r\n\r\nWe bought some food to take back to the hotel for dinner and ate in the room.', 1, 4, 75, 1, 1, 0, '2010-05-29', NULL, NULL, '2018-06-11 22:10:12', '2019-02-23 17:31:46'),
(102, 1, NULL, 31, NULL, 'Day 55: Train from Rome to Ancona', 'day-55-train-from-rome-to-ancona-2010-05-30', NULL, 'Had another superb breakfast at the Hotel Giotto and then headed to the train station with the big suitcase in tow. We got there extra early and sat around and watched people. There are always suspicious looking people hanging around in the bus and train stations. Our train gate number finally appeared on the big board so we hopped onboard. It had plenty of room for the big suitcase in the space by the bathroom and there were hardly any people in our car.\r\n\r\nHad a nice scenic train ride from Rome to Ancona. There were little villages usually with a huge church or palace purched on the highest hill and lots of wheat or rye fields. When we got to the coast near Ancona the train went right along the beach which was full of people and umbrellas.\r\n\r\nOur hotel was literally right in front of the train station so we just had to cross the street and enter. Great room but no free internet. Ancona was dead and full of Pakistanis and Cubans for some reason. For dinner, we walked around and finally found a pizzaria that was open. This was the real thing and the guy whipped up our pizza right in front of us. He had it made from a ball of dough and cooked in about 10 minutes.', 1, 4, 57, 1, 1, 0, '2010-05-30', NULL, NULL, '2018-06-11 22:13:55', '2019-02-23 17:30:50'),
(103, 1, NULL, NULL, NULL, 'Photo Gallery', 'section-gallery', NULL, NULL, 1, 7, 0, 1, 1, 0, NULL, NULL, NULL, '2018-06-12 03:56:52', '2018-07-25 18:03:26'),
(104, 1, 10, NULL, NULL, 'Beijing Subway Map and Schedule', 'beijing-subway-map-and-schedule-2018-06-27', NULL, 'The Beijing Metro operates from 5am and 11pm. First and last trains have different schedules depending on the subway line.\r\n\r\nThe Airport Express operates from approximately 6 am until 11 pm depending on the direction.\r\n\r\nTo avoid the lines at the ticket machines, reusable Beijing Transportation Smart Cards are sold at the ticket counters. \r\n\r\n[Click Here for Information about the Beijing Yikatong Metro Card](/entries/beijing-mtr-metro-card-yikatong-card-2018-06-27)', 1, 5, 105, 1, 1, 0, '2018-06-27', NULL, NULL, '2018-06-12 05:15:46', '2019-02-19 14:09:32'),
(210, 1, 14, 105, NULL, 'Wednesday, Train from Xi\'an to Lanzhou with a stopover at Maijishan Grottoes', 'wednesday-train-from-xi-an-to-lanzhou-with-a-stopover-at-maijishan-grottoes-2018-07-18', NULL, 'Left the Eastwood Inn for the last time at about 6:30 am.  Said goodbye to  (mini woo) the resident kitten and he was sad to see me go.  Walked over to the Yongningmen Subway stop and went to Xi\'an North Railway station.  \r\n\r\nThe train to Tianshui took about 2 hours.  I exited to the normal confusion of trying to find the bus to the Maijishan Grottoes.  I couldn\'t find bus 34 because I think it leaves from the regular train station.  I asked the bus people how to get to the grottoes but they gave me a long answer so I assumed it wasn\'t one direct bus.\r\n\r\nI went over to the taxi line and negotiated with a few of them.  I drew a big crowd as usual.  I got one guy down to 200 CNY round-trip because the grottoes are about an hour away and he would have to wait for me.\r\n\r\nWe took off and he started regretting his decision so he bailed on the return trip.  I told him that it was no problem and I could take the bus back.  Of course he wanted the whole 200 but I yelled at him a little and gave him 100.  \r\n\r\nThere was massive road construction and it was chaos for about half way.  Everybody passing on both sides and playing chicken with the big trucks, business as usual.\r\n\r\nThe Maijishan Grottoes were pretty good.  My favorite grotto place is still the first one that I went to, Yungang Grottoes near Datong.  These were still pretty good and photogenic.  I was able to leave my big backpack at \"left luggage\" while I toured the grottoes.\r\n\r\nTo get back to Tianshui I asked a teenage couple about the bus and the girl went on a mission to find out how to get me back to the bus station.  They even missed their first bus to make sure I got on the right bus and confirmed it with the driver when he finally showed up.  I just show people my train ticket so they can see where I\'m trying to go.\r\n \r\nThe bus finally left and getting back to Tianshui was a challenge because the traffic had become stop and go.  The bus went right to the Tianshui South Train Station and I killed an hour at KFC before my train left.  I love the fast trains.\r\n\r\nGot to Lanzhou at about 7 pm and found that bus #31 goes downtown to the start of the Pedestrian Street.  I got off there and took a motorcycle rickshaw taxi to the hotel for 10 CNY.  I could have hiked in but it was getting late and I didn\'t want the hotel to give away my room. \r\n\r\nThe Ibis is very comfortable and right in the middle of everything.  I had some Dim Sum right next door in a tiny little food place.  The weather seems a lot cooler in Lanzhou than in Xi\'an.', 1, 4, 68, 1, 1, 0, '2018-07-18', NULL, NULL, '2018-07-19 05:28:20', '2019-02-22 06:05:30'),
(105, 1, NULL, NULL, NULL, 'Big Asia Trip 2018', 'big-asia-trip-2018', NULL, 'My big Asia trip started in Beijing on June, 2018 and ended in December, 2018.  The plan was to travel for six months and make a circle through China and dip down to Myanmar and Laos.  I got side-tracked and kept going west after Urumqi, China into the \'stans for a couple of months.  Then I extended the circle by flying south to Dubai, India, Nepal, Sri Lanka, Thailand, and Myanmar.  I continued overland through Myanmar and Laos by bus and then back up through China to Beijing by train.\r\n\r\nHere is where I went:\r\nBeijing, China\r\nGreat Wall of China (Badaling)\r\nDatong, China\r\nYungang Grottoes\r\nHanging Monastery (Hunyuan, China)\r\nPingyao, China\r\nMianshan Mountain (Jiexiu, China)\r\nXi\'an, China\r\nTerracotta Warriors Site\r\nHuashan Mountains\r\nLongmen Grottoes (Luoyang, China)\r\nMaijishan Grottoes (Tianshui, China)\r\nLanzhou, China\r\nZhangye, China (Danxia Geological Park)\r\nJiayuguen, China \r\nDunhuang, China\r\nUrumqi, China\r\nKashgar, China\r\nYining Ile, China\r\nAlmaty, Kazakhstan\r\nBishkek, Kyrgyzstan\r\nKarakol, Kyrgyzstan\r\nToktogul, Kyrgyzstan\r\nOsh, Kyrgyzstan\r\nKhujand, Tajikistan\r\nDushanbe, Tajikistan\r\nSamarkand, Uzbekistan\r\nBukhara, Uzbekistan\r\nTashkent, Uzbekistan\r\nShymkent, Kazakhstan\r\nTurkestan, Kazakhstan\r\nTaraz, Kazakhstan\r\nDubai, United Arab Emirates\r\nAbu Dhabi, United Arab Emirates\r\nNew Delhi, India\r\nAgra, India\r\nRanthambhore National Park, India\r\nJaipur, India\r\nJodhpur, India\r\nKathmandu, Nepal\r\nNagarkot, Nepal\r\nChitwan National Park, Nepal\r\nColombo, Sri Lanka\r\nKandy, Sri Lanka\r\nSigiriya, Sri Lanka\r\nElla, Sri Lanka\r\nTissa, Sri Lanka\r\nGalle, Sri Lanka\r\nBangkok, Thailand\r\nMandalay, Myanmar\r\nBagan, Myanmar\r\nYangon, Myanmar\r\nNpa An, Myanmar\r\n(crossed Thailand by bus in less than 24 hours)\r\nVientiane, Laos\r\nLuang Prabang, Laos\r\nLuang Namtha, Laos\r\nJinghong, China\r\nKunming, China\r\nGuilin, China\r\nNanjing, China\r\nBeijing, China', 1, 3, 2, 1, 1, 0, NULL, NULL, NULL, '2018-06-12 05:45:53', '2018-12-21 18:58:44'),
(106, 1, NULL, 31, NULL, 'Day 56: Night Ferry Ancona, Italy to Split, Croatia', 'day-56-night-ferry-ancona-italy-to-split-croatia-2010-05-31', NULL, 'Before breakfast I went to buy the ferry tickets and Kate stayed in the hotel room. Had to take a bus to the ferry terminal and wait until 9am for the ticket office to open. Got back to the hotel just in time for breakfast before it ended. The ferry didn\'t leave until 8:30 pm so we had all day to kill.\r\n\r\nTook the bus downtown and walked around. Kate found a Zara so while she was in there I hiked up to the lighthouse at the highest point on the island. It was tricky to find with all of the little alleyways and narrow streets. The lighthouse was a weird place with signs that said military zone so I stopped at the gate and took some pictures of the view of the ocean and the backside of the island. There was no one around.\r\n\r\nIt started raining so we hunkered down in a nice place downtown for lunch. We had the usual Spaghetti a la Carbonera and some vegetables al gratin which were delicious. Once again the pasta was disappointing.\r\n\r\nAfter lunch we went to an internet cafe and then back to the hotel where we had checked out and stored the big suitcase and asked them if we could hang around in the lobby for a few hours until it we could board the ferry at 6:30 pm.\r\n\r\nAt 6:30 we were among the first people to arrive so we had time to scout out the boat and find a good place where we could sleep. We found a curvy couch in the non-smoking part of the bar that was long enough for both of us to lay down with a little overlap. The place eventually filled up and people were coming in just to eat dinner and they would sit at our table without asking and they left all of there trash when they left. We agree that the Italians are indeed more social.\r\n\r\nThe place finally calmed down and we hunkered down on the couch. Kate didn\'t want to sleep end to end so she had her head down around my knees and I was afraid that I would knee her in the face while sleeping. The couch wasn\'t super comfortable but we had a decent sleep.', 1, 4, 52, 1, 1, 0, '2010-05-31', NULL, NULL, '2018-06-12 17:46:30', '2019-02-24 16:49:48'),
(107, 1, NULL, 31, NULL, 'Day 57: Bus from Split, Croatia to Plitvice National Park', 'day-57-bus-from-split-croatia-to-plitvice-national-park-2010-06-01', NULL, 'First day of June.  Got to Croatia at 7 am and joined the mob scene at immigration. We cut right into the line just like a bunch of other people and went right through. There was yelling and screaming in the lines because of the cutting. One guy with horrible teeth was screaming in an old man\'s face.\r\n\r\nThe bus station in Split was right in front of the ferry terminal so we just had to cross the street and buy our ticket to Grabovac which is near Plitvice National Park. The bus ticket girl first sold us a ticket to the wrong Grabovac and it didn\'t leave until 5 pm. Luckily we were still sitting in the bus terminal when she came over and said it was wrong and we had to do it again. The correct bus left at 8:30 am so it turned out to be much better.\r\n\r\nWe had a quick coffee next door to the bus station and then headed out. The bus driver and his assistant were young guys and not very friendly. We kept asking them questions to try to figure out where Grabovac was so we would know where to get off to find our hotel, House Tina. We figured it all out and got off at the right spot after having to pay a little more since the hotel stop was beyond the National Park stop. From the main road where the bus stop was we had to walk around to a little neighborhood with houses with hotel rooms. We went down the wrong street first and asked some people where the hotel was and they barely knew even though they lived almost right next door to .\r\n\r\nFinally got to the House Tina which was a house that they had added on to and it had a bunch of rooms, a huge dining room, and cabins in front. We got a nice room with good internet. They also had a washing machine so we got to do a real load of laundry for the first time on the trip.', 1, 4, 55, 1, 1, 0, '2010-06-01', NULL, NULL, '2018-06-12 17:50:58', '2019-02-23 17:31:12');
INSERT INTO `entries` (`id`, `site_id`, `location_id`, `parent_id`, `photo_id`, `title`, `permalink`, `description_short`, `description`, `user_id`, `type_flag`, `view_count`, `published_flag`, `approved_flag`, `deleted_flag`, `display_date`, `color_foreground`, `color_background`, `created_at`, `updated_at`) VALUES
(108, 1, NULL, 31, NULL, 'Day 58: Exploring Plitvice National Park', 'day-58--exploring-plitvice-national-park-2010-06-02', NULL, 'Had an excellent breakfast of sandwiches, scrambled eggs, yogurt, and cereal at House Tina prepared by Tina. We were talking to an American guy at breakfast and found out that his wife was Nicaraguan. Kate thought she would probably be a chola but when she came in she turned out to be a highly educated and sophisticated older lady who was an architect.  We had a nice conversation with them and they offered to drop us off at the park since had a rental car and they were going in that direction.\r\n\r\nThe park was fantastic and the best waterfall was right at the entrance. I found out that I had left the big camera battery in the hotel room so we were only using the little camera. After about an hour Kate started feeling bad and she wanted to go back to the hotel. I thought that I could drop her off and then return to the park but it took us forever to get out of there and then catch a bus to go the 12 kms back to Grabovac. At one point we got caught in the middle of a school group on the walkway over the water and we were stuck going extremely slow for a long time. One we got to Grabovac we had lunch at about 2 pm and then went back to the hotel so she could recuperate.', 1, 4, 60, 1, 1, 0, '2010-06-02', NULL, NULL, '2018-06-12 17:58:26', '2019-02-23 17:43:47'),
(109, 1, NULL, 31, NULL, 'Day 59: Another Day Touring Plitvice National Park', 'day-59--another-day-touring-plitvice-national-park-2010-06-03', NULL, 'Went to the park again and our tickets were still good. Found the park shuttle bus and bought round trip tickets on it. We did a repeat of the day before but kept going to the other half of the park. Took some great pictures and video. \r\n\r\nThere were fewer school groups this time so it was much better. The park was excellent but the best scenery was right at the beginning so the second half was kind of a let down. At one point we took a boat ride across a lake to continue the hike.  Had a nasty hamburger inside the park for lunch.\r\n\r\nRushed to catch the shuttle bus that was leaving at 3 pm and barely caught it. Kate ate lunch again at Hotel Grabovac since she couldn\'t eat the nasty hamburger inside the national park and we bought a few souvenirs there too.', 1, 4, 57, 1, 1, 0, '2010-06-03', NULL, NULL, '2018-06-12 18:01:54', '2019-02-23 17:31:12'),
(110, 1, NULL, 31, NULL, 'Day 60: Bus from Plitvice to Split and Night Ferry to Ancona', 'day-60--bus-from-plitvice-to-split-and-night-ferry-to-ancona-2010-06-04', NULL, 'Got up early and had our last delicious House Tina breakfast and walked out to the main road to catch the all day bus to Split at 9:45 am. The bus came by early and we headed off to Split and got there at about 4 pm since the bus took a longer route by the coast with some nice scenery. \r\n\r\nIn Split we had a few hours to kill before the ferry opened for loading so we walked around the old palace which had some souvenir shops and little narrow streets and alley ways. We bought our usual souvenirs and then went to wait in line for the ferry. There were already a couple of bus groups waiting so it was another mob scene.\r\n\r\nAgain we were among the first to get on the boat but it was a different boat so we had to scramble to find a good place to sleep. The bar closed at midnight so we couldn\'t use the couches. We found a long carpeted corridor with tables and space between the table and the wall where we could make a sleeping nest without people stepping on us. Other Italians were fighting over the chairs and tables and moving other people\'s stuff around so we couldn\'t leave our table.\r\n\r\nAt about 11pm I unscrewed the lightbulbs in the light fixture above us and we spread out on the floor like everybody else. The floor was extremely hard so it was a rough night\'s sleep. I had to turn over every hour or so because it was painful in any position after awhile.', 1, 4, 50, 1, 1, 0, '2010-06-04', NULL, NULL, '2018-06-12 18:06:14', '2019-02-23 17:30:52'),
(118, 1, NULL, 31, NULL, 'Day 68: Day Trip: Train from Nice to Monte Carlo, Monaco', 'day-68--day-trip--train-from-nice-to-monte-carlo--monaco-2010-06-12', NULL, 'Took the train to Monaco and walked around the harbor and then up to the palace which was high up on a hill overlooking both sides of Monaco. \r\n\r\nThere were fantastic views from the palace grounds and we took 100s of photos as usual. Had lunch out of a grocery store and headed back to Nice pretty early. \r\n\r\nWe didn\'t have enough coins to buy two train tickets since the machines didn\'t take bills so Kate rode free and they never checked tickets. The train only takes about 15 minutes between Nice and Monaco. \r\n\r\nIn Monaco there are public elevators that go up to the top of the cliffs.', 1, 4, 52, 1, 1, 0, '2010-06-12', NULL, NULL, '2018-06-13 18:11:19', '2019-02-23 17:31:40'),
(111, 1, NULL, 31, NULL, 'Day 61: Train from Ancona to Bologna', 'day-61-train-from-ancona-to-bologna-2010-06-05', NULL, 'Got up early on the ferry because people started coming around and making racket. Got to Ancona on time and it was mob scene trying to get out of there. It took forever to get off of the boat but immigration was a breeze because most people where Italian and they got right through with their ID cards.\r\n\r\nWent to the train station and found out that the cheap train to Bologna left in ten minutes so I rushed back to Hotel Fortuna to get the huge suitcase out of their storage.  We then rushed around asking people where our train stopped because we couldn\'t find it on the big board. Barely made it to the train and headed off to Bologna.\r\n\r\nThe trip to Bologna took about 3 hours. Since we didn\'t have a hotel reservation we went to McDs right by the station to use their wifi. They had wifi but there was some complicated signup procedure which required an Italian cell phone to receive the signup info. So we had lunch and then I went off to find an internet cafe. Couldn\'t find one and I just got farther and farther away from the train station so I aborted the search and headed back to McDs where Kate was waiting. We decided to put the big bags in luggage storage at the train station and then went to find an internet cafe. Finally found one and found a hotel that wasn\'t too far from the train station. Went back to the station got the big bags and walked about 15 minutes to the Hotel Ideale which was nice but a few blocks into a sketchier part of town.\r\n\r\nThat evening went for a few slices of Pizza not far from the hotel. The pizza place was next to a big church that was taller than it was long.', 1, 4, 55, 1, 1, 0, '2010-06-05', NULL, NULL, '2018-06-12 23:50:16', '2019-02-23 17:32:16'),
(112, 1, NULL, 31, NULL, 'Day 62: All Day Touring Bologna', 'day-62-all-day-touring-bologna-2010-06-06', NULL, 'Slept until 10am and got out of the hotel at about noon. Went to McDs for salads and internet but I ended up eating full burger and fries.  Walked to downtown Bologna and Kate found her stores so she was happy. Found the main tourist attractions but we didn\'t have any cameras so didn\'t go inside. There were a couple of leaning towers and one had a lookout at the top.\r\n\r\nMessed around the rest of the day and took it easy. Had some more pizza from the same place as the day before. Also bought train tickets for a day trip to Venice for the following day.', 1, 4, 55, 1, 1, 0, '2010-06-06', NULL, NULL, '2018-06-12 23:52:33', '2019-02-24 07:25:43'),
(113, 1, NULL, 31, NULL, 'Day 63: Day Trip from Bologna to Venice', 'day-63-day-trip-from-bologna-to-venice-2010-06-07', NULL, 'Got up early and took the train to Venice and got there at about 10 am. Venice was fantastic and we took 100s of pictures. We walked all over the city and crossed many canals. Went to the top of a tower for incredible views of the red rooftops and water surrounding the city. Had some horrible pasta and pizza for lunch. \r\n\r\nWhen we got to the far end of the city we took a water taxi all the way back to the train station. The taxi boat trip was an excellent tour with great views from the water. \r\n\r\nTook the train back to Bologna and got there at about 5 pm.', 1, 4, 55, 1, 1, 0, '2010-06-07', NULL, NULL, '2018-06-12 23:55:45', '2019-02-23 17:31:48'),
(114, 1, NULL, 31, NULL, 'Day 64: All Day in Bologna, Italy', 'day-64-all-day-in-bologna-italy-2010-06-08', NULL, 'Spent the day in Bologna relaxing. Kate went back to the stores and I went and climbed the tower (no elevator) and took photos of the red rooftop views of Bologna which were excellent.', 1, 4, 56, 1, 1, 0, '2010-06-08', NULL, NULL, '2018-06-13 04:19:38', '2019-02-23 17:32:16'),
(115, 1, NULL, 31, NULL, 'Day 65: Day Trip from Bologna to Milan', 'day-65-day-trip-from-bologna-to-milan-2010-06-09', NULL, 'We were planning to go to Pisa to see the leaning tower but we found out that the early train was the only cheap one to Pisa so we decided to go to Milan instead. \r\n\r\nGot to Milan three hours later and took the subway to downtown. We came out of the subway at the Duomo stop and the largest Gothic cathedral in Europe, the incredible Duomo di Milano, stood before us. \r\n\r\nWe had lunch and finally got a decent plate of pasta. After lunch Kate went shopping while I went back to the church and looked around and then took a tour of the roof which had walkways and steps to walk all around it for some fantastic views.\r\n\r\nGot back to Bologna at about 8 pm and bought our train tickets to Nice for the next day, leaving at 7:52am and arriving at about 5pm. It was the hottest day yet in Italy and we were sweating profusely on the train and then back in the hotel room without a/c. I asked the hotel guy if they had any fans for the rooms and he brought us a nice big oscillating fan which made a huge difference that night.', 1, 4, 53, 1, 1, 0, '2010-06-09', NULL, NULL, '2018-06-13 04:34:11', '2019-02-23 17:32:16'),
(116, 1, NULL, 31, NULL, 'Day 66: Train from Bologna to Nice', 'day-66--train-from-bologna-to-nice-2010-06-10', NULL, 'Leaving Bologna was sad since it was the perfect base to explore the other cities and attractions of Northern Italy. We enjoyed the easy going atmosphere of this picturesque and cost-effective little city with its arch-covered sidewalks and it\'s laid back bike, scooter, and bus travelled streets. It\'s young population was also pleasant and friendly.\r\n\r\nWe dragged and carried our massive amount of luggage the 8 or so blocks back to the train station and caught our morning train which wasn\'t very crowded. The trip to Nice required three train changes and went like this: Bologna to Milan to Ventimiglia, Italy to Monte Carlo, Monaco to Nice, France.\r\n\r\nIn Nice, struggled onto a packed bus to go to the hotel. I had to yell at an old lady who was making comments about our big suitcase. I cursed her in Spanish and she understood park of it.\r\n\r\nFinally found the hotel with some help from people on the street. Hotel Danemark, nice place but no WiFi, and only one block from the beach and boardwalk.\r\n\r\nWe were right on the main street and close to the central ped walk way. Walked down to the center and looked at souvenirs and found a restaraunt for dinner.', 1, 4, 60, 1, 1, 0, '2010-06-10', NULL, NULL, '2018-06-13 04:46:09', '2019-02-23 17:31:40'),
(117, 1, NULL, 31, NULL, 'Day 67: All Day Exploring the Streets of Nice', 'day-67-all-day-exploring-the-streets-of-nice-2010-06-11', NULL, 'Kate found her favorite stores so we spent a lot of time walking around downtown. Went to the bus station to try to find a cheap bus to Paris but there were none.  Bought a train ticket online for around $250.', 1, 4, 52, 1, 1, 0, '2010-06-11', NULL, NULL, '2018-06-13 04:59:37', '2019-02-23 17:31:49'),
(119, 1, NULL, 31, NULL, 'Day 69: All Day Relaxing in Nice, France', 'day-69--all-day-relaxing-in-nice--france-2010-06-13', NULL, 'Most places were closed so we just messed around. Spent a lot of time sitting on the promenade in front of the beach and walking among the rollerbladers, joggers, and bicycles.\r\n\r\nThe beach views were fantastic and the Meditteranean was bright blue.', 1, 4, 50, 1, 1, 0, '2010-06-13', NULL, NULL, '2018-06-13 18:20:12', '2019-02-25 20:18:33'),
(120, 1, NULL, 31, NULL, 'Day 70: Day Trip: Nice to Villefranche-sur-Mer, France', 'day-70-day-trip-nice-to-villefranche-sur-mer-france-2010-06-14', NULL, 'Took the train to the next town over, Villefranche-sur-Mer, to go to the beach which we spotted from the train and it looked really calm. The beach was excellent and the water was calm but frigid as usual. There were more topless ladies on this beach.\r\n\r\nVillafranche was very scenic with colorful buildings lined up along the ocean and trailing up the hillside.', 1, 4, 53, 1, 1, 0, '2010-06-14', NULL, NULL, '2018-06-13 18:24:30', '2019-02-23 17:32:17'),
(204, 1, NULL, NULL, NULL, 'Receipts', 'receipts', NULL, 'Receipts are attached', 1, 1, 0, 0, 0, 1, NULL, NULL, NULL, '2018-07-14 07:02:39', '2018-07-19 04:56:37'),
(121, 1, NULL, 31, NULL, 'Day 71: All Day Scenic Train Trip from Nice to Paris', 'day-71-all-day-scenic-train-trip-from-nice-to-paris-2010-06-15', NULL, 'Left the hotel and took all of our gear to the train station. Bus #12 wasn\'t very crowded so we didn\'t have to fight with anybody to get on with all of our stuff. The train to Paris had plenty of luggage storage and we were the first ones into our car so had no headaches with the big suitcase. The French coast and countryside were spectacular with castles, beaches, and lush greenery everywhere.\r\n\r\nGot to Paris and took the RER subway with some help from a friendly guy at the train station. The people often help us without us even asking them as we are trying to figure out the subway maps and signs.  The RER is the train and subway system that is beyond the metro subway.\r\n\r\nWe got to the final stop, Rosny Bois Perrier, and had to walk all the way around a mall and cross under a major highway to find the hotel. Luckily I spotted the huge sign on the horizon. \r\n\r\nA half-blind old man from the train was trying to help us and he kept driving by and yelling directions which contradicted what we knew. At one point he was yelling at us and ran right over the corner curb of the sidewalk.  He really wanted to help us.\r\n\r\nThe hotel room turned out to be nasty and depressing even though the lobby and the pictures on the internet were nice. We went back to the mall we had passed for dinner at a Mexican place and then Kate found all of her favorite stores.\r\n\r\nLater spent a few hours in the lobby because the WiFi doesn\'t reach our room. We bought our train ticket to London and tried to find a decent hotel for our final week. There were a lot of sketchy people staying at the hotel, Africans, Russians, Middle-easterners as well as backpackers and businesspeople.', 1, 4, 52, 1, 1, 0, '2010-06-15', NULL, NULL, '2018-06-14 00:27:40', '2019-02-23 17:31:09'),
(123, 1, NULL, NULL, NULL, 'Latest Articles', 'section-articles', NULL, NULL, 1, 7, 0, 1, 1, 0, NULL, NULL, NULL, '2018-06-14 22:44:22', '2018-09-26 14:06:23'),
(154, 1, NULL, NULL, NULL, 'Datong Fly by Knight Highrise Hostel', 'datong-fly-by-knight-highrise-hostel', NULL, NULL, 1, 1, 0, 0, 0, 1, '2018-07-02', NULL, NULL, '2018-07-01 10:47:52', '2018-07-03 13:02:58'),
(130, 1, NULL, 31, NULL, 'Day 78: Fantastic Views From the Top of the Eiffel Tower', 'day-78-fantastic-views-from-the-top-of-the-eiffel-tower-2010-06-22', NULL, 'After lunch at our new favorite Greek place, we went back to the Eiffel Tower and stood in line for an hour to go up to the 2nd and top levels. \r\n\r\nThere were pirate souvenir vendors all over the place so bought a bunch of little Eiffel Towers.  Since we were waiting for so long we had plenty of time to do some hard negotiating with the souvenir vendors.  We got four of one size for 6 (down from 3 apiece and 8 keychain size for 1 (down from 5 for 1). \r\n\r\nOne vendor was mad at us and said that we were bad Italian people. I kept asking him if he was happy and he said \"No, you are bad people and I don\'t like you.\".\r\n\r\nThere were great views from the top of the tower but so many people that it was hard to get a good position with the camera. We also had to wait in line to come back down. We were there from about 1 pm to 4 pm.', 1, 4, 56, 1, 1, 0, '2010-06-22', NULL, NULL, '2018-06-18 06:04:57', '2019-02-16 00:17:47'),
(125, 1, NULL, 31, NULL, 'Day 73: Spent the day walking around Paris and shopping', 'day-73-spent-the-day-walking-around-paris-and-shopping-2010-06-17', NULL, 'We slept late and had lunch again in the mall close to the hotel. We bought food in the super market and ate it on a mall bench.\r\n\r\nNext we headed to another mall to look for Kate\'s stores because it is essential that she buys clothes in Paris. The mall was a few RER train stops away and it was right by the station so we found it easily.\r\n\r\nAfter that went to downtown Paris and found another huge mall at Chatelet Las Hallas which was the stop for the Notre Dame Cathedral and the Louvre.  \r\n\r\nWe kept finding more of Kate\'s stores so she happily shopped while I walked around the river and the Notre Dame area. Didn\'t look very impressive so far and there were huge crowds everywhere. Headed home and bought dinner at the big super market again and ate in the hotel.\r\n\r\nAfter dinner watched Mexico play France in the World Cup and I had a few heinekens from the vending machine in the hotel lobby.', 1, 4, 44, 1, 1, 0, '2010-06-17', NULL, NULL, '2018-06-18 05:45:52', '2019-02-16 00:17:47'),
(126, 1, NULL, 31, NULL, 'Day 74: Relaxing Day in Paris', 'day-74--relaxing-day-in-paris-2010-06-18', NULL, 'We decided to take it easy today so we just went to a few places.  We did more shopping since we are finding Kate\'s stores all over the place. \r\n\r\nAt one point we randomly got off of the train and started walking through an Indian neighborhood and what looked like a sex district with some sex shops and fat, old prostitutes.', 1, 4, 58, 1, 1, 0, '2010-06-18', NULL, NULL, '2018-06-18 05:48:11', '2019-02-16 00:17:47'),
(127, 1, NULL, 31, NULL, 'Day 75: Another day seeing the fantastic Sights of Paris', 'day-75--another-day-seeing-the-fantastic-sights-of-paris-2010-06-19', NULL, 'We spent another day seeing the fantastic sights of Paris.  Took a long walk from Gar de Nord to the Grand Palais, the river, and all the way to the Eiffel Tower. \r\n\r\nKate bought a big Eiffel Tower souvenir with flashing lights so she dances around with while the lights are flashing.', 1, 4, 53, 1, 1, 0, '2010-06-19', NULL, NULL, '2018-06-18 05:52:49', '2019-02-16 00:17:47'),
(128, 1, NULL, 31, NULL, 'Day 76: Visit to the Notre Dame Cathedral Paris', 'day-76--visit-to-the-notre-dame-cathedral-paris-2010-06-20', NULL, 'Today we went to a big flea market area to look for used books but didn\'t find anything good.  Most of the stuff that was being sold was imitation, pirated goods for sale by the Africans.\r\n\r\nAfterwards, we went to the Notre Dame cathedral and went up to the roof and towers to take pictures of the gargoyles and the fantastic views of Paris. \r\n\r\nWe had to wait for about an hour in line while a guy with a gargoyle mask clowned around with people passing by.', 1, 4, 46, 1, 1, 0, '2010-06-20', NULL, NULL, '2018-06-18 05:55:34', '2019-02-16 00:17:47'),
(129, 1, NULL, 31, NULL, 'Day 77: A day in Paris with a visit to the Louvre and the Mona Lisa', 'day-77--a-day-in-paris-with-a-visit-to-the-louvre-and-the-mona-lisa-2010-06-21', NULL, 'We found a Greek restaurant in the Latin Quarter for a delicious lunch of Greek Salad and pita kebob wraps.\r\n\r\nAfter lunch, I went to the Louvre and left Kate at Les Halles for shopping and a movie. \r\n\r\nThe area of the Louvre near the Mona Lisa was packed with tourists but the other areas were almost empty. \r\n\r\nI went through most of the exibits in about 3 hours and took a lot of pictures.', 1, 4, 55, 1, 1, 0, '2010-06-21', NULL, NULL, '2018-06-18 05:58:41', '2019-02-24 03:36:35'),
(131, 1, NULL, 31, NULL, 'Day 79: Channel Tunnel Train from Paris to London', 'day-79-channel-tunnel-train-from-paris-to-london-2010-06-23', NULL, 'Left for the train station at 11 am and barely made it on the train because of all the hard-core security and check-in procedures. We thought it would be like a regular international train but it was just like going through the airport.\r\n\r\nThe train went through the Channel Tunnel and only took about 2 and a half hours.\r\n\r\nWe got to London, got cash, bought Oyster cards for public transport and then took the subway to the Willesden Green stop and, as we were instructed, called the hotel people to pick us up. The hotel turned out to be a cozy, little studio apartment in an old brownstone building in a nice little neighborhood. The girl who picked us up was from Uruguay and she set us up in the apartment.\r\n\r\nIn the afternoon went to the local supermarket to buy dinner of instant spicy Indian food in boxes which were delightful.', 1, 4, 54, 1, 1, 0, '2010-06-23', NULL, NULL, '2018-06-18 06:08:02', '2019-02-16 00:17:47'),
(132, 1, NULL, 31, NULL, 'Final Days In Europe, Relaxing in London', 'final-days-in-europe-relaxing-in-london-2010-06-24', NULL, 'We spent a few more relaxing days seeing the sights of London and going to some nice parks.  We also really started enjoying the Indian food that was delicious and available almost everywhere.\r\n\r\nOur charming little efficiency flat in Willesden Green was also a very comfortable option for London.', 1, 4, 58, 1, 1, 0, '2010-06-24', NULL, NULL, '2018-06-18 06:15:12', '2019-02-24 12:30:46'),
(133, 1, NULL, NULL, NULL, 'Graphics', 'graphics', NULL, NULL, 1, 1, 0, 0, 0, 1, NULL, NULL, NULL, '2018-06-19 03:47:16', '2018-06-26 23:27:38'),
