(139, 1, 10, NULL, NULL, 'How to get to the Great Wall of China at Badaling by Bus', 'how-to-get-to-the-great-wall-of-china-at-badaling-by-bus-2018-06-29', NULL, 'Bus 877 or 919 Express bus goes direct from Deshengmen Bus Terminal to the Badaling Great Wall main entrance.\r\n\r\nOperating Hours for the Bus\r\n06:00-12:00 (Apr.1-Oct.31)\r\n06:00-12:30 (Nov.1-Mar.31)\r\n\r\nReturn from Badaling\r\n10:30-17:00 (Apr.1-Oct.31)\r\n11:00-16:30(Nov.1-Mar.31)\r\n\r\nDriving Time:  One and half hours (Non-stop)\r\nDistance: 60 km\r\nBus Fare: 12 RMB (Beijing Metro card is accepted, note you have to tap the card on arrival outside of the bus as well)\r\n\r\nDeshengmen Bus Terminal Location: Next to the Deshengmen Arrow Tower (see instructions below).\r\n\r\nBadaling Terminal Location: in the parking lot (Bear Park), about 700 meters southeast of Tower No.01 of Badaling Great Wall.\r\n\r\nInstructions:\r\n1) Take Subway Line 2 to the Jishuitan stop.  Exit the subway at Exit B1 and go left along the street.\r\n\r\n2) Walk East for 450 meters.  Walk toward the Deshengmen Arrow Tower (see photo below).\r\n\r\n3) Catch the 877 Bus inside the roundabout at the Deshengmen Arrow Tower complex.  You have to cross the busy street to get to the complex.  There is a crosswalk but no traffic light.  There will be a huge line of people but the buses leave continuously.\r\n\r\n4) At Badaling, walk 20 minutes from the bus stop area to the main entrance.  Avoid buying a \"slide\" ticket because there are huge long lines for the slide that take forever.\r\n\r\nBadaling Great Wall Basic Information:\r\n\r\n- Northern Slope - more scenic, cable car, toboggan, 2 hour loop route.  There are some very steep sections.\r\n\r\n- Southern Slope - fewer people, better photo opps, out and back route, no loop.\r\n\r\nPrices:\r\n\r\n- Ticket Price for basic entry: RMB 40 (Nov. 1 to Mar. 31), RMB 45 (Apr. 1 to Oct. 31)\r\n\r\n- Cable Car: RMB 80 (single trip), RMB 100 (round trip)\r\n\r\n- Toboggan Slide: RMB 30 (single trip).  Avoid this unless you like very long lines.\r\nOpening Hours: 06:30-19:00 (in summer), 07:00-18:00 (in winter)\r\nHiking Time: Two Hours\r\n\r\n[Reference](https://www.tour-beijing.com/blog/beijing-travel/travel-review/badaling-great-wall-bus)', 1, 5, 72, 1, 1, 0, '2018-06-29', NULL, NULL, '2018-06-21 03:51:44', '2019-02-23 08:52:59'),
(140, 1, NULL, NULL, NULL, 'Day Trip from Beijing: Guyaju Caves (Ancient Cliff Dwellings)', 'guyaju-caves-ancient-cliff-dwellings-2018-06-26', NULL, 'Take bus 919 or 919 Express from Deshengmen Station and get off at Yanqing Dongguan Station. \r\n\r\nTransfer to RNB 40 and get off at Guyaju Station. \r\n\r\nRNB 40 departs at 06:00, 08:00, 10:00, 13:00, 15:00 and 18:00.', 1, 6, 0, 0, 0, 0, '2018-06-26', NULL, NULL, '2018-06-21 04:53:04', '2018-07-07 03:26:05'),
(195, 1, 13, NULL, NULL, 'Xi\'an City Wall Hike and Bike', 'xi-an-city-wall-hike-and-bike', 'The most complete city wall fortification in China is great for walking and biking, especially in the evening and at night.', 'Initially built in the 1300\'s, the Xi\'an City Wall is a great location for a long hike or bike ride.  Electric tram rides and single or double bikes are rented near the main gates.  The South Gate has the longest hours and the most services.\r\n\r\nThe wall is especially scenic and photogenic at night because the red lanterns, temples, buildings and the outside of the wall are lit up in a spectacular fashion.\r\n\r\nOperating Hours:\r\nSouth Gate: 8:00 - 24:00\r\n\r\nEast/North/West Gate, Hanguang Gate, Wenchang Gate,  Heping Gate, Zhongshan Gate, Shangde Gate:\r\nMay - Oct.: 8:00 - 19:00\r\nNov. - Apr.: 8:00 - 18:00\r\n\r\nSingle and double bikes can be rented and turned in until 22:00 at the South gate.', 1, 2, 295, 1, 1, 0, NULL, NULL, NULL, '2018-07-09 18:12:03', '2019-02-25 18:26:07'),
(141, 1, NULL, NULL, NULL, 'Bestay Hotel Express', 'bestay-hotel-express-2018-06-27', NULL, NULL, 1, 5, 0, 1, 1, 1, '2018-06-27', NULL, NULL, '2018-06-22 05:49:09', '2018-07-03 18:29:36'),
(142, 1, NULL, 105, NULL, 'Central Beijing Attractions', 'central-beijing-attractions-2018-06-28', NULL, 'Map of Central Beijing\r\n- Tiananmen Square\r\n- Forbidden City\r\n- Zhongshan Park', 1, 4, 0, 1, 1, 1, '2018-06-28', NULL, NULL, '2018-06-22 07:31:35', '2018-07-01 12:04:34'),
(143, 1, 10, NULL, NULL, 'How to get to the Beijing Summer Palace', 'how-to-get-to-the-beijing-summer-palace-2018-06-30', NULL, 'Subway Line 4: Beigongmen stop.\r\n\r\n1) Take subway line 4 to the northwest direction and get off at the next to the last station, Beigongmen Station (North Gate, ).\r\n\r\n2) Use Exit D from the subway station.\r\n\r\n3) Walk to the west to get to the the north gate, Beigongmen Gate, of the Summer Palace, , to the left.\r\n\r\nEntrance fees:\r\n- Low Season, Nov 1  Mar 31: RMB 20.\r\n- High Season: April 1  Oct 31: RMB 30.\r\n\r\nOperating Hours:\r\n- Low Season, Nov 1  Mar 31: 7:00 am to 7:00 pm\r\n- High Season: April 1  Oct 31: 6:30 am to 8:00 pm \r\n(Ticket sales stop 2 hours before closing time)', 1, 5, 84, 1, 1, 0, '2018-06-30', NULL, NULL, '2018-06-22 20:39:24', '2019-02-22 10:06:00'),
(144, 1, NULL, 105, NULL, 'Fragrant Hills Park', 'fragrant-hills-park-2018-06-29', NULL, '- Subway stop Xiyuan or Yuanmingyuan\r\n- Then bus 331.\r\n\r\nHours:\r\n- Apr - Oct 6:00 am - 6:30 pm\r\n- Nov - Mar, 6:00 am - 6:00 pm', 1, 4, 0, 0, 0, 1, '2018-06-29', NULL, NULL, '2018-06-23 02:48:53', '2018-07-01 11:12:17'),
(203, 1, NULL, NULL, NULL, 'Beijing Things to do', 'beijing-things-to-do', NULL, '1) Beijing\r\n\r\n- Curio City (Antique City, as it is signed) on the south third ring road, is an easy \r\n  walk from Chao Wai Furniture market, the glasses market and directly opposite the Beijing antique painting and calligraphy centre. There is so much to do and see in this area you could easily make a day or two of shopping just around this small area!  Bid hard. The prices are going to be inflated.\r\nOr, via cab, it is about 15 minutes from Guomao Subway Station (China World Trade Center).\r\nOpen 9.30am 6.30pm daily / 21 Dongsanhuan Nanlu\r\n\r\n- silk alley market\r\n- Wangfujing Street Night Market, 1730-2200.\r\n- hong qiao market\r\n- Eat in taikoo li area\r\n- climb coal hill in Jing Shan Park\r\n- Beihai park\r\n- great wall tour buses leave from the tiananman plaza\r\n\r\n- GWOC: Huanghuacheng is a bit harder to get to, but its definitely worth it for the serenity / take a hiking tour through a company like Great Wall Hiking\r\n\r\n- Great wall simatai, remote/unrestored, take 980 fast bus from Dongzhimen bus stop to Miyun, get off at Gulou.  Transfer to bus 51 and get off at ???.  Must book online in advance and china cell # is needed.  Stay in Gubei Water Ancient Town?\r\n\r\n- Guyaju Caves (Ancient Cliff Dwellings).  50 miles NW of Beijing.  Take bus 919 or 919 Express from Deshengmen Station and get off at Yanqing Dongguan Station. Transfer to Y40 and get off at Guyaju Station. Y40 departs at 06:00, 08:00, 10:00, 13:00, 15:00 and 18:00.', 1, 6, 0, 0, 0, 0, NULL, NULL, NULL, '2018-07-13 15:20:12', '2018-07-14 07:01:12'),
(145, 1, NULL, 105, NULL, 'Wangfujing Exotic Food Market', 'wangfujing-exotic-food-market-2018-06-28', NULL, 'Directions:\r\nSubway Line 1, Wanfujing stop.', 1, 4, 0, 1, 1, 1, '2018-06-28', NULL, NULL, '2018-06-28 11:31:31', '2018-07-01 11:12:27'),
(146, 3, NULL, NULL, NULL, 'Sliders', 'section-sliders', NULL, NULL, 1, 7, 0, 1, 1, 0, NULL, NULL, NULL, '2018-06-29 01:45:05', '2018-06-29 01:45:12'),
(147, 1, 10, NULL, NULL, 'Beijing Summer Palace Walking Tour', 'beijing-summer-palace-walking-tour', 'Enjoy the sights around Lake Kunming in the the very photogenic Summer Palace in the outskirts of Beijing.', 'Walking around Lake Kunming in the the very photogenic Summer Palace in Beijing.  Starting at either the North Gate or East Gate entrance this four mile loop goes South all the way around Kunming Lake following the shoreline and then returns along the causeway (see map below).\r\n\r\nThe causeway is a narrow strip of land with exceptional views of the lake on both sides.', 1, 2, 264, 1, 1, 0, NULL, NULL, NULL, '2018-06-30 10:57:24', '2019-02-25 21:36:44'),
(148, 3, NULL, NULL, NULL, 'Asia Trip 2018 Journal', 'asia-trip-2018-journal-2018-06-26', NULL, NULL, 1, 3, 0, 0, 0, 0, '2018-06-26', NULL, NULL, '2018-06-30 12:48:33', '2018-06-30 17:45:33'),
(149, 3, NULL, 148, NULL, 'Tuesday, Flight to Beijing', 'tuesday-flight-to-beijing-2018-06-26', NULL, 'Tues, June 26\r\n\r\nUp at 5 am to do my steps through Lincoln Park.\r\n\r\nGot the message that my flight was delayed 5 hours so messed around all day with my final packing.\r\n\r\nFinally turned everything off and left at 6:30 pm.  Walked down and caught the RapidRide C bus and took it to the Link station downtown and took the train the rest of the way to the airport.  Breezed through everything since Delta gave me TSA Precheck for the first time.  I asked them if I could take cookies on the flight and they said no problemo.\r\n\r\nFlight left on time and it was smooth sailing all the way.  Got to Beijing at about 2:30 am and took a $50 taxi to the hotel.  The hotel had already marked me as a no show but they did have a room that they had to clean before I could have it.  Finally got to bed at about 3:30 am.', 1, 4, 0, 1, 1, 1, '2018-06-26', NULL, NULL, '2018-06-30 12:55:46', '2018-08-12 11:51:51'),
(150, 3, NULL, 148, NULL, 'Thursday, Tienanmen Square', 'thursday-tienanmen-square-2018-06-28', NULL, '(Note that Wednesday, 6/28 was lost during the time change).  Up at 7 am since I\'m trying to switch to the local schedule which is almost opposite.  Had coffee and a snack at Macs and then headed to Tienanmen Square to look around.  It was blazing hot so I didn\'t last long out in the open.  Tons of people everywhere.  \r\n\r\nRelaxed the rest of the day and tried to recovery from the time change.  Had dinner at Macs, which is about a 10 minute walk away.', 1, 4, 0, 0, 0, 1, '2018-06-28', NULL, NULL, '2018-06-30 12:59:25', '2018-07-01 11:23:39'),
(153, 3, NULL, 148, NULL, 'Sunday, Jingshan Park and Beijai Park', 'sunday-jingshan-park-and-beijai-park-2018-07-01', NULL, 'Up at 5 am as usual.  First went to Beijing West Railway station to pick up my train ticket to Datong for tomorrow morning.  I booked it online at ctrip.com.  I found the English line at the train station and the line was pretty short.  Got my ticket and then had breakfast at McDonald\'s in the train station.\r\n\r\nNext I took the subway to Jingshan Park and walked up to the highest point which overlooks the Forbidden City and has nice views of Beijing.  It was a little hazy and cloudy.\r\n\r\nAfter that I walked out the West Gate and over to Beijai Park which is right next Jingshan Park.  I walked up to the White Pagoda but there is an extra charge to go in so I skipped it.  The White Pagoda looks pretty high but it only takes a few minutes to get up to it.\r\n\r\nThen I walked all the way around the Forbidden City and looked around.  Took the subway from Tienanmen East back to the hotel.  I had delicious lunch of Hun-an Rice and Chicken in the Food Court next to McDonald\'s on the big street.', 1, 4, 0, 0, 0, 1, '2018-07-01', NULL, NULL, '2018-07-01 09:02:41', '2018-07-01 11:26:56'),
(151, 3, NULL, 148, NULL, 'Friday, Badaling Great Wall', 'friday-badaling-great-wall-2018-06-29', NULL, 'Up at 5am and had coffee in the room.  Left at 6am to go to Badaling on bus 877.  Big line waiting for the bus but they were running continuous buses so the wait wasn\'t very long.  I had my full sun gear on so it wasn\'t bad standing out in the blazing 7 am sun.\r\n\r\nGot to Badaling and the tour guide told us to buy tickets which included the Toboggan Slide that goes up and down to the wall.  Bad mistake since there was a huge line waiting for it.  The line wrapped around the hill so you couldn\'t see how long it was.  If I could have seen how long it was I would have aborted immediately.\r\n\r\nFinally got up to the wall and it was spectacular.  This is the first time I had been there during the summer and it was beautiful.  I walked the North side loop and it was very difficult.  Some of the ups and downs were almost vertical.  My legs were pretty rubbery by the time I got down.  I would have liked to have done more but I was wiped out and the sun was brutal.\r\n\r\nI took the 877 bus back at about 1 pm and there was hardly any line to get on.\r\n\r\nWent back to the hotel to mess around and wait for it to cool off a little.  I went out again in the evening to go to the Wangjufung Street Food Market but it wasn\'t there anymore.  I ate spicy won-ton at a typical restaurant and it was hot and delicious.', 1, 4, 0, 1, 0, 1, '2018-06-29', NULL, NULL, '2018-06-30 13:10:22', '2018-07-01 11:23:28'),
(152, 3, NULL, 148, NULL, 'Saturday, Beijing Summer Palace', 'saturday-beijing-summer-palace-2018-6-30', NULL, 'Up early as usual.  I got to the Summer Palace by 7 am.  Took a very scenic and photogenic walk around Kunming Lake.  Took some nice pictures of the temples and bridges.  It was about a 4 mile walk around.  Better than expected.', 1, 4, 0, 0, 0, 1, '2018-06-30', NULL, NULL, '2018-06-30 17:45:11', '2018-07-01 11:25:21'),
(155, 1, 10, 105, NULL, 'Thursday, Tienanmen Square', 'thursday-tienanmen-square-2018-06-28', NULL, 'Up at 7 am since I\'m trying to switch to the local schedule which is almost opposite.  Had coffee and a snack at Macs and then headed to Tienanmen Square to look around.  It was blazing hot so I didn\'t last long out in the open.  Tons of people everywhere.  \r\n\r\nRelaxed the rest of the day and tried to recover from the time change.  Had dinner at Macs, which is about a 10 minute walk away.', 1, 4, 94, 1, 1, 0, '2018-06-28', NULL, NULL, '2018-07-01 11:20:45', '2019-02-25 20:40:23'),
(156, 1, 10, 105, NULL, 'Friday, Great Wall of China at Badaling', 'friday-great-wall-of-china-at-badaling-2018-06-29', NULL, 'Up at 5 am and had coffee in the room. Left at 6 am to go to Badaling on bus 877. Big line waiting for the bus but they were running continuous buses so the wait wasn\'t very long. I had my full sun gear on so it wasn\'t too bad standing out in the blazing 7 am sun.\r\n\r\nGot to Badaling and the tour guide told us to buy tickets which included the Toboggan Slide that goes up and down to the wall. Bad mistake since there was a huge line waiting for it. The line wrapped around the hill so you couldn\'t see how long it was. If I could have seen how long it was I would have aborted immediately.  There was also no way to get out of the line.\r\n\r\nFinally got up to the wall and it was spectacular. This is the first time I had been there during the summer and it was beautiful. I walked the North side loop and it was very difficult. Some of the ups and downs were almost vertical. My legs were pretty rubbery by the time I got down. I would have liked to have done more but I was wiped out and the sun was brutal.\r\n\r\nI took the 877 bus back at about 1 pm and there was hardly any line to get on.\r\n\r\nWent back to the hotel to mess around and wait for it to cool off a little. I went out again in the evening to go to the Wangjufung Street Food Market but it wasn\'t there anymore. I ate spicy won-ton at a typical restaurant and it was hot and delicious.', 1, 4, 64, 1, 1, 0, '2018-06-29', NULL, NULL, '2018-07-01 11:23:11', '2019-02-20 07:04:52'),
(157, 1, 10, 105, NULL, 'Saturday, Beijing Summer Palace', 'saturday-beijing-summer-palace-2018-06-30', NULL, 'Up early as usual. I got to the Summer Palace by 7 am. Took a very scenic and photogenic walk around Kunming Lake. Took some nice pictures of the temples and bridges. It was about a 4 mile walk around. Better than expected.\r\n\r\nIt rained and hailed in the afternoon so I just went down the street for a duck dinner at a local place.', 1, 4, 65, 1, 1, 0, '2018-06-30', NULL, NULL, '2018-07-01 11:25:00', '2019-02-24 07:47:35'),
(158, 1, 10, 105, NULL, 'Sunday, Jingshan Park and Beijai Park', 'sunday-jingshan-park-and-beijai-park-2018-07-01', NULL, 'Up at 5 am as usual. First went to Beijing West Railway station to pick up my train ticket to Datong for tomorrow morning. I booked it online at ctrip.com. I found the English line at the train station and the line was pretty short. \r\n\r\nGot my ticket and then had breakfast at McDonald\'s in the train station since it has just opened and there were no people there yet.  By the time I left it was full.\r\n\r\nNext I took the subway to Jingshan Park and walked up to the highest point which overlooks the Forbidden City and has nice views of Beijing. It was a little hazy and cloudy.\r\n\r\nAfter that I walked out the West Gate and over to Beijai Park which is right next to Jingshan Park. I walked up to the White Pagoda but there is an extra charge to go in so I didn\'t go in. The White Pagoda looks pretty high but it only takes a few minutes to get up to it.\r\n\r\nThen I walked all the way around the Forbidden City and looked around. Took the subway from Tienanmen East back to the hotel. I had delicious lunch of Hun-an Rice and Chicken in the Food Court next to McDonald\'s on the big street.', 1, 4, 60, 1, 1, 0, '2018-07-01', NULL, NULL, '2018-07-01 11:26:01', '2019-02-20 11:06:01'),
(159, 1, 10, NULL, NULL, 'How to get to Jingshan Park and Beijai Park', 'jingshan-park-and-beijai-park-2018-07-01', NULL, 'For Jingshan Park, take Subway Line 8 to Shichahai Station.  Use Exit C and then go left (south) for about 1 km to the north gate of the park.  If it isn\'t open turn left and walk around to the East entrance. \r\n Entry Fee: 2 CNY.\r\n\r\nBeijai Park with the White Pagoda is just to the West of Jingshan.  Use the East Gate exit of Jingshan and West Gate Entrance to Beijai.  Entry Fee: 10 CNY', 1, 5, 95, 1, 1, 0, '2018-07-01', NULL, NULL, '2018-07-01 15:36:00', '2019-02-23 18:35:31'),
(160, 1, 11, NULL, NULL, 'Datong Fly by Knight Highrise Hostel, Datong, China', 'datong-fly-by-knight-highrise-hostel-datong-china-2018-07-02', NULL, '22F Business Apartment, 15 Yinbin St, Datong, Cheng District, Datong, 037000, China - \r\n1522 (, 037000)\r\n\r\nPhone: +8618611914348\r\n\r\nThe entrance is right behind Mr. Lee\'s restaurant on Yinbin Street and right next door to the massive Weidu International Hotel with the horse on the side.\r\n\r\n[Click here to book a Hostel in Datong on Booking.com](https://www.booking.com/searchresults.en.html?city=-1902639&aid=1535306&no_rooms=1&group_adults=1)', 1, 5, 115, 1, 1, 0, '2018-07-02', NULL, NULL, '2018-07-02 02:05:12', '2019-02-23 17:30:51'),
(161, 1, 10, NULL, NULL, 'Bestay Hotel Express Beijing Temple of Heaven', 'bestay-hotel-express-beijing-temple-of-heaven-2018-06-27', NULL, 'NO.10 Fahua Nan Li, Dongcheng, 100063 Beijing, China.\r\n\r\nTake Subway Line 5 to the Tinatandongman Stop.  Use Exit B and then cross the big street next to the Subway exit and walk North for about 5 minutes.  Turn right (East) at the next street after the McDonald\'s and walk about 5 more minutes.\r\n\r\n[Book a hotel in Beijing](https://www.booking.com/searchresults.en.html?city=-1898541&aid=1535306&no_rooms=1&group_adults=1)', 1, 5, 63, 1, 1, 0, '2018-06-27', NULL, NULL, '2018-07-02 02:12:05', '2019-02-23 08:31:14'),
(162, 1, 10, NULL, NULL, 'How to get to the Beijing Summer Palace', 'how-to-get-to-the-beijing-summer-palace-2018-06-30', NULL, 'The Beijing Summer Palace is easily accessible by the Beijing MTR Subway.  Take Subway Line 4, and get off at the Beigongmen stop, Use Exit D then turn left (west) and walk about 5 minutes to the North Gate entrance.\r\n\r\nNote that once inside the Summer Palace there are few signs that show how to get back to the North Entrance.', 1, 5, 0, 1, 1, 1, NULL, NULL, NULL, '2018-07-02 02:39:55', '2018-07-03 18:31:25'),
(163, 1, 10, NULL, NULL, 'Beijing West Train Station', 'beijing-west-train-station-2018-07-02', NULL, 'Beijing West Train Station is the last stop on Beijing MTR Subway Line 7.\r\n\r\nThere are information counters and the agents may speak a tiny bit of English.\r\n\r\nTicket counters to buy or pick up online tickets are inside.  One ticket window has English service, look for the sign.\r\n\r\nInternational Train tickets to Mongolia must be purchased from a special travel agency.\r\n\r\nEntrances for the train gates are outside.  Foreigners can\'t use the automated machine lines because passports must be checked by an agent.  \r\n\r\nGate numbers for the trains are shown on the big screens throughout the staion inside and outside.\r\n\r\nLines are long so arrive early especially on the weekends.\r\n\r\nOnce it\'s time to board, the platform number will be shown on the gate screen and the gates will open.  What looks like an impossible number of people will pass through fairly quickly and dissipate as they spread out on the platform to find their coaches.\r\n\r\nThe coach number and seat number are shown on the tickets and are easily found on the train.  There is an attendant at the entrance to each coach to check tickets.\r\n\r\nOn a standard non-bullet train, there are 3 ticket classes in order from cheapest to most expensive: hard seat, hard bunk, and soft bunk.\r\n\r\nThe hard seats are normal padded seats and are not harder than normal.', 1, 5, 82, 1, 1, 0, '2018-07-02', NULL, NULL, '2018-07-02 15:24:59', '2019-02-23 00:09:17'),
(164, 1, 9, NULL, NULL, 'Web Sites that are Blocked in China', 'web-sites-that-are-blocked-in-china', NULL, 'Many common apps and web sites are blocked in China.  Here are the major ones:\r\n\r\n- All Google sites including Google Search, Google Play, Gmail, Google Maps, etc\r\n- YouTube\r\n- Facebook\r\n- Instagram\r\n- Twitter\r\n\r\nNote that these web sites can be used as replacements:\r\n- Bing.com search\r\n- Bing.com Maps\r\n- Maps.me Offline Mapping app\r\n\r\nVirtual Private Network (VPN) services can be used to access the blocked sites.  Some VPN companies offer trial accounts.  Here is a recommended VPN service that works in China:\r\n\r\n[Go to ExpressVPN](https://www.expressrefer.com/refer-friend?referrer_id=8883811&utm_campaign=referrals&utm_medium=copy_link&utm_source=referral_dashboard)', 1, 5, 82, 1, 1, 0, '2018-07-04', NULL, NULL, '2018-07-02 17:32:55', '2019-02-16 23:02:57'),
(165, 1, 11, 105, NULL, 'Monday, Train from Beijing to Datong', 'monday-train-from-beijing-to-datong-2018-07-02', NULL, 'Headed for the Beijing West Train Station pretty early since I knew that the subway would be packed.  Had breakfast and coffee at McDonald\'s in the train station.  Got into the departure area after a little confusion about which entry to use.  Foreigners with passports had to go through an entry where passports are checked.\r\n\r\nAt the gate, a massive number of people filled the huge departure hall for my train.  Once they opened the gate the throng got through pretty fast and then dissipated along the train platform.  I had to walk almost the whole length of the train to find coach number 4.  There was an attendant at each coach entry to check tickets.\r\n\r\nFound my seat next to an old guy who wanted to lean on me the whole way.  There was a stop about half way to Datong and half of the passengers departed.  I found a seat with more space for the rest of the trip.\r\n\r\nGot to Datong and took a taxi to the hotel which was semi-easy to find.  It was a huge apartment that was turned into a hostel.  There was only one other person staying there and I never ran into her.  I had a spacious room on the 22nd floor with a nice view of the smoggy city.\r\n\r\nTook a walk around the area to buy some groceries and find out how to get to the old town.', 1, 4, 60, 1, 1, 0, '2018-07-02', NULL, NULL, '2018-07-03 04:10:53', '2019-02-20 05:58:34');
INSERT INTO `entries` (`id`, `site_id`, `location_id`, `parent_id`, `photo_id`, `title`, `permalink`, `description_short`, `description`, `user_id`, `type_flag`, `view_count`, `published_flag`, `approved_flag`, `deleted_flag`, `display_date`, `color_foreground`, `color_background`, `created_at`, `updated_at`) VALUES
(166, 1, 11, NULL, NULL, 'Datong Day Trip to Yungang Grottoes', 'datong-day-trip-to-yungang-grottoes', 'A UNSECO World Heritage site, the Yungang Grottoes are a must-see attraction near Datong, China.', 'Carved into sandstone cliffs starting in the first century AD, there are 53 major caves and over 50000 carved images and statues.\r\n\r\nYungang Grotto Hours:\r\n8:30 - 17:20 (Apr 15 - Oct 27)\r\n8:30 - 17:00 (Oct 28 - Apr 14)', 1, 2, 281, 1, 1, 0, NULL, NULL, NULL, '2018-07-03 04:16:46', '2019-02-25 22:05:35'),
(172, 1, 11, NULL, NULL, 'Datong Day Trip to Hanging Monastery', 'datong-day-trip-to-hanging-monastery', 'The ancient Hanging Monastery clings to the side of a cliff in a spectacular fashion.', 'The Hanging Temple or Hanging Monastery () near Hunyuan was built more than 1500 years ago into the side of a cliff 246 feet / 75m above the ground.  It is location 40 miles / 65 km from Datong.\r\n\r\n[Click for instructions on how to get to the Hanging Monastery](/entries/how-to-get-to-the-hanging-monastery-from-datong)', 1, 2, 238, 1, 1, 0, '2018-07-04', NULL, NULL, '2018-07-03 17:37:22', '2019-02-25 19:01:36'),
(167, 1, 10, NULL, NULL, 'Beijing Day Trip to Great Wall of China at Badaling', 'beijing-day-trip-to-great-wall-of-china-at-badaling', 'The northern loop of the Great Wall of China at Badaling is a spectacular but very difficult hike.', '[How to get to Badaling by Bus](/entries/how-to-get-to-the-great-wall-of-china-at-badaling-by-bus-2018-06-29)', 1, 2, 188, 1, 1, 0, NULL, NULL, NULL, '2018-07-03 13:00:13', '2019-02-25 17:00:40'),
(168, 1, NULL, NULL, NULL, 'Quotes', 'quotes', NULL, 'There are only two mistakes one can make along the road to truth: not pursuing the path all the way, and not beginning - Buddha', 1, 1, 0, 0, 0, 1, NULL, NULL, NULL, '2018-07-03 13:03:48', '2018-07-14 07:01:23'),
(169, 1, 9, NULL, NULL, 'Mr. Lee\'s Restaurant', 'mr-lee-s-restaurant-2018-07-03', NULL, 'Mr. Lee\'s is a restaurant chain in China serving delicious Chinese noodle and rice dishes.\r\n\r\nThey also have free Wifi that actually works.\r\n\r\nMr. Lee\'s can be found in Beijing, Datong, and other Chinese mainland cities.', 1, 5, 78, 1, 1, 0, '2018-07-03', NULL, NULL, '2018-07-03 14:20:05', '2019-02-16 00:17:45'),
(170, 1, 11, 105, NULL, 'Tuesday, Yungang Grottoes Day Trip', 'tuesday-yungang-grottoes-day-trip-2018-07-03', NULL, 'Went out to find a taxi to take me to the Yungang Grottoes.  It was rush hour so I had to walk around for awhile until I found one who was available.  We negotiated 50 CNY for a one way trip.  It took about 30 minutes to get there.  \r\n\r\nThe whole area was full of temples and very scenic.  The caves and grottoes with the huge Buddhas were impressive and better than expected.  I took tons of photos.  There were plenty of people but it wasn\'t packed so there were no lines and I got to takes pictures without people in the way.\r\n\r\nSpent a few hours there and then took the bus back to Datong.  I wasn\'t sure where to get off but the bus was getting farther away from the hotel so I got out near the old city walls.  I walked through the old town, had an expensive coffee at a place and then took the long walk back to the hostel.\r\n\r\nTook it easy the rest of the day because my legs were tired.  Had dinner at Mr. Lee\'s right in front of the building.  Then booked the train and hotel for Pingyao on Thursday.  I was going to take the night train but the sleepers were all sold out.  I\'m the only one at the hostel tonight.', 1, 4, 62, 1, 1, 0, '2018-07-03', NULL, NULL, '2018-07-03 15:43:05', '2019-02-18 21:56:04'),
(171, 1, 12, NULL, NULL, 'Datong to Pingyao ( - ) by Train', 'datong-to-pingyao-by-train-2018-07-05', NULL, 'Taking the train from Datong to the ancient city of Pingyao takes almost 6 hours because there is no high-speed train service.  \r\n\r\nThe trains leave from the Datong Railway Station which is located at the Northern end of Weidu Avenue, see attached map.  Bus #15 runs along Yingbin Street and then turns North on Weidu and ends at the train station.\r\n\r\nIn Pingyao the train arrives just a few blocks outside of the city walls near the West Gate, see attached map.', 1, 5, 105, 1, 1, 0, '2018-07-05', NULL, NULL, '2018-07-03 16:31:30', '2019-02-16 00:17:45'),
(173, 1, NULL, NULL, NULL, 'Nine Dragon Wall', 'nine-dragon-wall-2018-07-04', NULL, 'Opening hours: 09: 0017:00\r\nRecommended visiting time: 30 minutes\r\nHow to get there: Travelers can take public bus 4 from Datong Railway Station to Nine Dragon Wall.', 1, -1, 0, 0, 0, 1, '2018-07-04', NULL, NULL, '2018-07-04 02:51:34', '2018-07-06 04:12:59'),
(175, 1, 11, 105, NULL, 'Wednesday, Day Trip to Hanging Monastery', 'wednesday-day-trip-to-hanging-monastery-2018-07-04', NULL, 'Woke up at 5 am to clear blue skies in Datong. There was a clear view from the 22nd Floor Hostel of the huge smokestacks on the edge of the city pouring poisons into the air.\r\n\r\nHad coffee and some precooked sausage at the empty hostel.  I wasn\'t sure if the hostel lady was there but she emerged in her nightgown to turn off some lights.\r\n\r\nI walked over to the main bus station at about 6:30 am. Caught the bus to Hunyuan at 7 am and it took about 2 hrs to get to the monastery drop off at a gas station. Shared a taxi with some other people from the bus.  The taxi driver tried to charge me more than the locals but I complained and got the same price.\r\n\r\nThe Hanging Monastery was interesting but it was the only thing to do or see there.  I followed the line of people through it and hoped that it wouldn\'t slide off of the mountain because of all the weight.  Some of the banisters were only a little above knee high so it would be easy to fall over the edge.\r\n\r\nSpent about an hour and a half there and then caught a taxi to the Hunyuan Bus Station.  I met a Swiss couple and talked to them all the way back to Datong.  They are doing the reverse of the trip that I am doing so we shared info.  They have been traveling for 10 months so they know what they are doing.', 1, 4, 61, 1, 1, 0, '2018-07-04', NULL, NULL, '2018-07-04 15:34:33', '2019-02-25 07:29:27'),
(174, 1, 11, NULL, NULL, 'How to get to the Hanging Monastery from Datong', 'how-to-get-to-the-hanging-monastery-from-datong', NULL, 'Buses for Hunyuan leave from the main bus station in Datong on Weidu street (see attached maps) and cost 25 CNY. In Hunyuan, the bus will make several stops. The stop for the monastery is next to a gas station. Show the driver a picture of the monastery if it is not clear which stop to use. At the gas station, there should be taxis waiting to take people the rest of the way. Price for the taxi should be about 20 CNY. Taxis may be shared with other people. If possible ask a local how much they are paying and pay the same amount.\r\n\r\nTo return to the Hunyuan Bus Station, tourists are at the mercy of the taxi drivers because there is no other way out. The price will be higher and it\'s best to find someone to share a taxi with. The price will start at about 50 CNY and it may be a little flexible. The taxi will go to the Hunyuan Bus Station which is only about 3-5 kms from the monastery. Buses to Datong leave frequently and cost 25 CNY. Buses will return to the Datong Main Bus Station and stop on the main road just outside of the station.', 1, 5, 70, 1, 1, 0, '2018-07-04', NULL, NULL, '2018-07-04 13:55:06', '2019-02-24 05:23:32'),
(176, 1, 13, NULL, NULL, 'How to get to the Terracotta Warrior Site in Xian', 'how-to-get-to-the-terracotta-warrior-site-in-xian', NULL, 'From the Fast Train Station, there is a free shuttle to the Terracotta Warrior Site.  It leaves every hour on the hour.', 1, 5, 0, 1, 0, 1, '2018-07-06', NULL, NULL, '2018-07-04 15:40:14', '2018-08-11 14:48:06'),
(177, 1, 12, 105, NULL, 'Thursday, Train from Datong to Pingyao', 'thursday-train-from-datong-to-pingyao-2018-07-05', NULL, 'Up at 5 am, had coffee and packed up.\r\n\r\nLeft the 22nd floor hostel at 7 am and caught the #15 bus right across the street to the train station.  It wasn\'t quite full rush hour so the bus wasn\'t packed yet.The train station was the last stop for this bus so everybody got off.  \r\n\r\nHad another coffee because i spotted a McD\'s right outside the train station.\r\n\r\nThe train left right on time and was completely full as usual. This one made more stops had harder seats but it still wasn\'t too bad. Not much scenery though just lots of farmland. My seatmate was a scrawny kid so I had plenty of room.\r\n\r\nGot to Pingyao and walked from the train station to the exact location of the hotel on the map but I couldn\'t find it.  There were a few little alley ways and all of the signs were in Chinese.  I gave up pretty fast and went into a different place that turned out to be cheaper with all of the same amenities (in-suite bathroom, WiFi, etc) so I stayed there.\r\n\r\nI paid for four nights which took all of my cash so I had to find an ATM machine.  The first one rejected my card so I was a little panicky about not having any cash.  I went into a high end hotel to ask them and they sent me to a bank right outside of the city walls which worked.  I\'m trying to figure out how to use Alipay or WeChat to pay for everything since that is what the locals do.  I also still need a Chinese SIM card.\r\n\r\nHad Lunch/Dinner at a place near the bank and they recommended Beef Kao Lao Lao which looks like some kind of specialty here.  It is basically big noodles sitting upright with stuff on top.\r\n\r\nThere was a large number of Chinese tourists here and a few Western backpackers.  This looks like a nice little scenic place to relax for a few days.  Also, it\'s not as gray as all of the photos that I saw.  Today is pretty bright and clear.\r\n\r\nIn the evening I walked to the other end of the Old Town and watched the kite flyers with huge kites right outside of the city walls.  Then sat outside and had a beer at a place on the main Old Town street.  Several Chinese tourists stopped to take pictures of me and one lady had her kids stand next to me for a photo so I also had her take one with my camera for me.', 1, 4, 58, 1, 1, 0, '2018-07-05', NULL, NULL, '2018-07-06 03:55:02', '2019-02-24 12:14:52'),
(178, 1, 12, NULL, NULL, 'Pingyao Day Trip to Mian Shan', 'china-pingyao-day-trip-to-mian-shan', 'Mianshan is a huge area with many sites and trails.', 'Day trip to Mian Shan  a mountain about 1 and a half hour\'s drive from Pingyao. \r\n\r\nThe entrance fee is 165 CNY includes the hop on/hop off buses which stop at all of the interesting sights along the mountain road.  \r\n\r\nBest stops: Qixian, Yungfeng Temple, Two Dragons Playing with Water Waterfall.', 1, 2, 288, 1, 1, 0, '2018-07-07', NULL, NULL, '2018-07-06 04:01:36', '2019-02-18 00:16:37'),
(179, 1, NULL, NULL, NULL, 'Sights to See in Pingyao', 'sights-to-see-in-pingyao-2018-07-06', NULL, 'Walk on the city walls.\r\n\r\nThe City God Temple was the most interesting to us and had a room unlike what we\'ve seen in other temples, with statues depicting demons and punishments in Daoist hell.', 1, 5, 0, 0, 0, 1, '2018-07-06', NULL, NULL, '2018-07-06 04:09:31', '2018-08-11 14:47:40'),
(180, 1, 9, NULL, NULL, 'Highs and Lows of Traveling in China', 'highs-and-lows-of-traveling-in-china-2018-07-06', NULL, 'HIGHS\r\n1. Public bathrooms are everywhere\r\n2. Public transportation and food are very cheap\r\n3. People are very friendly and helpful\r\n4. Fantastic variety of geography, culture, and history\r\n5. Excellent food\r\n6. There is always somebody sweeping everywhere\r\n7. Hotels provide toothbrushes and toothpaste\r\n8. Very low crime because everybody is busy working\r\n\r\nLOWS\r\n1. Air pollution\r\n2. Internet censorship\r\n3. Not much English, can\'t chitchat with the people\r\n4. Squat toilets\r\n5. Credit cards only work in a few places\r\n6. Only certain hotels can take foreigners\r\n7. Coffee-shop coffee and restaurant coffee, if they have it,  is very expensive', 1, 5, 70, 1, 1, 0, '2018-07-06', NULL, NULL, '2018-07-06 04:45:33', '2019-02-20 06:29:26'),
(181, 1, 12, 105, NULL, 'Friday, All Day in Pingyao', 'friday-all-day-in-pingyao-2018-07-06', NULL, 'Tried to sleep a little later since nothing will be happening in this little place for awhile.  Also, the big hotel gate/door is probably still closed.  \r\n\r\nAt around 8 am, I walked right outside of the North Gate and had a delicious basket of pork Dim Sum for breakfast.  Then went to a bigger than normal grocery store that I had seen yesterday by the ATM.\r\n\r\nBought the 3 day pass to all the attractions in Pingyao for 130 CNY.  A little pricey but they don\'t sell individual tickets to the walkway on top of the city walls.  \r\n\r\nTook a nice long stroll along the walls and there were only people near the entrances so had long stretches of it to myself.  It is unusual in China to have anything to yourself.  \r\n\r\nThe Western side of the wall was closed for construction so you can only walk from the North gate to the South gate on the East side.  It took about an hour to casually walk that part.\r\n\r\nLater had a delicious lunch of Chinese style spicy eggs and endless tea.  The tea cost as much as the plate so I won\'t order that again.\r\n\r\nAfter lunch I went to the Bus Station outside the North gate to check on buses to Jiexiu for tomorrow to go to Mianshan mountain.  It looks like it\'s pretty easy to do without booking a tour.  First bus leaves at 7:20 am.\r\n\r\nI also booked my train for Xian on Ctrip for Monday, July 9th.  It\'s a fast train so will only take about 3 hours even though it\'s a lot farther than my previous two six hour slow train trips.', 1, 4, 96, 1, 1, 0, '2018-07-06', NULL, NULL, '2018-07-06 05:35:09', '2019-02-25 05:23:54'),
(182, 1, 12, NULL, NULL, 'Guangxianyuan Inn - Pingyao', 'guangxianyuan-inn-pingyao-2018-07-05', NULL, 'This hotel is a traditional courtyard compound and has rooms with Kang platform beds with a table on the bed.  It is located right off of the main road inside the city walls right by the North Gate.\r\n\r\nThe Hotel also has:\r\n\r\n- In-suite Bathrooms\r\n- Good WiFi\r\n- Great location right inside the North Gate of the Old City.\r\n\r\n[Click Here to Reserve a Hotel in Pingyao on Booking.com](https://www.booking.com/searchresults.en.html?city=-1921247&aid=1535306&no_rooms=1&group_adults=1)', 1, 5, 76, 1, 1, 0, '2018-07-05', NULL, NULL, '2018-07-06 05:44:56', '2019-02-16 00:17:45'),
(183, 1, 12, NULL, NULL, 'Pingyao City Walls Walking Tour', 'pingyao-city-walls-walking-tour', NULL, 'The ancient city walls of Pingyao are a fun place to take a hike or a bike ride.\r\n\r\nOperating Hours:\r\nMar - Nov: 8:00 - 18:00\r\nDec - Feb: 8:00 - 17:30', 1, 2, 284, 1, 1, 0, NULL, NULL, NULL, '2018-07-06 06:03:50', '2019-02-25 09:49:06'),
(196, 1, NULL, NULL, NULL, 'Xi\'an, China', 'xian-china', NULL, NULL, 1, 8, 162, 1, 1, 0, '2018-07-10', NULL, NULL, '2018-07-11 06:23:58', '2019-02-25 02:25:16'),
(184, 1, 13, NULL, NULL, 'Things to do in Xi\'an', 'things-to-do-in-xian-2018-07-11', NULL, 'Terracotta Warrior Site\r\nCity Wall Hike/Bike\r\nBig Wild Goose Pagoda\r\nGreat Mosque of Xi\'an\r\nMuslim Street Food Market\r\nBell Tower at Night\r\nDefu Alley Bar Area\r\nHua Shan Mountain (100 km)\r\nLongmen Grottoes, Luoyang (Xinjichuan, 226 km)', 1, 5, 90, 1, 1, 0, '2018-07-11', NULL, NULL, '2018-07-07 03:31:23', '2019-02-23 03:31:35'),
