(186, 1, NULL, NULL, NULL, 'Beijing, China', 'beijing-china', NULL, NULL, 1, 8, 195, 1, 1, 0, '2018-06-26', NULL, NULL, '2018-07-08 04:02:53', '2019-02-25 15:07:53'),
(187, 1, NULL, NULL, NULL, 'Yungang Grottoes, China', 'yungang-grottoes-china', NULL, NULL, 1, 8, 111, 1, 1, 0, '2018-06-30', NULL, NULL, '2018-07-08 04:14:16', '2019-02-22 02:08:42'),
(188, 1, 12, 105, NULL, 'Saturday, Day Trip to Mianshan Mountain', 'saturday-day-trip-to-mianshan-mountain-2018-07-07', NULL, 'Took the 7:20 am bus to Jiexiu and then caught a bus to Mianshan.  Some other people from Pingyao where doing the same thing so I followed them.  Mianshan is a huge tourist complex and is pretty well organized.\r\n\r\nOnce you are inside there are hop on hop off buses that run continuously up and down the narrow, cliff-side mountain road and stop at the many attractions.  I road the bus all the way to the end and then worked my way back to the beginning.\r\n\r\nAbout half way through it started raining hard so I had to cut the hiking short because of the slick steps.  The highlights were the Stairway to Heaven staircase that is built onto the side of a cliff and the Temple Cave. \r\n\r\nEven though Mianshan is only about 30 km from Pingyao, the buses take forever because of the traffic and they wait until they are full before taking off.  This is an industrial area so there are huge trucks clogging every road.  The bus drivers like to pass into oncoming traffic and play chicken with the big trucks.\r\n\r\nThe buses coming back were a little more complicated because the bus from Mianshan doesn\'t stop at the same terminal that the bus to Pingyao leaves from.  The terminal with buses to Pingyao is about a block down the street on the other side.\r\n\r\nGot back to Pingyao at about 5 pm, had dinner right outside of the North Gate.  Later I booked the Xi\'an train and a hotel for Monday for 4 nights.  Looking forward to Xi\'an.', 1, 4, 76, 1, 1, 0, '2018-07-07', NULL, NULL, '2018-07-08 04:27:17', '2019-02-24 19:21:34'),
(189, 1, 12, NULL, NULL, 'How to get from Pingyao to Mianshan Mountain by Bus', 'how-to-get-from-pingyao-to-mianshan-mountain-by-bus-2018-07-08', NULL, 'It\'s fairly easy but time consuming to get to Mianshan Mountain from Pingyao using public transportation even though it\'s only  about 30 km.  The trip takes about an hour and a half each way.\r\n\r\nFirst stop is Jiexiu and then Mianshan.\r\n\r\n1) From Pingyao the buses leave from the main bus station a few blocks from the North Gate.  The first bus to Jiexiu is at 7:20 am and then there are  buses every hour.  Cost 10 CNY.\r\n\r\n2) In Jiexiu, tell the driver \"Mianshan\" and he will drop you off at a little bus terminal.  Buses to Mianshan leave frequently and cost 5 CNY.  The last stop is the Mianshan complex.\r\n\r\n3) The return bus to Jiexiu leaves from the same drop-off point.  In Jiexiu, tell the driver \"Pingyao\" and he will drop you off at a little bus terminal but you have to cross the street and go down about half a block to the left to a different terminal.  There are little holes in the street divider that you can crawl through in order to cross the busy street.\r\n\r\n4) The bus from Jiuxiu will stop close to the departure point near the North gate but not exactly at the Pingyao Bus Station.', 1, 5, 141, 1, 1, 0, '2018-07-08', NULL, NULL, '2018-07-08 04:35:23', '2019-02-25 13:21:52'),
(190, 1, NULL, NULL, NULL, 'Seattle, USA', 'seattle-washington-usa', NULL, NULL, 1, 8, 121, 1, 1, 0, '2018-06-01', NULL, NULL, '2018-07-08 12:18:41', '2019-02-24 22:02:58'),
(226, 1, NULL, NULL, NULL, 'Zhangye, China', 'zhangye-china', NULL, NULL, 1, 8, 144, 1, 1, 0, '2018-07-23', NULL, NULL, '2018-07-25 17:44:02', '2019-02-23 13:38:44'),
(191, 1, NULL, NULL, NULL, 'Olympic Nat\'l Park, USA', 'olympic-national-park-washington-usa', NULL, NULL, 1, 8, 108, 1, 1, 0, '2018-05-02', NULL, NULL, '2018-07-08 12:21:12', '2019-02-22 23:49:40'),
(192, 1, 12, 105, NULL, 'Sunday, Pingyao and Shuanglin Temple', 'sunday-pingyao-and-shuanglin-temple-2018-07-08', NULL, 'Had some more dim sum for breakfast, delightful.  Then went to walk around on the wall again since this is the last day of my ticket.  It was raining a little so I had the wall almost to myself again.  I went outside the south gate and walked around in the park and sat there for awhile.  Saw some funny little crested birds that are called \"Hoopoe\" birds.  I got pretty close to them to take pictures.  I continued walking around the entire wall, on the outside of the part that is closed.  \r\n\r\nNext I walked over to the train station because I saw a China Mobile office there the other day.  I tried to get a SIM card but they said I needed a Chinese ID card and couldn\'t use my passport.  I checked on the internet again and it says you can get one with just a passport.  I will try a China Unicom store next since that is supposed to be easier.\r\n\r\nAfter that, I got a taxi to the Shuanglin Temple which is about 6 km outside of Pingyao.  It was semi-interesting and had a lot of statues of odd looking figures.  The taxi waited for me and then took me back to Pingyao.\r\n\r\nHad a fiery Kung Pao chicken plate for dinner.  I got the hiccups for the first time because of the spicy food.', 1, 4, 80, 1, 1, 0, '2018-07-08', NULL, NULL, '2018-07-08 14:37:06', '2019-02-24 01:39:20'),
(193, 1, 13, NULL, NULL, 'Eastwood Inn Xi\'an', 'eastwood-inn-xian-2018-07-09', NULL, 'Eastwood Inn  \r\n\r\n\r\nNo.4 Baishulin, Near Beilin Museum and City Wall, Beilin, Xi\'an, China - \r\n4 , ()\r\n\r\nPhone: +86 29 8739 6649\r\n\r\nHere are the directions provided by the hotel:\r\n\r\nFrom the train station:\r\n1.(From Xian Main Train Station) You may take the bus No.258 (2 Yuan/person) and get off after almost 4 stops, where you will find the City Wall().  Our hostel is 100 meters away northwards.\r\n\r\n2.(From Xian North Train Station, Fast Bullet Train Station) You may take the subway from Xian North Train Station to Yongningmen (and then take the bus No.258 (2 Yuan/person) and get off after next stops(), where you will find our hostel is right across the street from the bus stop.\r\n\r\nFrom the airport:	\r\nYou may take the No.2 Airport Shuttle Bus, and get off at the last stopXian Main Train Station (, then take the bus No.258 (2 Yuan/person) and get off after almost 4 stops, where you will find the City Wall().  Our hostel is 100 meters away northwards.\r\n\r\n[Book a hotel in Xi\'an](https://www.booking.com/searchresults.en.html?city=-1931562&aid=1535306&no_rooms=1&group_adults=1)', 1, 5, 115, 1, 1, 0, '2018-07-09', NULL, NULL, '2018-07-09 03:19:39', '2019-02-19 11:13:35'),
(194, 1, 13, 105, NULL, 'Monday, High Speed Train from Pingyao to Xi\'an', 'monday-high-speed-train-from-pingyao-to-xi-an-2018-07-09', NULL, 'Another cool, rainy day in Pingyao.  I finally got to take the high-speed bullet train instead of the normal, slow train.\r\n\r\nLeft the hotel right before the 12:00 check out time.  Walked out the North gate and a few blocks up to the bus stop for Bus #8 to the High Speed Train Station.  The bus finally came along and then he waited awhile for more people.  Got to the station and had a nice train ride to Xi\'an.\r\n\r\nGot to Xi\'an at about 5 pm.  From the Xi\'an North Train Station took the subway to the Yongningmen station which is close to the South gate and about a 15 minute walk to the Eastwood Inn.  I looked for a Xi\'an metro card so I wouldn\'t have to buy tickets every time but there was only one machine and it had no English option.  I asked the ticket seller and he didn\'t understand what I wanted.\r\n\r\nThe Eastwood Inn was easy to find and I got my room with a private bathroom.  Went to the closest restaurant and had a nice noodle dish for dinner.', 1, 4, 62, 1, 1, 0, '2018-07-09', NULL, NULL, '2018-07-09 05:03:16', '2019-02-23 17:28:12'),
(201, 1, 9, NULL, NULL, 'How to get a SIM Card for mobile/cellular telephone service in China', 'how-to-get-a-sim-card-for-mobile-cellular-telephone-service-in-china-2018-07-13', NULL, 'Getting cell phone service with a data plan is useful to have in China when WiFi is not available.  \r\n\r\nInternet access is extremely useful in the street especially for translation apps and texting.\r\n\r\nSome places with free WiFi, for example at some McDonald\'s restaurants, require a local telephone number to connect to and use their WiFi.\r\n\r\nThere are three major mobile cellular service providers in China: \r\n- China Mobile\r\n- China Unicom\r\n- China Telecom\r\n\r\nEach requires a passport to get a SIM card.  \r\n\r\nChina Mobile offices are the most common and are everywhere but some locations will not accept a passport and will ask for a Chinese ID card.\r\n\r\nChina Unicom is the recommended service.  They have a monthly plan with telephone and data for 100 CNY and they readily accept passports as identification.', 1, 5, 62, 1, 1, 0, '2018-07-13', NULL, NULL, '2018-07-13 06:35:21', '2019-02-16 00:17:43'),
(197, 1, 13, 105, NULL, 'Tuesday, All Day Trip to the Terracotta Warriors Site from Xi\'an', 'tuesday-all-day-trip-to-the-terracotta-warriors-site-from-xian-2018-07-10', NULL, 'Left the hostel at about 7 am and took the subway to the Xi\'an Train Station just outside of the city wall on the north side.  It\'s the regular train station not the Xi\'an North bullet train station.\r\n\r\nThe train station area is huge so I had to ask a few times to find the buses.  It was the typical chaos  but I got right onto a bus.  The buses run continuously and cost 7 or 8 CNY each way.\r\n\r\nThe bus made one other stop at some hot springs and then the Terracotta Warrior site was the last stop.\r\n\r\nIt was a huge complex with lots of parking lots, buses, and people.  As usual it wasn\'t clear where the return bus would leave from so I tried to memorize some landmarks.\r\n\r\nThe first building was just a bunch of dirt with a few broken pieces of soldiers and horses. \r\n\r\nThe second building was more of a museum but there were so many people grouped around each display that I didn\'t stay very long.\r\n\r\nI left Pit 1 for last since it is the most excavated and photogenic.  It was a mob scene and hard to get to the front row to be able to see anything.  It also has low light so I didn\'t take any clear zoom photos.\r\n\r\nFound a bus back to Xi\'an but I\'m not sure if it was the tourist bus or a fake one.  Got back to the railway station and just walked all the way home.\r\n\r\nI stopped at McD\'s on the way and had my first Western style meal in about a week.', 1, 4, 64, 1, 1, 0, '2018-07-10', NULL, NULL, '2018-07-12 10:51:41', '2019-02-18 17:37:50'),
(198, 1, 13, 105, NULL, 'Wednesday, Xi\'an: Big Wild Goose Pagoda and Bell Tower at Night', 'wednesday-xian-big-wild-goose-pagoda-and-bell-tower-at-night-2018-07-11', NULL, 'It was raining pretty hard during the day so I took it easy.  \r\n\r\nI went to the Bank of China to change $500 because I\'ve been carrying around too much cash.  I still have about 300 USD that I\'ll keep in case my ATM cards fail.  It took about 30 minutes to change it and the girl carefully examined my passport for about ten minutes.\r\n\r\nI also went to China Unicom and got a SIM card so I can have Internet in the street, mainly for translating. Getting the SIM card  was supposed to be complicated but it only took about 10 minutes and costs 100 CNY per month.\r\n\r\nThat night I took the metro a few \r\nstops south to see the Wild Goose Pagoda.  It was a really nice area with a bunch of fountains and thousands of people.\r\n\r\nOn the way back I got off at Zhon Glou to take some night pictures of the beautifully lit Bell Tower.  \r\n\r\nThe Galaxy S9 camera continues to impress with really sharp low light photos.', 1, 4, 68, 1, 1, 0, '2018-07-11', NULL, NULL, '2018-07-12 10:52:41', '2019-02-22 12:11:08'),
(199, 1, 13, 105, NULL, 'Thursday, Walked the Xi\'an City Wall', 'thursday-walked-the-xian-city-wall-2018-07-12', NULL, 'Got up on the city wall pretty early while it was still cool.  Started at the South Gate because I didn\'t realize that there was an entry right by the hotel.  Most people were renting bikes but I wanted to walk the loop.  \r\n\r\nAfter about 30 minutes a Chinese kid latched onto me and wanted to practice English.  He asked 100s of questions all starting with \"What do you think about...?\".  When he ran out of questions he starting repeating them.  He finally left and I was able to finish the walk peacefully.\r\n\r\nLater that day, did laundry at the hotel and then hung it up on the top floor.  The exhaust from an air conditioner unit was blowing on the area so it got dry really fast.', 1, 4, 74, 1, 1, 0, '2018-07-12', NULL, NULL, '2018-07-12 10:54:55', '2019-02-21 14:28:25'),
(200, 1, 13, NULL, NULL, 'How to get from Xi\'an to Huashan Mountains', 'how-to-get-from-xi-an-to-huashan-mountains-2018-07-13', NULL, 'From Xi\'an to Mount Huashan:\r\n\r\nTake the bullet train from Xi\'an North Railway Station () to Huashan North Railway Station ().\r\n\r\nTime: 40 minutes\r\nCost: 50 CNY, second class\r\nDeparture: approximately every 30 minutes\r\n\r\nAt Huashan, there are special green minibuses outside the station that go to the mountain entrance for 10 CNY.\r\n\r\nFrom Mount Huashan to Xi\'an:\r\n\r\nOption 1: Take a taxi from Dongshanmen Parking Lot to Huashan North Train Station.  It should cost about 25 CNY.  Take the bullet train back to Xi\'an.  Same price and leaves about every 30 minutes.\r\n\r\nOption 2: Take the Tourist Bus Line 1 which leaves from the Dongshanmen Parking Lot at 1700 and goes to the Xi\'an Train Station by the North Gate, costs 22 CNY and takes 3 hours.', 1, 5, 109, 1, 1, 0, '2018-07-13', NULL, NULL, '2018-07-12 13:56:54', '2019-02-22 13:44:23'),
(202, 1, 9, NULL, NULL, 'What is the best offline mapping app for China?', 'what-is-the-best-offline-mapping-app-for-china-2018-07-13', NULL, 'Google Maps is not available in China without using a VPN service and an offline map of China cannot be downloaded before arriving in China.\r\n\r\nA good alternative for offline maps with geo-location is the Maps.me app.  It\'s search function for businesses, restaurants, etc. is limited but it\'s street mapping and bookmarking are very good. \r\n\r\n[Download the Maps.me app](https://maps.me/download/)', 1, 5, 68, 1, 1, 0, '2018-07-13', NULL, NULL, '2018-07-13 06:48:30', '2019-02-24 03:20:11'),
(205, 1, 9, NULL, NULL, 'How to count in Chinese', 'how-to-count-in-chinese-2018-07-14', NULL, ' One - yee\r\n\r\n Two - are\r\n\r\n Three - sen / san (pronounced between \'sen\' and \'san\')\r\n\r\n Four - suh (short sound)\r\n\r\n Five - woo / wu\r\n\r\n Six - leo / lio\r\n\r\n Seven - tchee\r\n\r\n Eight - baa\r\n\r\n Nine - teo / tio\r\n\r\n Ten - shee\r\n\r\nFor the next ten numbers 11 through 19, just start them with  (ten - \'shee\'), for example:\r\n\r\n Eleven - shee yee (10 1)\r\n\r\n Twelve - shee are (10 2)\r\n\r\n Thirteen - shee sen (10 3)\r\n\r\nFor the twenties, each starts with \'are shee\' (2 10), for example:\r\n\r\n Twenty - are shee (2 10)\r\n\r\n Twenty one - are shee yee (2 10 1)\r\n\r\n Twenty two - are shee are (2 10 2)\r\n\r\n Twenty three - are shee san (2 10 3)\r\n\r\nThis pattern continues on for the thirties, forties on upwards:\r\n\r\n Thirty (sen shee)\r\n Thirty one (sen shee yee)\r\n\r\n Forty (suh shee)\r\n Forty one (suh shee yee)\r\n\r\n Fifty (woo shee)\r\n\r\n Sixty (leo shee)\r\n\r\n Seventy (tchee shee) \r\n\r\n Eighty (baa shee)\r\n\r\n Ninety (teo shee)\r\n\r\n One Hundred (yee bai)', 1, 5, 94, 1, 1, 0, '2018-07-14', NULL, NULL, '2018-07-14 14:33:02', '2019-02-23 08:16:55'),
(206, 1, NULL, NULL, NULL, 'How to say a few simple phrases in Chinese', 'how-to-say-a-few-simple-phrases-in-chinese-2018-07-14', NULL, 'How much?\r\n\r\nDuo shao\r\n\r\nDo you have wifi?\r\nwifi\r\nNi yow Wi Fi ma?', 1, 5, 0, 0, 0, 1, '2018-07-14', NULL, NULL, '2018-07-14 14:42:29', '2018-07-25 18:43:54'),
(207, 1, 13, 105, NULL, 'Friday, Night Bike Ride on the Xi\'an City Wall', 'friday-night-bike-ride-on-the-xian-city-wall-2018-07-13', NULL, 'Went to the closest McDonald\'s for coffee and breakfast at about 0700.  I can\'t figure out if they are open 24 hours or not.  Had some great meals during the day, one at a dumpling place near the hotel.  The other place that I went to for lunch had a delicious meat sandwich with some kind of homemade bread.  I had reserved more days at the Eastwood Inn so I paid the guy for that and the laundry.\r\n\r\nAt about 6:30 pm I went up to the wall using the entrance that is right by the hotel Eastwood Inn.  From walked toward the South Gate to the bicycle rental places.  The fee was 240 CNY which included a refundable deposit of 200 CNY.  \r\n\r\nThe bike ride was delightful.  When it got dark at about 20:00 and the lantern lights came on it was very scenic.  The outside of the wall and the pagodas and other buildings are all wired with lights and they light up in a spectacular fashion, very photogenic.\r\n\r\nThe 8.5 mile loop took a couple hours because I was taking it very slow and making a lot of photo stops.', 1, 4, 66, 1, 1, 0, '2018-07-13', NULL, NULL, '2018-07-15 02:37:49', '2019-02-22 02:30:03'),
(218, 1, 15, NULL, NULL, 'How to get from Xi\'an to the Maijishan Grottoes by Fast Train', 'how-to-get-from-xi-an-to-tianshui-and-the-maijishan-grottoes-by-fast-train-2018-07-18', NULL, 'Going to the Maijishan Grottoes near Tianshui is a nice day trip from Xi\'an using the high speed train line.  Here are the steps for getting to the grottoes from Xi\'an.\r\n\r\n1) Take the Xi\'an Subway Line 2 to the Xi\'an North Train Station (the last stop going North).\r\n\r\n2) Xi\'an North ticket lines are very long. Advance tickets can be purchased online, for example on Trip.com (formerly Ctrip), but they still have to be picked up at the ticket counter. Allow 15 to 45 minutes for waiting in line.\r\n\r\n3) The fast train arrives at the Tianshui South Railway Station which is on the edge of the city. There is a little bus station right in front of the train station. Bus 60 goes directly to and from Maijishan, which is about 30 kms away.  Currently, there is a massive road construction project for about half of the trip so the bus takes about an hour each way.  \r\n\r\nOption 2: It\'s also possible to take a taxi from the Train Station for about 200 CNY roundtrip if the driver waits or about 120 CNY each way.\r\n\r\n4) At Maijisan, there is an optional electric tram that goes the from the entrance to the mountain.  It\'s a 3 km to the Grotto site so the tram is recommended to save time.', 1, 5, 76, 1, 1, 0, '2018-07-18', NULL, NULL, '2018-07-21 16:34:58', '2019-02-23 13:44:44'),
(208, 1, 13, 105, NULL, 'Sunday, Xi\'an Day Trip to Huashan Mountains', 'sunday-xi-an-day-trip-to-huashan-mountains-2018-07-15', NULL, 'Left at 6:45 am and took the subway to the Xi\'an North Train Station to catch the fast train to Huashan North.  I had already bought the ticket on Ctrip but I still needed to pick it up so had to wait in line.  The line wasn\'t too bad but people kept going right to the front and cutting in.  \r\n\r\nTrain left right on time as usual for the 30 minute trip to the Huashan stop.  Caught the cheap shuttle bus that just drives across town to the entrance.  The place was pretty crowded but got my entry ticket and took the shuttle bus up to the Gondola station that goes up to the mountain trails at the top.\r\n\r\nThe views were spectacular and the climbing was very hard.  The trails were all rock and cement but there were so many ups and downs on the steps.  It was a real leg burner.  I went to 3 of the 4 peaks to take in the views.  \r\n\r\nThe Gondola station to get back down at about 3 pm was a mob scene.  The wait was about an hour.  Did a repeat of the arrival and got back to the hotel at about 8 pm.', 1, 4, 72, 1, 1, 0, '2018-07-15', NULL, NULL, '2018-07-16 09:41:38', '2019-02-24 01:13:08'),
(209, 1, 13, NULL, NULL, 'Xi\'an Muslim Street Food Market', 'xi-an-muslim-street-food-market-2018-07-16', NULL, 'The bustling Muslim Street Food Market is a must see area in Xi\'an.\r\n\r\nIt is located a few blocks West of the Bell Tower and the Drum Tower on West Street.', 1, 5, 121, 1, 1, 0, '2018-07-16', NULL, NULL, '2018-07-16 18:07:05', '2019-02-25 14:40:29'),
(216, 1, 14, NULL, NULL, 'How to get from Xi\'an to Lanzhou by Fast Train', 'how-to-get-from-xi-an-to-lanzhou-by-fast-train-2018-07-18', NULL, 'By fast train, it takes about 3 hours to go from Xi\'an to Lanzhou.  Here are the instructions:\r\n\r\n1) Take the Xi\'an Subway Line 2 to the Xi\'an North Train Station.  It is the last stop going North.\r\n\r\n2) Xi\'an North ticket lines are very long.  Advance tickets can be purchased online, for example on Trip.com (formerly Ctrip), but they still have to be picked up at the ticket counter.  Allow 15 to 45 minutes for waiting in line.\r\n\r\n3) The fast train arrives at the Lanzhou West Train Station (Lanzhouxi).  There is a bus terminal on one side of the train station.  Bus 31 (costs 1 CNY) goes to the West end of the Zhangye Road Pedestrian Street in the center of Lanzhou.  Get off when the bus turns right one block after passing the big Mosque on the left.  The bus takes about 30 minutes to get to the pedestrian street area depending on traffic.\r\n\r\n4) To return to the Lanzhou West Train Station, Bus 31 can be caught on Zhongshan Rd, 50m south of the Pedestrian Street, on the West (left) side of the street, see attached map.  The train station is the last stop for Bus 31 going west.', 1, 5, 64, 1, 1, 0, '2018-07-18', NULL, NULL, '2018-07-21 05:20:51', '2019-02-22 07:01:12'),
(211, 1, 14, NULL, NULL, 'Ibis Hotel Lanzhou Zhangye Road', 'ibis-hotel-lanzhou-zhangye-road-2018-07-18', NULL, 'The Ibis is a very comfortable hotel in Lanzhou.  It\'s location is excellent, on the Zhangye Road Pedestrian Street and only a few blocks from the Yellow River.', 1, 5, 68, 1, 1, 0, '2018-07-18', NULL, NULL, '2018-07-19 05:51:29', '2019-02-16 23:02:09'),
(212, 1, 13, 105, NULL, 'Tuesday, Xi\'an Day trip to Luoyang Longmen Grottoes', 'tuesday-xi-an-day-trip-to-luoyang-longmen-grottoes-2018-07-17', NULL, 'Up and out early for my 08:10 train to Luoyang Longmen to see the Grottoes.  Already had my train tickets so breezed right in to the waiting area.  The train trip took about an hour and a half.  It was the same train that goes to Huashan Mountain.\r\n\r\nFrom the train station, took a taxi for 25 CNY.  The grottoes were okay.  The area with the huge figures is definitely the highlight.  If it wasn\'t for those then this would be a bust.  Compared to hiking to the peaks in Huashan Mountain, the steps here were nothing. \r\n\r\nI walked the big loop and took tons of photos, the best ones being from the far side of the river.  This was a nice outing but my favorite grottoes are the first ones I went to, Yungang Grottoes.  The huge Buddhas there captivated me.\r\n\r\nGot back to the train station early enough to buy my tickets to Lanzhou for the next day.  I wanted to buy them here to avoid the massive lines at the train station in Xi\'an.  Booked them on Ctrip first just to avoid the confusion at the ticket counter.  Ctrip is great but they charge way too much commission.  The commissions seem to be fixed amounts and not percentages.\r\n\r\nGot back to Xi\'an in the evening.  Luckily there weren\'t huge lines at the subway ticket machines.', 1, 4, 65, 1, 1, 0, '2018-07-17', NULL, NULL, '2018-07-19 05:59:03', '2019-02-16 00:17:43'),
(213, 1, 14, 105, NULL, 'Thursday, First Day in Lanzhou', 'thursday-first-day-in-lanzhou-2018-07-19', NULL, 'Went down to the Yellow River walkway and took in the sights.  The river level is about the same as the sidewalk level and is overflowing the sidewalk at some points.  There are open air bars and bar boats all along the way full of people drinking beer.\r\n\r\nI went back down there at night and the temples and buildings on the other side of the river are spectacularly lit up.  The White Pagoda at the top of the park is lit up with spotlights.\r\n\r\nI also walked over to the Zhengning Road Night Market and ate some satay and a spicy meat sandwich for dinner.  The whole are around the food market is packed with other vendor stalls, selling items such us fake purses and clothes, and people have to walk in the street. \r\n\r\nAs I was heading back to the hotel, I spotted a huge lit up mosque the next block over from the pedestrian part of Zhangye Road.  I went over to take pictures of it and also found the bus terminal.  The Chinese really know how to light up buildings.', 1, 4, 101, 1, 1, 0, '2018-07-19', NULL, NULL, '2018-07-19 06:21:17', '2019-02-24 11:46:59'),
(214, 1, 13, 105, NULL, 'Monday, Recovered from Huashan Climb', 'monday-recovered-from-huashan-climb-2018-07-16', NULL, 'Took it easy all day to recover from the Huashan Mountain climb yesterday.  \r\n\r\nIn the afternoon, went to the Xi\'an North Train Station to get tickets for the Luoyang Longmen Grottoes for the next day.  I hadn\'t prepaid the tickets this time so I had everything in Chinese on my phone with the dates and times for the tickets.  The guy understood everything and I got them with no problems.', 1, 4, 59, 1, 1, 0, '2018-07-16', NULL, NULL, '2018-07-19 06:55:13', '2019-02-21 03:37:25'),
(215, 1, 14, NULL, NULL, 'Zhengning Road Night Market in Lanzhou', 'zhengning-road-night-market-in-lanzhou-2018-07-20', NULL, 'The Zhengning Road Street Food Night Market has a wide variety of food vendor serving up the local dishes.  It is located in the busy area at Map Location: 36.05384, 103.81859.\r\n\r\nThe surrounding area also has many other vendors selling clothes, shoes, gadgets, and other miscellaneous items.', 1, 5, 95, 1, 1, 0, '2018-07-20', NULL, NULL, '2018-07-20 06:15:06', '2019-02-16 09:14:35'),
(217, 1, 14, 105, NULL, 'Saturday, Hike to the top of Baitashan Park', 'saturday-hike-to-the-top-of-baitashan-park-2018-07-21', NULL, 'Bright sunny day in Lanzhou.  Had breakfast and coffee at Macs.  Walked across the Yellow River and hiked up to the White Pagoda at the top of Baitashan Park.  The river was raging after the rain yesterday.  Some of the lower trails are flooded and impassable.\r\n\r\nBaitashan Park is on a hillside that goes straight up from the river so the views are spectacular.  There are a lot of view points with clear views of the river and city.  There are maps and signs all along the trails.  \r\n\r\nThere is a big loop trail that goes up and around the back of the park to the cable car station and then down the other side back to the river.  The cable car starts at the top and goes all the way down and then across the river into a building.\r\n\r\nWhen I got back down, I had some street food for lunch from some Muslim ladies.  I ordered some fried squares which I thought may be cheese but I think they were flat square noodles.  There were chewy and spicy.  I washed that down with the delicious thick yogurt drinks that come in the white glass bottles that have to be returned to the vendor.', 1, 4, 70, 1, 1, 0, '2018-07-21', NULL, NULL, '2018-07-21 10:05:53', '2019-02-16 00:17:42'),
(219, 1, 16, NULL, NULL, 'How to get from Zhangye to Danxia National Geological Park', 'how-to-get-from-zhangye-to-danxia-national-geological-park-2018-07-24', NULL, 'Buses to Danxia National Geological Park (pronounced \'Dan-shee-uh\') leave from the Zhangye West Bus Station.\r\n\r\nThe bus leaves every 60 minutes from 09:00 to 12:00, and 15:30 and 16:30.\r\n\r\nThere is no specific bus number, only Chinese characters and you can show this to the staff at the bus station:\r\n\r\n\r\n\r\nOr just show them a picture of Danxia.\r\n\r\nYou can take the bus to Ice Valley area first, and after visiting you can take the pass-by bus to the Colorful Hills area and back to Zhangye.\r\n\r\nDanxia National Geological Park Operating Hours:\r\n 6:00 - 20:00 (May 1 to Oct 10)\r\n 7:00 - 19:00 (other dates)', 1, 5, 75, 1, 1, 0, '2018-07-24', NULL, NULL, '2018-07-22 09:50:22', '2019-02-24 04:59:23'),
(220, 1, 13, NULL, NULL, 'Xi\'an Day trip to Luoyang Longmen Grottoes', 'xian-day-trip-to-luoyang-longmen-grottoes', '', 'The Luoyang Longmen Grottoes are about an hour and a half from Xi\'an on the fast train from the Xi\'an North Railway Station.  The stop is called \"Luoyang Longmen\".  From the train station to the grottoes by taxi is about 25 CNY.\r\n\r\nAt the site, the path goes by the grottoes first and then crosses the far river bridge to the east side where there are excellent views of the big Buddhas.  The trail then continues to the exit.  Electric shuttles are available from the east side to the exit. \r\n\r\nMost of the small Buddhas in the caves and on the walls are disfigured by having had their faces destroyed.  The highlight of the grottoes are the large figures at the end.', 1, 2, 279, 1, 1, 0, NULL, NULL, NULL, '2018-07-22 17:27:35', '2019-02-23 06:06:55'),
(221, 1, 16, NULL, NULL, 'Zhangye Liangmao Hotel', 'zhangye-liangmao-hotel-2018-07-23', NULL, 'Centrally located one block east of the Zhangye Drum and Bell Tower and offers a very affordable price.  \r\n\r\nThis hotel features:\r\n- In-suite Bathrooms\r\n- Good WiFi\r\n- Good Hot Water\r\n- Clean and Modern Rooms\r\n- Helpful Staff (the guy speaks English)\r\n\r\nAddress:\r\n276 DongDaJie street, at the intersection of Dong Street andd MaShenMiao Street.\r\n\r\n[Book a Hotel in Zhangye](https://www.booking.com/searchresults.en.html?city=-1938374&aid=1535306&no_rooms=1&group_adults=1)', 1, 5, 78, 1, 1, 0, '2018-07-23', NULL, NULL, '2018-07-23 18:59:34', '2019-02-16 00:17:42'),
(222, 1, 16, NULL, NULL, 'Things to do in Zhangye China', 'things-to-do-in-zhangye-china-2018-07-23', NULL, 'Danxia Geo Park Rainbow Mountains - The number one reason for visiting Zhangye, the Rainbow mountains are a spectacular formation of color striped mountains.\r\n\r\nWooden Pagoda - Built in the first century AD, the nine-story Wooden Pagoda is in the People\'s Square, a huge open space where the locals gather.\r\n\r\nGiant buddha temple, Dafo temple, open from 07:30 to 17:30, entry fee is 40 CNY.\r\n\r\nBell and Drum tower that marks the center of the city.\r\n\r\nMarco polo statue', 1, 5, 86, 1, 1, 0, '2018-07-23', NULL, NULL, '2018-07-23 19:30:32', '2019-02-16 00:17:42'),
(223, 1, 16, 105, NULL, 'Monday, Fast Train from Lanzhou to Zhangye', 'monday-fast-train-from-lanzhou-to-zhangye-2018-07-23', NULL, 'Heading for Zhangye to see the Rainbow Mountains.  At 10:00 I checked out of the hotel and walked one block over to the stop for bus 31 to the Lanzhou West Train Station, Lanzhouxi.  I had bought my tickets the day before on Sunday so no waiting in line.  Had breakfast and coffee at McDonald\'s in the train station. \r\n\r\nNice train ride to Zhangye even though I had the \'B\' seat which is the only middle seat.  There is no way to choose seats on Ctrip / Trip.com.\r\n\r\nIn Zhangye the taxi drivers mobbed me because they are all trying to sell trips to the Rainbow Mountains.  My guy kept pulling over to give me the hard sell.  We finally got to the Zhangye Liangmao Hotel which wasn\'t that far away (cost 10 CNY).  I told the driver to come in with me and we worked out a tour for 180 CNY for the next day since it was already 4 pm.\r\n\r\nZhangye is a pleasant little place.  Later on in the evening, I took a long walk to the Wooden Pagoda and some other stuff.  There were thousands of people at the People\'s Plaza where the pagoda is located.\r\n\r\nHad dinner with the usual confusion near the hotel.  Also had snacks at a few bakeries which may become my new favorite thing because they are very tasty.  I especially like the egg tarts which are also a specialty in Malaysia.', 1, 4, 71, 1, 1, 0, '2018-07-23', NULL, NULL, '2018-07-24 03:36:26', '2019-02-22 07:34:19');
