(227, 1, 16, NULL, NULL, 'How to get from Lanzhou to Zhangye by Fast Train', 'how-to-get-from-lanzhou-to-zhangye-by-fast-train-2018-07-23', NULL, 'By fast train, it takes about 3 hours to go from Lanzhou West Train Station (Lanzhouxi) to Zhangye West Train Station (Zhangyexi). \r\n\r\nHere are the instructions:\r\n\r\n1) To go to Lanzhou West Train Station, Bus 31 can be caught on Zhongshan Rd, 50 m south of the Pedestrian Street, on the West (left) side of the street, see attached map. The train station is the last stop for Bus 31 going west.\r\n\r\n2) Advance tickets can be purchased online, for example on Trip.com (formerly Ctrip), but they still have to be picked up at the ticket counter.\r\n\r\n3) The fast train arrives at Zhangye West Train Station (Zhangyexi) which is on the edge of the city.  The bus stop is right outside the train station, about 50 m from the exit, just follow the crowd. Bus 22 (costs 2 CNY) goes to the center of Zhangye and passes near the Drum and Bell Tower which is the geographic center of the city.  Bus 1 (the blue one, not the green one) also leaves from the train station.\r\n\r\nThere are also plenty of taxis that will go to the center of the city for about 10 CNY.  The price is cheap but they will give the hard sell for tours to the Danxia Geological Park.\r\n\r\n4) To return to the Zhangye West Train Station, Bus 22 goes roughly along the same path in the opposite direction.  The train station is the last stop.', 1, 5, 62, 1, 1, 0, '2018-07-23', NULL, NULL, '2018-07-25 18:31:44', '2019-02-16 00:17:42'),
(228, 1, 18, NULL, NULL, 'How to get from Zhangye to Jiayuguan by Fast Train', 'how-to-get-from-zhangye-to-jiayuguan-by-fast-train-2018-07-25', NULL, 'By fast train, it takes about 1.5 hours to go from Zhangye West Train Station (Zhangye xi) to Jiayuguan South Train Station (Jiayuguan nan).\r\n\r\nJiayuguan is pronounced \'gee you gwan\'.\r\n\r\nHere are the instructions:\r\n\r\n1) Advance tickets can be purchased online, for example on Trip.com (formerly Ctrip), but they still have to be picked up at the ticket counter.\r\n\r\n2) To go to Zhangye West Train Station, Bus 22 can be caught in the downtown area. It costs 2 CNY. \r\n The train station is the last stop for Bus 22.  The train station is not far from the city center so taxi\'s only charge about 10 to 20 CNY.\r\n\r\n3) The fast train arrives at Jiayuguan South Train Station (Zhangye nan) which is about 5 kms from the city center.  Taxi\'s to the center will cost around 20 to 25 CNY and they use a meter.', 1, 5, 69, 1, 1, 0, '2018-07-25', NULL, NULL, '2018-07-25 18:45:39', '2019-02-16 23:23:29'),
(231, 1, NULL, NULL, NULL, 'Jiayuguan, China', 'jiayuguan-china', NULL, NULL, 1, 8, 114, 1, 1, 0, '2018-07-26', NULL, NULL, '2018-07-26 14:37:16', '2019-02-25 06:32:34'),
(234, 1, 19, NULL, NULL, 'How to get from Jiayuguan to Dunhuang by Train', 'how-to-get-from-jiayuguan-to-dunhuang-by-train-2018-07-29', NULL, 'Trains for Dunhuang leave from Jiayuguan Railway Station which is at the west end of Ying Bin Street.  \r\n\r\nBus 12 runs all along Ying Bin Street.  Bus 1 runs along the North end of Xin Hua Zhong Lu Street and then turns onto Ying Bin Street.  The train station is the last stop for both of them.\r\n\r\nThere is no fast train to Dunhuang.  The fast trains use Jiayuguan nan (south) Railway Station.\r\n\r\nIn Dunhuang, there are green minibuses, Bus 12, right outside the exit that go the 13 kms to the city.  The final stop is right by the little river bridge.\r\n\r\nBus 12 also goes to Mogao Grottoes which is near the train station.  From Dunhuang, they go to the Mogao Visitor Center and the train station.  Make sure to let the driver know which one you are going to.  They leave from the stop right by the river bridge.\r\n\r\nThe train station bus will also go to the airport on request since it is right past the train station.', 1, 5, 122, 1, 1, 0, '2018-07-29', NULL, NULL, '2018-07-28 10:21:02', '2019-02-16 00:17:41'),
(232, 1, 18, 105, NULL, 'Thursday, Zhangye to Jiayuguan by Fast Train', 'thursday-zhangye-to-jiayuguan-by-fast-train-2018-07-26', NULL, 'Checked out of the Liang Mao hotel at about 9:00 and walked one block over to the bus stop for Bus 22.  Got to the station a little early so sat outside at a little restaurant and had a soy milk.  Train ride was only an hour and a half.\r\n\r\nIn Jiayuguan took a taxi to the hotel which was on the other side of the city.  I had a lady taxi driver and she didn\'t try to sell my any tours.  She also used the meter which was a first.  \r\n\r\nHad lunch at the hotel restaurant.  Waited til it cooled off a little then walked around town and had some food at the famous food street.  After dark there was live music, tons of people, and lots of lights.  I had a big plate of fried mutton and green peppers and a massive plate of noodles. \r\n\r\nJiayuguan looks a lot better at night when all the lights are on.', 1, 4, 71, 1, 1, 0, '2018-07-26', NULL, NULL, '2018-07-26 20:04:38', '2019-02-21 23:02:04'),
(229, 1, 18, NULL, NULL, 'Jinjiang Inn Jiayuguan Lanxin Road', 'jinjiang-inn-jiayuguan-lanxin-road-2018-07-26', NULL, 'Jinjiang Inn Jiayuguan Lanxin Road\r\n\r\n\r\nNo. 638 Lanxin East Road, Jiayuguan, Gansu, Jiayuguan, 735100, China - \r\n638 (, 735100)\r\n\r\nPhone: +86 937 639 9806', 1, 5, 69, 1, 1, 0, '2018-07-26', NULL, NULL, '2018-07-26 03:49:00', '2019-02-16 00:17:42'),
(230, 1, 18, NULL, NULL, 'Things to do in Jiayuguan', 'things-to-do-in-jiayuguan-2018-07-26', NULL, 'Jiayu Pass / Fort - Bus 4 or 6 can take you from the train station to the fort, which is the last stop.  Also, Bus 6 can be caught all along Lanxin Road which leads up to the historical site.  Buses run from 07:00 to 20:00 and cost CNY 1.\r\n\r\nEntry fee is 120 CNY and includes the Overhanging Great Wall and First Fire Tower of the Great Wall.  There is no shuttle bus between the sites but there are plenty of taxis who will charge around 25 CNY.  To get a low price, make sure to tell them that they don\'t have to wait.\r\n\r\nHistorical Sites Hours:\r\n- May to Oct: 8:3020:00	\r\n- Nov to April: 8:3018:00\r\n\r\nGrand Tang Food Street (Datang Meishijie)', 1, 5, 77, 1, 1, 0, '2018-07-26', NULL, NULL, '2018-07-26 03:55:48', '2019-02-16 00:17:42'),
(233, 1, 18, 105, NULL, 'Friday, Jiayuguan Fort and Overhanging Great Wall', 'friday-jiayuguan-fort-and-overhanging-great-wall-2018-07-27', NULL, 'It was a gray morning so I waited until the afternoon and caught Bus 6 right in front of the hotel and went to the Jiayuguan Fort.  The fort was kind of interesting but the gray day didn\'t make it very photogenic.  There was a herd of camels outside the fort walls that made some nice photos.\r\n\r\nAfter the fort, I took a 25 CNY taxi to the Overhanging Great Wall site which is about 11 kms away.  It is the end of the Great Wall of China and the wall is scenic but very small.  The views from the last and highest watch tower were nice.\r\n\r\nAfter the Great Wall site, I took a shared taxi back to the fort to catch the bus back to the hotel.  After getting off of the bus, I had a sugar water at a little store with seating and sat outside for awhile.  The people are always delighted when the foreigner hangs around and joins them for awhile.\r\n\r\nIn the evening, I walked downtown through the big park on the way to the food street and saw the huge dolphin meteorological tower that is lit up with light patterns that constantly change.  The Chinese really know how to light stuff up.  The park is officially called the Jiayuguan Donghu Ecological Scenic Area.\r\n\r\nAt the food street I had a big plate of fried mutton with green peppers.  The green peppers were the spicy ones this time so they fired me up pretty good.  I was able to eat most of them by avoiding the seeds.  The restaurant family was delighted with me and the kids came over and stared at me and talked to me for awhile.\r\n\r\nI took a taxi back to the hotel because it was late and a long way and I\'m never sure if the food is going to turn on me.', 1, 4, 112, 1, 1, 0, '2018-07-27', NULL, NULL, '2018-07-28 05:04:14', '2019-02-24 08:39:54'),
(235, 1, 19, NULL, NULL, 'Things to do in Dunhuang China', 'things-to-do-in-dunhuang-china-2018-07-29', NULL, 'Mogao Caves - Ignore those expensive tours and taxis. Visiting the Mogao Grottoes can be done easily on your own.  Click here for the details: [How buy tickets and get to Mogao Grottoes by Bus](/entries/how-to-book-tickets-to-mogao-grottoes-and-get-there-from-dunhuang-2018-07-30)\r\n\r\nMingsha Shan (Echo Sand Mountain) and Crescent Moon Lake - Once again the expensive tours and taxis can be skipped because there is a bus that goes frequently to the site for 2 CNY.  Here are the details: [How to get to Mingsha Shan / Echo Sand Mountain and Crescent Moon Lake by Bus](/entries/how-to-get-to-echo-sand-mountain-mingsha-shan-and-crescent-moon-lake-from-dunhuang-2018-07-30)\r\n\r\nFood Street / Shazhou Night Market - Dunhuang has a huge Food Street and Night Market right in the center of the city.  It is hard to miss it.  There are some parts open during the day and most stalls are open at night.', 1, 5, 64, 1, 1, 0, '2018-07-29', NULL, NULL, '2018-07-28 14:07:45', '2019-02-16 00:17:41'),
(236, 1, NULL, NULL, NULL, 'Lanzhou, China', 'lanzhou-china', NULL, NULL, 1, 8, 258, 1, 1, 0, '2018-07-19', NULL, NULL, '2018-07-28 18:31:35', '2019-02-22 17:06:23'),
(237, 1, 19, 105, NULL, 'Sunday, Jiayuguan to Dunhuang by Slow Train', 'sunday-jiayuguan-to-dunhuang-by-slow-train-2018-07-29', NULL, 'Early train to Dunhuang leaves at 7:16 am so I left the hotel at 6:00 when it was still a little dark.  Not much traffic on a Sunday morning but I flagged down a taxi before I got to the big street.  He immediately start going the opposite direction of the train station so I had to straighten him out.\r\n\r\nOn the train, some kids of about 2 to 5 years old took an interest in me and started bringing me their snacks to share.  They were delighted to give me little cookies and stuff.\r\n\r\nThe train ride was about five hours but it wasn\'t totally packed so I could stretch out a little.  The scenery wasn\'t great, just a bunch of scrubby semi-desert.\r\n\r\nIn Dunhuang, I got on the minibus to go the 10 kms from the train station to the city.  I was able to get off close to the hotel when another guy got off.  The hotel wasn\'t at the map location but I eventually found it.  It\'s on the edge of town and there wasn\'t much around it.\r\n\r\nI asked the hotel lady for help booking the Mogao Cave tour since you are supposed to have an advance reservation.  She directed me to the ticket office which was only about 3 long blocks away.  I got a regular ticket for the next day even though I read that they are usually sold out for about a week in advance. \r\n\r\nIn the evening I walked around Dunhuang and realized what the people are talking about when they say that Dunhuang is a charming little city.  It has a huge Food Street and Night Market that go on and on.  I had some huge, delicious meat pockets for dinner and some of the thick yogurt drinks that I really like.  The glass yogurt bottles have to be returned so I hung around and ate near the little store that sells them.', 1, 4, 79, 1, 1, 0, '2018-07-29', NULL, NULL, '2018-07-29 06:12:19', '2019-02-23 14:09:37'),
(243, 1, NULL, NULL, NULL, 'Maijishan, China', 'maijishan-grottoes-china', NULL, NULL, 1, 8, 112, 1, 1, 0, '2018-07-18', NULL, NULL, '2018-07-31 12:47:29', '2019-02-25 04:54:50'),
(238, 1, 19, NULL, NULL, 'Dunhuang Nongfu Hostel', 'dunhuang-nongfu-hostel-2018-07-29', NULL, 'The Dunhuang Nongfu Hostel is actually two places at the same location using the same advertisement on Booking.com.\r\n\r\nThere is no sign in English but this is the only business in the immediate area.  It looks like there is a restaurant or something in the front.  The hostel with the shared rooms is a little farther back and the hotel with the private rooms is in the back at the end of property.\r\n\r\nThe map location is wrong.  The location is about 100 m farther east.  This is the correct Map Location: 40.139130, 94.685088.  It\'s about 500 m east of the Dunhuang Bus Station.\r\n\r\nFrom the hostel it\'s about a 10 to 15 minute walk to downtown Dunhuang.  To return from downtown Bus 4 goes from the main east west street to the Dunhuang Bus Station which is about half way to the hotel.\r\n\r\n[Click here to find great hotels like this on Booking.com](https://www.booking.com/index.html?aid=1535306)', 1, 5, 81, 1, 1, 0, '2018-07-29', NULL, NULL, '2018-07-29 11:48:19', '2019-02-19 13:26:13'),
(239, 1, 19, NULL, NULL, 'Dunhuang, China', 'dunhuang-china', NULL, NULL, 1, 8, 100, 1, 1, 0, '2018-07-29', NULL, NULL, '2018-07-29 19:05:46', '2019-02-21 22:01:06'),
(240, 1, 19, NULL, NULL, 'How to book tickets to Mogao Grottoes and get there from Dunhuang', 'how-to-book-tickets-to-mogao-grottoes-and-get-there-from-dunhuang-2018-07-30', NULL, 'How to book tickets to Mogao Grottoes \r\n\r\nTickets to Mogao Grottoes should be booked in advance and can be booked online on the official web site that is only in Chinese:\r\n\r\n[Official Web Site to Book tickets to Mogao Grottoes](https://www.mgk.org.cn/index.htm)\r\n\r\nIf that isn\'t possible then advance tickets can be purchased from the ticket office on the east edge of Dunhuang.  It is located on Yangguan Middle Road which is the major road to Dunhuang from the east.  It\'s about a 10 minute walk from downtown Dunhuang and it\'s very easy to find.\r\n\r\nHow to get to Mogao Grottoes \r\n\r\nBus 12 to Mogao Grottoes leaves from Sanwei Road, about 50 m before it ends at Wen Chang Road going into Dunhuang, Map Location: 40.139966, 94.669269.  \r\n\r\nThe buses leave as soon as they are full and charge 3 CNY each way.  The driver collects the money upon arrival.  These are the same buses that go to the train station which is very near the Mogao Visitor Center.', 1, 5, 67, 1, 1, 0, '2018-07-30', NULL, NULL, '2018-07-30 08:27:56', '2019-02-22 19:26:25'),
(241, 1, 19, 105, NULL, 'Monday, Mogao Grottoes and Mingsha Shan Crescent Moon Lake', 'monday-mogao-grottoes-and-mingsha-shan-crescent-moon-lake-2018-07-30', NULL, 'At about 10 am I walked over to the buses to Mogao Grottoes and took bus 12 to the site.  My tour was at 11:30 so we had to wait for our group to be let in to the place to watch the movies.  I slept through the 2nd movie in the 360 degree screen room.  After the movies we got on buses to go to the site.\r\n\r\nEverything was tightly controlled and no photos were allowed inside the caves.  No photos = No fun for me.  I was with the English speaking group and there were about 8 of us.  The Buddhas and cave paintings were excellent.  The big Buddha was spectacular because he was built straight up one wall in a little cave so you had to look straight up to see his huge face.  The important caves had police and other guards.\r\n\r\nAfter the tour, I went to KFC for lunch because almost everything else was closed.  Then I found Bus 3 that goes to the Mingsha Shan desert and Crescent Moon Lake site.\r\n\r\nAt Mingsha Shan the lines were short so I got right in.  I went straight to the camel tour area where there were thousands of camels.  There was a line of camels circling through the desert as far as the eye could see almost.  Each group was four camels tied together using the rings in their noses with a guide leading the first camel.  I took a lot of fuzzy photos because of the camel rocking but it was great fun.\r\n\r\nAfter the camels I walked over to the crescent lake which was okay but no big deal.  Cloudy skies meant gray photos of everything.  Hundreds of people were climbing up the sand mountain but I wanted to save that for my 2nd visit and hopefully clearer skies.  The tickets allow visits for 3 days.\r\n\r\nI took the same bus back to Dunhuang and had dinner at the same meat pocket place from the night before.  I only had one fire sandwich this time and then had an ice cream afterward to put out the fire around my mouth.  When I was eating the ice cream some teenage girls came over to quiz me and try out their English.  They wanted to know where I was from, etc.  I made the main girl hold my ice cream while I showed them stuff on my phone such as where Seattle is, etc.  My China Unicom data plan had run out so I couldn\'t translate anything for them.', 1, 4, 66, 1, 1, 0, '2018-07-30', NULL, NULL, '2018-07-31 02:22:51', '2019-02-20 06:49:19'),
(242, 1, 19, NULL, NULL, 'How to get to Echo Sand Mountain (Mingsha Shan) and Crescent Moon Lake from Dunhuang', 'how-to-get-to-echo-sand-mountain-mingsha-shan-and-crescent-moon-lake-from-dunhuang-2018-07-30', NULL, 'Echo Sand Mountain (Mingsha Shan) and Crescent Moon Lake are located at the same place 5 kms south of Dunhuang.\r\n\r\nRegular city bus 3 goes to the site and can be caught along Yangguan Middle Road going west in the blocks before it turns south at the big roundabout at the city center.  Once it turns south it stops along Shazhou South Road, and then all along Ming Shan road which ends at the site.\r\n\r\nOpening Hours: \r\nGenerally in high-season / summer: 05:00 to 20:30\r\n \r\nAdmission Fee:	\r\nMingsha Shan / Echo Sand Mountain and Crescent Lake:\r\nMay 1 to October 31: CNY 120\r\nAll other dates: CNY 80\r\n\r\nThe entry ticket is valid for three days.  In order to reuse the ticket, you must take a picture at the photo machine at the exit.  Then on the next entry, go to the  entry lane with the photo machine and the it will try to recognize your face.  If it doesn\'t work, go to the regular entry, show the ticket again and explain that the machine didn\'t recognize your face.', 1, 5, 95, 1, 1, 0, '2018-07-30', NULL, NULL, '2018-07-31 08:50:41', '2019-02-25 05:47:46'),
(244, 1, 19, 105, NULL, 'Tuesday, Back to the Echo Sands Site to Climb the Sand Mountains', 'tuesday-back-to-mingsha-shan-to-climb-the-sand-mountains-2018-07-31', NULL, 'Left pretty early and got to the Echo Sands Crescent Moon Lake site at about 8:00 am.  Reused my ticket since they are good for 3 days.  Climbed up the biggest hill using the cable ladder that was in the sand.  It took awhile since there was a long line of people going up and when one would stop the whole line would stop.\r\n\r\nAt the top the views were spectacular especially of the Crescent Moon Lake.  I walked way off along the top of a big dune and had some alone time for awhile.  The camels were already going in full force too with thousands of them making their circle with the tourists.  \r\n\r\nGetting down was easy since it just required big soft stops sliding steps all the way to the bottom of the mountain.\r\n\r\nAfter that headed back to Dunhuang and got off of the bus when I saw a China Unicom since I needed to recharge my phone.  They weren\'t able to do it because there was something wrong with my account.  I sat there for a long time while they tried to do it.  A girl standing in line behind me translated for me.  No luck with that.\r\n\r\nWent to KFC for a big coffee and an early lunch and then went to find the bus to the train station.  I never found it but finally figured out later that they were the same buses that go to Mogao Grottoes.  Later on in the evening I took one of them to the train station to pick up tickets so I wouldn\'t have to wait in line the next day.\r\n\r\nHad dinner for the third night in a row at my favorite meat pocket place in the night market.  I bought two meat pockets and ate one at the bus stop waiting for the number 4 bus to the hotel.  Bus 4 goes about half way to the hotel.  Also picked up some road food for the next day since I have two trains, Dunhuang to Yumen (3 hours) on the slow train and then Yumen to Urumqi (6 hours) on the fast train.', 1, 4, 59, 1, 1, 0, '2018-07-31', NULL, NULL, '2018-08-01 02:23:28', '2019-02-16 00:17:40'),
(245, 1, 20, NULL, 1026, 'Things to do in Urumqi', 'things-to-do-in-urumqi-2018-08-02', NULL, 'Er Dao Qiao International Grand Bazaar\r\n- Bus 61, 70, 104, 301, 308, 310, 911, 920, or 923, and get off at He Ping Nan Lu, the bazaar is on the west side.\r\n- Bus 10, 16, 21, 63, or 912, get off at Erdao Qiao Station, and walk east for 150 m\r\n\r\nSouthern Pasture - Take a bus from Urumqi Nanjiao Bus Station.\r\n\r\nRed Hill\r\n\r\nQinghai Mosque', 1, 5, 78, 1, 1, 0, '2018-08-02', NULL, NULL, '2018-08-02 04:40:41', '2019-02-16 00:17:40'),
(246, 1, 20, NULL, NULL, 'Jinjiang Inn Urumqi Hongqi Road', 'china-urumqi-jin-jiang-hotel-urumqi-2018-08-01', NULL, 'Jinjiang Inn Urumqi Hongqi Road\r\n\r\n\r\nCentury Famous Watch Plaza, No.93 Hongqi Road, Tianshan District, Urumqi, Tianshan District, rmqi, 830002, China - \r\n93, , (, 830002)\r\n\r\nPhone: +86 181 2931 1558\r\n\r\nVery comfortable high-end hotel with a great location near the center of Urumqi.\r\n\r\nMap Location: 43.794469, 87.616660\r\n\r\n[Click Here to Reserve Hotels on Booking.com](https://www.booking.com/index.html?aid=1535306)', 1, 5, 76, 1, 1, 0, '2018-08-01', NULL, NULL, '2018-08-02 06:34:09', '2019-02-23 17:31:12'),
(247, 1, 21, NULL, NULL, 'Xinde Business Hotel', 'china-kashgar-xinde-business-hotel-2018-08-03', NULL, 'Xinde Business Hotel\r\n\r\n\r\nOpposite to TV station, Keziduwei Road, Kashgar, 844000, China - \r\n\r\n (, 844000)\r\n\r\n: +86 099 8287 0009\r\n\r\nMap Location: 39.464843, 75.979047\r\n\r\n[Click Here to Reserve Hotels on Booking.com](https://www.booking.com/index.html?aid=1535306)', 1, 5, 74, 1, 1, 0, '2018-08-03', NULL, NULL, '2018-08-02 06:38:21', '2019-02-23 02:39:08'),
(248, 1, NULL, NULL, NULL, 'Flying from Urumqi to Kashgar', 'china-urumqi-flying-from-urumqi-to-kashgar-2018-08-03', NULL, 'Buses to Urumqi Airport\r\n\r\nLine 27: Terminal 3  Yingbin Road  Hangzhou Road Tianjin Road-Wangjialiang 		\r\nHours:  7:30 - 23:30		\r\n\r\nLine 51: Airport - Yingbin Road  Nianzigoug - Red Hill - Shiqihu 		\r\nHours: 07:30 - 23:30', 1, 5, 0, 0, 0, 1, '2018-08-03', NULL, NULL, '2018-08-02 07:49:02', '2018-08-08 03:24:20'),
(249, 1, 20, NULL, NULL, 'Urumqi, China', 'urumqi-china', NULL, NULL, 1, 8, 166, 1, 1, 0, '2018-08-01', NULL, NULL, '2018-08-02 16:01:44', '2019-02-23 05:09:43'),
(250, 1, 20, 105, NULL, 'Wednesday, Trains from Dunhuang to Yumen to Urumqi', 'wednesday-trains-from-dunhuang-to-yumen-to-urumqi-2018-08-01', NULL, 'Got up early, packed up, and was out the door at about 7:30 am.  On my way to the Bus 12 stop, one came by and I flagged it down.  Now that I know what the symbol for \'Train Station\' looks like it\'s easy to spot the right bus.  \r\n\r\nThe first train was the 3 hour slow train to Yumen.  The second train was the 6 hour fast train to Urumqi so I wasn\'t sure that it left from the same station in Yumen but it did.  Usually the fast train is at a different station farther away.  It looks like Yumen is small enough for only one station.\r\n\r\nThe fast train got to Urumqi at about 8 pm.  I tried to take the bus to downtown but I wasn\'t sure it was going that direction even though the people asked said it was.  I bailed on it and took a taxi the rest of the way.  It was a long way to downtown but the taxi was only 24 CNY, under 4 USD.  The hotel was on a one way street so the taxi dropped me off a few blocks away and I hike in the rest of the way.  \r\n\r\nWhen I get to a new city after a long train ride it takes awhile for my phone\'s geo-location to update.  I am completely lost until it updates so that always adds to the confusion.  Once everything got updated I realized that I should have gotten off the train at Urumqi South because it is a lot closer to center of the city where the hotel was.  The regular Urumqi Train Station is way up north.\r\n\r\nUrumqi is a huge, modern, vibrant city.  One thing that is new is the fact that there is security and police everywhere here.  At the train station I had to go through separate security for foreigners to be checked and double checked.  There was also a cop on the train who took my picture and a picture of my passport photo.  \r\n\r\nIn the city, there are metal detectors and security on the street and at all big stores and restaurants.  They don\'t do much good since the metal detectors always go off and the guards or cops just sit there.\r\n\r\nAnother difference in Urumqi is that there are far fewer scooters and electric bikes and there aren\'t separate bike-only side roads like in all the previous Chinese cities that I\'ve been to.\r\n\r\nThere was a KFC right around the corner from the hotel, the Jinjiang Inn Urumqi Hongqi Road, so I went there for a late dinner.', 1, 4, 63, 1, 1, 0, '2018-08-01', NULL, NULL, '2018-08-03 04:53:46', '2019-02-25 03:16:58'),
(251, 1, 20, 105, 1030, 'Thursday, International Grand Bazaar Xinjiang in Urumqi', 'thursday-international-grand-bazaar-xinjiang-in-urumqi-2018-08-02', NULL, 'In the morning tried again at a different China Unicom to recharge my SIM card and phone service but again they said something is wrong with the telephone number and they can\'t recharge it.  Meanwhile I was able to download the Google Translator for Chinese so I can use it offline.\r\n\r\nIn the afternoon walked over to the Xinjiang Grand Bazaar.  It\'s not very big and there was road construction for miles around it so the whole area was a disaster.   I think the construction is for the new Urumqi subway system which is supposed to launch in 2019.\r\n\r\nAt the bazaar they had a Uyghur dance show and afterwards there were some Uyghur musicians sitting on a big bed and playing their typical instruments, very nice.\r\n\r\nInside the bazaar there is a huge Carrefour which was our favorite grocery store in Barcelona (it\'s like the Spanish Walmart).  I bought some dim sum for lunch from their bakery and some new socks since the two pair I have left are destroyed and super funky.  On the walk home I also picked up some chicken legs to add to the lunch.  The healthiest way to eat in China is to buy the meat-only options.  Everything else is pure carbs.\r\n\r\nIn the evening I tried to walk over to a little park but got stuck along the side of a huge freeway where there was a bus stop full of people.  The park had a huge fence around it and I couldn\'t find an entrance.', 1, 4, 68, 1, 1, 0, '2018-08-02', NULL, NULL, '2018-08-03 05:24:34', '2019-02-16 16:07:04'),
(252, 1, 21, NULL, 1103, 'Things to do in Kashgar', 'things-to-do-in-kashgar-2018-08-04', NULL, 'Kashgar Old Town\r\n\r\nId Kah Mosque - North Jiefang Road across from the food street.\r\n\r\nGrand Bazaar - It\'s open everyday but the big day is Sunday.  The Bazaar is right across the river from the Old Town.  Also, it\'s not a bad walk from Id Kah and the food street.  It\'s on Aizirete Lu .  Bus 7 goes to the market.  A taxi is about 5 to 10.  Map Location: 39.475608, 76.010665.\r\n\r\nSunday Livestock Market - Taxi 25 - 30 CNY each way.  Things really get going at around noon.  The location on Google Maps and Maps.me is wrong.  This is the correct map location: 39.52501, 75.933663.  The name in Chinese is: \r\n\r\nGiant Mao Zedong Statue - The huge statue of the Great Helmsman, Mao Zedong, is located across the street from the north side of People\'s Park (Renmib Park).  Finished in 1969, the statue is 24 meters tall.', 1, 5, 82, 1, 1, 0, '2018-08-04', NULL, NULL, '2018-08-03 06:00:52', '2019-02-20 07:16:53'),
(253, 1, NULL, NULL, NULL, 'Kashgar Old Town', 'kashgar-old-town-2018-08-04', NULL, 'Kashgar Old Town is located in the center of Kashi City, Xinjiang Uyghur Autonomous Region, covering an area of about 3.6 square kms.  It is north of Renmin Road near the huge Statue of Mao, south of Seman Road and Yawag Road, east of Yumulakxahar Road, and west of the Tuman River sightseeing area.  The Old Town has a history of over 2100 years.', 1, 5, 0, 0, 0, 1, '2018-08-04', NULL, NULL, '2018-08-04 16:15:50', '2018-08-08 03:24:06'),
(254, 1, 21, NULL, NULL, 'Kashgar, China', 'kashgar-china', NULL, NULL, 1, 8, 251, 1, 1, 0, '2018-08-04', NULL, NULL, '2018-08-04 16:17:01', '2019-02-24 07:37:10'),
(255, 1, 21, 105, NULL, 'Friday, Flight from Urumqi to Kashgar', 'friday-flight-from-urumqi-to-kashgar-2018-08-03', NULL, 'Took a taxi to the airport for 42 CNY by the meter.  I got there early since I thought the check in would be complicated and I didn\'t have anything printed out for them.  I found out that I was in business class so I got to use the special line and the lady walked me to an security procedure and then escorted me to the gate entrance.\r\n\r\nThe flight was smooth and easy.  I had an empty seat next to me and I had the bulkhead so there was plenty of leg room.\r\n\r\nIn Kashgar, I took a shared taxi to the hotel since it was already about 22:00 and I am always worried that they will give my room away if I am late.  No problems with the hotel but the girl kept my passport overnight which made me nervous.  I asked her to please be careful with it.  If I lose it, I couldn\'t be anymore screwed.', 1, 4, 64, 1, 1, 0, '2018-08-03', NULL, NULL, '2018-08-04 16:33:46', '2019-02-16 00:17:40'),
(256, 1, 21, 105, 1050, 'Saturday, Huge Mao Statue near People\'s Park and Kashgar Old Town', 'saturday-huge-mao-statue-near-peoples-park-and-kashgar-old-town-2018-08-04', NULL, 'Rough night at the hotel since my neighbor had his TV blaring all night and the walls are pretty thin.  Breakfast was included at the hotel for the first time, but it was pretty bleak with no meat and no coffee.  There were a lot of cold noodle dishes and bread.\r\n\r\nAfter breakfast, walked over to People\'s Park.  Just figured out that \'Renmib\' means People\'s, like \'Renmibi\'s\' are the People\'s money.  The park was full of dancers as usual with some ethnic Uyghurs thrown in doing their dance.  The park was sealed off so after I got in there was no other way out so I had to go back to the entrance.  There are police and swat teams everywhere in riot gear ready for problems.\r\n\r\nI walked around to the huge statue of Mao Zedong, which is impressive.  The Old Town is just north of Mao, so I walked all through it.  It has a Middle-Eastern feel to it.  It was full of little Uyghur kids running around.  It was easy to get lost in the labyrinth of little streets.\r\n\r\nAfter all of that, I tried to take the buses home but took one wrong one even after the driver said that he was going my way.  Finally got back to the hotel on Bus 8.  I even figured out from the symbols that Bus 8 goes south to the big Bus Station.\r\n\r\nFor dinner I took Bus 32 back to the Night Food Street area.  I had the best plate of noodles yet Uyghur style for less than 1 USD.  I had a chicken leg and a pancake roll thing.  It doesn\'t get dark until after 22:00 so I took a taxi back to the hotel.  The Uyghur taxi driver couldn\'t read Chinese so I just directed him the whole way with hand gestures.\r\n\r\nAt the hotel I asked for a new room and they gave me one on the 14th floor.  It was amazing how much I trashed the first room in less than 24 hours and had my stuff scattered everywhere.  I hope my new room on the top floor is quieter.', 1, 4, 106, 1, 1, 0, '2018-08-04', NULL, NULL, '2018-08-04 16:43:43', '2019-02-21 23:46:32'),
(257, 1, 21, 105, 1095, 'Sunday, Kashgar Animal Market', 'sunday-kashgar-animal-market-2018-08-05', NULL, 'In the morning, took a taxi to the Sunday Animal Bazaar which is about 10 km outside of the city.  I got there a little early at about 10 am and the place didn\'t get packed until about noon.  There were farmers bringing animals on every mode of transportation, mostly sheep and goats.  There were a few Yaks and quite a few cow but nothing really exotic.\r\n\r\nI had a delicious noodle dish for breakfast.  The man lovingly prepared it by running his bare hands all through the noodles.  Other than that just stood around and watched the commotion, took pictures, and tried not to get run over or get in the way.  There were quite a few tourists sticking cameras in the farmer\'s faces as the farmers ignored them.\r\n\r\nThe bathrooms were pretty rough.  No plumbing, just an outside with holes over open sewage.  There was a little tiny half curtain for privacy.  That is the winner for the worst bathroom so far in China.  Luckily, I only had a stand-up visit.', 1, 4, 97, 1, 1, 0, '2018-08-05', NULL, NULL, '2018-08-05 18:08:38', '2019-02-22 14:16:11'),
(258, 1, NULL, NULL, NULL, 'Things to do in Turpan', 'things-to-do-in-turpan-2018-08-07', NULL, '07 Aug, T - Urumqi\r\n08 Aug, W - Yining\r\n09 Aug, T - Yining\r\n10 Aug, F - Yining\r\n11 Aug, S - Almaty?\r\n\r\n- DONE: 07 Aug: Book Urumqi hotel\r\n- 08 Aug: Book Urumqi Yining Train\r\n- 08 Aug: Book Yining Hotel', 1, 5, 0, 0, 0, 1, '2018-08-07', NULL, NULL, '2018-08-06 07:15:11', '2018-08-06 11:59:22'),
(259, 1, NULL, NULL, NULL, 'Urumqi Xindonghui Hotel', 'china-urumqi-xindonghui-hotel-2018-08-07', NULL, 'Urumqi Xindonghui Hotel\r\n\r\n\r\nNo. 71, East Beizhan Road, Xinshi District., rmqi, 830000, China - \r\n71 (, 830000)\r\n\r\nPhone: +86 135 6592 2274', 1, 5, 0, 0, 0, 1, '2018-08-07', NULL, NULL, '2018-08-06 07:17:17', '2018-08-08 03:23:43'),
(261, 1, 20, 105, NULL, 'Tuesday, Kashgar to Urumqi Flight', 'tuesday-kashgar-china-to-urumqi-flight-2018-08-07', NULL, 'Flew back to Urumqi from Kashgar.  The afternoon flight went over the vast desert and some spectacular snow-capped mountains.  \r\n\r\nThere was a huge line for taxis at the airport.  Finally got one and the guy didn\'t know how to read a map so he called the hotel for directions.  The hotel lady said that the hotel was closed so I was out of luck even though I had a guaranteed reservation on Booking.com.  A flight attendant was walking by so the taxi driver asked her to translate for him and she helped us for about 15 minutes.  \r\n\r\nI asked him to take me back to the Jinjiang Inn that I had stayed at last week since that was the only one I had directions to.  It was a lot farther and it took forever to get there.  They did have a room though so I was in luck.\r\n\r\nI reported the hotel problem to Booking.com and they gave me a $25 refund so everything worked out okay.', 1, 4, 64, 1, 1, 0, '2018-08-07', NULL, NULL, '2018-08-09 14:46:37', '2019-02-19 16:07:41'),
(262, 1, 20, 105, 1210, 'Thursday, Urumqi Tour to Nanshan Southern Pasture', 'thursday-tour-to-nanshan-southern-pasture-2018-08-09', NULL, 'Took a tour to Nanshan (Southern Mountain) aka Southern Pasture which is an area about 70 kms south of Urumqi with jagged mountains and a high prairie.  It is inhabited by nomadic groups from Kazakhstan.\r\n\r\nI found the tour because the company has an office right at the south entrance to the People\'s Park (Ren Min Park) inside the temple.  They have a tour bus to a lake that leaves every day from there.  The Nanshan tour bus leaves from somewhere else but came by to pick me up a little after 9 am.  I was the only foreigner on the tour so the poor tour guide girl had to give me separate instructions in not great English.  As usual, every move I made  was closely watched by everyone else.\r\n\r\nAt Nanshan we all took the electric shuttle car to the mountain.  It was very scenic but there wasn\'t much to do.  There was a donkey and a yak to take pictures with.  There were steps up to a waterfall on one side and up the mountain on the other side.  They step trails weren\'t very long so I did all of that in about 20 minutes of the 2 hours that we had.\r\n\r\nFor the rest of the time, I casually took the long walk back to the Yurt camp and enjoyed the alpine mountains, cows, and the Kazakh horse guys and girls that were taking the horses back after the horse tours.  Each horse tour rider had a Kazakh on the horse with them reaching around to handle the reigns.  The key phrase is \"reach around\" which is what it looked like.\r\n\r\nAfter that we had a Kazakh lunch and tea in a nice yurt.  There was a young Kazakh girl who came with her traditional dress and hat and gave us a lively Kazakh dance demonstration.  She pulled people out of the audience to dance with her and naturally I got pulled up twice to everyone\'s glee.\r\n\r\nAfter the tour, I had a long dinner at KFC, went to get my big backpack from the hotel, caught a pirate taxi to the train station, and caught the overnight train to Yining which is close to the Kazakhstan border.  Security at the train station was super tight and it took forever to get into the departure area.', 1, 4, 62, 1, 1, 0, '2018-08-09', NULL, NULL, '2018-08-09 14:47:35', '2019-02-24 17:40:29'),
(264, 1, 22, NULL, NULL, 'Xinjiang Yizhan Youth Hostel', 'yining-china-xinjiang-yizhan-youth-hostel-2018-08-10', NULL, 'Xinjiang Yizhan Youth Hostel\r\n\r\n\r\nNo.18 Lane, Liqun Road, Yining, 835000, China - \r\n (, 835000)\r\n\r\nPhone: +8618299963623\r\n\r\nMap Location: 43.931962, 81.287686\r\n\r\nThe Xinjiang Yizhan Youth Hostel is large, three story hostel with both dorm beds and private rooms with air-conditioning, free Wifi in all the rooms, and laundry service for 10 CNY per load.\r\n\r\nThere are plenty of typical restaurants and grocery stores in the area.  \r\n\r\nBus 18 stops along the main road and goes to the center of the city (east).\r\n\r\nYining Bus Station is about a 15 minute walk from the hostel.\r\n\r\n[Click Here to Book Hotels on Booking.com](https://www.booking.com/index.html?aid=1535306)', 1, 5, 77, 1, 1, 0, '2018-08-10', NULL, NULL, '2018-08-10 12:03:19', '2019-02-20 07:19:11'),
(265, 1, 22, NULL, NULL, 'Things to do in Yining China', 'things-to-do-in-yining-china-2018-08-10', NULL, 'Narat Grasslands or the Bayinbulak Grasslands, both of which are popular tourist destinations and are mentioned in most major guide books. These are both great places to visit\r\n\r\nThe Baytullah Mosque (aka Baitula or ) is hard to miss in the center of Yining. Its not much of a place to stop and spend time, however its certainly interesting to pass by and take a picture.\r\n\r\nThe Kazanqi Handicraft Market () in central Yining is an interesting  albeit touristy  place to stop in the city.\r\n\r\nAside from the old Hui mosque you can see in the background of the picture above, the Kazanqi market is a pleasant place for an afternoon stroll in Yining. There are plenty of souvenirs to buy (leather shoes, animal skins, horse riding gear, etc.) in addition to the variety of snacks and fruits to buy.\r\n\r\nFWC Exclusive Travel Tip: Make sure to visit in the late afternoon or later. Yining can get extremely hot during the summer months!\r\n\r\nYili River Bridge (). Before this bridge was built, there was only a single, two-lane bridge that crossed the Yili River. Now, at over 2 kilometers in length, the Yili River Bridge is one of Chinas largest.\r\n\r\nIf you have an evening to spend in Yining, dont forget to take a stroll along the river walk near the Yining bridge. Its here where locals relax, eat and enjoy the cool of the evening and the view of the bridge.', 1, 5, 0, 0, 0, 1, '2018-08-10', NULL, NULL, '2018-08-10 13:41:41', '2018-08-14 15:26:53');
