(266, 1, NULL, NULL, NULL, 'From Yining, China to Almaty, Kazakhstan', 'from-yining-china-to-almaty-kazakhstan-2018-08-13', NULL, '1 YUAN = 52 TENGE\r\n\r\n1 USD = 357 TENGE\r\n\r\nBuses from Yinning to Khorgos take 1.5 hours, cost 20.5 RMB and go hourly.\r\n\r\nIn Yining, the Long Distance Bus Station is at the northwest end of Jiefang Road near the intersection with Ahemaitijiang Road.\r\n\r\nChorgas/Horgos - Small bus 25, Large bus ?. Use this to cross the border to Kazakhstan by foot. Takes about one hour after which you can walk to the border by foot in ten minutes. \r\n\r\nTo get from the bus station to the border, simply exit, turn right, and follow the main road until you cross a suspension bridge and see the chaos of the border.\r\n\r\nOnce through the Chinese passport control and customs you must use a bus to travel over the border for 20. Bribes appear to have been formalized so that you need to pay a further 20 after the bus departs. \r\n\r\nThere is no official money changer at Chinese side, but there are few guys exchanging yuan\'s to tenge and they will surely find you - you definitely need some tenge as there is nothing on Kazakh side - they actually had good exchange rate. \r\n\r\nYou are not able to go to the border customs without the bus ticket (you are not allowed to walk to between Kazakh and Chinese customs), not sure where tickets can be bought. \r\n\r\nOn Kazakh side there are taxis waiting, it cost 5000 Tenge/person to Almaty takes 6-8 hours (july 2016).\r\n\r\nDo not forget to ask for your (apparently) free registration at the Kazakh border, you need two stamps on your immigration card for this. Otherwise it costs 767 Tenge at least in Almaty, to register. It is not really necessary but can save you a lot of hassle with corrupt officials.\r\n\r\n~~~~~~~~~~~~~~~~~~~~\r\n\r\nYou can take a 09:00 AM bus from the Ili bus station (in the block east of the Tianma Lu / Jiefang Xi Lu crossing) in Yining. It will circle around from 08:30 to \"find\" passengers) which takes you to the bus station near the border in Khorgos around 10:45 (20 RMB). There it seems you have to buy a transport ticket for either a bus to Zharkent (70 RMB) or a shared taxi (? RMB). Please take my advice and opt for the latter as the bus left around 12:00 but finally left the border crossing at 14:30 Almaty time, so 16:30 Beijing time. So that\'s almost 6 hours for crossing a border as you have to wait for hours for bus passengers that simply don\'t show up anymore as they have changed to a faster mode of transport at one of the stops. Very frustrating. A shared taxi would have done that in maybe 1 to 1.5 hours instead of 6.\r\n\r\nFrom the empty field or so where the bus finally drops you off some cars go to Almaty and other places. I think (but I\'m not sure) from there the bus goes to the Zharkent bus station where you can take a cheap bus to Almaty. A shared car to Almaty is 4000 Tenge and since you\'ll be cooked by then I think it\'s a good option as it\'s 2-3 hours faster than by bus that you\'ll have to find first and/or may have to wait for for another couple of hours.\r\n\r\nThe shared taxi may find you already at the Kazakh border stop. If you can get it from there for 4000 Tenge do it as it saves you even more time.\r\n\r\nUsing the cheapish bus-bus-shared taxi-city bus combination I arrived in Almaty around 19:30. Had I used the shared taxi option from Khorgos to the field where the bus stops it may have been around 15:30.\r\n\r\nOh, one more thing: On the Kazakh side there seems to be nowhere to change Yuan into Tenge. On the Khorgos side there is and the money changers will find you between being dropped of by the bus from Yining and entering the transport station for the bus or shared taxi a minute later. DON\'T change all your Yuan as you\'ll have to change BACK from Tenge into Yuan to buy your ticket! So buy your ticket first and THEN head back to the guys to change the rest of your money. Currently the official rate is about 47 Tenge for 1 Yuan and you should be able to get about the same, which came as a positive surprise to me.', 1, 5, 0, 0, 0, 1, '2018-08-13', NULL, NULL, '2018-08-11 10:08:05', '2018-08-14 15:17:46'),
