(268, 3, NULL, NULL, NULL, 'Current Location: USA', 'section-current-location', 'Recent Locations', 'China\r\nLaos\r\nMyanmar\r\nThailand \r\nSri Lanka\r\nNepal\r\nIndia \r\nDubai \r\nUzbekistan \r\nTajikistan \r\nKyrgyzstan\r\nKazakhstan', 1, 7, 0, 1, 1, 0, NULL, NULL, NULL, '2018-08-12 11:55:22', '2019-01-13 21:56:26'),
(269, 1, 24, NULL, 1239, 'Things to do in Almaty', 'things-to-do-in-almaty-kazakhstan-2018-08-15', NULL, 'Park of 28 Panfilov Guardsmen - Named after the Panfilov Heroes, 28 soldiers from Almaty who died fighting Nazi German invaders outside of Moscow in World War II.  Near the east entrance of the park there is the eternal flame and the massive dramatic sculptures of soldiers and other themes.  Map Location: 43.258959, 76.955618.\r\n\r\nAscension Cathedral / Zenkov\'s Cathedral - Built entirely of wood in 1906, the opulent and colorful cathedral is currently being renovated and is almost completely covered up (see photo).  The cathedral is in the center of 28 Panfilov Park.  Map Location: 43.258845, 76.953175.\r\n\r\nThe Green Bazaar - A complex of two large buildings with several levels and many vendor stalls selling almost everything such as meat, vegetables, fruit, clothes, shoes, hats, hardware, etc.  There are souvenir stores mixed in with everything else.  Map Location: 43.263424, 76.954698.\r\n\r\nMukagali Makataev Street / Tolebaev Street Pedestrian Walkway - These wide streets are the promenade area of Almaty where people gather.  There is a wide variety of street musicians, a few vendors, and the usual cross section of humanity. \r\n\r\nAlmaty Central Mosque - This big mosque is interesting to take a quick look at, especially at night when it is lit up.  Map Location: 43.268785, 76.953961.\r\n\r\nHiking in the Ile-Alatau National Park - The park is located just south of Almaty and has good access by public transportation.  Popular day hikes include the following:\r\n\r\n[- Kok Zhailou, the Three Brothers and Kumbel Peak](/tours/hike-to-kok-zhailau-three-brothers-and-kumbel-peak)\r\n\r\n[- Trails at the top of Shymbulak Ski Resort](/tours/kazakhstan-almaty-shymbulak-ski-resort-hike)\r\n\r\n- The Alma Arasan Gorge\r\n\r\n[- Almaty Downtown Walking Tour](/tours/kazakhstan-almaty-downtown-walking-tour)\r\n\r\nGetting Around Almaty\r\n\r\nAlmaty has excellent public transportation including a subway system and extensive bus service.  Buses cost 150 tenge per ride and you pay the driver even if they don\'t seem interested in taking the money.  [Click here to check Almaty Bus Routes](https://wikiroutes.info/en/almaty/catalog).', 1, 5, 96, 1, 1, 0, '2018-08-15', NULL, NULL, '2018-08-13 16:07:10', '2019-02-16 00:17:39'),
(270, 1, 22, 105, NULL, 'Monday, Crossed the border from China to Kazakhstan, Ile Yining to Almaty', 'monday-crossed-the-border-from-china-to-kazakhstan-ile-yining-to-almaty-2018-08-13', NULL, 'After a month and a half in China I crossed the western border into Kazakhstan.\r\n\r\nChecked out of the Xinjiang Yizhan Youth Hostel at 0730.  The hotel girl was asleep on the couch.  I had to wake her up to get my 100 CNY deposit back.  \r\n\r\nI walked over to the Long Distance Bus Station on Jie Fang Road but it wasn\'t open yet.  I found out that there were a bunch of shared taxi guys there taking people to the border so I went with one them.  There was a European guy there and we shared a taxi with some other people for 45 CNY per person. \r\n\r\nThe taxi dropped us off at a bus station at the border with buses to Zharkent.   We took the bus for 70 CNY but we had to wait until it filled up and didn\'t leave until about 11:30.  The bus was worth it because it went through the border through some back way and it was only our bus going through each stage.  We didn\'t have to line up with other people, just the 15 or so from our mini bus.  Even so, each stage took forever and we finally got to Zharkent at about 14:00 China time.  With 100 feet after crossing the final border check, there were donkeys in the street in Kazakhstan.\r\n\r\nAt the Zharkent bus station there were no buses to Almaty but a lot of gypsy taxi guys yelling at us.  I went with one of them for 50 tenge which included the drop off at my hotel in Almaty.  There were two ladies with a kid in the back seat with me.  The driver was a maniac as usual and played with his phone most of the time as he sped down the road and passed all of the other cars.  The drive took three hours and we stopped one time at a very grim outhouse bathroom along the highway.\r\n\r\nThe border crossing and trip to Almaty took all day.  We gained two hours with the time change so arrived in Almaty at about 15:00.\r\n\r\nIn Almaty, I had dinner at an excellent bakery Kebab place right across the street from the hotel.  I also got a Kazakh SIM chip for internet only.  The hotel is right down the street from the main mosque and near the central park.  \r\n\r\nIt\'s nice to be back where Internet sites are not blocked, credit cards can be used, and getting a SIM card is no big deal.', 1, 4, 140, 1, 1, 0, '2018-08-13', NULL, NULL, '2018-08-13 21:21:28', '2019-02-25 21:06:11'),
(271, 1, 24, NULL, NULL, 'Turkestan Hotel', 'kazakhstan-almaty-turkestan-hotel-2018-08-13', NULL, 'Double Room, 8,000 tenge per night, Breakfast included.\r\n\r\nGood location with A/C, refrigerator, WiFi, and a desk.\r\n\r\nIt\'s an old hotel with worn out mattresses but still pretty comfortable.\r\n\r\nAddress: Makataeva/Pushkina, 51/34, Almaty, Kazakhstan.\r\n\r\nMap Location: 43.26478, 76.953689.\r\n\r\n[Click Here to Find Hotels on Booking.com](https://www.booking.com/index.html?aid=1535306)', 1, 5, 65, 1, 1, 0, '2018-08-13', NULL, NULL, '2018-08-13 21:40:01', '2019-02-23 10:59:07'),
(272, 1, 24, NULL, NULL, 'Crossing the border between China and Kazakhstan at Khorgas', 'crossing-the-border-between-china-and-kazakhstan-at-khorgas-2018-08-13', NULL, 'Here is information about crossing the border between China and Kazakhstan at the Khorgas border crossing starting from Yining Ile, China and going to Almaty, Kazakhstan.\r\n\r\nShared taxis and buses from Yining Ile leave from the Bus Station at the Northwest end of Jiefang Road, map location: 43.935947, 81.297213.\r\n\r\nThe bus station opens sometime around 08:00 or later but the shared taxes are there earlier.  The shared taxis are just private cars which leave when they are full and charge around 45 CNY per person.  They drop people off at the bus station in Khorgas where the buses to Zharkent depart.  \r\n\r\nThe bus station opens around 09:30 to sell tickets to Zharkent for 70 CNY.  The buses are actually big vans which hold about 15 people.  They also leave when they are full which could be a few hours after the stated departure time.  The advantage to the Zharkent bus is that it seems to have it\'s own route through immigration and customs so there aren\'t lines with other buses or people.\r\n\r\nIn Zharkent, the bus goes to a bus station where there may or may not be buses to Almaty.  There are many shared taxis waiting for people to go the three hours to Almaty for about 4000 to 5000 tenge per person.\r\n\r\nHere is an example of the travel time breakdown:\r\n08:00 - Left Yining/Ile bus station in shared taxi.  There was one long stop for a police check outside of Khorgas.\r\n09:00 - Arrived at Khorgas Bus Station.\r\n09:30 - Bus Station opened.\r\n09:45 - Nasty bus station lady finished her breakfast and started selling tickets.  She said that the bus would leave at 10:00 but it leaves when it is full.\r\n11:30 - Bus was finally full and went to the China exit at the border.  The China exit took an hour because an old Kazakh couple didn\'t know how to fill out their departure cards and got held up.\r\n12:30 - Arrived at Kazakh Immigration/Customs.  This also took about an hour\r\n14:00 - Arrived at Zharkent Bus Station.  Took forever even though it\'s only about 30 kms to Zharkent from Khorgas.  There were no more buses to Almaty but there were many shared taxis going for about 4000 tenge (5000 if they dropped off at a particular address).  The drive to Almaty takes about 3 hours with 1 bathroom stop at a horrific desert outhouse.\r\n17:00 (15:00 Kazakh time) - Arrived in Almaty.  There is a 2 hour time difference between China (Beijing time) and Kazakhstan.', 1, 5, 113, 1, 1, 0, '2018-08-13', NULL, NULL, '2018-08-14 06:22:46', '2019-02-23 17:31:46'),
(273, 2, NULL, NULL, NULL, 'Sliders', 'section-sliders', NULL, NULL, 1, 7, 0, 1, 1, 0, NULL, NULL, NULL, '2018-08-14 07:31:09', '2018-08-14 07:31:23'),
(274, 1, 24, 105, 1239, 'Tuesday, Exploring Almaty Kazakhstan', 'tuesday-exploring-almaty-kazakhstan-2018-08-14', NULL, 'Woke up at about 06:00 to a great view of the mountains over Almaty.  I saw that the bakery kebab place across the street was open so I went over there for coffee since the hotel breakfast wasn\'t until 08:00.\r\n\r\nAfter that had a good breakfast at the hotel with a lot of protein for a change.\r\n\r\nAfter breakfast I walked way over to the immigration police office to register.  I got copies of my passport and immigration stamps on the way.  The police said that I didn\'t need to do anything since I they had given me all the stamps at the border.\r\n\r\nTook a nice long walk around Almaty and had lunch at Macs on the way back to the hotel.  Almaty is very modern and feels like a European city.  The people speak enough English for basic communication.', 1, 4, 75, 1, 1, 0, '2018-08-14', NULL, NULL, '2018-08-14 11:48:07', '2019-02-25 08:40:58'),
(275, 1, NULL, NULL, NULL, 'Almaty, Kazakhstan', 'almaty-kazakhstan-2018-08-14', NULL, NULL, 1, 8, 200, 1, 1, 0, '2018-08-14', NULL, NULL, '2018-08-14 11:50:59', '2019-02-23 20:18:16'),
(280, 1, 24, 105, 1220, 'Wednesday, Hike to Alma Arasan Gorge', 'wednesday-hike-to-alma-arasan-gorge-2018-08-15', NULL, 'This hike is more of a climb up and down the river bank.  There are also a couple of sketchy bridges to cross.  The first one is partially underwater so your feet get wet.\r\n\r\nGetting to the trail-head also takes forever because Bus 28 near President\'s Park is on the other side of Almaty.  Here are the buses I used:\r\n\r\nBus 112 - runs mostly east-west \r\n\r\nBus 77 - runs north-south along Rozybakiev Street.\r\n\r\nBus 28 - there are stops north of President\'s Park, for example at map location: 43.202387, 76.885798.\r\n\r\n[Almaty Bus Routes](https://wikiroutes.info/en/almaty/catalog)', 1, 4, 68, 1, 1, 0, '2018-08-15', NULL, NULL, '2018-08-18 08:47:23', '2019-02-25 19:52:01'),
(276, 1, 24, NULL, NULL, 'Kazakhstan Visa Registration with the Immigration Police', 'kazakhstan-visa-registration-with-the-immigration-police-2018-08-14', NULL, 'In Kazakhstan all tourist visas must be registered with the immigration police.  This is usually done automatically upon entry to the country especially if arriving at an airport.\r\n\r\nIf your tourist visa card has two stamps then it is registered.  If it only has one stamp then you must go to the Office of Visas and Registration (OVIR) office and register within five days of arrival.  The entry date counts as one day.\r\n\r\nAlmaty OVIR Office\r\n\r\n109A Karasay Batyr, the cross street is Baitursynov.\r\nHours: MonFri 9-13 and 15-18, Sat 9  13\r\nMap Location: 43.250588, 76.925228\r\nThe entrance is on Baitursynov Street at map location: 43.25064, 76.92588\r\n\r\nThe office is in a building with a blue entrance (see photo). Window number 3 is for foreigners. You don\'t have to take a number.\r\n\r\nThere are copy shops right at the entrance and inside the complex: .  One copy is needed of the passport info page, the Kazakhstan entry stamp and the tourist card.', 1, 5, 74, 1, 1, 0, '2018-08-14', NULL, NULL, '2018-08-15 06:14:44', '2019-02-20 06:21:07'),
(278, 1, NULL, NULL, NULL, 'Cash', 'section-cash', NULL, NULL, 1, 7, 0, 1, 1, 0, NULL, NULL, NULL, '2018-08-18 08:19:58', '2018-08-18 08:20:05'),
(279, 1, 24, NULL, 1219, 'Hike to Kok Zhailau, Three Brothers, and Kumbel Peak', 'hike-to-kok-zhailau-three-brothers-and-kumbel-peak', '', 'Kok Zhailau is a big open plateau in the Ile-Alatau National Park.  It has an elevation of 2250 meters and it is a two hour hike from the main road.  \r\n\r\nDirections to the trail-head:\r\n\r\nTake Bus 12 going south from the bus stop across the street from the Kazakhstan Hotel, Map location: 43.244797, 76.956419.  Buses 65, 121 and 131 connect to the Kazakhstan Hotel from the north.\r\n\r\n[Bus 12 Route](https://wikiroutes.info/en/almaty?routes=10234)\r\n\r\nGet off of the bus at the \"Komissarovskoe\" stop, Map Location: 43.16207, 77.040842.  Walk back toward the city for about 50 m and turn left (west).  Follow the road as it loops back to the south toward the mountains.  Stay on the main road as it turns to gravel and ends in a parking lot.  At this point there are signs to Kok Zhailau.  When the gravel road ends turn right on to the trail, there is a sign.\r\n\r\nThe rest of the trail is straightforward.  It\'s about a two hour hike to the Kok Zhailau clearing.  From there it\'s another two hours to Kumbel Peak, follow the big sign.  The last few kilometers are very steep and grueling.\r\n\r\nTake plenty of water in the summer (two liters).  There is a stream crossing at Kok Zhailau on the way to the Kumbel Peak trail.  Water is available if you have a water filter.', 1, 2, 260, 1, 1, 0, '2018-08-17', NULL, NULL, '2018-08-18 08:37:18', '2019-02-23 19:54:37'),
(277, 2, NULL, NULL, NULL, 'Articles', 'section-articles', NULL, NULL, 1, 7, 0, 0, 0, 1, NULL, NULL, NULL, '2018-08-16 08:14:50', '2018-09-17 13:33:38'),
(281, 1, 24, 105, 1215, 'Friday, Hike to Kok Zhailau', 'friday-hike-to-kok-zhailau-2018-08-17', NULL, 'Took the number 12 Bus from Hotel Kazakhstan to the Komissarovskoe Bus Stop near the trail head to Kok Zhailau.  There were some other people on the bus doing the same hike.  I started at about 10:15 and got to the big clearing that is Kok Zhailau at about 12:00.  The views were very nice and there were trails going off in all directions.  There were a lot of people hiking and some people were camping.\r\n\r\nI continued walking toward the Three Brothers (Tri Brata) but never quite made it because it was so steep and I was running out of water.  The last few kilometers are straight up.  Beyond the Three Brothers is the peak of Mount Kumbel.  At about 13:40 I turned around and headed back down the mountain.  It took about 2 hours to go down.\r\n\r\nThe last stop for Bus 12 heading back into Almaty is right in front of a Burger King so I had lunch and drank a lot of water there and then took Bus 121 the rest of the way back to the hotel.', 1, 4, 88, 1, 1, 0, '2018-08-17', NULL, NULL, '2018-08-18 08:54:21', '2019-02-25 19:48:41'),
(282, 1, 24, 105, 1247, 'Sunday, Hiked from Medeu to Shymbulak Ski Resort', 'sunday-hiked-from-medeu-to-shymbulak-ski-resort-2018-08-19', NULL, 'Took Bus 12 to the last stop which is the Medeu Ice Rink.  From there I walked up to the Shymbulak Ski Resort entrance which takes about an hour, and then took the cable cars up to the top of the mountain. \r\n\r\nThe views of the ice-capped mountains at the top were fantastic.  I walked up the trail toward Shymbulak Peak where the views got even better.\r\n\r\nThere were wild yaks roaming around.  I got too close to them to take photos and one of them charged me.  He or she didn\'t have horns but got pretty close so I got out of there. \r\n\r\nAfter spending a few hours at the top, I took the cable cards back down and then took the shuttle bus back down to Medeu and caught Bus 12 back to Almaty.', 1, 4, 63, 1, 1, 0, '2018-08-19', NULL, NULL, '2018-08-19 16:33:07', '2019-02-16 00:17:38'),
(283, 1, NULL, NULL, NULL, 'Bishkek Info', 'bishkek-info-2018-08-20', NULL, '[Bishkek Bus Routes](https://wikiroutes.info/en/bishkek/catalog)\r\n\r\nUSA EMBASSY IN KYRGYZSTAN\r\n\r\nUnited States of America, Prospekt Mira 171,  +996 312 551-241 (bishkekpas@state.gov, fax: +996 312 551-264). It is recommended that you visit the website for the embassy\'s hours and the process for arranging an appointment', 1, 5, 0, 0, 0, 1, '2018-08-24', NULL, NULL, '2018-08-20 08:13:53', '2018-09-08 17:12:45'),
(284, 1, 24, NULL, 1248, 'Shymbulak Ski Resort Hike', 'kazakhstan-almaty-shymbulak-ski-resort-hike', 'Spectacular views of the mountains of Ile-Alatau National Park with a trail all the way to Furmanov Peak.', 'At the top of the Shymbulak Ski Resort there are some epic summer hikes and fantastic mountain scenery.  There are three options for getting to the base of the Ski Resort: shuttle bus, gondola, or walking.  From there, the ski resort\'s cable cars are used to go to the top of the mountain.  There are two cable car systems, each going half of the way.\r\n\r\nWalking up to the base of the ski resort begins at the Medeu Skating Rink and takes about an hour and involves climbing about a 1000 steps.  From the final stop of Bus 12, just start walking up and keep going. \r\n\r\nThe shuttle bus also starts at the Medeu Skating Rink and goes up to the ski resort and costs 350 tenge each way.\r\n\r\nThe big gondola cable car starts below Medeu at the next to the last bus stop for Bus 12.  The big gondola goes all the way to the base of Shymbulak Ski Resort.\r\n\r\nAt the top of the mountain, the most popular trail goes straight north up to Chimbulachka Peak and continues on along a ridge to several more peaks, Bashuta, Panorama, and Furmanov Peak.  There are also other trails in all directions.\r\n\r\nHow to get to Medeu\r\n\r\nTake Bus 12 going south from the bus stop across the street from the Kazakhstan Hotel, Map Location: 43.244797, 76.956419.  Buses 65, 121 and 131 connect to the Kazakhstan Hotel from the north.\r\n\r\n[Bus 12 Route](https://wikiroutes.info/en/almaty?routes=10234)\r\n\r\nMedeu is the final stop for Bus 12.  The big Gondola is the next to the last stop for Bus 12.  The bus stops next to the Gondola ticket office.', 1, 2, 239, 1, 1, 0, '2018-08-19', NULL, NULL, '2018-08-20 13:49:44', '2019-02-20 23:54:39'),
(285, 1, 24, NULL, 1197, 'Almaty Highlights Walking Tour', 'kazakhstan-almaty-highlights-walking-tour', 'Excellent walking loop to see the tourist sites in Almaty.', 'This long walking loop connects most of the interesting tourist sites in Almaty, including: The Almaty Central Mosque, The Green Bazaar, Central Park, Park of the 28 Guardsmen, Panfilov\'s Soldier\'s Memorial, Zenkov Cathedral, The Independence Monument of Kazakhstan, Almaty Opera House, The Panfilov Pedestrian Walking Street, as well as many other small monuments.', 1, 2, 334, 1, 1, 0, '2018-08-21', NULL, NULL, '2018-08-21 12:07:27', '2019-02-24 19:26:13'),
(286, 1, 24, NULL, NULL, 'MILDOM Express Hotel', 'mildom-express-hotel-almaty-kazakhstan-2018-08-20', NULL, 'A very modern, stylish, mid-range hotel with Breakfast, A/C, Hot Water, good WiFi, and very comfortable beds.\r\n\r\nThere are stores and restaurants in the area and it\'s only about two blocks away from the large MEGA Park mall.\r\n\r\nSeyfullina Avenue 434, Almaty, 050000, Kazakhstan\r\n\r\nPhone: +7 778 448 1111\r\n\r\nWifi Password: qwerty123\r\n\r\n[Click Here to Find Hotels on Booking.com](https://www.booking.com/index.html?aid=1535306)\r\n\r\nMap Location: 43.261884, 76.932214', 1, 5, 66, 1, 1, 0, '2018-08-20', NULL, NULL, '2018-08-21 12:37:55', '2019-02-16 02:00:45'),
(287, 1, 24, 105, NULL, 'Wednesday, Went to Shymbulak Ski Resort Again', 'wednesday-went-to-shymbulak-ski-resort-again-2018-08-22', NULL, 'Went to hike at Shymbulak Ski Resort again.  The plan was to take the cablecars to the top, hike over to Furmanov Peak and hike down from there.\r\n\r\nAt the top it started out semi-clear but soon was completely clouded over and fogged in.  I made it past Shymbulak Peak but then had to turn back because I couldn\'t see the trail.\r\n\r\nI still ended up hiking for about three hours so at least I got a good workout.', 1, 4, 75, 1, 1, 0, '2018-08-22', NULL, NULL, '2018-08-22 17:56:51', '2019-02-22 19:00:40'),
(288, 1, 24, NULL, 1294, 'How to get from Almaty to Bishkek', 'how-to-get-from-almaty-to-bishkek--2018-08-24', NULL, 'Traveling from Almaty, Kazakhstan to Bishkek, Kyrgyzstan is very simple and only takes about half of a day.\r\n\r\nIn Almaty minibuses (Marshrutkas) and taxis to Bishkek leave from the Sayran Bus Station (sometimes written as Sairan), the long distance bus station.  \r\n\r\nTickets to Bishkek are sold at the ticket windows (Kacca) to the right of the entrance and cost 1800 tenge.  Buses leave when they are full from 08:00 to 20:00.\r\n\r\nTaxis will ask for about 15000 to 18000 tenge per car.\r\n\r\nSayran is located on Tole Bi Street, Map Location: 43.244811, 76.858263.  City buses 16, 37, 45, and 65 among many others stop near there.\r\n\r\n[Almaty Bus Routes](https://wikiroutes.info/en/almaty/catalog)\r\n\r\nThe trip to the border takes about 3.5 hours and the bus makes one bathroom stop about halfway.\r\n\r\nThe border process is very easy, check out of Kazakhstan, walk to the other side with all luggage, and check in to Kyrgyzstan.  \r\n\r\nIn Kyrgyzstan, you can wait for the bus to come across or you can take a taxi directly to a hotel for about 300 to 500 som per car because Bishkek is very close to the border.  \r\n\r\nThe cross border buses only go to the main bus station which is several kilometers from the city center.', 1, 5, 80, 1, 1, 0, '2018-08-24', NULL, NULL, '2018-08-23 10:20:54', '2019-02-22 13:44:31'),
(289, 2, NULL, NULL, NULL, 'Photo Gallery', 'section-gallery', NULL, NULL, 1, 7, 0, 1, 1, 0, NULL, NULL, NULL, '2018-08-23 14:14:55', '2018-08-23 14:16:17'),
(296, 1, 28, NULL, NULL, 'How to get from Karakol to Jyrgalan', 'how-to-get-from-karakol-to-jyrgalan-kyrgyzstan-2018-08-27', NULL, 'From Karakol, take marshrutka 331 from Ak-Tilek Market (the Big Bazaar) bus station, which is located at the intersection of Bektenova and Zhamansariev streets (Map Location: 42.494014, 78.385224). \r\n\r\nMake sure that your marshrutka goes all the way to Jyrgalan as some only go as far as Ak-Suu (the vans label will say Jyrgalan Village). \r\n\r\nThroughout the year, marshrutkas from Karakol to Jyrgalan leave every day, three times a day:\r\n\r\n- Summer: 8:30, 13:30 and 17:30.\r\n- Winter: 8:30, 13:30, and 16:30.\r\n\r\nThe ride lasts less than two hours and costs 80 som. \r\n\r\nMarshrutkas generally leave on time, so arrive early (30 minutes is usually plenty of time) to ensure you secure a seat.', 1, 5, 0, 0, 0, 1, '2018-08-27', NULL, NULL, '2018-08-25 07:43:28', '2018-09-02 16:04:35'),
(290, 1, 26, NULL, NULL, 'Compass Hostel', 'bishkek-kyrgyzstan-compass-hostel-2018-08-24', NULL, 'Compass is a big very modern hostel with private and shared dormitory rooms and shared bathrooms.\r\n\r\nThe private rooms have A/C and an enclosed terrace.\r\n\r\nThe location of the hostel in the very center of Bishkek is excellent.  There are plenty of restaurants, coffee shops, grocery stores, parks, and bars nearby.\r\n\r\nTynystanov Street 94 Tynystanova 94, Bishkek, Kyrgyzstan (On the northeast side of the Turkish Embassy).  [Map Location: 42.870588, 74.608571](https://www.google.com/search?q=42.870588%2C+74.608571).\r\n\r\nNote that the location of the hostel is WRONG on Booking.com and Maps.me and correct on Google Maps\r\n\r\nPhone: +996 770 904 050\r\n\r\nWifi Password: compass2017\r\n\r\n[Click Here to Book Hotels on Booking.com](https://www.booking.com/index.html?aid=1535306)', 1, 5, 108, 1, 1, 0, '2018-08-24', NULL, NULL, '2018-08-23 14:48:55', '2019-02-21 21:32:11'),
(329, 1, NULL, NULL, NULL, 'Toktogul, Kyrgyzstan', 'toktogul-kyrgyzstan', NULL, NULL, 1, 8, 0, 0, 0, 0, '2018-09-07', NULL, NULL, '2018-09-09 06:38:21', '2018-09-09 07:03:57'),
(291, 1, NULL, NULL, NULL, 'Bishkek, Kyrgyzstan', 'bishkek-kyrgyzstan', NULL, NULL, 1, 8, 264, 1, 1, 0, '2018-08-24', NULL, NULL, '2018-08-24 13:16:23', '2019-02-25 12:49:47'),
(292, 1, 26, NULL, 1374, 'Shopping at Osh Bazaar', 'kyrgyzstan-bishkek-shopping-at-osh-bazaar-2018-08-24', NULL, 'Osh Bazaar (Kyrgyz:   o bzr).  Map Location: 42.874951, 74.569814\r\n\r\nOsh Bazaar is a huge complex with a confusing maze of different buildings and aisles selling everything imaginable.\r\n\r\nThe area with souvenir shops and stalls is located at map location: 42.876824, 74.570287.\r\n\r\nHow to get to Osh Bazaar \r\n\r\nMany of the minibuses that run along Chuy Avenue have stops near the bazaar.  The sign in their windows will include \"\".\r\n\r\n[Bishkek Bus Routes](https://wikiroutes.info/en/bishkek/catalog)', 1, 5, 133, 1, 1, 0, '2018-08-25', NULL, NULL, '2018-08-24 14:23:09', '2019-02-24 21:13:08'),
(293, 1, 26, 105, 1293, 'Friday, Crossed the Border from Kazakhstan to Kyrgyzstan', 'friday-crossed-the-border-from-kazakhstan-to-kyrgyzstan-2018-08-24', NULL, 'Checked out of the hotel after breakfast at about 7:45 am and walked the four blocks down to catch the East-West buses to the Sayran Bus Station.  It was early enough that the bus wasn\'t packed yet.  Got to the bus station at about 08:00, bought my ticket, and I was the final person to fill up the minibus to the border.  It still took the driver about 10 minutes to round everybody else up so we could take off.\r\n\r\nThe trip to the border took a little less than four hours.  It was pretty comfortable.  We checked out of Kazakhstan and in to Kyrgyzstan with hardly any lines.  The border officers were pretty relaxed and didn\'t ask too much.\r\n\r\nOn the Kyrgyzstan side, instead of waiting for our bus to cross over, I just took a taxi to Bishkek because it was only 500 som (about 7 USD) and he said he would take me directly to the hotel.  I got out where Maps.me said that the hotel was but it was wrong.  I thought it was just going to be a tricky entrance but the whole building was being renovated.  Google Maps showed a different location for the Compass Hostel a few blocks away next to the Turkish Embassy so I found it that way.\r\n\r\nAt the hostel, everybody was panicky because an older German lady had hit her head and was bleeding a lot.  They had called the ambulance and were waiting on it.  The ambulance finally got there and they took her to the hospital.\r\n\r\nAfter checking in, I went out for lunch at a delicious Kebab place close to the hostel.  I ordered a kebab expecting a wrap but I got a big plate of meat, bread, and veggies.  I barely had enough som to pay for it so afterwards I went to an ATM to get come currency.\r\n\r\nIt was cloudy and rained a little in Bishkek so it was nice and cool as I walked around the center of the city and looked at the big statues in the parks.  I also bought a SIM card from a newsstand but then found out later that I also have to add money to it from a mobile recharge machine.  I found the green recharge machine on the street and some young girls helped me with it since there was no English option.  The girls were delighted to speak a little English and help the ignorant foreigner with this simple task.\r\n\r\n[How to use Krygyzstan SIM cards](http://grittytravel.com/entries/how-to-get-a-kyrgyzstan-sim-card-for-mobile-cellular-telephone-service-2018-08-25)', 1, 4, 72, 1, 1, 0, '2018-08-24', NULL, NULL, '2018-08-24 17:58:10', '2019-02-21 22:08:52'),
(294, 1, 26, NULL, NULL, 'How to get and use a Kyrgyzstan SIM card', 'how-to-get-a-kyrgyzstan-sim-card-for-mobile-cellular-telephone-service-2018-08-25', NULL, 'In Bishkek, SIM cards are sold at newsstand kiosks and other places including hotels.  The basic SIM card costs around 50 som and then a balance credit must be added to it from one of the many green mobile recharge machines.\r\n\r\nThe touchscreen mobile recharge machines do not have an English option but are fairly easy to use.  Here are the steps to recharging:\r\n\r\n1. Select the mobile service of the SIM card.  The common ones are O!, Beeline (with the bumblebee), and MegaCom.\r\n\r\n2. Enter the telephone number using only the last 9 digits.\r\n\r\n3. There will be a message about a 5 SOM charge for the machine.  At this screen insert the money into the machine.  Put in the desired amount and then press the continue button which is obvious even in another language.\r\n\r\n4. The machine will print out a receipt and an SMS message will be sent to the telephone with information about the recharge amount.\r\n\r\nFor the O! SIM cards, *177*3# can be sent via the telephone keypad to set the service on the phone to English.', 1, 5, 92, 1, 1, 0, '2018-08-25', NULL, NULL, '2018-08-25 06:54:41', '2019-02-24 07:41:07'),
(295, 1, 26, NULL, NULL, 'How to get from Bishkek to Karakol', 'how-to-get-from-bishkek-to-karakol-kyrgyzstan-2018-08-27', NULL, 'In Bishkek minibuses / marshrutkas to Karakol leave from the Western Bus Station ( ), Shymkent 1, Bishkek, Map Location: 42.885313, 74.568164.  \r\n\r\nThe minibuses leave from the parking lot on the east side of the bus station.  The ticket window is right inside the entrance and the cost is 350 som.  There is no need to go into the big main bus station building.\r\n\r\nThe drive follows the north side of the lake, takes about six hours, and there is one bathroom break.\r\n\r\nIn Karakol, the buses arrive at the Main Bus Station at 149 Przhevalskiy Street, map location:  42.504718, 78.393056.', 1, 5, 65, 1, 1, 0, '2018-08-27', NULL, NULL, '2018-08-25 07:04:52', '2019-02-24 12:20:08'),
(297, 1, 26, NULL, 1306, 'Things to do in Bishkek', 'things-to-do-in-bishkek-2018-08-25', NULL, 'The Osh Bazaar - A huge market complex with a confusing maze of different buildings and aisles selling everything imaginable.  [More information about the Osh Bazaar](/entries/kyrgyzstan-bishkek-shopping-at-osh-bazaar-2018-08-24)\r\n\r\nThe new Central Mosque - The new mosque is a massive structure with extraordinary minarets and is very photogenic and well worth a visit.  It is located about 10 blocks north-east of the center at Map Location: 42.882983, 74.620433.\r\n\r\nHoly Resurrection Cathedral - For church enthusiasts this Russian orthodox cathedral will be interesting.  It is the only Catholic cathedral in Kyrgyzstan.  It was totally renovated in 2015 and looks brand new.  It is located at Vasiljeva 197, Map Location: 42.884165, 74.597468.\r\n\r\nParks and Monuments - There are many squares, monuments, parks, and sculptures around Bishkek.  The main ones are Ala Too square (Map Location: 42.8757167, 74.6014809), Panfilov Park (Map Location: 42.8796953, 74.5979587), Manas Statue next to the huge flag (Map Location: 42.876697, 74.603721), and many more.', 1, 5, 115, 1, 1, 0, '2018-08-25', NULL, NULL, '2018-08-25 12:36:06', '2019-02-24 18:25:43'),
(298, 1, 26, 105, 1304, 'Saturday, Went Shopping at the Osh Bazaar in Bishkek', 'saturday-went-shopping-at-the-osh-bazaar-in-bishkek-2018-08-25', NULL, 'In the morning, I walked up to the main road, Chuy Ave, and caught a minibus to the Osh Bazaar.  The minibus said \"\" in the window so I thought that meant the bazaar and it did.\r\n\r\nThe bazaar is a large maze of vendors selling everything but mainly food, clothes, and shoes.  It wasn\'t too crowded when I got there but by noon it was getting packed.  \r\n\r\nI was looking for souvenirs but didn\'t find that area until I was about ready to give up and leave.  The souvenir area has quite a few stores and lots of cheap souvenirs.  There were a lot of tourists there. \r\n I bought a Kyrgyzstan tee shirt for less than 5 USD and some little stuff.  I also bought a little knife to replace the one that got confiscated at the Urumqi airport in China.\r\n\r\nThere were also plenty of restaurants and bakeries there so I had a big heavy meat pocket for lunch.  To get back to the hostel I hopped on one minibus heading in the right direction but it turned off so I jumped off and casually walked the rest of the way.\r\n\r\nIn the evening, the hotel girl was very concerned about what time I wanted breakfast in the morning.  I had freaked them all out by getting up at 07:00 for coffee.  They sleep in the lobby so when anybody is messing around down there they think they have to get up and do something.', 1, 4, 67, 1, 1, 0, '2018-08-25', NULL, NULL, '2018-08-26 07:00:15', '2019-02-22 12:53:10'),
(299, 1, 26, 105, 1316, 'Sunday, Seeing More Sights in Bishkek', 'sunday-seeing-more-sights-in-bishkek-2018-08-26', NULL, 'It\'s another hot and sunny day in Bishkek.  In the morning I walked over to the brand new huge Central Mosque of Bishkek.  It\'s doesn\'t look like it\'s open yet and they are finishing the smal road around it.  Even so it is spectacular and very photogenic from outside the fence.\r\n\r\nAlong the major road on the north side of the Central Mosque, Silk Road Avenue, I caught marshrutka 344 going west and hopped off near the Resurrection Cathedral and went inside to look around.  It\'s not very big and was completely renovated a few years ago.  I was the only tourist there among all of the middle age ladies who were saying their prayers.\r\n\r\nNext I hopped on another 344 marshrutka and went to the Western Bus Station to find out about the minibus to Karokol that I\'m taking tomorrow.  The bus station is huge but I went in the correct entrance and the Karakol buses were right there.  The trip costs 350 Som.\r\n\r\nOn the way back from the Western Bus Station, I got out at the area near the Philharmonic Hall and relaxed for a long while on a park bench in front of the big statue of the lady on a horse with a sword.', 1, 4, 63, 1, 1, 0, '2018-08-26', NULL, NULL, '2018-08-26 15:55:37', '2019-02-23 20:10:27'),
(300, 2, NULL, NULL, NULL, 'Affiliates', 'section-affiliates', NULL, NULL, 1, 7, 0, 1, 1, 0, NULL, NULL, NULL, '2018-08-27 06:36:13', '2018-08-27 06:37:07'),
(301, 3, NULL, NULL, NULL, 'Affiliates', 'section-affiliates', NULL, NULL, 1, 7, 0, 1, 1, 0, NULL, NULL, NULL, '2018-08-27 06:38:29', '2018-08-27 06:38:36'),
(302, 1, 27, NULL, NULL, 'Caravan Hotel', 'kyrgyzstan-karakol-caravan-hotel-2018-08-27', NULL, 'Caravan Hotel is very modern with spacious, comfortable rooms, soft beds, flat screen TV, abundant hot water, and a huge breakfast that is included in the price.  \r\n\r\nIt is centrally located only a few blocks from the business area of Karakol.  There is a grocery store in the same building.\r\n\r\nThere is no A/C and the Internet is poor.\r\n\r\nAddress:\r\nUl. Abdrakhmanova 110/per. Bektenova, Karakol, Kyrgyzstan\r\n\r\nMap Location: 42.496266, 78.390141\r\n\r\nPhone: +996 551 229 924\r\n\r\nWifi Password: hotel2018', 1, 5, 71, 1, 1, 0, '2018-08-27', NULL, NULL, '2018-08-27 06:50:57', '2019-02-25 03:41:00'),
(303, 1, 27, NULL, NULL, 'Karakol, Kyrgyzstan', 'karakol-kyrgyzstan-photo-gallery', NULL, NULL, 1, 8, 279, 1, 1, 0, '2018-08-27', NULL, NULL, '2018-08-27 17:10:27', '2019-02-25 06:11:59'),
(304, 1, 27, 105, 1329, 'Monday, Took the Bus from Bishkek to Karakol near Lake Issyk Kul', 'monday-took-the-bus-from-bishkek-to-karakol-near-lake-issyk-kul-2018-08-27', NULL, 'Waited for breakfast at the hotel a little after 08:00 and then took a taxi to the West Bus Station.  The taxi got pulled over by the police and they shook him down for 200 som.  Both taxis I\'ve been in have been pulled over.  Both times the police totally ignored me in the back seat.\r\n\r\nAt the bus station, I bought a ticket to Karakol for 350 som and then waited for the minibus to fill up.  It didn\'t take long and we left at about 09:40.  The trip took 6 hours with one bathroom stop in the middle of nowhere.  \r\n\r\nThere was a fat guy next to me who had to be touching me no matter how much I squirmed to make space between us.  Then the whole back row got off the bus before Karakol so I had some space for the last hour or so.\r\n\r\nKarakol is a small place so I could just walk from the bus station to the hotel in about 15 minutes.  After I checked in I went to the center had a burger and fries at a little place.  I saw a lot of backpackers walking around.  The mountains to the north are spectacular but not very close.', 1, 4, 73, 1, 1, 0, '2018-08-27', NULL, NULL, '2018-08-27 17:25:42', '2019-02-16 00:17:37'),
(305, 1, 27, NULL, NULL, 'Ak-Suu Valley Hike', 'ak-suu-valley-hike-karakol-kygyzstan-2018-08-28', NULL, 'Ak-Suu Valley Hike - Take the bus from the center of Karakol, map location: 42.491038, 78.393011, to  Kurort Ak-Suu ( ).   The bus goes 9 km to the Ak-Suu valley through the village of Teplokcluchenko.  The price is 15-25 som per person.  Come back on the same bus.\r\n\r\nAbove it, in 3 kilometers is the eponymous reserve, beyond which the Ak-Suu gorge begins. At the bottom of the gorge, which is 30-40m wide, the Ak-Suu River flows. The bottom is strewn with gray and reddish granites: the rapid flow of the river beats against these stones and foam forms, hence the name of the river (\"Ak-Suu\" - \"White River\"). The slopes of the gorge reach 300m in height. \r\n\r\nA few kilometers from the reserve there is Aksu Resort, where there is a sanatorium and about 30 thermal radon springs. Central nervous system diseases, in particular, infantile cerebral palsy, are treated here.After the resort, the gorge expands, and in its lower part on the slopes appear the famous giants - Tien Shan firs. Next are two stunningly beautiful waterfalls 25 and 30 meters high. On both sides of the waterfalls grow harmonious fir trees, which complements the spectacular picture of the falling water with living green colors. Also there is a moraine-glacial lake Kashka-Suu with the purest melt water. It is not surprising that the Ak-Suu gorge is one of the most popular places for mountain adventures and expeditions.', 1, 5, 0, 0, 0, 1, '2018-08-28', NULL, NULL, '2018-08-27 19:30:17', '2018-09-08 17:12:00'),
(306, 1, 27, NULL, 1337, 'Karakol Gorge National Park Hike', 'karakol-gorge-national-park-hike', 'Superb views of the mountains and green valleys with grazing animals.', 'How to get there\r\n\r\nTake a taxi for around 150 som or Minibus 101 for 10 som.  A taxi will go to the National Park entrance.  The Bus will go to the beginning Karakol valley.  \r\n\r\nThe hike follows a road through the valley.  It passes through a small village.  Just stay on the main road which follows the river and then crosses it once at about 4 miles / 6.5 kms from the entrance.  \r\n\r\nThe road continues to where the trail splits at map location: 42.315118, 78.471237.  At that point going east leads to Ala Kul lake.  The Ayu-Tor Ryce Camp Site is also located near there.', 1, 2, 206, 1, 1, 0, '2018-08-28', NULL, NULL, '2018-08-28 06:41:16', '2019-02-24 03:42:28'),
(308, 1, 27, NULL, NULL, 'Hotel Ak Maral', 'ak-maral-hotel-karakol-kyrgyzstan-2018-08-29', NULL, 'Has spacious rooms with terraces, desks, free Wifi, and a sauna.\r\n\r\nKoyenkozova ulitsa 70 /  70, Karakol, Kyrgyzstan\r\n\r\nMap Location: 42.492779, 78.405217\r\n\r\nWifi Password: 16018600', 1, 5, 75, 1, 1, 0, '2018-08-29', NULL, NULL, '2018-08-29 11:30:13', '2019-02-16 23:01:11'),
(313, 1, NULL, NULL, NULL, 'Synonyms', 'synonyms', NULL, 'FANTASTIC\r\nexceptional\r\nextraordinary\r\nincredible\r\nunbelievable\r\nawesome\r\nfirst-rate\r\ngreat\r\nmarvelous\r\nsensational\r\nsuperb\r\nunreal\r\nfirst-class\r\nout of this world', 1, 1, 2, 0, 0, 1, NULL, NULL, NULL, '2018-08-31 08:55:40', '2019-01-16 07:41:03'),
(307, 1, 27, NULL, 1390, 'Things to do in Karakol Kyrgyzstan', 'things-to-do-in-karakol-kyrgyzstan-2018-08-29', NULL, 'Even though Karakol is the fourth largest city in Kyrgyzstan, it is a small city with a population of only 66,000.  The tourist attractions, restaurants, coffee shops, tour offices, and other sites of interest are located in a small area in the center of the city and can be visited in a short period of time.\r\n\r\nDungan Mosque - Built without nails by Chinese wood carvers in the early 1900s.  The mosque is open to tourists for a 20 som entry fee.  Map Location: 42.497322, 78.390806.\r\n\r\nHoly Trinity Church - Built in the late 1800s by the Russian Orthodox community, the church is open to tourists.  The official hours are Mon-Sat, 08:00 to 18:00 and Sun, 08:00 to 17:00 but these are pretty loose and depend on the ladies who are working there.  Map Location: 42.489233, 78.394912.\r\n\r\nKarakol Gorge National Park - Full information about the gorge can be found here: [Karakol Gorge Hike](/tours/karakol-gorge-national-park-hike)', 1, 5, 65, 1, 1, 0, '2018-08-29', NULL, NULL, '2018-08-29 08:32:22', '2019-02-16 00:17:37'),
(309, 1, NULL, 105, 1332, 'Tuesday, Went Hiking in Karakol Gorge National Park', 'tuesday-went-hiking-in-karakol-gorge-national-park-kyrgyzstan2018-08-28', NULL, 'Took a cheap taxi to the entrance of the Karakol Gorge National Park and took a long hike, out and back.  There is a small village in the National Park and herds of goats, horses, and cows along the way to make it interesting.  The mountain views are also very nice.  \r\n\r\nI walked for four hours and then turned around and headed back.  I talked for awhile to a British guy who was riding a mountain bike.  He was retired, lives in San Francisco, and travels a lot.\r\n\r\nI was about half way back when a taxi came along and talked me into going with him back to Karakol for a dollar or so.  It didn\'t take much convincing to get me into the car.', 1, 4, 104, 1, 1, 0, '2018-08-28', NULL, NULL, '2018-08-29 12:00:07', '2019-02-24 17:54:20'),
(310, 1, 27, NULL, 1370, 'Mountain Biking: Karakol to Issyk Kul Lake Loop', 'karakol-kyrgyzstan-mountain-biking-karakol-to-issyk-kul-lake-loop', '', 'This bike ride takes you through the scenic countryside between Karakol and Lake Issyk Kul. It starts on the main road and ends on a main road but in between it\'s nice and quiet on the back roads next to the lake and through the bucolic farmland and several small villages of Kyrgyzstan.\r\n\r\nThe ride can be shortened by turning left right before the village of Lipenka and more of the main road can be avoided by returning on the back roads between Ichke-Bulun and Konkino before joining the main road, 3M-06 to Karakol.', 1, 2, 202, 1, 1, 0, '2018-08-30', NULL, NULL, '2018-08-30 17:01:05', '2019-02-23 17:31:39'),
(311, 1, 27, 105, 1368, 'Thursday, Mountain Biking from Karakol to Issyk Kul Lake', 'thursday-mountain-biking-from-karakol-to-issyk-kul-lake-karakol-kyrgyzstan-2018-08-30', NULL, 'Had a huge breakfast at the hotel at 08:00 and then picked up a mountain bike at the \'Bulak-Say Trekking and Horseback\' office, 800 som for the day.  They were supposed to open at 09:00 but the guy didn\'t show up until about 09:30.  \r\n\r\nThe guy showed me a loop to take to Issyk-Kul lake and back.  I headed out and tracked my route on Wikiloc.com:\r\n\r\n[Wikiloc.com GPS map route of the trail](https://www.wikiloc.com/mountain-biking-trails/karakol-to-issyk-kul-lake-loop-28137115)\r\n\r\nThe ride along the lake and through the Kyrgyzstan countryside, farms and small villages was excellent.  The area around the lake was very arid but the trail also went near a march and along pastures full of farm animals, such as horses, cows, geese, etc.\r\n\r\nI had a sandwich for lunch at a little grocery store in the small village of Kabak.  I ate the sandwich on a bench right outside of the door.  All of the kids were there and they kept coming out to look at me and talk to me a little.   New kids kept appearing from inside the store.  There were at least six of them.  The mother and oldest daughter could speak a little English and they were really nice. \r\n\r\nThe last part of the ride was along the highway coming in to Karakol from the west and there was quite a bit of traffic.  All along the highways there was a wide shoulder to ride on and sometimes a separate path to the side of the main road.', 1, 4, 90, 1, 1, 0, '2018-08-30', NULL, NULL, '2018-08-31 04:53:49', '2019-02-24 01:11:23'),
(312, 1, 27, NULL, NULL, 'Madanur Hotel', 'madanur-hotel-karakol-kyrgyzstan-2018-08-31', NULL, 'Address: Toktogul Street 201, 722360 Karakol, Kyrgyzstan \r\n\r\nTelephone: +996 777 757 757\r\n\r\nMap Location: 42.485043, 78.382373\r\n\r\nWifi Password: room2400', 1, 5, 75, 1, 1, 0, '2018-08-31', NULL, NULL, '2018-08-31 07:31:53', '2019-02-21 16:33:13');
