(314, 1, 32, NULL, NULL, 'Osh to Khujand: Crossing the border from Kygyzstan to Tajikistan at Batken', 'osh-to-khujand-crossing-the-border-from-kygyzstan-to-tajikistan-at-batken-2018-09-10', NULL, 'The trip from Osh, Kyrgyzstan to Khujand, Tajikistan can easily be done in one day.  The border crossing from Batken, Kygyzstan to Isfara, Tajikistan is very easy and straightforward.\r\n\r\nStep 1. Osh to Batken, 250 kms, 4.5 hours, 307 som\r\n\r\nMarshrutkas / Minibuses from Osh to Batken leave from the Central Bus Station in Osh precisely from Map Location: 40.561731, 72.770949.  The fare is 307 som.  The first minibus leaves at around 08:00 to 08:30 whether it is full or not.\r\n\r\nBefore the journey, Tajikistan currency exchange can be done near the Osh Bazaar at Map Location: 40.537632, 72.802718.\r\n\r\nIn Batken, the minibus arrives at the Bus Station near the center.  \r\n\r\nStep 2. Batken to Khujan (), 123 kms, 3 hours, 180 som\r\n\r\nIn Batken, minibuses that cross the border and go to Isfara, Tajikistan and then to Khujand leave from the exact same place where the buses from Osh arrive.  The fare is 180 som.\r\n\r\nThe border crossing is very fast and easy.  Luggage can be left in the minibus while people pass through the Kyrgyzstan exit and walk across the border to the Tajikistan entry and then rejoin the waiting bus.  The border personnel are friendly and helpful.  Proof of visa is required.\r\n\r\nStep 3. Getting to central Khujand.\r\n\r\nThe marshrutka minibus from Batken may just drop everyone off beside the road outside of Khujand.  At this point it is easy to grab a local marshrutka in the direction of Khujand.  It may take several minibuses and regular buses to get to the center of Khujand so just do what the locals do.', 1, 5, 76, 1, 1, 0, '2018-09-10', NULL, NULL, '2018-09-02 07:44:11', '2019-02-25 00:05:30'),
(322, 1, 32, NULL, NULL, 'Asman Guest House', 'asman-guest-house-osh-kyrgyzstan-2018-09-08', NULL, 'Muzurbek Alimbekov 9/7, Osh Kyrgyzstan.  \r\n\r\nRight behind Mama Mia Karaoke.\r\n\r\nMap Location: 40.511068, 72.808901.  \r\n\r\nPhone: +996553121268\r\n\r\nWiFi Password: 76129131\r\n\r\nA/C, Hot Water, Free Wifi, Free Parking, Breakfast is included, and the owner\'s name is Talai.\r\n\r\nOpened in March 2018, it is a modern mid-range hotel in a lively area close to many restaurants, shops, markets, and the riverfront park.', 1, 5, 74, 1, 1, 0, '2018-09-08', NULL, NULL, '2018-09-08 15:37:55', '2019-02-19 07:18:58'),
(323, 1, 26, 105, 1429, 'Tuesday, Returned to Bishkek from Karakol', 'tuesday-returned-to-bishkek-from-karakol-2018-09-04', NULL, 'Checked out of the hotel right after breakfast and went outside to catch a taxi.  The hotel girl came running out because I still had the key in my pocket.  Caught a taxi to the bus station on the other side of town.\r\n\r\nThe Marshrutka / Minibus to Bishy was almost full so I didn\'t have to wait very long.  Also got a good seat next to a nice lady.  I like sitting by the ladies because they avoid contact unlike the men who drape themselves all over you.  It was a delightful and cozy ride back to Bishkek.  This time we went along the south side of the lake.\r\n\r\nIn Bishkek, I took a taxi to a new hotel, the Silk Road Lodge, which was very comfortable and the room was huge.  It was also in a great location close to everything.  The taxi driver agreed on a price and then as soon as we took off he tried to raise the price.  I started to grab my stuff and get out several times so he finally shut up and drove.\r\n\r\nThe hotel room had the Paramount TV channel in English so I got to watch a few movies for the first time in months.  I ended up spending the next three days relaxing in Bishkek because the hotel was comfortable and I enjoyed taking long walks through the many parks and seeing the sights.', 1, 4, 70, 1, 1, 0, '2018-09-04', NULL, NULL, '2018-09-08 16:08:10', '2019-02-25 21:31:19'),
(315, 1, 30, NULL, NULL, 'Getting a Tourist Visa for Uzbekistan', 'getting-a-tourist-visa-for-uzbekistan-2018-09-02', NULL, 'The Uzbekistan eVisa application costs 20 USD and takes three working days to get the visa issued.  \r\n\r\nThe application web site can be found at this address: [Official Electronic Visa Portal of the Republic of Uzbekistan](https://e-visa.gov.uz/).\r\n\r\nA passport size photo of the applicant and a photo of the information page of the applicant\'s passport must be uploaded during the application.  Here are the specifications for the passport size photo of the applicant:\r\n\r\n\"The photo must have a size of 35x45 mm with a resolution of 300 dpi. Image dimensions should not exceed 1 Mb. The photo must meet the standards [ICAO](https://www.icao.int).\"\r\n\r\nMake sure to read this page before doing the application:\r\n\r\n[Official Electronic Visa Portal - Need t know](https://e-visa.gov.uz/what-you-need-to-know)\r\n\r\nOnce the application is submitted, an email should arrive with a link to the application and the application ID.  If they link gives an error (see attached photo), just ignore it and click on the payment icon to make the payment.  \r\n\r\nOnce the payment is made successfully, a message will be displayed that the visa will processed within three working days and the status will be \"Sent for processing\".  The following email should also arrive:\r\n\r\n\"Dear applicant,\r\n\r\nThe payment for Uzbekistan\'s e-visa had been successfully proceeded.\r\n\r\nWithin 3 working days you will receive an email with results of the approval of the application.\"\r\n\r\nGETTING THE VISA FROM THE UZBEKISTAN EMBASSY IN DUSHANBE \r\n\r\nYou will need to take the following documents with you to the embassy:\r\n\r\n- Passport\r\n\r\n- A photocopy of passport photo page\r\n\r\n- A passport photo\r\n\r\n- A filled out application form.  This can be done at an office two houses before the embassy entrance on the left side of the road.  They will do the form, photos, and copies for a small fee.  They will also submit an e-visa application on behalf of the applicant which is much cheaper than manually applying for it at the embassy.\r\n\r\nEmbassy Hours:  9AM to 12PM and 2PM to 4PM, Monday to Friday\r\n\r\nEmbassy Address: 30 Sanoi Street, Dushanbe, Map Location: 38.6009497, 68.7824607.', 1, 5, 71, 1, 1, 0, '2018-09-14', NULL, NULL, '2018-09-02 08:22:50', '2019-02-19 07:54:37'),
(316, 1, 29, NULL, NULL, 'Tajikistan eVisa Application', 'tajikistan-evisa-application-2018-09-03', NULL, 'The e-Visa application for Tajikistan is straightforward.  \r\n\r\nA photo of the information page of the applicant\'s passport is required during the application.\r\n\r\nThe payment of 50 USD is done during the application. \r\n\r\n[Official Tajikistan e-Visa Application](https://www.evisa.tj/index.evisa.html)\r\n\r\nThe web site states that a download link to the Visa will be provided as soon as the application is completed and the payment is made.  This is not always the case and may take several days for the visa to be processed.  \r\n\r\nOnce the visa is approved it will be emailed to the applicant as a PDF file which can then be printed.', 1, 5, 81, 1, 1, 0, '2018-09-03', NULL, NULL, '2018-09-02 16:01:14', '2019-02-16 00:17:36'),
(317, 1, 27, NULL, NULL, 'Madanur Hotel', 'madanur-hotel-2018-8-31', NULL, 'Toktogul Street 201, Karakol, Kyrgyzstan\r\n\r\nPhone: +996777757757\r\n\r\nMap Location: 42.484984, 78.382384', 1, 5, 0, 1, 1, 1, '2018-08-31', NULL, NULL, '2018-09-02 16:29:55', '2018-09-02 16:32:41'),
(318, 1, 26, NULL, NULL, 'Silk Road Lodge', 'silk-road-lodge-bishkek-kyrgyzstan-2018-09-04', NULL, 'A very comfortable mid-range hotel in the center of Bishkek \r\n\r\nBreakfast is included in the room rate.\r\n\r\nAbdymomunova 229, Bishkek, Kyrgyz Republic\r\n\r\nPhone: +996 312 324 889\r\n\r\nMap Location: 42.8802548556912, 74.594088792800.\r\n\r\nWiFi Password: silkroad11', 1, 5, 72, 1, 1, 0, '2018-09-04', NULL, NULL, '2018-09-03 16:12:38', '2019-02-20 06:56:20'),
(319, 1, 26, NULL, 1325, 'Bishkek Walking Tour', 'kyrgyzstan-bishkek-walking-tour-2018-09-05', 'A nice loop which leads to the most interesting sites in central Bishkek.', 'This long walk covers most of the interesting sites in central Bishkek, including the following:\r\n\r\n- Ala Too Square (center of Bishkek) \r\n- Hole Resurrection Cathedral (Greek Orthodox) \r\n- The new Central Mosque (spectacular) \r\n- Erkindik Boulevard Walking Street (shady and relaxing) \r\n- Manas Monument and Flag Square with Guards (huge flag) \r\n- Osh Bazaar (Trail enters at the souvenir area) \r\n- Oak Park (Sculpture Garden) \r\n- Panfilov Park (Amusement Park) \r\n- Victory Park (Eternal Flame)', 1, 2, 258, 1, 1, 0, '2018-09-05', NULL, NULL, '2018-09-05 08:35:18', '2019-02-24 20:34:19'),
(320, 1, 26, NULL, 1439, 'How to get from Bishkek to Osh', 'how-to-get-from-bishkek-to-osh-kyrgyzstan-2018-09-08', NULL, 'This trip can be done comfortably in two days with a stopover in Toktogul.  \r\n\r\nThe first day takes you through the mountains and then through a long tunnel.  It passes through a wide green valley full of yurts and livestock.  There are big herds of horses, sheep, and cattle grazing as far as the eye can see.  \r\n\r\nThe second day passes along some impressive mountains and infinite golden rolling hills.\r\n\r\nDay 1: Bishkek to Toktogul \r\n\r\nShared taxis from Bishkek to Toktogul leave from the main street in front of the Western Bus Station.  They park on both sides of the big street on the block just east of the bus station, Map Location: 42.884803, 74.569406.\r\n\r\nThe shared taxis are usually minivans and can do the 275 km trip in about 5 hours and charge from 500 to 700 som per person.\r\n\r\nIn Toktogul, the taxis arrive in front of the main bus station, Map Location: 41.878344, 72.942078.\r\n\r\nDay 2: Toktogul to Osh \r\n\r\nFor this leg there is a marshrutka that leaves from the Toktogul Bus Station at around 07:00.  It will leave without being full because it will pickup and drop off people all along the way.  The buses are at the back of this station, not in the front with the shared taxis.  The shared taxis go back and forth to Bishkek.  It is unclear if there are shared taxis to Osh.\r\n\r\nThe 335 km trip to Osh costs 440 som and takes all day (roughly 07:00 to 16:00).  The marshrutka stops at almost every little town along the way and also does pick ups and drop offs in between.\r\n\r\nIn Osh, the bus ends at the new Central Bus Station at Map Location: 40.562095, 72.770797.', 1, 5, 75, 1, 1, 0, '2018-09-08', NULL, NULL, '2018-09-05 09:01:04', '2019-02-25 20:03:57'),
(321, 1, 31, NULL, NULL, 'RAHAT Hostel in Toktogul', 'rahat-hostel-in-toktogul-kyrgyzstan-2018-09-07', NULL, 'Abdi Suerkulova 15/3 ( Lenina) 15/3, Toktogul, Kyrgyzstan\r\n\r\nMap Location: 41.875984, 72.940237\r\n\r\nPhone: +996 700 080 395\r\n\r\nWifi: raxal / welkome2018', 1, 5, 75, 1, 1, 0, '2018-09-07', NULL, NULL, '2018-09-07 18:42:17', '2019-02-21 09:55:57'),
(324, 1, 26, 105, 1430, 'Thursday, Getting Ready to go to Osh', 'thursday-getting-ready-to-go-to-osh-2018-09-06', NULL, 'In the morning, I walked all the way over to the Western Bus Station via the Osh Bazaar.  I wanted\r\n to find out where the shared taxis to Toktogul were.  The first group of cars that I came across were the right ones so I got the price details from the drivers and told them that it was for tomorrow morning.\r\n\r\nMy e-Visa to Tajikistan finally came in via email.  The hotel girls were nice enough to print it for me.  My e-Visa for Uzbekistan hasn\'t come in yet and the status just says \"Application Active\".  If it doesn\'t come in by the time I get to Tashkent, then I\'ll have to do it the old fashioned way at the Uzbek embassy there.\r\n\r\nIn the evening, I found a superb kebab place for dinner that was close to the hotel.', 1, 4, 71, 1, 1, 0, '2018-09-06', NULL, NULL, '2018-09-08 16:19:47', '2019-02-21 18:27:17'),
(325, 1, 31, 105, 1431, 'Friday, Shared Taxi from Bishkek to Toktogul', 'friday-shared-taxi-from-bishkek-to-toktogul-kyrgyzstan-2018-09-07', NULL, 'Paid and checked out of the hotel at 07:00.  There was confusion because the girls were changing shifts at that exact moment.  Finally got out of there and caught a taxi right outside the hotel.  \r\n\r\nAt the bus station, I found a shared taxi van and then waited until 09:30 before it filled up and we got to leave.  We needed eight people and I was the first one there even though the taxi driver said that there were already people and we only needed two more.  There was a young girl who spoke English in the taxi so she explained everything that was happening to me.\r\n\r\nThe ride was uneventful other than the crazy driving with the usual passing on blind curves and barely missing head-on collisions.  We got to Toktogul at about 14:00 and I walked to the hostel which was only a few blocks down the main street.  \r\n\r\nThe hostel was a regular house run by a family who lived in another house on the same lot.  There were some other backpackers there and they just slept outside in a big cabana with a huge table and padded benches.', 1, 4, 75, 1, 1, 0, '2018-09-07', NULL, NULL, '2018-09-08 16:48:57', '2019-02-23 05:09:21'),
(326, 1, 31, NULL, NULL, 'Saturday, All Day Bus from Tortogul to Osh', 'saturday-all-day-bus-from-tortogul-to-osh-kyrgyzstan-2018-09-08', NULL, 'Left the hostel at about 06:50 and walked the two blocks to the bus station to catch the mashrutka to Osh. I thought there might be shared taxis as well but there was only the bus. It left without being full at about 07:15. It stopped at every little village and picked up and dropped off people all along the way.\r\n\r\nThe trip took a full 9 hours but the scenery was very nice as we drove through areas of golden rolling hills and some dramatic mountains right along the highway. There were lots of sheep herds and a few herds of horses using the road as well.', 1, 4, 0, 1, 1, 1, '2018-09-08', NULL, NULL, '2018-09-08 19:17:09', '2018-09-08 19:30:08'),
(327, 1, 31, 105, 1439, 'Saturday, All Day Bus from Toktogul to Osh Kyrgyzstan', 'saturday-all-day-bus-from-toktogul-to-osh-kyrgyzstan-2018-09-08', NULL, 'Left the hostel at about 06:50 and walked the two blocks to the bus station to catch the marshrutka to Osh.  I thought there might be shared taxis as well but there was only the bus.  It left without being full at about 07:15.  It stopped at every little village and picked up and dropped off people all along the way.\r\n\r\nThe trip took a full 9 hours but the scenery was very nice as we drove through areas of golden rolling hills and some dramatic mountains right along the highway.  There were lots of sheep herds and a few herds of horses using the road as well.', 1, 4, 71, 1, 1, 0, '2018-09-08', NULL, NULL, '2018-09-08 19:22:25', '2019-02-25 21:07:54'),
(328, 1, NULL, NULL, NULL, 'Osh, Kyrgyzstan', 'osh-kyrgyzstan', NULL, NULL, 1, 8, 0, 0, 0, 0, '2018-09-08', NULL, NULL, '2018-09-08 20:28:55', '2018-09-08 20:34:26'),
(330, 1, 35, NULL, NULL, 'Border Crossing: Tajikistan to Uzbekistan, Dushanbe to Panjakent to Samarkand', 'border-crossing-tajikistan-to-uzbekistan-dushanbe-to-panjakent-to-samarkand-2018-09-18', NULL, 'Going from Dushanbe, Tajikistan to Samarkand, Uzbekistan via Panjakent is pretty straightforward.  In Dushanbe, the shared taxis to Panjakent leave from a station about 10 km north of the center at map location: 38.648057, 68.769269.  Bus 3a goes to or close to that station or a taxi from the center will charge around 30 somoni.\r\n\r\nShared taxis to Panjakent charge around 80 to 100 somoni per person and leave when they are full.  The key is to find a taxi that is almost full and go with them.  This is difficult since the taxi drivers swarm potential customers and will say anything to get their luggage locked in the car until they have enough people.  Don\'t commit to a taxi unless you can get a confirmed head count and by all means don\'t let them take your luggage hostage.   \r\n\r\nThe drive to Panjakent takes about four hours with a bathroom and snack break about half way.  For people prone to carsickness be prepared with a plastic bag or something else to throw up in.  The mountain crossing is all curves and the drivers steer violently.\r\n\r\nIn Panjakent, shared taxis to the border leave from the bazaar and also charge around 8 to 10 somoni and can be paid either in Tajik or Uzbek somoni.  There are money exchange offices around the bazaar.  The drive to the border takes about 30 minutes.  \r\n\r\nDepending on the crowd, the border crossing usually takes from 30 minutes to an hour.  The Tajik exit had the biggest crowd of about 15 people.  The gate guards check papers before letting people enter the offices.  The guards and border officers are very friendly and enjoy practicing their English.  For the entrance into Uzbekistan there are immigration/customs forms but apparently are only required for the locals.\r\n\r\nAfter entering Uzbekistan, there is the usual group of aggressive shared taxis, marshrutkas, and big bus 273 which goes to Kaftaxona station where other buses continue on to the center of Samarkand.  Depending on the type of transportation selected, the ride to the center of Samarkand takes around 30 minutes to an hour.', 1, 5, 116, 1, 1, 0, '2018-09-18', NULL, NULL, '2018-09-09 14:14:55', '2019-02-22 22:52:40'),
(331, 1, 34, NULL, NULL, 'Khujand, Tajikistan', 'khujand-tajikistan', NULL, NULL, 1, 8, 148, 1, 1, 0, '2018-09-11', NULL, NULL, '2018-09-11 10:47:06', '2019-02-24 09:16:26'),
(332, 1, 34, NULL, 1450, 'Things to do in Khujand, Tajikistan', 'things-to-do-in-khujand-tajikistan-2018-09-11', NULL, 'Sheikh Muslihiddin mausoleum - Located on the main square across from the Panjshanbe Market.  The Masjidi Jami mosque and mausoleum on the main square are the iconic buildings of Khujand.\r\n\r\nPanjshanbe Market - The main bazaar in Khujand.  It is a large covered market selling mainly food.  Photo tip: go up the stairs to the second floor to get some panoramic photos of the market vendors.\r\n\r\nKhujand Fortress - The fortress, also known as the Historical Museum of Sughd, regional history museum of the Sughd region of Tajikistan.\r\n\r\nMonument to Ismoil Somoni - This huge statue is on the other side of the river on a hill surrounded by fountains.  Buses 2 and 3 cross the bridge and go right by it.', 1, 5, 74, 1, 1, 0, '2018-09-11', NULL, NULL, '2018-09-11 12:25:26', '2019-02-16 00:17:28'),
(333, 1, 32, 105, 1475, 'Sunday, Spent the Day Exploring Osh Kyrgyzstan', 'sunday-spent-the-day-exploring-osh-kyrgyzstan-2018-09-09', NULL, 'After breakfast at the hotel with a group of Swiss climbers, I spent the day exploring Osh.  I started with a long walk through the park along the river.  Ended up at the Osh Bazaar which was very large of full of people.\r\n\r\nAcross the street from the bazaar there was a long line of money change offices.  They wouldn\'t take my USD since I only had twenties and they wanted bigger bills.  I was able to change all the Kazakhstan Tenges that I had for Tajikistan Somonis.  It\'s always better to have the money ready before a border crossing.\r\n\r\nLater, I walked up the little mountains, Suleyman Too, to watch the sunset over the city.  Osh is completely flat except for several little mountains that are right in the city.  The petroglyph museum is built right into the side of the mountain around the petroglyphs.  I didn\'t get there in time to go in and see the petroglyphs.', 1, 4, 65, 1, 1, 0, '2018-09-09', NULL, NULL, '2018-09-11 14:37:28', '2019-02-16 00:17:28'),
(334, 1, 34, 105, 1452, 'Monday, Took Marshrutkas from Osh Kyrgyzstan to Khujand Tajikistan', 'monday-took-marshrutkas-from-osh-kyrgyzstan-to-khujand-tajikistan-2018-09-10', NULL, 'Got up and out of the hotel before 08:00.  Had breakfast with the Swiss group again.  Talai the owner cooked dumplings for us.  Got a taxi to the new Central Bus Station and the driver found the Batken minibus for me.  The bus left at about 08:30 without being full.  It was a nice relaxing drive since I had my own seat on the shady side of the bus.\r\n\r\nIs Batken, the bus stopped right next to the buses for Khujand, Tajikistan so I just had to switch buses and we took off to the border.  The border crossing was really easy.  They just let in a few people at a time so it was pretty relaxed.  I tried to get in first since all the rest of the people were locals who were just showing ID cards.  An older Uzbek guy befriended me and luckily he only knew a few words of English.  He updated everyone on the bus with my details.\r\n\r\nWe loaded back on the bus on the Tajik side and took off to Khujand.  About 10 km outside of Khujand the driver dumped us out on the side of the road and flagged down a local minibus for us.  My friend was going the same way so I just stuck with him.  He made sure to update everyone on each bus that we took about my travels.  The minibus dropped us off in the next town and we got on the big bus to Khujand.  \r\n\r\nI Khujand I didn\'t have a hotel reservation but I had the map location of a hotel but the location was wrong and I couldn\'t find it.  I asked a couple of guys for a hotel and they sent me to a dirt bag place for 5 USD per night.  I asked if I could see the room and the lady gave me the key to a room that already had a guy in it.  I assume that they were renting beds since it was so cheap and I would have to share with someone.  \r\n\r\nThere were taxis outside and I had one take me to the original hotel that I was looking for.', 1, 4, 78, 1, 1, 0, '2018-09-10', NULL, NULL, '2018-09-11 14:51:50', '2019-02-20 04:57:40'),
(372, 1, 39, NULL, 1625, 'How to get from Shymkent to Turkestan, Kazakhstan', 'how-to-get-from-shymkent-to-turkestan-kazakhstan-2018-09-25', NULL, 'Marshrutkas / minibuses from Shymkent to Turkestan (i) leave from the bus terminal next to the Bekzhan Market (or former market) and the massive Tsentralnaya Mosque at map location: 42.350153, 69.529224.  To get to the bus terminal take Marshrutka 47 or Bus 12 going north on Tamerlanovshoe Street for 75 tenge.  \r\n\r\nIt\'s about a two hour ride to Turkestan and costs 1000 tenge.  The minibuses leave when they are full and start loading at about 07:00 every morning.  There are also big overnight buses at this station that go to Almaty and Astana.\r\n\r\nIn Turkestan, the minibus will turn right and then stop at the bus stop at Map Location: 43.299845, 68.276938 which is a few blocks from the Yasawi mausoleum complex.  It is visible from the bus stop.  The entry fee is 500 tenge.\r\n\r\nTo return to Shymkent, the marshrutkas leave from the Altyn Orda Bus Station at Map Location: 43.303553, 68.249294.', 1, 5, 91, 1, 1, 0, '2018-09-25', NULL, NULL, '2018-09-24 11:34:07', '2019-02-22 08:30:32'),
