(344, 1, NULL, NULL, NULL, 'Dushanbe, Tajikistan', 'dushanbe-tajikistan', NULL, NULL, 1, 8, 256, 1, 1, 0, '2018-09-14', NULL, NULL, '2018-09-14 06:41:32', '2019-02-23 23:04:56'),
(345, 1, 35, NULL, 1478, 'Things to do in Dushanbe, Tajikistan', 'things-to-do-in-dushanbe-tajikistan-2018-09-14', NULL, 'Hisor Fortress - [Day trip from Dushanbe to Hisor Fortress](http://grittytravel.com/entries/day-trip-from-dushanbe-to-the-hisor-fortress-2018-09-16)\r\n\r\nRudaki Park, Monument to Rudaki\r\n\r\nSomoni Square\r\n\r\nNational Flag Park\r\n\r\nHaji Yakoub Mosque\r\n\r\nVarzob Bazaar\r\n\r\nDelhi Darbar Indian Restaurant\r\nRudaki Avenue 55/1, Dushanbe, Tajikistan\r\nMap Location: 38.571227, 68.788279\r\n\r\nSalaam Namaste Indian Restaurant\r\n81 Rudaki Ave, Dushanbe, Tajikistan\r\n\r\nTaking the regular Buses in Dushanbe (not the Marshrutkas)\r\n\r\nThe regular big buses in Dushanbe require a City Card for payment.  The City Card machines can be found at every bus stop and have an English option.  To get a card, select \'City Card\' and then the machine prompts for a local telephone number.  Any phone number can be entered, such as all 1\'s with a valid city code.  The city codes are displayed on the machine as examples.  Once the phone number is accepted then money can be put in, and a loaded card will come out.  The minimum is seven somonis.', 1, 5, 118, 1, 1, 0, '2018-09-14', NULL, NULL, '2018-09-14 07:31:27', '2019-02-22 04:03:04'),
(347, 1, 34, NULL, NULL, 'Hotel Xecoh', 'hotel-xecoh-khujand-tajikistan-2018-09-10', NULL, 'Good A/C, Hot Water, and WiFi.  No breakfast.\r\n\r\nMap location is wrong on Booking.com.  The correct Map Location: 40.285586, 69.623431.\r\n\r\nIt\'s up the stairs on the right side of the Oasis building (O).\r\n\r\nA very comfortable hotel in a good location.', 1, 5, 73, 1, 1, 0, '2018-09-10', NULL, NULL, '2018-09-14 18:52:43', '2019-02-20 07:26:05'),
(348, 1, 34, 105, 1490, 'Thursday, Khujand to Dushanbe by Shared Taxi', 'thursday-khujand-to-dushanbe-tajikistan-by-shared-taxi-2018-09-13', NULL, 'I got up extra early, packed, and checked out of the hotel by about 06:30.  I walked a few blocks to the bus stop that I had scouted the day before and caught a marshrutka to the parking lot from where the shared taxis for Dushanbe departed, map location: 40.275845, 69.610515.\r\n\r\nI was swarmed by drivers when I got off of the bus.  They were trying to take my bags so I would have to go with them so I had to wrestle my bags away from them.  I saw that one car was almost full so I headed for it and worked out the price with the driver.  He only wanted 100 somoni which was less than the 120 to 150 that I was expecting to pay.\r\n\r\nI took a seat next to a young Tajik girl who was probably in her early 20\'s or late teens.  I like sitting by the ladies since, unlike the guys, they avoid being touched.  The taxi filled up with two more guys. and took off after only about 5 minutes so I had timed it perfectly.  The driver told me to get in the 2nd back row of seats but I ignored him and stayed put.\r\n\r\nEverybody in the car was excited to have a foreigner among them and they asked me questions for about the first hour.  The excitement finally passed and I could relax.\r\n\r\nThe trip passes through some spectacular mountains and goes through the tunnel of death and another long tunnel.  Inside the tunnel, our driver kept passing other cars even though the tunnel had no lights or ventilation, was filled with exhaust, and you could barely see oncoming traffic.\r\n\r\nThe road is on the side of the mountain along a cliff for quite a ways.  There are several crumpled cars at the bottom of the cliff that never made it to their destinations.\r\n\r\nWe had a long lunch stop at a restaurant right after going over the mountain pass.  I don\'t eat on these trips to avoid any intestinal issues.  We also had to stop one more time so the guy in the front seat could hop out and throw up for about five minutes.\r\n\r\nThe driver dropped us off on the north side of Dushanbe along the main road at map location: 38.614799, 68.784591.  From there I took Bus 1 the rest of the way and walked the final few long blocks to the hotel.', 1, 4, 73, 1, 1, 0, '2018-09-13', NULL, NULL, '2018-09-14 19:15:49', '2019-02-21 02:23:24'),
(349, 1, 34, NULL, 1489, 'How to get from Khujand to Dushanbe, Tajikistan', 'how-to-get-from-khujand-to-dushanbe-tajikistan-2018-09-13', NULL, 'Shared taxis leave Khujand from the little bus stop at Map Location: 40.275845, 69.610515.\r\n\r\nThe trip passes through some spectacular mountains and goes through the tunnel of death and another long tunnel.\r\n\r\nThe road is on the side of the mountain along a cliff for quite a ways. There are several crumpled cars at the bottom of the cliff that never made it to their destinations.\r\n\r\nThe shared taxis drop off on the north side of Dushanbe at Map Location: 38.648057, 68.769269 or next to the bus station at Map Location: 38.614799, 68.784591.', 1, 5, 87, 1, 1, 0, '2018-09-13', NULL, NULL, '2018-09-15 09:55:43', '2019-02-16 13:40:51'),
(346, 1, 35, NULL, NULL, 'Hotel Sarvar', 'hotel-sarvar-dushanbe-tajikistan-2018-09-12', NULL, 'Bukhoro Street, 2, Dushanbe, Tajikistan.  \r\n\r\nEntrance is through the alley from the Bukhoro Street side.\r\n\r\nMap Location: 38.571083, 68.786183\r\n\r\nPhone: +992 88 028 8888\r\n\r\nBreakfast is included.\r\n\r\nThe internet is horrible.', 1, 5, 76, 1, 1, 0, '2018-09-12', NULL, NULL, '2018-09-14 11:42:25', '2019-02-19 11:24:24'),
(366, 1, 37, 105, 1623, 'Sunday, Border Crossing Tashkent to Shymkent', 'sunday-border-crossing-tashkent-uzbekistan-to-shymkent-kazakhstan-2018-09-23', NULL, 'Had breakfast at the hotel at 07:00 and then paid for my two nights in USD. The clerks were still groggy so I was able to get rid of one of my torn 20s which nobody else would take.\r\n\r\nTook the bus to the metro then took the green line to the last stop, Shahriston. Caught a couple of buses going north until I got to the spot beside the road where the marshrutkas leave for the border. The border is in the suburbs of Tashkent and we never really left the city.\r\n\r\nThe marshrutka stopped at a little market area about 500 meters from the border. At the market I was able to change all of my somoni to tenge with some random black market guys and then go to the bathroom. I walked the rest of the way to the border and joined the hoards heading for Kazakhstan.\r\n\r\nThe exit from Uzbekistan was crowded but people weren\'t cutting in line very much because other people were yelling at them. When it was my turn, I clogged up two lines because the border guys seemed baffled by my passport and visa. They finally figured it out and stamped me out.\r\n\r\nThe Kazakhstan entry was a nasty mob scene because everybody was crammed into a semi-narrow lane and then a few were let in at a time. There were at least 100 people crammed in there waiting. I finally got in the door but didn\'t have an immigration form so I paid a lady to fill one out for me. She was already set up and doing them for other people and was charging under a buck for the service.The whole border crossing took about an hour and was the worst crossing in the four \"stans\" that I traveled through (Kaz, Uzb, Taj, and Kyrgyzstan).  I would have gone to Turkmenistan but the visa was too complicated because you have to book a tour to get a visa.\r\n\r\nOn the Kazakhstan side a lady money changer latched onto me and I finally had to use my translator app to tell her to leave me alone.\r\n\r\nI found the marshrutka to Shymkentwhich took about two hours and only cost700 tenge (about 2 USD). It was a nice comfortable ride and, as usual, the people wanted to know where I was from. Then as other people got on the bus they would fill them in on my details.  I know when they are talking about me because they always say \"tourist\".\r\n\r\nIn Shymkent the minibus went right into the center and I got out just a few blocks from the hotel that I had reserved.  It was nice to be back in civilization where there are ATM\'s that work and credit cards are accepted.', 1, 4, 77, 1, 1, 0, '2018-09-23', NULL, NULL, '2018-09-23 19:28:22', '2019-02-24 21:34:06'),
(350, 1, 35, NULL, 1507, 'Day Trip from Dushanbe to the Hisor Fortress', 'day-trip-from-dushanbe-to-the-hisor-fortress-2018-09-16', NULL, 'The Hisor Fortress (may also be spelled \'Hissor\' or \'Hissar\') is a restored fortress about 30 km from Dushanbe and about 7 km from the village of Hisor.  The best time to visit is on summer week-ends because a constant stream of lively marriage processions celebrate at the fort with live music and rowdy dancing.\r\n\r\nHow to get to Hisor Fortress from Dushanbe\r\n\r\nGetting to the fortress by public transportation is currently a little more complicated because of the massive road construction project that has blocked Somoni Avenue between the center of Dushanbe and the area from where the marshrutkas and shared taxis depart for Hisor at Map Location: 38.581808, 68.721011.\r\n\r\nFormerly Bus 8 would go from Rudaki and turn west on Somoni Avenue to the taxi stop.  Because of the construction the best option is to take a taxi to the departure area.   \r\n\r\nIn Hisor, taxis charge around 10 to 12 somonis to go to the fortress, each way.  They leave from the bus terminal area at map location: 38.524658, 68.556993.', 1, 5, 90, 1, 1, 0, '2018-09-16', NULL, NULL, '2018-09-16 15:30:49', '2019-02-25 13:19:00'),
(351, 1, NULL, 105, 1503, 'Friday, Uzbek Embassy for a Visa', 'friday-uzbek-embassy-for-a-visa-2018-09-14', NULL, 'Went to the Uzbekistan Embassy in Dushanbe (Map Location: 38.600903, 68.784836) to apply for a visa.  I had applied for the e-Visa but it never came so I thought I would have to do it the old fashioned way.  \r\n\r\nA completed application is required before they let you in to the embassy so I went to an office near the embassy where they prepare the applications for a small fee.  I went to the closest one and they explained that I could do an e-Visa much cheaper, 20 USD instead of 160 to 200 USD for the manual process.  I explained that I had attempted it but the visa email never came.  The guy showed me some e-Visas that he had done and I realized the mistake that I had made.  \r\n\r\nI went back to the hotel and was able to complete my e-Visa application and pay for it online and now it said that I only had to wait for three working days for the visa to be sent.  The mistake I made was that even though the email link gives an error, you can still make the payment from that page and then the visa will be submitted for processing.\r\n\r\nLater went through the park and came across the monument to the famous Tajik poet, Rudaki.', 1, 4, 74, 1, 1, 0, '2018-09-14', NULL, NULL, '2018-09-18 15:00:40', '2019-02-21 02:06:46'),
(352, 1, 35, 105, 1507, 'Sunday, Went to the Hisor Fortress', 'sunday-went-to-the-hisor-fortress-2018-09-16', NULL, 'Took a day trip to the village of Hisor outside of Dushanbe and then went from there to the historic Hisor Fortress.  Getting there was a challenge since there was major road construction between the center of the Big Dush and the area where the Hisor minibuses departed.  An old man and his teenage grandson (probably) latched onto me because they were also going to Hisor. \r\n\r\nInstead of walking around the construction site we crawled through a hole in the fence and went right through the middle of it.   We finally got to the other side and caught a couple of marshrutkas to get to the bus terminal.  I just followed my new friends.  The old man paid a few of my fares which is always awkward.  We took a shared taxi to Hisor and I parted ways with my new friends and took another taxi from Hisor to the fortress which was about 7 km outside of the village.\r\n\r\nThe fortress was pretty simple and there wasn\'t much to see besides the big gate and the sun was blazing hot.  The fun part of being there was seeing the wedding parties that come to celebrate and take photos.  There was a constant stream wedding parades with bands and guys with long horns playing while the people dance frantically (mostly guys dancing with guys).  As soon as one moved along, another one would come along.  The whole scene was very fun to watch and take video of.  The wedding parties seemed to be having a great time but most of the brides looked pretty sour.', 1, 4, 64, 1, 1, 0, '2018-09-16', NULL, NULL, '2018-09-18 15:14:23', '2019-02-19 20:29:52'),
(353, 1, 35, 105, NULL, 'Monday, Went to the Mekhrgon Baazar', 'monday-went-to-the-mekhrgon-baazar-dushanbe-tajikistan-2018-09-17', NULL, 'In the morning after breakfast at the hotel,  I walked over to the big new Mekhrgon Bazaar.  This is the bazaar that replaced the green bazaar in Dushanbe.  There was nothing special here, just a regular indoor fruit and vegetable bazaar and not very photogenic.', 1, 4, 92, 1, 1, 0, '2018-09-17', NULL, NULL, '2018-09-18 15:27:42', '2019-02-24 07:46:55'),
(354, 1, 36, NULL, NULL, 'Samarkand, Uzbekistan', 'samarkand-uzbekistan', NULL, NULL, 1, 8, 259, 1, 1, 0, '2018-09-18', NULL, NULL, '2018-09-18 15:32:44', '2019-02-25 12:15:21'),
(355, 1, NULL, NULL, 1529, 'Things to do in Samarkand', 'things-to-do-in-samarkand-2018-09-19', NULL, 'Registan - The spectacular Registan complex is right in the very center of Samarkand at map location: 39.654723, 66.975715.  It has three structures, from west to east they are: Ulugh Beg Madrasa, Tillya Kori Medrese, and the Sherdor Medrese.  The Ulugh and the Sherdor are full of souvenir vendors.  The entrance fee for the complex is very cheap at 20000 somoni.  Hours are 09:00 to 18:00 everyday.  At night the lights are turned on at random times, usually around 20:00.\r\n\r\nBibi Khanoum Mosque - The mosque is the other complex with fantastic architecture and history.  It consists of huge tiled gates and a minaret at each corner.  Map Location: 39.660790, 66.980067.  There are electric shuttles from the east side of the Registan to the Bibi Mosque. \r\n\r\nShiki-Zinda Park - The park is right across the street from the Bibi Mosque.  It has a cemetery, a mosque, and other interesting structures.  Map Location: 39.663464, 66.983232.', 1, 5, 112, 1, 1, 0, '2018-09-19', NULL, NULL, '2018-09-18 21:17:50', '2019-02-22 06:54:55'),
(356, 1, NULL, 105, NULL, 'Tuesday, Took Shared Taxis from Dushanbe, Tajikistan to Samarkand, Uzbekistan', 'tuesday-took-shared-taxis-from-dushanbe-tajikistan-to-samarkand-uzbekistan-2018-09-18', NULL, 'Up and out of the hotel by 07:00.  Took a taxi 10 km north to the area where the shared taxis leave for Panjakent.  Went through the usual chaos of being swarmed by the drivers and them trying to pull the bags out of my hands.  Figured out who was the fullest and would leave first and went with him.  I only had to wait about 15 minutes and we took off.  It was an old man in the front seat and two old ladies and a kid in the back seat with me.\r\n\r\nThe driver was taking all of the mountain curves at full speed throwing us all around in the back seat.  I got queasy and luckily had some plastic baggies to throw up into.  I don\'t eat on travel days so it was all liquid but still pretty nasty with the clear baggies.  For once the people stopped staring at me for awhile and the little girl looked especially disgusted and a little queasy herself.  I need to learn how to vomit more quietly since I make a very loud and hearty \'ralph\' noise.  I immediately felt better for awhile but then I had to do it again and this time a lot more came out.\r\n\r\nAt Panjakent I found a money change office right by the bazaar and exchanged all of my Taj somoni for Uzbek somoni.  The exchange is 1000 to 1 so you get a big wad of bills.  Caught a full taxi to the border which is about 20 minutes away.  \r\n\r\nThere was a crowd at the Taj exit but the border officer called me out of the line to go ahead.  Finally some benefit to being a tourist!  He was friendly and wanted to speak English.  Then walked about 100 meters to the Uzbek entry where there was no line and they were also extra friendly.\r\n\r\nWent through the taxi driver frenzy again on the Uzbek side.  Found a marshrutka that was almost full and we took off.  It took about an hour to get to Samarkand and the driver dropped us off by the Registon at the center of the city.  My hotel was only about two blocks away and easy to find.\r\n\r\nSpent the rest of the day trying to find an ATM that worked.  Apparently this is a big problem in Uzbekistan.  I had spent all of my Uzbek somoni for the taxis so and only had enough money for a coke and some cookies.  The coke refreshed my pukey mouth.  No luck with the ATM\'s but I found a souvenir vendor who changed 20 USD for me so I could at least eat something.', 1, 4, 75, 1, 1, 0, '2018-09-18', NULL, NULL, '2018-09-19 07:31:36', '2019-02-25 08:48:54'),
(357, 1, 36, NULL, NULL, 'Hotel Zarina', 'samarkand-uzbekistan-hotel-zarina-2018-09-18', NULL, 'Umarova Street 4, Samarkand, Uzbekistan\r\n\r\nPhone: +998 66 235 07 61\r\n\r\nMap Location: 39.652240, 66.972407.\r\n\r\n30 USD for a Single Room, Breakfast Included, Wifi okay for awhile, Good Hot Water and A/C.  Kind of expensive for the room but great location, about a block from the Registon right off of the main street with plenty of restaurants and shops.', 1, 5, 77, 1, 1, 0, '2018-09-18', NULL, NULL, '2018-09-19 21:14:01', '2019-02-19 03:46:41'),
(358, 1, 38, NULL, NULL, 'Bukhara, Uzbekistan', 'bukhara-uzbekistan', NULL, NULL, 1, 8, 151, 1, 1, 0, '2018-09-20', NULL, NULL, '2018-09-20 20:52:44', '2019-02-23 20:19:24'),
(359, 1, 37, NULL, NULL, 'Orzu Hotel', 'orzu-hotel-tashkent-uzbekistan-2018-09-21', NULL, 'Katta Mirabad Str. Dom 14, Tashkent, Uzbekistan\r\n\r\nMap Location: 41.291944, 69.263939.\r\n\r\nPhone: +998 99 837 02 05\r\n\r\nVery overpriced hotel with worn out beds.  Good WiFi, A/C, and Hot Water.  Location is okay.', 1, 5, 93, 1, 1, 0, '2018-09-21', NULL, NULL, '2018-09-22 07:32:36', '2019-02-25 13:19:34'),
(360, 1, 36, NULL, 1561, 'Samarkand to Bukhara by Train', 'uzbekistan-samarkand-to-bukhara-by-train-2018-09-19', NULL, 'Taking the fast train from Samarkand to Bukhara is a very comfortable way to travel compared to shared taxis and marshrutkas.  There is a morning train that leaves around 09:40, costs 57600 somoni, and only takes 1.5 hours.  Passport must be shown to buy tickets.\r\n\r\nThe train station (Vokzal) in Samarkand is located at Map Location: 39.685411, 66.928874.  Bus 3 and 73 run from Registan Street (the main street next to the Registan) to the train station.  Taxis will charge around 10000 somoni for the trip and are much faster than the buses.  The ticket office has a separate entrance on the east (right) side of the main building.\r\n\r\nThe train station in Bukhara is about 13 kms outside of the city, map location: 39.722241, 64.548588.  Taxis charge between 30k and 50k depending on day or night and the negotiating skill of the passenger.', 1, 5, 79, 1, 1, 0, '2018-09-19', NULL, NULL, '2018-09-22 13:28:42', '2019-02-16 15:56:33'),
(361, 1, 38, NULL, NULL, 'Sokhrob Barzu Guest House', 'sokhrob-barzu-guest-house-bukhara-uzbekistan-2018-09-20', NULL, 'L. Babahanov Street 9, 200118 Bukhara, Uzbekistan\r\n\r\nVery cozy, family run guest house in Bukhara.  Has air conditioning, a balcony, and flat-screen TV with satellite channels.  Breakfast is included.\r\n\r\nPerfect location right off of the main street in the center of Bukhara, Map Location: 39.7728, 64.421545.', 1, 5, 80, 1, 1, 0, '2018-09-20', NULL, NULL, '2018-09-22 14:04:29', '2019-02-16 00:17:27'),
(362, 1, 38, NULL, 1595, 'How to get from Bukhara to Tashkent by Train', 'how-to-get-from-bukhara-to-tashkent-uzbekistan-by-train-2018-09-21', NULL, 'Taking the four hour train ride from Bukhara to Tashkent on the fast train is a great alternative to the frenetic shared taxis in Uzbekistan.  The first train leaves at 04:55 and arrives at around 09:00 in Tashkent.\r\n\r\nIn Bukhara, the train station is about 13 kms outside of the city at Map Location: 39.722241, 64.548588. Taxis charge between 30k and 50k depending on day or night and the negotiating skill of the passenger.  A 4 am taxi will cost the maximum amount and can be arranged by the hotel staff the night before.\r\n\r\nIn Tashkent, the train station is in the city at map location: 39.7728, 64.421545.  The entrance to the \'Toshkent\' metro/subway station is right in front of the train station.', 1, 5, 80, 1, 1, 0, '2018-09-21', NULL, NULL, '2018-09-22 16:40:35', '2019-02-19 05:41:08'),
(363, 1, 37, NULL, 1596, 'Things to do in Tashkent, Uzbekistan', 'things-to-do-in-tashkent-uzbekistan-2018-09-21', NULL, 'Tashkent Tower Map Location: 41.345644, 69.284874.\r\n\r\nChorsu Bazaar Map Location: 41.32679, 69.235083.  Souvenir area map location: 41.32501, 69.234515.\r\n\r\nMetchet Kazrati Mosque Complex, Map Location: 41.33746, 69.24126.\r\n\r\nMonument to Amir Timur (Tamerlane), Map Location: 41.311166, 69.279736.\r\n\r\nSubway, 1200 somoni per ride to any destination.  There are three lines, red, green, and blue.', 1, 5, 77, 1, 1, 0, '2018-09-21', NULL, NULL, '2018-09-22 16:50:56', '2019-02-19 09:42:21'),
(364, 1, 37, NULL, NULL, 'Tashkent, Uzbekistan', 'tashkent-uzbekistan', NULL, NULL, 1, 8, 203, 1, 1, 0, '2018-09-22', NULL, NULL, '2018-09-22 16:55:29', '2019-02-25 04:32:29'),
(365, 1, 39, NULL, NULL, 'Promenade Park Hotel', 'promenade-park-hotel-shymkent-kazakhstan-2018-09-23', NULL, 'Prospect Beybitshilik 4B, Shymkent, Kazakhstan\r\n\r\nDouble Room, 30 USD per night.  Mid-range hotel with WiFi, Good A/C, Hot-water, Breakfast Included.  Good Location in the center of Shymkent.\r\n\r\nMap Location: 42.317623, 69.586183.\r\n\r\nPhone: +77252468287', 1, 5, 75, 1, 1, 0, '2018-09-23', NULL, NULL, '2018-09-23 13:32:28', '2019-02-22 12:57:10'),
(367, 1, 36, 105, 1562, 'Thursday, Took the Train from Samarkand to Bukhara, Uzbekistan', 'thursday-took-the-train-from-samarkand-to-bukhara-uzbekistan-2018-09-20', NULL, 'Had breakfast at the hotel and then headed to the train station for my 09:45 train to Bukhara.  I took a taxi to the train station because the buses were all packed with people and they take forever.\r\n\r\nThe train ride was a relaxing and comfortable change from the crowded and bumpy marshrutkas.  The only downside is that the train stations are usually way out of town and require a taxi to get there.  In Bukhara I did some hard bargaining with a taxi driver and we finally headed to the center of town where my hotel was.\r\n\r\nAfter checking into the hotel, I went to lunch and then headed out to see the sights.  I only had the afternoon and evening in Bukhara so I tried to see everything in the afternoon and then go back in the evening for some night photos.  The mausoleums and mosques were extraordinary and I took a lot of photos.\r\n\r\nIn the evening, an older guy talked me into going to his house for dinner since they cooked for the tourists.  I thought it would be a group thing with his family but I was the only one there eating.  They served the typical dish, rice pilaf.', 1, 4, 89, 1, 1, 0, '2018-09-20', NULL, NULL, '2018-09-23 19:30:15', '2019-02-25 07:55:42'),
(368, 1, NULL, 105, 1595, 'Friday, Took the Train from Bukhara to Tashkent, Uzbekistan', 'friday-took-the-train-from-bukhara-to-tashkent-uzbekistan-2018-09-21', NULL, 'My train from Bukhara to Tashkent was at the ungodly hour of 04:55.  I had arranged for a taxi with the hotel the night before for 04:00.  I woke up before the alarm and got up at 03:30 and got everything ready.  The taxi got there a little early so the hotel guy came and got me.\r\n\r\nThere were quite a few people and taxis around at that time but we made it to the train station in about 10 minutes.  The train to Tashkent only took about four hours.  \r\n\r\nIn Tashkent, I took a gypsy taxi with an old guy who couldn\'t read the address or map on my phone.  He said he knew the hotel and we took off.  There was also a girl in the taxi and we had to take her to the airport first.\r\n\r\nThe old guy got me to the hotel with no problems even though there were three hotels with basically the same name.  I got there way too early and the room wasn\'t ready yet.  They let me have some coffee and then I went and tried to find an ATM that worked without success.  ATMs and Credit Cards don\'t work very well in Uzbekistan.\r\n\r\nThe hotel was pretty centrally located and was about a 15 minute walk to a subway station.', 1, 4, 72, 1, 1, 0, '2018-09-21', NULL, NULL, '2018-09-23 19:32:10', '2019-02-22 21:28:57'),
(369, 1, NULL, NULL, NULL, 'Shymkent, Kazakhstan', 'shymkent-kazakhstan', NULL, NULL, 1, 8, 0, 0, 0, 0, '2018-09-24', NULL, NULL, '2018-09-24 07:30:30', '2018-09-24 07:30:30');
