(370, 1, 37, NULL, NULL, 'Tashkent Metro Map', 'uzbekistan-tashkent-metro-map-2018-09-22', NULL, 'The Tashkent Metro routes aren\'t extensive but they a good, cheap option for public transportation.  Attached are Maps of the Tashkent Metro in Russian and English.', 1, 5, 131, 1, 1, 0, '2018-09-22', NULL, NULL, '2018-09-24 07:48:00', '2019-02-23 14:44:07'),
(371, 1, 37, NULL, 1623, 'Uzbekistan to Kazakhstan, Tashkent to Shymkent Border Crossing', 'uzbekistan-to-kazakhstan-tashkent-to-shymkent-border-crossing-2018-09-23', NULL, 'The border crossing between Tashkent and Shymkent is at map location: 41.467018, 69.356470 and enters Kazakhstan at Zhibek Zholy.\r\n\r\nThe marshrutka minibuses from Tashkent to the Border gather on the north side of the outer ring road at Map Location: 41.383904, 69.290564.  To get there using public transportation, take the Tashkent Metro to the last stop on the green line, Shahriston, ([Tashkent Metro Map](http://grittytravel.com/entries/uzbekistan-tashkent-metro-map-2018-09-22)) and then catch buses or marshrutkas going north.\r\n\r\nThe ride to the border only takes about 20 minutes and is almost free.  The minibus stops in a market area about 500 meters south of the border.  Money can be exchanged by individuals hanging around the market.  There are also money changers on both sides of the border.  To get to the border, follow the crowd walking straight north on the main road. \r\n\r\nThe Uzbekistan exit is crowded with people constantly trying to cut into the lines.  After the exit, everyone is funneled into a fenced corridor with a huge mob of people shoving and waiting at the entrance to the Kazakhstan immigration office.  Small groups are let in periodically.  An immigration form must be filled out before going through immigration.  The blank forms are hard to find and there are people giving out and filling out forms for a very small price.  Once again everyone, especially the older women, try to cut into the lines.  All luggage is scanned after the immigration check but they don\'t really pay attention to that.  The border crossing takes at least an hour.\r\n\r\nOn the Kazakhstan side there is a big crowd of taxi drivers and money changers doing their hustle.  A little farther out there are marshrutkas that leave as soon as they are full and charge around 700 tenge to go to Shymkent.  The marshrutkas make several stops in Shymkent starting at map location: 42.306058, 69.575356 and then going close to the center at map location: 42.318272, 69.579397.', 1, 5, 112, 1, 1, 0, '2018-09-23', NULL, NULL, '2018-09-24 08:13:23', '2019-02-23 00:42:54'),
(373, 1, NULL, 105, 1629, 'Tuesday, Day Trip from Shymkent to Turkestan', 'tuesday-day-trip-from-shymkent-to-turkestan-kazakhstan-2018-09-25', NULL, 'Took the bus way up north to the Bus Terminal and caught the marshrutka for Turkestan.  Had to wait about an hour for it to fill up.  We finally left and made the almost two hour drive to Turkestan.  There were wild camels out in the countryside.  They were one-humpers instead of the usual two-humpers.\r\n\r\nIn Turkestan, the major attraction is the Yasawi Mausoleum complex.  It\'s right in the center of Turkestan so I was able to get off of the minibus and walk over to it.  It was okay but after seeing the stuff in Uzbekistan this was pretty limited.\r\n\r\nThere was also a big mosque in the area so I walked over to it and took some photos.  I ran into some baby camels out in the scrub.  They were tied up and grazing.\r\n\r\nAfter spending about an hour looking around, I stopped into the tourist center and asked them where I could catch the marshrutka back to Shymkent.  They told me which local bus to take to the bus station.  I got there and only had to wait about 15 minutes to leave but I had to sit in the back with two fat guys.  So it was about four hours in the minibus to spend about an hour in Turkestan.', 1, 4, 83, 1, 1, 0, '2018-09-25', NULL, NULL, '2018-09-25 15:16:32', '2019-02-21 15:40:32'),
(374, 1, NULL, NULL, NULL, 'Turkestan, Kazakhstan', 'turkestan-kazakhstan', NULL, NULL, 1, 8, 213, 1, 1, 0, '2018-09-25', NULL, NULL, '2018-09-25 18:38:01', '2019-02-25 03:57:43'),
(375, 1, 39, NULL, NULL, 'How to get from Shymkent to Taraz, Kazakhstan', 'how-to-get-from-shymkent-to-taraz-kazakhstan-2018-09-26', NULL, 'Marshrutkas / minibuses from Shymkent to Turkestan (i) leave from the bus terminal next to the Bekzhan Market (or former market) and the massive Tsentralnaya Mosque at Map Location: 42.350153, 69.529224. To get to the bus terminal take Marshrutka 47 or Bus 12 going north on Tamerlanovshoe Street for 70 tenge.\r\n\r\nIt\'s about a two hour ride to Taraz and costs 1200 tenge. The minibuses leave when they are full and start loading at about 07:00 every morning.\r\n\r\nIn Taraz, the minibus will stop at the bus stop at Map Location: 42.899026, 71.328578.', 1, 5, 96, 1, 1, 0, '2018-09-26', NULL, NULL, '2018-09-26 11:30:24', '2019-02-17 20:14:18'),
(376, 1, 41, NULL, NULL, '- Hotel', 'tay-doc-hotel-taraz-kazakhstan-2018-09-26', NULL, '  35, Taraz, Kazakhstan\r\n\r\nMap Location: 42.897952, 71.326189.\r\n\r\nPhone: +7 778 777 0792\r\n\r\nHigh-end hotel with big rooms, free breakfast, good A/C, WiFi, and Hot Water.  It\'s located right next to the area where the Shymkent marshrutkas depart and arrive.', 1, 5, 88, 1, 1, 0, '2018-09-26', NULL, NULL, '2018-09-26 12:02:32', '2019-02-22 13:38:49'),
(377, 1, 39, 105, NULL, 'Wednesday, Took a Marshrutka from Shymkent to Taraz', 'took-a-marshrutka-from-shymkent-to-taraz-kazakhstan-2018-09-26', NULL, 'Headed back to the same bus station as yesterday so it was easy since I knew all the buses.  It wasn\'t very crowded so me and my backpacks didn\'t cause too much of a problem.\r\n\r\nThe marshrutka to Taraz was almost full when I got there.  We just had to wait about 10 minutes for the final two people and then we took off for the easy, two hour trip.\r\n\r\nIn Taraz, I had booked a hotel that was just a block away from the bus station so it was easy to find.  I had a very expensive steak lunch at the restaurant next to the hotel but it was delicious.\r\n\r\nIn the evening, went to the train station and bought a ticket to Almaty for the next day at 09:40.  Then took a long walk around Taraz.  Had dinner at a coffee shop that was full of mother\'s and kids.  I think it was a \"mommy and me\" coffee shop so not sure if I was supposed to be there or not.  They gave me black plastic gloves to eat my hamburger.  I also saw that strange custom in Kyrgyzstan.', 1, 4, 80, 1, 1, 0, '2018-09-26', NULL, NULL, '2018-09-26 12:08:09', '2019-02-25 04:53:54'),
(378, 1, 41, NULL, NULL, 'Taking the Train from Taraz to Almaty Kazakhstan', 'taking-the-train-from-taraz-to-almaty-kazakhstan-2018-09-28', NULL, 'There are several trains daily that make the 9 hour trip from Taraz to Almaty starting at around 07:00.  All or most of the coaches are triple-deck sleepers.\r\n\r\nThe train station in Taraz is at Map Location: 42.870171, 71.378996.  It isn\'t far from the center of Taraz and several buses go by the station.  \r\n\r\nIn Almaty, the train arrives at the Almaty 1 train station at Map Location: 43.341145, 76.948877.  Taxis to the center of Almaty cost around 1500 to 2000 tenge.  The taxi drivers will try to charge much more.', 1, 5, 92, 1, 1, 0, '2018-09-28', NULL, NULL, '2018-09-28 06:05:58', '2019-02-24 01:12:15'),
(379, 1, 24, 105, NULL, 'Thursday, Took the train from Taraz to Almaty', 'thursday-took-the-train-from-taraz-to-almaty-kazakhstan-2018-09-27', NULL, 'Went down for breakfast at the hotel at 08:00 but everything was dark and the receptionist was asleep on the couch.  I checked out and caught a taxi in front of the hotel and it turned out to be the same guy from yesterday who took me to the train station.\r\n\r\nI had a coffee from a snack kiosk at the train station.  The water they were using from a big jug didn\'t look very sanitary but I really needed the coffee.  A strange guy latched onto me to practice English so he followed me around for awhile.\r\n\r\nThe train platform was busy and I couldn\'t tell which train was going to Almaty.  There were two tracks and to get to the train on the second track you had to climb through the train on the first track.  So when a train arrived on the second track everybody had to crawl through another train with all of their luggage.\r\n\r\nThe other trains finally cleared out and the Almaty train arrived.  It turned out to be a triple-deck sleeper and luckily I had a lower berth and there was nobody above me and only one other guy right across from me.\r\n\r\nThe scenery on the nine hour trip to Almaty was pasture with mountains in the distance and never changed.  There were goat herds, horses, and a few camels but not much else to look at.  \r\n\r\nIn Almaty, it was almost dark so I took a taxi to the hotel and had a delicious dinner at Digerman right across the street.  It\'s nice when you already know where everything is.', 1, 4, 80, 1, 1, 0, '2018-09-27', NULL, NULL, '2018-09-28 06:42:48', '2019-02-25 12:31:33'),
(380, 1, NULL, NULL, NULL, 'My Essential Travel Gear', 'my-essential-travel-gear-2018-09-29', NULL, 'This is my list of essential travel gear.  \r\n\r\nCell Phone with a good camera and good GPS - I use and highly recommend the Samsung Galaxy S9 phone.  It has an excellent camera which takes very clear and detailed photos in any light.  The zoom creates pixelated photos so a DSLR camera with a zoom lens is better for zooming.  Almost all of the photos on the web site were taken with this camera.\r\n\r\nSpare cell phone instead of a battery bank - I use an extra cell phone instead of a portable battery pack because I always have a few laying around and they are about the same size and weight for packing.  An extra phone or battery is essential for those long travel days when you need the phone to find your way around when you arrive but you also want to listen to music all day while travelling.\r\n\r\nDigital SLR camera with zoom lens - I currently use a Canon EOS 1100D camera with a Tamron 18-200 MM lens.  I\'m not happy with it because it is so hard to get clear zoom and low light shots.  The non-zoomed and low-light photos with the Galaxy S9 are so much better than the Canon.\r\n\r\nLifeStraw Water Purifier - For those places where you don\'t want to drink the water, the LifeStraw is a life saver.  It is very lightweight for packing but it is a little hard to use because you have to suck the water through a thick filter.  These are easy to find at Amazon, Walmart and Target.  For long or multi-day hikes this is useful because if there is water available in rivers, etc. then you won\'t have to carry so much water.  I have also used it in sketchy places like India for brushing my teeth and making coffee when I run out of bottled water.\r\n\r\nZip off pants with zipper pockets - This is my favorite clothing item since they work as shorts or long pants.  The zipper pockets are essential to keep your valuables safe on crowded trains and to keep stuff from falling out of your pockets when reclining or laying down.  They are lightweight and dry very quickly so I also use them as a swimsuit.  With two pair of these, I don\'t need to carry any other pants, shorts, or a swimsuit.', 1, 5, 97, 1, 1, 0, '2018-10-12', NULL, NULL, '2018-09-29 09:36:20', '2019-02-24 21:34:13'),
(381, 1, NULL, NULL, NULL, 'Essential Travel Apps', 'essential-travel-apps-2018-09-29', NULL, 'The following is a list of essential travel apps which make life much easier on the road.  Apps that work offline are noted and are very important when WiFi or cell service is not available.\r\n\r\nMaps.me maps (free, offline) - This is the most important app on my phone.  Popular landmarks, hotels, restaurants, etc are already marked on the maps and the app tracks your current position whether you are online or offline.  Maps obviously need to be downloaded in advance for offline access.  Maps.me also works in China where Google Maps is blocked.  [Click here to go to the download page for Maps.me](https://maps.me/).\r\n\r\nBooking.com (free) - Has the world\'s largest selection of online hotels.  Many hotels give a 10% discount for frequent bookers known on the site as \'Genius\' users.  Only two bookings in a two year period are needed to automatically become a genius user and qualify for discounts and other perks.  The other huge advantage of Booking.com is that the reservations are guaranteed and if the hotel doesn\'t have a room then you will be given an equivalent or better room at another hotel.  [Click Here to Book Hotels on Booking.com](https://www.booking.com/index.html?aid=1535306).\r\n\r\nPodcast Addict (free, offline) - Essential for providing free listening material for those long plane, train, and bus rides.  Thousands of podcasts are available for download.\r\n\r\nCurrency Plus currency converter (free, offline) - Outstanding tool to keep from getting ripped off when changing money in the street.  It shows exactly what rate you are getting and can display multiple currencies at the same time.\r\n\r\nGoogle Maps (free, offline) - Works well offline but doesn\'t work in China and in general isn\'t as nimble as Maps.me.  \r\n\r\nGoogle Translator (free, offline) - Languages can be pre-loaded for offline use.  The speech recognition is weak when there is a lot of ambient noise.  Doesn\'t work in China.\r\n\r\nExpedia.com (free) - Good app for booking flights mainly for prices and because it give you 24 hours to cancel a flight for free if your plans change.\r\n\r\nTrip.com (formerly CTrip, free) - Excellent for booking trains in China and flights in many other countries.  For trains, the service charge as a percentage seems a little hefty sometimes.  However the app is very useful to avoid language difficulties when buying tickets.  Tickets still have to be picked up at the train station but the agent just has to be given a reservation number.  For flights, the prices are very competitive compared to other services like Expedia.\r\n\r\nExpressVPN (free trial then monthly fee) - This is a must-have app in China to provide access to the many popular web sites such as Google, Facebook, Instagram, and YouTube that are blocked.  The app is also useful outside of China for example if you need to do online banking and you don\'t want your bank to freak out because the login attempt is coming from a strange country.  You can pick the country that you will appear to be connecting from.\r\n\r\nWikiloc (offline) - Has easy to follow GPS maps for hiking and biking trails all around the world.  Your location is shown on the trail map for easy offline navigation.\r\n\r\nWikiroutes (free) - Has bus route maps for many cities.\r\n\r\nPedometer Step Counter (free) - Throw away your battery sucking Fit Bit and start using this app to track your activity.  It may be a little less accurate than a dedicated step counter but it is consistent which is the most important factor.\r\n\r\nGoogle Voice (free) - Provides a free telephone number where you can be reached by phone or text message anywhere in the world.  It can also be used as your WhatsApp telephone number.\r\n\r\nLightning QR code reader (free) - Useful for places where WiFi passwords and other important information are provided as QR codes. \r\n\r\nNice To Haves\r\n\r\nAmazon Kindle (a few free books) - eBook provider and reader. \r\n\r\nAudible (free trial then monthly fee) - Audio book provider and reader.', 1, 5, 113, 1, 1, 0, '2018-09-29', NULL, NULL, '2018-09-29 09:52:25', '2019-02-18 06:40:46'),
(382, 1, 24, NULL, NULL, 'Things to do in Dubai', 'things-to-do-in-dubai-united-arab-emirates-2018-09-30', NULL, 'Burj Khalifa\r\n\r\nDubai Mall\r\n\r\nOld Souk\r\n\r\nOld Dubai\r\n\r\nDubai Creek\r\n\r\nDubai Marina\r\n\r\nJumeirah Beach Walk', 1, 5, 13, 0, 0, 1, '2018-10-05', NULL, NULL, '2018-09-30 08:06:58', '2018-11-07 07:42:05'),
(501, 1, 69, NULL, NULL, 'Crown Prince Hotel', 'crown-prince-hotel-bagan-myanmar-2018-11-21', NULL, 'Very comfortable mid-range hotel with large rooms, very good WiFi, A/C, and Hot Water and a good location.  They also rent e-bikes and make tour and bus reservations.\r\n\r\nKhat Tar Street, Shwe Laung Block, Kyansitta Qtr, New Bagan, Myanmar\r\n\r\nPhone: +95973150134\r\n\r\nThe map location in Booking.com and Maps.me is incorrect.  The correct map location is 21.133938, 94.856587.', 1, 5, 80, 1, 1, 0, '2018-11-21', NULL, NULL, '2018-11-22 10:29:09', '2019-02-23 17:31:47'),
(459, 1, NULL, NULL, NULL, 'Friday, Exploring Kandy, Sri Lanka', 'friday-exploring-kandy-sri-lanka--2018-11-02', NULL, 'In the morning, walked over to the Udawatta Kele Sanctuary and hiked around in the woods. There were lots of macaques at the entrance but only saw a little deer (barking deer?) after that.\r\n\r\nThere were nice views of the city and the big Buddha on the hilltop at Bahirawakanda Temple.\r\n\r\nI had the park to myself from about 09:00 to 10:00 then I started running into other people including a huge group of schoolgirls in uniform.\r\n\r\nAfter the park, I walked up the hill to the Bahirawakanda Temple. It was okay but the big white Buddha is best viewed from a distance.\r\n\r\nFor lunch I went to the Muslim Hotel Restaurant and had a delicious Basmathi with fried chicken. That\'s just a big plate of rice with a few vegetables and a boiled egg mixed in .\r\n\r\nI felt like they were trying to get rid of me and then the waiter said that they were closing for prayers since it was Friday at 13:00. They open again at 16:00.\r\n\r\nIn the afternoon I went to find where the buses to Dambulla and Sigiriya leave from. \r\n\r\nFor dinner I had another Basmathi at the Devon Restaurant because that was all that they had that I recognized.', 1, 5, 1, 0, 0, 1, '2018-11-02', NULL, NULL, '2018-11-03 05:29:45', '2018-11-03 05:31:01'),
(383, 1, 24, NULL, 1662, 'Kok Tobe Park', 'kok-tobe-park-almaty-kazakhstan-2018-10-01', NULL, 'Kok Tobe Park overlooks Almaty and is an enjoyable outing with nice views of the city and mountains.  Access to the park by the gondola / cable car costs 2000 tenge round-trip and the station is right off of Dostyk Avenue at map location: 43.242428, 76.958997.\r\n\r\nAt the top, there are carnival rides and games, a mini-zoo, souvenir stores, a big restaurant with outdoor seating, the Beatles monument, and miscellaneous other stuff to do.', 1, 5, 83, 1, 1, 0, '2018-10-01', NULL, NULL, '2018-10-01 10:07:16', '2019-02-23 08:56:33'),
(384, 1, 43, NULL, NULL, 'Hotel Moscow', 'hotel-moscow-dubai-uae-2018-10-02', NULL, ' \r\nAl Maktoum Street, Dubai, United Arab Emirates\r\n  (, )\r\n\r\nPhone: +97142288222\r\n\r\nMid-range hotel in Dubai with spacious and very comfortable rooms.  Good A/C and comfortable bed. \r\n Their WiFi policy is confusing.  WiFi is advertised as not being free in the rooms but the hotel may provide free access.  WiFi is always free in the lobby area.\r\n\r\nThe location is okay.  There isn\'t much around the hotel and it is a hot 500 meter walk to the Al Rigga metro station.  There are many stores and restaurants on Al Rigga street.', 1, 5, 93, 1, 1, 0, '2018-10-02', NULL, NULL, '2018-10-03 08:04:41', '2019-02-25 10:10:49'),
(385, 1, NULL, NULL, NULL, 'India Visa', 'india-visa', NULL, 'INDIAN e-VISA\r\n\r\nElectronic Travel Authorization (ETA)\r\n\r\nDear WILKINSON SCOTT BRANDON,\r\n\r\nYour application for Indian e-Visa has been processed with following result\r\n\r\n\r\nApplication ID :- I004VD130418\r\nPassport Number :- 505876561\r\nApplication Status :- Granted\r\nETA Number :- 901ABED8I\r\nNationality :- UNITED STATES OF AMERICA\r\nVisa Type :- e-Visa\r\nService Name :- eTOURIST VISA\r\nNo. of Entries :- Double\r\ne-Visa Validity period is 60 days from the date of first arrival in India.\r\nOn presentation of ETA to the Immigration Officer on your first arrival, an e-Visa stamp (valid for 60 days from the date of first arrival in India) would be endorsed on your passport.\r\nYour first arrival in India should be between October 02nd,2018 to January 30th,2019 .(Date format is DD/MON/YYYY)\r\nThe second entry for e-Tourist visa & e-Business visa and third entry for e-Medical Visa will be granted within the e-Visa validity period stamped on your passport\r\n\r\n\r\nFor any assistance contact e-VISA support center at indiatvoa@gov.in.\r\n\r\nFor Tele enquiries(IVRS enquiry) call at +91-11-24300666.Please use 00485683618 as key \r\n\r\nNote:\r\n- Please carry a copy of the ETA in this email at the time of your first arrival in India.\r\n\r\n- e-Visa is non-extendable, non-convertible & not valid for visiting Protected/Restricted and Cantonment Areas. If you intend to visit Protected/Restricted areas, you would require prior permission from the Civil Authority. Please visit here. for more information\r\n\r\n- Biometric details of the applicant will be mandatorily captured at Immigration on arrival in India.\r\n\r\n-Applicant must arrive with the same passport as mentioned above.\r\n-Applicant can arrive at 25 e-Visa designated airports i.e. Ahmedabad, Amritsar,Bagdogra, Bengaluru, Calicut, Chennai, Chandigarh, Cochin, Coimbatore, Delhi, Gaya, Goa, Guwahati, Hyderabad, Jaipur, Kolkata, Lucknow, Mangalore, Mumbai, Nagpur, Pune, Tiruchirapalli, Trivandrum , Varanasi, Vishakhapatnam and 5 designated seaports (i.e. Chennai, Cochin, Goa, Mumbai, Mangalore). However, he/she can depart from any of the authorized Immigration Check Posts in India.The second/third (only for e-Medical Visa) entries are to be availed within 60 days from your first arrival in India. \r\n-e-VISA is not allowed for employment, NGO/volunteer activities, journalism and conference purposes.\r\n-Once you have entered India, you will be subject to Indian Laws.\r\n-This electronic travel authorization does not entitle you for guaranteed entry into India. Your entry can still be refused at the time of arrival.\r\n-Please confirm that your ETA status is shown as GRANTED on our official website (https://indianvisaonline.gov.in/visa/tvoa.html) prior to commencement of your journey.\r\n-Applicant must carry YELLOW FEVER VACCINATION CARD if arriving from yellow fever affected countries.Please visit here\r\n- Passport should have at least six months validity from the date of arrival in India.', 1, 1, 0, 0, 0, 1, '2018-10-03', NULL, NULL, '2018-10-03 08:13:34', '2018-10-13 14:48:43'),
(386, 1, 43, NULL, NULL, 'Dubai, UAE', 'dubai-uae', NULL, NULL, 1, 8, 198, 1, 1, 0, '2018-10-04', NULL, NULL, '2018-10-04 16:23:25', '2019-02-24 16:23:19'),
(402, 1, 46, 105, 1769, 'Monday, India Gate, Qutb Minaret, and Humayun Tomb', 'monday-india-gate-qutb-minaret-and-humayun-tomb-delhi-2018-10-08', NULL, 'In the morning, I took the packed metro to the stop closest to the India Gate, Central Secretariat and then walked along the water in the park to the gate.  All along the little canal there were people hanging out and washing clothes and sleeping in the grass.  The India Gate wasn\'t very impressive because there was a construction fence around the area.\r\n\r\nNext I negotiated with a tuktuk driver to go all the way to the Qutb (Qutub) historical site that has the huge minaret and then to the Humayun Tomb.  It was a long drive to the Qutub site but well worth it.  Along with the huge minaret there are ruins of buildings and temples.\r\n\r\nAfter the Qutb visit I couldn\'t find my rickshaw driver.  I waited around for about 15 minutes and then I negotiated with another guy to go to the Humayun Tomb.  The tomb complex was better than expected and the main tomb building was huge and impressive.  A big group of young Indian guys wanted to take pictures with me so we took a bunch of pictures sitting on some steps.  \r\n\r\nAfter to tombs, I took a different tuktuk back to Connaught Place which is becoming my favorite area to walk around, eat, and have expensive tea.', 1, 4, 64, 1, 1, 0, '2018-10-08', NULL, NULL, '2018-10-10 19:17:34', '2019-02-24 16:26:21'),
(387, 1, 24, 105, 1663, 'Monday, Took the Cable Car up to Kok Tobe', 'monday-took-the-cable-car-up-to-kok-tobe-2018-10-01', NULL, 'In the morning, walked over to the cable car station which goes up Kok Tobe hill.  It had just opened so I was the only one going up.  I thought about walking up the hill but it is a lot farther than it looks.\r\n\r\nAt the top is a little amusement park.  There are nice views of Almaty and the mountains.  I tried to walk over to the Almaty Tower but it is separate from Kok Tobe and is fenced off.  Had coffee outdoors at the restaurant with sweeping views of the entire city.', 1, 4, 66, 1, 1, 0, '2018-10-01', NULL, NULL, '2018-10-05 08:37:33', '2019-02-16 00:17:25'),
(388, 1, 43, 105, 1722, 'Tuesday, Flew from Almaty to Dubai', 'tuesday-flew-from-almaty-to-dubai-2018-10-02', NULL, 'Had breakfast at the hotel and then checked out.  Took the cheapest Uber ever to the airport, about 3 USD.  It took about 30 minutes to get there.  It is a little airport and there were no lines so I breezed right through everything.\r\n\r\nThe flight on Air Almaty was only about one-third full so almost everyone had there own aisle which was glorious.  It was the first time in decades that I was able to lay down on a flight.  It was smooth all the way and there was some spectacular scenery of the mountains and desert.\r\n\r\nThe airport in Dubai is very close to the city so I took a taxi to the hotel after changing some money.  Hotel Moscow was only about 10 minutes from the airport.  It was nice being able to speak English with the taxi driver after three months of Chinese and Russian.\r\n\r\nChecked in to the hotel and headed out to see the Burj Khalifa.  The desert heat was intense and oppressive.  I bought a metro card at the Al Rigga metro station and went to the Dubai Mall / Burj Khalifa stop.  The subway was fast and not to crowded in the late afternoon.  The Burj was incredible and I was only asked to leave once when I got too close to the entrance to the private residences.\r\n\r\nAfter dark, I went to the Dubai Mall and looked around.  There were many souvenir shops so I bought some small stuff.  There is an enclosed, air-conditioned walkway with moving sidewalks from the mall to the subway station that is about 800 meters long (8 blocks).\r\n\r\nOn the way back to the hotel the metro was packed since it was rush hour.  In noticed that most of the store and hotel workers in Dubai are Filipinos.  There are also many Indians, Afghani\'s, and Pakistanis here to do all of the work.  There is also construction everywhere.', 1, 4, 69, 1, 1, 0, '2018-10-02', NULL, NULL, '2018-10-05 08:57:17', '2019-02-21 19:50:23'),
(389, 1, 43, 105, 1706, 'Wednesday, Hop On Hop Off Bus Tour All Day', 'wednesday-hop-on-hop-off-bus-tour-all-day-2018-10-03', NULL, 'Had an 8 USD coffee at the hotel and then walked over to the Al Ghurair mall to catch the City Sightseeing Dubai - Hop On Hop Off bus tour.  I did four of the routes which took almost all day.  It gave me a good overview of what there is to see in Dubai.  The tour was well worth it even though there was quite a bit of traffic so the bus was slow sometimes.  I only hopped off a few times to eat.  The best areas were the Souks, the beaches, the marina, and the Palm man-made island.', 1, 4, 64, 1, 1, 0, '2018-10-03', NULL, NULL, '2018-10-05 09:11:50', '2019-02-16 00:17:24'),
(390, 1, 43, 105, 1718, 'Thursday, The Old Souk and the Dubai Creek Boardwalk', 'thursday-the-old-souk-and-the-dubai-creek-boardwalk-2018-10-04', NULL, 'Went out early to avoid the heat.  First took the metro to the Al Ras stop and walked around the gold souk area and along the canal.  I wanted to take the water taxi across to the Old Souk area but the wait was too long since they have to wait for the boat to fill up with 20 people before they take off.  I took the metro across to the Al Ghubaibi stop and then walked around the Old Souk area and the canal where the water taxis where buzzing around. \r\n\r\nIn the evening took the metro to the Business Bay stop and walked over to the Dubai Creek boardwalk.  After dark there was some excellent skyline views with lit up buildings.', 1, 4, 73, 1, 1, 0, '2018-10-04', NULL, NULL, '2018-10-05 09:22:14', '2019-02-23 07:49:53'),
(391, 1, 46, NULL, NULL, 'New Delhi Airport Metro Express', 'india-new-delhi-airport-metro-express-2018-10-06', NULL, 'There is a special airport subway line called the Delhi Airport Metro Express which connects the airport to the New Delhi Railway Station, Map Location: 28.643471, 77.222771.  At the airport, the metro entrance is at Terminal 3 or at Delhi Aerocity station (which is in between the Aerocity Hotels and Mahipalpur Junction).', 1, 5, 78, 1, 1, 0, '2018-10-06', NULL, NULL, '2018-10-06 21:17:02', '2019-02-16 00:17:24'),
(392, 1, 43, NULL, NULL, 'Dubai Metro Map', 'uae-dubai-metro-map-2018-10-06', NULL, 'The Dubai Metro has two lines, the red line and the green line.  The red line runs parallel to the coast and the green line loops around the Old Dubai and canal area.  There is also a connection to the Dubai tram line in Dubai Marina.\r\n\r\nThe Metro fare depends on how many zones are crossed.  The base price for 1 zone is less than 1 USD.  Multi-ride tickets are available.\r\n\r\nThe easiest way to use the Dubai Metro is to buy a Nol card which is a re-loadable smart-card.  The Nol Card can be used to travel on Dubai\'s Metro, Buses, Water Buses, Dubai Tram as well as pay for RTA\'s Paid Parking.', 1, 5, 90, 1, 1, 0, '2018-10-05', NULL, NULL, '2018-10-06 21:17:34', '2019-02-21 22:56:37'),
(393, 1, NULL, NULL, NULL, 'Abu Dhabi', 'abu-dhabi--', NULL, NULL, 1, 8, 0, 0, 0, 1, '2018-10-06', NULL, NULL, '2018-10-07 00:23:33', '2018-10-07 00:25:26'),
(394, 1, 44, NULL, NULL, 'Abu Dhabi, UAE', 'abu-dhabi-uae', NULL, NULL, 1, 8, 132, 1, 1, 0, '2018-10-06', NULL, NULL, '2018-10-07 00:23:33', '2019-02-25 19:51:49'),
(395, 1, NULL, NULL, NULL, 'Things to do in New Delhi', 'things-to-do-in-new-delhi-india-2018-10-07', NULL, '[Delhi TukTuk Ride](https://youtu.be/721n31yWDu8)\r\n\r\nThe Red Fort\r\n\r\nJama Mosque\r\n\r\nChandi Chowk Market\r\n\r\nConnaught Place \r\n\r\nJanpath Market (souvenirs)\r\n\r\nFood and Drink\r\n\r\n- Masala Chai\r\n- Aachar (pickled fruits and vegetables)\r\n- Mathri Salty Crackers (for the aachar)', 1, 5, 5, 0, 0, 1, '2018-10-07', NULL, NULL, '2018-10-07 12:43:07', '2018-11-07 07:43:01'),
(396, 1, 46, NULL, NULL, 'New Delhi, India', 'new-delhi-india', NULL, NULL, 1, 8, 190, 1, 1, 0, '2018-10-07', NULL, NULL, '2018-10-07 17:58:30', '2019-02-22 15:40:03'),
(397, 1, 46, NULL, NULL, 'Hotel Tashkent Palace', 'hotel-tashkent-palace-new-delhi-india-2018-10-07', NULL, '2710, Chuna Mandi, Paharganj\r\nNew Delhi, India\r\n\r\nMap Location: 28.643683, 77.211093\r\n\r\nNice and comfortable hotel but it is located in a depressing slum area with trash everywhere.  A hotel in the Connaught Place area would be much better.', 1, 5, 75, 1, 1, 0, '2018-10-07', NULL, NULL, '2018-10-07 18:21:54', '2019-02-16 00:17:24'),
(398, 1, 44, 105, 1772, 'Saturday, All Day Tour to Abu Dhabi from Dubai', 'saturday-all-day-tour-to-abu-dhabi-from-dubai-united-arab-emirates-2018-10-06', NULL, 'The van from the Rayna Tours picked me up at the Hotel Moscow at 08:30.  We picked up a few more people and then met the big tour bus of the south side of Dubai.  It was about a two hour drive to Abu Dhabi.  \r\n\r\nThere are seven emirates in the United Arab Emirates and each one is like a little separate country.  Abu Dhabi is the capital and isn\'t as touristy as Dubai.  We went by the huge palaces of the important wives and relatives of the Sheikh and the most expensive hotel in the world, the Abu Dhabi Emirates Palace Hotel.\r\n\r\nThe most interesting stop was at the massive and incredible Sheikh Zayed Mosque, the largest mosque in the country, which can accommodate 40000 worshipers.\r\n\r\nWe also stopped at a few other places and at the beach for photos.  We had lunch at a buffet place with a lot of Indian dishes which was delicious.\r\n\r\nBy the time I got back to the hotel it was 20:00.  I messed around for a few hours and then took a taxi the short ride to the airport for my flight to India.', 1, 4, 73, 1, 1, 0, '2018-10-06', NULL, NULL, '2018-10-09 11:10:35', '2019-02-25 10:28:36'),
(399, 1, 43, 105, 1727, 'Friday, Dubai Marina Beach', 'friday-dubai-marina-beach-united-arab-emirates-2018-10-05', NULL, 'In the afternoon, I took the metro to the Dubai Marina stop and then walked through the marina area and to the beach.', 1, 4, 66, 1, 1, 0, '2018-10-05', NULL, NULL, '2018-10-09 11:20:29', '2019-02-25 15:46:15'),
(400, 1, 46, 105, 1754, 'Sunday, Flight from Dubai to New Delhi and First Day in India', 'sunday-flight-from-dubai-to-new-delhi-and-first-day-in-india-2018-10-07', NULL, 'The overnight flight to New Delhi from Dubai was pack with Indians taking merchandise to India to sell.  There were long lines at the check-in counter and took me about 45 minutes to get to the counter.  \r\n\r\nThe airline guy said I needed a print out of my India visa and I explained to him that there was no document just an ID number for the visa.  He finally accepted that after going to check with someone.  Next he wanted an onward ticket which I didn\'t have since no one else has asked for one.  Luckily there was free WiFi at the airport so I quickly booked a refundable flight to Kathmandu and he accepted that.  As soon as I got to India I cancelled the flight.\r\n\r\nThe three hour flight to India was packed and left five minutes after midnight (00:05) on Sunday morning and arrived in New Delhi at 04:45.  In Delhi there was a separate immigration line with very few people for foreigners with the e-visa .  Most of the immigration agents were asleep so I had to wake a guy up.  Immigration was easy but baggage claim took forever.  My backpack was one of the last items to come out.  I was killing time anyway since I knew my room wouldn\'t be ready this early.\r\n\r\nOnce I was through customs I had a coffee and got some cash from an ATM.  I also tried to buy a SIM card but the guys said they couldn\'t activate the card until after 18:00 since it was Sunday.\r\n\r\nI took a fixed-price taxi for the long ride to the hotel for 150 rupees / 2 USD.  The taxi was extra cheap because they will take you to a tour office and get a percentage of any tour that you book.  I had time to kill so I agreed to go to the tour office which was walking distance to the hotel.  I got a lot of good tour info and then turned down the expensive package.  The taxi driver hung around the whole time and then took me the rest of the way to the hotel.  My room wasn\'t ready for another hour or two so I nodded off on the couch in the lobby and waited.', 1, 4, 71, 1, 1, 0, '2018-10-07', NULL, NULL, '2018-10-09 11:57:29', '2019-02-22 21:26:03'),
(401, 1, 47, NULL, NULL, 'Agra, India', 'agra-india', NULL, NULL, 1, 8, 259, 1, 1, 0, '2018-10-10', NULL, NULL, '2018-10-10 18:40:23', '2019-02-25 21:05:52'),
(403, 1, NULL, NULL, NULL, 'Tuesday, Connaught Place', 'tuesday-connaught-place-2018-10-09', NULL, 'Had lunch at Saravana Bhavan\r\n\r\nBooked 8 day tour\r\n\r\nBathroom issue while booking tou', 1, -1, 2, 0, 0, 0, '2018-10-09', NULL, NULL, '2018-10-10 19:21:30', '2018-10-13 05:21:35'),
(404, 1, NULL, 105, NULL, 'Tuesday, Connaught Place', 'tuesday-connaught-place-2018-10-09', NULL, 'Had lunch at Saravana Bhavan\r\n\r\nBooked 8 day tour\r\n\r\nBathroom issue while booking tour', 1, 4, 0, 0, 0, 1, '2018-10-09', NULL, NULL, '2018-10-10 19:23:47', '2018-11-01 19:43:33'),
(405, 1, 47, 105, 1786, 'Wednesday, Delhi to Agra and Taj Majal Tour', 'wednesday-delhi-to-agra-and-taj-majal-tour-2018-10-10', NULL, 'The driver picked me up at 07:30 and we headed off to Agra.  He made a few stops to mess around along the way and we get there at about 11:30.  I checked in to the hotel and then he picked me up at 15:00 to go to the Taj Mahal.  The tour included a guide so he was with us.  \r\n\r\nAt the Taj Mahal the guide tried to get me to pay for my ticket which was already included in the tour.  He bought my ticket but I got rid of him and enjoyed the Taj on my own without anymore aggravation.   I spent about three hours there.  Lots of Indians wanted to take pictures with me so I did a lot of that.  It\'s always the guys who want pictures never the ladies unfortunately.\r\n\r\nThe Taj was superb and as good as expected.  One side is bordered by the Yamuna River.  At the river bank there were monkeys and stray dogs running around and causing general mischief.  There were also green parrots with long tails all over the place.\r\n\r\nAfter dark I went back to the hotel and hopped in to the rooftop pool for awhile.', 1, 4, 67, 1, 1, 0, '2018-10-10', NULL, NULL, '2018-10-11 06:42:32', '2019-02-20 16:24:10'),
(406, 1, 47, NULL, NULL, 'Radisson Blu Agra Taj East Gate', 'radisson-blu-agra-taj-east-gate-2018-10-10', NULL, 'Taj East Gate Road, Uttar Pradesh, Agra, India\r\n\r\nMap Location: 27.162633, 78.056308 \r\n\r\nPhone: +91 562 233 5555\r\n\r\nVery comfortable, high-end hotel located very close to the Taj Mahal East Gate.  Features an excellent Location, A/C, Hot Water, and WiFi.  The rooms have a flat screen TV with satellite channels, a desk, sofa, and bathtub.  The property has a restaurant, a tea room, a club and a rooftop swimming pool with a view of the Taj Mahal.', 1, 5, 83, 1, 1, 0, '2018-10-10', NULL, NULL, '2018-10-11 14:00:50', '2019-02-16 18:26:42'),
(407, 1, 47, NULL, 1807, 'Taj Mahal Entry Fee, Hours, and Best Viewing', 'taj-mahal-entry-fee-hours-and-best-viewing-2018-10-10', NULL, 'For foreigners the entry fee for the Taj Mahal site is 1100 rupees.\r\n\r\nThe opening and closing times are the following:\r\n\r\nEast and West Gate: Opening Time\r\n\r\nTicket Counter: 1 hour before sunrise\r\nEntry Gate: 30 minutes before sunrise\r\n\r\nEast and West Gate: Closing Time\r\n\r\nTicket Counter: 45 minutes before sunset\r\n\r\nEntry Gate: 30 minutes before sunset\r\n\r\nThe best light for photographing the front of the Taj Mahal inside the complex is in the late afternoon.\r\n\r\nThe best light for photographing the river side of the Taj Mahal is in the morning.  There is a primitive boat that will give a small photo tour of the river side for around 150 to 200 rupees per person.  It is outside of the East Gate of the Taj Mahal complex, down the small road toward the river at Map Location: 27.175809, 78.043826.\r\n\r\nThere is also a viewpoint in a park across the river called Mehtab Bagh at Map Location: 27.178341, 78.040625.  The entry fee is 250 rupees.  The views from there aren\'t as good as the views from the boat.', 1, 5, 148, 1, 1, 0, '2018-10-10', NULL, NULL, '2018-10-11 14:16:55', '2019-02-25 21:55:35'),
(408, 1, 47, NULL, 1812, 'The Agra Fort Entry Fee and Open Hours', 'the-agra-fort-entry-fee-and-open-hours-2018-10-11', NULL, 'The entry fee to the Agra Fort for foreigners is 550 rupees.  \r\n\r\nThe operating hours for the fort are:\r\n\r\nEvery day from Sunrise to Sunset', 1, 5, 87, 1, 1, 0, '2018-10-11', NULL, NULL, '2018-10-11 14:34:13', '2019-02-22 16:49:48'),
(409, 1, 47, 105, 1817, 'Thursday, All Day Touring Agra India', 'thursday-all-day-touring-agra-india-2018-10-11', NULL, 'After breakfast at the hotel, I walked to the east gate of the Taj Mahal and then took a little side road down to the river.  The little flat top river boat was leaving with a couple so I quickly negotiated with the driver and hopped aboard.  I got him down from 500 rupees to 200 but later found the the couple only paid 150 per person.  They paddled the boat over to the front of the Taj Mahal so we could take pictures.  The view was okay but the river water wasn\'t very photogenic.\r\n\r\nAfter the boat ride I hung around and took photos of the macaques around the river.  They were baby monkeys playing and fighting all around.  These macaques weren\'t interested in stealing my stuff like the other Asian monkeys.\r\n\r\nOne fun thing about India is that there are animals running around all over the place.  There are water buffaloes in the rivers, cows in the street, little miniatures donkeys, horses pulling carts, an occasional camel beside the road, macaques on the rooftops and in the trees, chipmunk squirrels everywhere, a few rats, stray dogs barking and crapping everywhere, huge Black Kites soaring around, and bright green parrots with long tails screeching and flying around.\r\n\r\nI walked back out to the main road and caught a Auto-rickshaw to the Agra Fort and spent about an hour there.  All of the temples and forts are starting to look the same to me.  There were some nice views of the Taj Mahal in the distance.  One of the gardeners gave me some sugar or something to feed the chipmunks which they call squirrels.  The chipmunks were everywhere and would hop into your hand to eat the stuff.\r\n\r\nAfter the fort I took another tuktuk all the way to the other side of the river to a viewpoint in a park called \'\'Mehtab Bagh\" which was right across the river from the Taj Mahal.  There was charge for entering the park even though it was in the middle of nowhere.  There was also a guy giving camel rides to tourists.\r\n\r\nIn the afternoon I spent some time at the hotel at the rooftop pool.  At about 17:00 a storm rolled in and the wind started blowing but it never rained.', 1, 4, 82, 1, 1, 0, '2018-10-11', NULL, NULL, '2018-10-12 05:58:29', '2019-02-20 10:24:59'),
(410, 1, 48, NULL, NULL, 'Ranthambhore Siddhi Vinayak Resort', 'ranthambhore-siddhi-vinayak-resort-india-2018-10-12', NULL, 'Budget hotel with good A/C, good WiFi, limited hot water, swimming pool, and a decent restaurant.\r\n\r\nLocated in Sawai Madhopur, near Ranthambore National Park\r\n\r\nTelephone: +91 7462-222293\r\n\r\nMap Location: 26.019429, 76.374564', 1, 5, 85, 1, 1, 0, '2018-10-12', NULL, NULL, '2018-10-13 10:34:18', '2019-02-17 01:54:45'),
(411, 1, 48, NULL, 1846, 'Ranthambhore National Park', 'ranthambhore-national-park-india-2018-10-13', NULL, 'The former hunting grounds of the Maharajas of Jaipur, this large national park is full of animals.  \r\n\r\nSafaris can be booked through the hotels and they are either gypsy (normal jeep with raised bench seats for 6) or canter (large open truck with seats).  The vehicle will pick up at the local hotels. \r\n\r\nPrices for the safari are around 2000 rupees and include entry to the park.\r\n\r\nThere are morning tours and evening tours with the following hours:\r\n\r\n1st October to 31st October: 6.30 am to 10.00 am / 2.30 pm to 6.00 pm\r\n1st November to 31st January: 7.00 am to 10.30 am / 2.00 pm to 5.30 pm\r\n1st February to 31st March: 6.30 am to 10.00 am / 2.30 pm to 6.00 pm\r\n1st April to 15th May: 6.00 am to 9.30 am / 3.00 pm to 6.30 pm\r\n15th May to 30th June: 6.00 am to 9.30 am / 3.30 pm to 7.00 pm', 1, 5, 81, 1, 1, 0, '2018-10-13', NULL, NULL, '2018-10-13 11:28:12', '2019-02-16 00:17:23'),
(412, 1, 48, NULL, NULL, 'Ranthambhore N.P., India', 'ranthambhore-national-park-india', NULL, NULL, 1, 8, 137, 1, 1, 0, '2018-10-13', NULL, NULL, '2018-10-13 11:29:51', '2019-02-25 13:48:03'),
(413, 1, 48, 105, 1857, 'Saturday, Morning Tiger Safari at Ranthambhore National Park', 'saturday-morning-tiger-safari-at-ranthambhore-national-park-india-2018-10-13', NULL, 'The jeep for the tiger safari picked me up at the hotel at 06:30.  I was the last person picked up so we headed to Ranthambhore National Park which was about a 20 minute drive to the other side of Sawai Madhopur.  We were in a regular size jeep with built up seats but there were other tours in big open trucks.\r\n\r\nWe were one of the first jeeps out there but were soon joined by many others.  We didn\'t see any tigers but we saw Peacocks, Axis Spotted Deer, Chinkara Gazelles, the big Sambar Deer, Gray Langur Monkeys, and some colorful birds.  I asked the guide how often they saw tigers and he said not very often and that it\'s been a long time since he has seen one.\r\n\r\nThe tour lasted until about 10:00 and then we got dropped off at our hotels for breakfast.', 1, 4, 82, 1, 1, 0, '2018-10-13', NULL, NULL, '2018-10-13 18:57:32', '2019-02-17 09:02:38'),
(414, 1, NULL, NULL, NULL, 'Things to do in Jaipur', 'things-to-do-in-jaipur-india-2018-10-14', NULL, 'Jaigarh Fort - Part of ???\r\n\r\nJal Mahal - Water Temple\r\n\r\nNahargarh Fort - Ensure youve arranged for your auto driver to wait for you; Nahargarh Fort is about a 40 minute auto ride from the centre of Jaipur (its an 8km circuitous trip).  [Open 9am to 5:30pm every day. Foreigner ticket is Rs200 and children under 12 are free]\r\n\r\nHawa Mahal - \r\n\r\nCity Palace -', 1, 5, 5, 0, 0, 1, '2018-10-14', NULL, NULL, '2018-10-14 18:32:45', '2018-11-07 07:43:31'),
(415, 1, 48, 105, 1867, 'Sunday, Another Tiger Safari in Ranthambhore National Park', 'sunday-another-tiger-safari-in-ranthambhore-national-park-2018-10-14', NULL, 'Went on another safari in Ranthambhore.  This time I went in the big tour truck and we went to a different park entrance.  This side was more interesting and we saw a few new animals including some big monitor lizards, owls in hollow trees, several crocodiles, and a nice big leopard.\r\n\r\nThe leopard was outside of the park along the entrance road that goes to the fort.  I couldn\'t get a good photo of it but we got a good look at it as it walked through the thick woods along the road.  The guide said he saw a tiger near the leopard but nobody else saw it.  I\'m not sure what that was all about.\r\n\r\nThis part of the national park is where the impressive Ranthambore Fort is located.  Note that Ranthambhore is spelled both ways: Ranthambhore and Ranthambore.  The fort would be worth going to separately.  The big lake with crocodiles and lots of water birds is also in this area.\r\n\r\nAfter the tour and after breakfast at the hotel, we made the four hour drive to Jaipur.  After checking in to the hotel, I took a tuktuk to the City Palace but it was closing so I went to Jal Mahal, the Water Palace which is a little outside of the city.  Jaipur looks very interesting.', 1, 4, 74, 1, 1, 0, '2018-10-14', NULL, NULL, '2018-10-14 21:31:35', '2019-02-21 08:55:56'),
(416, 1, 49, NULL, NULL, 'Polo Inn And Suites', 'polo-inn-and-suites-jaipur-india-2018-10-14', NULL, 'The name of this hotel on Booking.com is \'Capital O 7830 Hotel Polo Inn And Suites\' but on the hotel it just says \'Polo Inn And Suites\'.\r\n\r\nHSB House, C 24, Bhagwaan Das Road, Jaipur, India\r\n\r\nMap Location: 26.913528, 75.807627\r\n\r\nPhone: +91 93139 31393\r\n\r\nVery nice mid-range hotel with good A/C, WiFi, and Hot Water.  Good location close to the center of Jaipur.  Breakfast is included.', 1, 5, 89, 1, 1, 0, '2018-10-14', NULL, NULL, '2018-10-14 21:38:47', '2019-02-22 09:19:35');
