(417, 1, 49, 105, 1886, 'Monday, Spent All Day Touring Jaipur, India', 'monday-spent-all-day-touring-jaipur-india-2018-10-15', NULL, 'First went to Amer Fort and got there at about 10:00.  It wasn\'t crowded yet but by the time I left it was packed.  This fort has very interesting architecture and great views of Jaipur from the top of the hill.  There are usually elephant rides up to the top but there were none today because of a festival or something.  The fort is a must-see attraction in Jaipur.\r\n\r\nSince there were no elephants at the fort and my tour included an elephant ride we went to the elephant\'s house and rode her around in a little open area in the neighborhood.  They also offer the deluxe package where you can paint the elephant then ride it and then feed it bananas.  I opted to just ride it.  One of the guides had my big camera and he took mostly horrible photos as usual.\r\n\r\nAfter the elephant ride we went for lunch at a tourist restaurant called The Green Pigeon.  It was a little expensive but had very good, clean food and drink.\r\n  \r\nAfter lunch, we stopped at a Block Printing Textile factory for a quick tour and sales pitch.  The driver\'s get commission if the tourists buy anything so they always want to stop at these places.\r\n\r\nBlock Printing is done by dipping a wooden block with a pattern on it into some organic ink and stamping the cloth with it repeatedly until it is covered.  Each block must be lined up precisely with the previous stamp.  They repeat the process many time with different blocks and different colors until the pattern is finished.\r\n\r\nThe next stop was the Monkey Temple which is at the top of a hill and you have to walk up to it.  All of the monkeys were in the shade along the path and none were in the temple.  There were great views of Jaipur all along the path and from the temple.  There were also the usual hawkers along the way including a guy with a cobra in a basket.  The cobra charmer called his little tiny kid over to play with the cobra to show that it was harmless.  The cobra would strike but they had pulled out his teeth.\r\n\r\nOn the way back from the Monkey Temple, I got off at the Hawa Mahal - Wind Palace and let the driver go home.  I took some pictures of the palace from a store across the street and upstairs with a nice view.\r\n\r\nFrom there caught a tuktuk to Nahargarh Fort for the sunset.  The driver didn\'t know how to get there and went to the bottom of the hill instead of driving up to the entrance on the other side of the hill.  I asked him to wait and I hiked all the way up the hill and looked around.  It wasn\'t really worth going into the fort since the views on the way up were just as good.\r\n\r\nAfter the fort I had figured out that the tuktuk driver didn\'t know his way around so I guided him all the way to my hotel with my phone and the maps.me app.', 1, 4, 113, 1, 1, 0, '2018-10-15', NULL, NULL, '2018-10-15 18:28:40', '2019-02-25 02:48:56'),
(418, 1, 49, NULL, NULL, 'Jaipur, India', 'jaipur-india', NULL, NULL, 1, 8, 210, 1, 1, 0, '2018-10-15', NULL, NULL, '2018-10-15 19:50:58', '2019-02-25 19:44:05'),
(419, 1, 50, NULL, NULL, 'Jodhpur, India', 'jodhpur-india', NULL, NULL, 1, 8, 239, 1, 1, 0, '2018-10-16', NULL, NULL, '2018-10-16 17:32:16', '2019-02-25 09:17:24'),
(420, 1, 50, NULL, NULL, 'Kings Retreat Jodhpur', 'kings-retreat-jodhpur-india-2018-10-16', NULL, 'Naya Baas, Killi Khana, Clock Tower Area, Jodhpur, India\r\n\r\nMap Location: 26.297043, 73.021643\r\n\r\nPhone: +919799855417\r\n\r\nMid-range hotel very close to the clock tower and below the Mehrangarh Fort with Good WiFi, Hot Water, and A/C.  Has a nice roof-top restaurant with superb views of the Fort.', 1, 5, 93, 1, 1, 0, '2018-10-16', NULL, NULL, '2018-10-16 20:30:29', '2019-02-23 16:39:36'),
(561, 1, NULL, NULL, NULL, 'Dos Mil 19', 'dos-mil-19-2019-01-01', NULL, 'Blog 2019', 1, 3, 1, 0, 0, 0, '2019-01-01', NULL, NULL, '2019-01-11 19:05:37', '2019-01-14 19:43:47'),
(562, 1, NULL, 561, NULL, '2019, January', '2019-january-2019-01-01', NULL, '1/1, Tuesday\r\n\r\nGot up at 07:30 and walked over to Walmart to buy a car battery charger.  Got one and walked back.  It didn\'t have enough charge to turn over the car.  Steve came over later and jumped the car and we took it to Walmart to buy a new battery and change the oil.\r\n\r\nWhen we got home, Mom freaked out and had a panic attack because of the cold weather.  I took her to the urgent care place because she said she couldn\'t breathe and thought she would pass out.  She made the usual crazy spectacle at the clinic and tried to argue with everybody.  They measured her blood oxygen and she didn\'t have a breathing problem.  She said that she stopped taking her meds so that may have been the problem.  She calmed down after we got home so I didn\'t have to fill the prescription for knock-out pills to calm her down and put her to sleep.\r\n\r\n1/2, Wednesday\r\n\r\nBoiled eggs for breakfast and then went to Starbucks to avoid mom\'s helper who is supposed to come at 0900.\r\n\r\n1/3, Thursday\r\n\r\nMom and I started packing up her stuff so we could move it out to the garage for her remodel.\r\n\r\n1/4, Friday\r\n\r\nSpent all day finishing packing Mom\'s stuff in each room into boxes.\r\n\r\nThe remodel will take about 3 weeks.  I reserved a suite at the Holiday Inn for a week for about $820 and put it on Mom\'s credit card.\r\n\r\n1/5, Saturday\r\n\r\nThe two Guatemalans came over at about 8:30 and we moved all of the furniture into the garage and into the POD we rented for a month.  It only took us about 2.5 hours.\r\n\r\nIn the afternoon, we went to the Holiday Inn Express on the other side of Edmond.  I took the bedroom and Mom took the crappy couch so she could be close to the bathroom.\r\n\r\n1/6, Sunday\r\n\r\nFirst day at the hotel with breakfast buffet included.  The breakfast was pretty good and they had a pancake machine that pumped out pancakes. \r\n\r\n1/7, Monday\r\n\r\nMom\'s helper, Brianna, came over at 0900 and took her out until 1300.  Later Barkley came over and took us to Walgreen\'s to fill her prescriptions.  We went by the house to pick up my deliveries and she freaked out because we wouldn\'t let her go in and bother the workers.\r\n\r\nWatched the NCAAF Championship game between Alabama and Clemson, 44-16, Clemson.\r\n\r\n1/8, Tuesday\r\n\r\nMom was up wandering around at 0200 when I went to the bathroom.  Had to get her up so Brianna could take her to the dentist at 10:00.  I brought her some food from the buffet breakfast since she couldn\'t make it downstairs in time.\r\n\r\n1/9, Wednesday \r\n\r\nWent to Java Dave\'s for a few hours and then took Mom to the denture place at 14:30.  We found out that she has to have all of her teeth pulled out.', 1, 4, 10, 0, 0, 0, '2019-01-01', NULL, NULL, '2019-01-11 19:07:09', '2019-01-14 19:47:22'),
(421, 1, 50, 105, 1916, 'Tuesday, Drove from Jaipur to Jodhpur', 'tuesday-drove-from-jaipur-to-jodhpur-india-2018-10-16', NULL, 'Checked out of the Polo Inn and Suites in Jaipur at 08:30.  The driver picked me up and we headed out for the seven hour drive to Jodhpur, the Blue City.\r\n\r\nTraffic was light and we got out of Jaipur pretty fast.  On the way we stopped for lunch at a tourist place and I had a delicious chicken tika masala.\r\n\r\nWe arrived in Jodhpur at around 16:00 and found the Kings Retreat Hotel which is a few blocks from the clock tower at the center of Jodhpur.  The hotel has an open rooftop restaurant with epic views of the fort.', 1, 4, 72, 1, 1, 0, '2018-10-16', NULL, NULL, '2018-10-17 07:47:06', '2019-02-22 20:19:28'),
(422, 1, 50, 105, 1919, 'Wednesday, Spent All Day Touring Jodhpur', 'wednesday-spent-all-day-touring-jodhpur-india-2018-10-17', NULL, 'In the morning, walked up to the Mehrangarh Fort which was very close to the hotel.  I got an audio-guide and walked all through the huge fort.  I ended up in the temple line and got a red dot painted on my forehead.  For the rest of the day everybody commented that I had been to the temple.  The fort had some nice views of Jodhpur and the blue city.  I got to the fort at about 0900 and by the time I was leaving it was getting real crowded with large groups of schoolkids.  \r\n\r\nAfter the fort, I walked over to the White Palace, which is very close.  It was okay and had nice views of the fort.  \r\n\r\nI walked back down the hill to the hotel and got lost for a few minutes after taking a wrong turn in the maze of alleys.  My phone GPS wouldn\'t lock in to my exact location.\r\n\r\nIn the afternoon, took a tuktuk to the Umaid Bhawan Palace which was a bust and had no views and no good photo opps.\r\n\r\nHad dinner at the hotel again at the fabulous rooftop restaurant.  The electricity in the whole city went out for awhile so sat there in darkness and watched the candles come on around the city.', 1, 4, 61, 1, 1, 0, '2018-10-17', NULL, NULL, '2018-10-19 06:15:43', '2019-02-24 10:10:38'),
(423, 1, 50, 105, 1957, 'Thursday, All Day Drive from Jodhpur to Delhi', 'thursday-all-day-drive-from-jodhpur-to-delhi-2018-10-18', NULL, 'We left at 06:30 for the 12 hour driver back to Delhi.  The drive was uneventful and we had lunch in Jaipur at the same Green Pigeon restaurant.  When we got close to Delhi there was a massive traffic jam and the last 5 km took about an hour.  My hotel was near the airport which so we didn\'t have to actually go into Delhi.', 1, 4, 58, 1, 1, 0, '2018-10-18', NULL, NULL, '2018-10-19 06:19:58', '2019-02-16 00:17:22'),
(424, 1, NULL, NULL, NULL, 'Pashupatinath and Boudhanath', 'pashupatinath-and-boudhanath-2018-10-19', NULL, 'Walk to Patan Dhoka (Patan\'s Gate) about ten minutes from the Durbar Square, and get a taxi to Pashupatinath. How long the ride takes depends on the traffic; it could be as little as twenty minutes, or as long as an hour.\r\n\r\nPashupatinath is the holiest Hindu site in Nepal: it\'s where many Nepali Hindus come to die. On the banks of the holy Bagmati River, temples and cremation ghats (burning platforms) make for a somber but fascinating visit. Non-Hindus are not allowed in the temples themselves, but there are plenty of outdoor areas to explore. Cross the river to meet the colorful sadhus (holy men), who will let you take their pictures for a fee. (For more on local standards for tipping and currency in Nepal, check out this article.)\r\n\r\nAfter these classic photo ops, head uphill to the temples surrounded by parkland. According to Hindu tradition, this is where Lord Shiva, one of the principal Hindu deities, frolicked during his incarnation as a deer.\r\n\r\nOnce you\'ve finished exploring Pashupatinath, walk or take a taxi to nearby Boudhanath. Note that the walk takes around half an hour, and depending on traffic, it may be faster than driving.\r\n\r\nBoudhanath (Boudha for short) is the center of Tibetan Buddhism in Kathmandu. Many Tibetan Buddhist refugees and their descendants live in the Boudha area, as well as foreigners who come to learn about Tibetan Buddhism. At the heart of Boudha is a huge stupa (a mound-like structure that\'s used as a meditation space). It\'s considered the holiest Tibetan Buddhist site outside of Tibet. Aim to be at Boudha around dusk, or stay till the sun goes down: this is when the devout come to say their prayers and circumambulate the stupa. Note: even as a tourist, you should always walk clockwise around the stupa and all other Buddhist sites.\r\n\r\nSave some time for shopping: Boudha is an excellent place to pick up a few souvenirs. Popular items include prayer flags, incense, Tibetan-inspired jewelry, traditional paintings, and pashmina scarves. Read more here on shopping in Kathmandu.', 1, 5, 1, 0, 0, 1, '2018-10-19', NULL, NULL, '2018-10-19 18:05:12', '2018-10-24 07:08:18'),
(425, 1, 52, NULL, NULL, 'Kathmandu, Nepal', 'kathmandu-nepal', NULL, NULL, 1, 8, 199, 1, 1, 0, '2018-10-19', NULL, NULL, '2018-10-19 19:16:07', '2019-02-25 19:23:57'),
(426, 1, NULL, 105, 1940, 'Friday, Flew from New Delhi to Kathmandu, Nepal', 'friday-flight-from-new-delhi-to-kathmandu-nepal-2018-10-19', NULL, 'Left the airport hotel at about 07:30. The Uber driver got lost on the 3 km drive to the airport and I had to guide him in. He kept saying \"I\'m new\", \"I\'m new\".\r\n\r\nGot to terminal 3 and got through everything in about 45 minutes.They didn\'t ask for an onward ticket even though I had a real one for a change.\r\n\r\nSecurity was extra strict and slow and they took away my little tiny bathroom scissors.  I attempted to get some Nepal rupees at the currency exchange counter but they said that Indian rupees can be used in Nepal.  I found out later that it is true that they will grudgingly accept Indian rupees in Nepal.\r\n\r\nWhen we got close to Kathmandu, the airplane corkscrewed it\'s way down and then landed.  During that here were some epic views of the huge mountains poking through the clouds and then the green terraces of the Kathmandu Valley.\r\n\r\nImmigration was a slow mess for foreigners because they have self-service machines which are hard to use, don\'t work very well, and take forever to enter all of the required information.\r\n\r\nI took a taxi to the hotel which was right in the middle of the tourist area in Thamel.  It was really touristy with tons of souvenir shops, restaurants, bars, and coffee shops.  I had street food for lunch and dinner.', 1, 4, 64, 1, 1, 0, '2018-10-19', NULL, NULL, '2018-10-19 19:41:48', '2019-02-23 06:08:05'),
(427, 1, 52, 105, 1963, 'Saturday, Spent All Day Exploring Kathmandu', 'saturday-spent-all-day-exploring-kathmandu-2018-10-20', NULL, 'After breakfast at the hotel, I started the day at 08:00 by walking from my hotel in Thamel down to the Kathmandu Durbar Square (Map Location: 27.704233, 85.306768).  I came in the back way so didn\'t even realize that you have to buy a 1000 rupee ticket just to walk through the square.  There was a lot of damage from the 2015 earthquake so many of the buildings are propped up and have scaffolding so they aren\'t very photogenic.\r\n\r\nNext, I took a taxi for 500 rupees to the Patan area where the other big square is, Patan Durbar Square.  It had some interesting temples and a lot of pushy guides hawking their services.  I paid the 1000 rupee entry to the square.  I also walked up to the Golden Temple and then took a taxi to Pashupatinath which is near the airport at Map Location: 27.710659, 85.348575.\r\n\r\nPashupatinath is the holiest Hindu site in Nepal.  It\'s a complex of temples along the Bagmati River.  The main attraction here is the cremation platforms where they burn bodies.  While I was there, there were four or five burning and farther up they were preparing two more bodies to burn.\r\n\r\nAcross the river there were some holy men who had their faces painted and were asking for ridiculous amounts of money to take pictures.  The \"holy men\" seemed to be making a lot of money.\r\n\r\nI climbed up the stairs and followed the path past more temples and then past a deer park.  I went out the back way, crossed a little bridge across the river, and then walked a couple of kilometers to Boudhanath where Tibetan Buddhism is practiced.  There is a huge white stupa there that is taller than the surrounding buildings.  You can see the stupa as you exit the Pashupatinath area to the northeast.\r\n\r\nAround the stupa is a circle of tall narrow buildings that are hotels, restaurants, and souvenir shops.  It is a nice area to spend some time and eat and have tea.  I had an excellent chicken curry at a Thai place.  Entry to the stupa complex is 400 rupees.  The stupa is at map location: 27.721498, 85.361965.\r\n\r\nIn the afternoon, I went to a tour office and worked out a little trek for the next few days.  The guide came to my hotel to introduce himself.', 1, 4, 68, 1, 1, 0, '2018-10-20', NULL, NULL, '2018-10-20 09:24:02', '2019-02-22 00:17:53'),
(428, 1, 52, NULL, NULL, 'Trekkers Home Hotel, Kathmandu, Nepal', 'trekkers-home-hotel-kathmandu-nepal-2018-10-19', NULL, 'Chaksibari Marg, Thamel, Kathmandu, Nepal\r\n\r\nMap Location: 27.713669, 85.310363\r\n\r\nPhone: +977 980-5892964\r\n\r\nGreat location in Thamel.  Excellent restaurant.  No A/C, no hot water, no screens on the windows.\r\n\r\nLow-end hotel with old rooms with worn out furniture and beds.  \r\n\r\nSome of the rooms may have been renovated because the pictures look good.', 1, 5, 86, 1, 1, 0, '2018-10-19', NULL, NULL, '2018-10-20 15:51:21', '2019-02-20 08:20:07'),
(429, 1, 53, 105, 2021, 'Sunday, All Day Hike from Sundarijal to Chisapani', 'sunday-all-day-hike-from-sundarijal-to-chisapani-nepal-2018-10-21', NULL, 'Had breakfast at the hotel at 07:00 then packed up and checked out.  The hotel stored my heavy stuff and I packed the minimum for three days in my big backpack.\r\n\r\nThe guide met me at the hotel at 08:30 and we walked about 20 minutes from Thamel to the Ratna Park bus station, map location: 27.705582, 85.314532.\r\n\r\nThe bus left at about 09:00 and made a lot of stops and filled up with people.  We got to Sundarijal at about 10:15, map location: 27.759288, 85.420653.\r\n\r\nWe started walking north to the Sundarijal National Park.  The entrance fee was 1050 nr for foreigners.  We didn\'t see anything interesting in the park but it was a nice walk in the shady woods.\r\n\r\nMost of the first two hours was going up stairs.  My legs were getting a little wobbly before we stopped for lunch at 12:40 at a little village with a cluster of restaurants at map location: 27.779259, 85.434972.\r\n\r\nWe had a nice Dal Bat and mint tea for lunch and the family was real nice.  We took about an hour for lunch.\r\n\r\nAfter lunch, the hiking was a little easier and we got to Chisapani at about 16:00.\r\n\r\nThe first few hotels were full but we found a room at Hotel Chisopani for 1500 nr, map location: 27.829955, 85.448958.  I asked the guide where he was staying and he said that he will manage.  If my room had twin beds I would let him bunk with me.\r\n\r\n[Here is the route navigation on Wikiloc](https://www.wikiloc.com/hiking-trails/sundarijal-to-chisapani-29854373)', 1, 4, 84, 1, 1, 0, '2018-10-21', NULL, NULL, '2018-10-21 15:47:28', '2019-02-16 22:12:09'),
(430, 1, 53, NULL, NULL, 'Kathmandu Valley', 'kathmandu-valley-nepal', NULL, NULL, 1, 8, 143, 1, 1, 0, '2018-10-21', NULL, NULL, '2018-10-21 16:38:01', '2019-02-25 04:11:06'),
(431, 1, 53, 105, 2121, 'Monday, All Day Hike from Chisapani to Nagarkot', 'monday-all-day-hike-from-chisapani-to-nagarkot-nepal-2018-10-22', NULL, 'There was a dramatic sunrise with the sun rising up through the fog in the valley. Then there were clear views of the the big mountains to the north, Dorje Lakpa, Domeblanc, and Lempo Gang the 7000m peak. The hotel owner knocked on everyone\'s door and told them to go up to the roof to see the show. I was already out and about.\r\n\r\nWe had a big breakfast at the hotel and then left at around 07:40. Along the peaceful trail we saw more views of the mountains. The trail was a small road and was mainly flat all day with a few minor ups and downs. There were a few four wheel vehicles and quite a few motorcycles especially after lunch.\r\n\r\nWe had lunch at 11:30 at a village at map location: 27.763835, 85.498005. We had another delicious and extra spicy Dal Bhat for lunch. There was a friendly Lebanese hiker there and we talked to him. \r\n\r\nThe village was on a bigger road and some buses came along that were overflowing with people and there were a bunch of them on the roof.\r\n\r\nAfter lunch the trail went along the side of the mountains and there were fantastic views of the colorful valley full of clusters of houses and farm terraces. We went through a lot of little hamlets and there were a lot of people and farm animals on the trail.  The baby goats were especially adorable.\r\n\r\nWe got to Nagarkot (Map Location: 27.722578, 85.524708) at about 15:00 and found a cheap hotel with ample hot water (first hot shower in 5 days).', 1, 4, 92, 1, 1, 0, '2018-10-22', NULL, NULL, '2018-10-22 16:46:58', '2019-02-23 16:40:29'),
(432, 1, 54, NULL, NULL, 'Resort Eco Home', 'resort-eco-home-nagarkot-nepal-2018-10-22', NULL, 'Map Location: 27.722578, 85.524708\r\n\r\nBudget hotel with cozy rooms, good hot water and decent WiFi in the restaurant area.  There are obstructed views of the valley and mountains from the rooftop where there are some tables.', 1, 5, 85, 1, 1, 0, '2018-10-22', NULL, NULL, '2018-10-22 17:02:33', '2019-02-22 03:06:57'),
(433, 1, 53, 105, 2031, 'Tuesday, Hiked from Nagarkot to Naya Basti', 'tuesday-hiked-from-nagarkot-to-naya-basti-2018-10-23', NULL, 'We got up at 05:00 and walked 4 km over to the view tower to watch the sun rise over the Himalayas and maybe catch a glimpse of Mount Everest. I finally got to use my powerful travel flashlight as we walked in the dark. The guide was using his phone light. It was too cloudy to see Everest but the sunrise was impressive.\r\n\r\nWe walked back to the hotel for breakfast then packed up and hit the trail for Naya Basti by following the signs to Dhulikhel. At the trail-head we had to pay a usage fee of 339 NR.\r\n\r\nThe trail was actually another small road but there was very little traffic. Looking back there were incredible views of the big mountains above Nagarkot.\r\n\r\nThe hike was downhill all the way and the valley was covered with colorful terraces. The farmers were planting at the top and harvesting at the bottom. The whole area was very scenic. The harvesters were using a mechanical device to separate the grain. They pumped it with one leg and it did the job. It looked like something from the past.\r\n\r\nWe made it down to the main road in the early afternoon and caught the packed bus to Kathmandu at map location: 27.631180, 85.518656. It slowly went to the Ratna Park Bus Station where we started the trip (map location: 27.705582, 85.314532).\r\n\r\nI went to the Trekkers Home hotel to pick up my other bag and then went to a slightly better hotel that had the same owner, Hotel Yambu, and supposedly has better WiFi and hot water.', 1, 4, 85, 1, 1, 0, '2018-10-23', NULL, NULL, '2018-10-23 17:10:03', '2019-02-24 18:39:26'),
(434, 1, 53, NULL, 2021, 'Nepal Trekking: Sundarijal to Chisapani', 'nepal-trekking-sundarijal-to-chisapani', '', 'Buses from Kathmandu to Sundarijal leave from the Ratna Park Bus Station (Map Location: 27.705582, 85.314532) which is walking distance from Thamel.\r\n\r\nThe hike from Sundarijal to Chisapani starts out in Shivapuri National Park right outside of Sundarijal. Just go north on the only road and follow the big water pipe up the steps.\r\n\r\nThere are little shops and restaurants all along the way so water and snacks are no problem.\r\n\r\nMost of this hike is uphill and much of the trail has steps. Once over the mountain there are some nice views of the verdant valley.\r\n\r\nIn Chisapani there are plenty of cheap hotels, some right at the entrance and some down the hill. They have nice views of the Lang Tang Himalayas. The best time to see them is right after sunrise.\r\n\r\nThis is a \'Teahouse Trek\' which means that there are plenty of hotels and restaurants available so camping and cooking are not required. \r\n\r\nThese hikes can be combined to make a nice three day loop through the Kathmandu Valley:\r\n\r\n[Nepal Trek: Sundarijal to Chisapani](http://grittytravel.com/tours/nepal-trekking-sundarijal-to-chisapani)\r\n\r\n[Nepal Trek: Chisapani to Nagarkot](http://grittytravel.com/tours/nepal-trekking-chisapani-to-nagarkot)\r\n\r\n[Nepal Trek: Nagarkot to Naya Basti](http://grittytravel.com/tours/nepal-trekking-nagarkot-to-naya-basti)', 1, 2, 273, 1, 1, 0, '2018-10-21', NULL, NULL, '2018-10-24 06:52:35', '2019-02-25 10:24:15'),
(435, 1, 52, NULL, NULL, 'Hotel Yambu, Kathmandu, Nepal', 'hotel-yambu-kathmandu-nepal-2018-10-23', NULL, 'Budget hotel in Thamel that is a little more isolated but still close enough to walk to everything.  Good WiFi, Good Hot Water, Cable TV.\r\n\r\nBuffet Breakfast is included and starts at 07:00.\r\n\r\nMap Location: 27.717822, 85.311263.\r\n\r\nWiFi Login: hotelyambu / 2018', 1, 5, 94, 1, 1, 0, '2018-10-23', NULL, NULL, '2018-10-24 13:55:03', '2019-02-24 10:33:53'),
(436, 1, 52, 105, 2049, 'Wednesday, Swayambhunayh Temple and Kathmandu Durbar Square', 'wednesday-swayambhunayh-temple-and-kathmandu-durbar-square-2018-10-24', NULL, 'Spent most of the day exploring the rest of Kathmandu. Walked about 15 minutes from the Yambu Hotel to the Swayambhunayh Temple. \r\n\r\nThe temple is perched at the top of a hill with nice views of the city. There are stairs up to it lined with statues of Buddha and other religious figures. There are also hundreds of macaque monkeys that are up to their usual shenanigans, fighting, eating the offerings, and causing general mischief.\r\n\r\nAt the top there is a white stupa with the Buddhist eyes watching each of the four compass points and a lot of little temples and shrines where people put their offerings.\r\n\r\nOn the way back down I bought a medium sized singing bowl because the guy went down from 3000 NR to 500. It\'s kind of heavy to carry around for two more months but I wanted one anyway. I also bought some little key-chains, two with Buddha faces and one with garuda.\r\n\r\nAfter the temple, I took a taxi to Kathmandu Durbar Square to have a longer and more relaxed look around. I paid the hefty 1000 NR entry fee and wandered around for about an hour. \r\n\r\nI had lunch at a bakery place by the square and had a milk tea, little pastries, and a big puffy piece of bread (Chola Bhatura) that is dipped into a very tasty garbanzo bean sauce. I ordered that because the people next to me had one and it looked interesting.\r\n\r\nIn the afternoon, I arranged a three day trip to Chitwan National Park with the hotel guy to see the rhinos. They will pick me up at 06:30 in the morning.', 1, 4, 70, 1, 1, 0, '2018-10-24', NULL, NULL, '2018-10-24 15:17:37', '2019-02-24 01:11:23'),
(437, 1, 55, NULL, NULL, 'Safari Club Hotel', 'safari-club-hotel-2018-10-25', NULL, 'Mid-range hotel in Sauraha near Chitwan National Park.\r\n\r\nComfortable, spacious rooms, with outside seating, good WiFi and Hot Water.\r\n\r\nMap Location: 27.579744, 84.492719.', 1, 5, 94, 1, 1, 0, '2018-10-25', NULL, NULL, '2018-10-25 19:38:03', '2019-02-21 12:52:27'),
(438, 1, NULL, NULL, NULL, 'Chitwan, Nepal', 'chitwan-nepal', NULL, NULL, 1, 8, 244, 1, 1, 0, '2018-10-25', NULL, NULL, '2018-10-25 20:37:49', '2019-02-25 03:57:43'),
(439, 1, 55, 105, 2081, 'Thursday, Bus from Kathmandu to Chitwan National Park', 'thursday-bus-from-kathmandu-to-chitwan-national-park-2018-10-25', NULL, 'Got up before 06:00 to pack up and have breakfast before the bus ride to Chitwan National Park. The tour guy came and got before breakfast was ready so had to leave. \r\n\r\nWe walked over to the tourist bus area (Map Location: 27.718588, 85.307831) which was just a bunch of buses lined up for blocks down the street. We found my bus and then it finally left almost empty. We picked up people all along the way in Kathmandu and it took forever to get out of the city. Once out of the city it took a long route that hugged the edge of the mountain all the way down and then followed the Trisuli River most of the way. The final stop was Sauraha, the gateway to Chitwan National Park.\r\n\r\nIn Sauraha, the guides were picking up tourists at the bus station. One had a sign with my last name but was for someone else. My guide finally showed up and we waited for one more person then went to the hotel, Safari Club.\r\n\r\nIn the evening the guide took us to see the sunset over the river on the edge of town. The view was very nice and there were some crocodiles on the river bank. \r\n\r\nWe walked along the river to an elephant place where there was also a rescued rhino running around. They said he was a baby but he was huge. \r\n\r\nI thought he was inside the fence but he came charging out and the guide told us to run. Everybody scattered and I ducked into some bushes and avoided him. The Danish girl who was with us ran into a fleeing Napalese lady and both of them fell down and the rhino ran right past them, about a foot away. All I saw was a bunch of papers go up in the air from the Nepalese lady\'s purse.\r\n\r\nI tried to video it all but as soon as I turned on the video I had to run. I was able get a little video of the rhino half-heartedly chasing a guy.', 1, 4, 85, 1, 1, 0, '2018-10-25', NULL, NULL, '2018-10-26 10:18:41', '2019-02-24 02:27:59'),
(440, 1, 55, 105, 2085, 'Friday, Exploring Chitwan National Park', 'friday-exploring-chitwan-national-park-nepal-2018-10-26', NULL, 'Had breakfast at the hotel at 07:00 and then hopped in a safari jeep with a group from Slovakia.  We took a boat tour of the river and saw some nice colorful birds and a bunch of marsh crocodiles and thin-snouted gharial crocodiles.  \r\n\r\nNext we went for a walk in the woods but only saw some spotty deer way off in the distance.\r\n\r\nAfter that we went to the government elephant breeding place to look at the poor chained up elephants and their calves.\r\n\r\nThe next stop was in town where they were letting people get on an elephant in the river and then the elephant would spray them with water.  That was pretty fun to watch.\r\n\r\nIn the afternoon, we took a jeep safari into the national park.  We saw a few rhinos in the heavy brush at a distance, a few birds, and some deer.  It was hard to see from the jeep since it had a roof unlike the ones in India that were completely open so you could stand up and see a lot better.', 1, 4, 66, 1, 1, 0, '2018-10-26', NULL, NULL, '2018-10-26 10:53:35', '2019-02-21 16:36:58'),
(441, 1, 52, NULL, NULL, 'Hotel Osho Home', 'hotel-osho-home-kathmandu-nepal-2018-10-27', NULL, 'Jyatha Marg, Thamel, Kathmandu, Nepal\r\n\r\nMap Location: 27.711722, 85.312816\r\n\r\nPhone: +977 1-4152083\r\n\r\nWiFi Login: osho / visit\r\n\r\nBreakfast: 06:30 - 10:00\r\n\r\nMid-range Hotel with Good WiFi, Hot Water, and A/C, breakfast included.  Twin or Double Rooms for 30 USD.  Located in the heart of Thamel.\r\n\r\n[Check Availability on Booking.com](https://www.booking.com/hotel/np/osho-home-kathmandu.en.html?aid=1535306&no_rooms=1&group_adults=2)', 1, 5, 75, 1, 1, 0, '2018-10-27', NULL, NULL, '2018-10-28 06:34:13', '2019-02-25 07:55:25'),
(442, 1, 55, 105, 2069, 'Saturday, All Day Bus from Chitwan to Kathmandu', 'saturday-all-day-bus-from-chitwan-to-kathmandu-nepal-2018-10-27', NULL, 'Had breakfast at the hotel at 06:30 then they took us to the bus station in Sauraha (Map Location: 27.583075, 84.502356) for the all day trip to Kathmandu.  \r\n\r\nThe bus left at 08:00 and we arrived in Kathmandu at 15:00.  It\'s only 160 km but they go extremely slow and make many stops at the beginning and end to pick up and drop off people.  \r\n\r\nThe highway through the mountains is clogged up with trucks going at a snail\'s pace up and down the mountain passes.  The roads in and around Kathmandu are horrific and some aren\'t even paved so it\'s a rough ride until the bus reaches the main highway.\r\n\r\nThe bus makes two 15 minute bathroom stops and one longer lunch stop along the way. \r\n\r\nFrom the final stop near Thamel (Map Location: 27.718588, 85.307831), I walked to a new hotel, Hotel Osho Home, that was on the other side of Thamel.  Took a glorious hot shower and then had a huge lunch/dinner at a nearby Nepali restaurant.  They didn\'t have Dal Bhat but I ordered Dal something with white rice and curry vegetables and it was pretty tasty.', 1, 4, 71, 1, 1, 0, '2018-10-27', NULL, NULL, '2018-10-28 06:44:20', '2019-02-25 20:59:23'),
(443, 1, 53, NULL, 2135, 'Nepal Trekking: Chisapani to Nagarkot', 'nepal-trekking-chisapani-to-nagarkot', 'Spectacular sunrises and views of the Lang Tang Himalayas from Chisapani when the skies are clear.', 'This hike can be started by watching the dramatic sunrise through the valley fog from Chisapani. If it\'s clear then the big mountains to the north, Dorje Lakpa, Domeblanc, and Lempo Gang the 7000m peak, can be seen.\r\n\r\nThe trail is a small road and is mostly flat or downhill with a few minor uphill stretches.\r\n\r\nThis is a \'Teahouse Trek\' which means that there are plenty of hotels and restaurants available along the way so camping and cooking are not required. \r\n\r\nThese hikes can be combined to make a nice three day loop through the Kathmandu Valley:\r\n\r\n[Nepal Trek: Sundarijal to Chisapani](http://grittytravel.com/tours/nepal-trekking-sundarijal-to-chisapani)\r\n\r\n[Nepal Trek: Chisapani to Nagarkot](http://grittytravel.com/tours/nepal-trekking-chisapani-to-nagarkot)\r\n\r\n[Nepal Trek: Nagarkot to Naya Basti](http://grittytravel.com/tours/nepal-trekking-nagarkot-to-naya-basti)', 1, 2, 270, 1, 1, 0, '2018-10-22', NULL, NULL, '2018-10-28 09:06:48', '2019-02-24 20:23:10'),
(444, 1, 53, NULL, 2026, 'Nepal Trekking: Nagarkot to Naya Basti', 'nepal-trekking-nagarkot-to-naya-basti', '', 'This hike can be started outside of Nagarkot with a sunrise view of the Lang Tang Himalayas.  On clear mornings farther out along the trail there are epic views of the mountains towering over Nagarkot.\r\n\r\nThe hike is downhill all the way and the valley is covered with colorful rice and potato terraces.  The whole area is very scenic and photogenic. \r\n\r\nThe main road can be reached in the early afternoon and buses to Kathmandu stop at Map Location: 27.631180, 85.518656 .  In Kathmandu, they stop at the Ratna Park Bus Station (Map Location: 27.705582, 85.314532 ) which is walking distance to Thamel.\r\n\r\nThis is a \'Teahouse Trek\' which means that there are plenty of hotels and restaurants available so camping and cooking are not required. \r\n\r\nThese hikes can be combined to make a nice three day loop through the Kathmandu Valley:\r\n\r\n[Nepal Trek: Sundarijal to Chisapani](http://grittytravel.com/tours/nepal-trekking-sundarijal-to-chisapani)\r\n\r\n[Nepal Trek: Chisapani to Nagarkot](http://grittytravel.com/tours/nepal-trekking-chisapani-to-nagarkot)\r\n\r\n[Nepal Trek: Nagarkot to Naya Basti](http://grittytravel.com/tours/nepal-trekking-nagarkot-to-naya-basti)', 1, 2, 192, 1, 1, 0, '2018-10-23', NULL, NULL, '2018-10-28 09:20:09', '2019-02-24 14:20:43'),
(445, 1, 52, 105, 2150, 'Sunday, Relaxing Day in Kathmandu', 'sunday-relaxing-day-in-kathmandu--2018-10-28', NULL, 'Last full day in Nepal so took it easy and got everything ready for the flight back to Delhi tomorrow and then to Sri Lankathe next day.  Read online that there are political problems at the moment in Sri Lanka.\r\n\r\nIn the morning walked over to Swayambhunath Temple again to see the big Buddhas at the other entrance on the far side of the temple complex.\r\n\r\nHad lunch at my favorite Dal Bhat place and it did not disappoint.\r\n\r\nIn the afternoon, I had my laundry done at a place by the hotel.', 1, 4, 70, 1, 1, 0, '2018-10-28', NULL, NULL, '2018-10-29 06:16:53', '2019-02-22 05:13:00'),
(446, 1, 55, NULL, 2100, 'Do it Yourself Trip to Chitwan National Park', 'do-it-yourself-trip-to-chitwan-national-park', NULL, 'A trip to Chitwan National Park can easily be arranged without paying for an expensive package tour.\r\n\r\nThe gateway town to Chitwan National Park is Sauraha, Nepal.  Buses from Kathmandhu to Sauraha leave from the Tourist Bus Park at Map Location: 27.718588, 85.307831.  The bus park is just a bunch of big buses lined up for blocks along the street and is easy walking distance from Thamel (10 to 15 minutes).  Buses can be booked ahead of time at any travel agency for around 700 NR each way.\r\n\r\nThe drive to Sauraha looks short on the map but with traffic it takes almost all day.  Buses leave from 07:00 to 08:00 and pick up people along the way in Kathmandu.  The buses make two bathroom stops and one lunch stop.  Buses arrive after 15:00 and drop people off along the way in Sauraha..\r\n\r\nIn Sauraha, the bus station is at the edge of town (Map Location: 27.583075, 84.502356) and is an easy 15 minute walk to the hotel area.\r\n\r\nHotels can be booked online in advance and can arrange jeep or elephant tours into the national park.  There are also tour offices in town that can arrange the safaris.\r\n\r\nThings To Do in Sauraha \r\n\r\nChitwan National Park jeep and elephant safaris - Can be arranged through the hotels or tour offices in town.\r\n\r\nCanoe and walking tours - Can be arranged through hotels or tour offices.  The river tours allow up close viewing of crocodiles and colorful river birds. \r\n\r\nElephant Bathing - Fun and free to watch.  Fee to swim with the elephant.  Check it out at Map Location: 27.57732, 84.491826.  It\'s on the river right inside the town.\r\n\r\nRiver walk and river dining area - The main street in town ends at the river on the edge of Chitwan National Park.  This is where everyone goes to watch the sunset and have drinks at the riverside restaurants.  In the other direction, there is a path along the river that goes to the government elephant pens (Map Location: 27.572717, 84.496140).  There is also a rescue rhino running around that occasionally terrorizes people on the path.\r\n\r\nTraditional Dance Show - Slightly interesting but more of a show for tourists instead of something traditional.\r\n\r\nElephant Breeding and Training Center (Map Location: 27.582828, 84.463155) - Government run breeding program.  Not much to see except the line of elephants chained up outside with their calves of various ages.', 1, 5, 77, 1, 1, 0, '2018-10-29', NULL, NULL, '2018-10-29 08:42:50', '2019-02-22 10:40:12'),
(447, 1, 46, NULL, NULL, 'Airport Hotel Smart Palace', 'airport-hotel-smart-palace-2018-10-29', NULL, 'Aerocity Mahipalpur, Road Number 5, New Delhi\r\n\r\nMap Location: 28.550196, 77.130012\r\n\r\nBudget hotel very close to the airport.  The rooms look good in the photos but they are old and a little worn out.  Good A/C and WiFi, lackluster breakfast.\r\n\r\nUber ride to airport: 220 INR', 1, 5, 89, 1, 1, 0, '2018-10-29', NULL, NULL, '2018-10-29 10:21:46', '2019-02-16 00:17:20'),
(448, 1, NULL, NULL, NULL, 'Things To Do in Colombo, Sri Lanka', 'things-to-do-in-colombo-sri-lanka-2018-10-31', NULL, NULL, 1, 5, 6, 0, 0, 1, '2018-10-31', NULL, NULL, '2018-10-31 05:21:42', '2018-12-08 18:27:27'),
(449, 1, NULL, NULL, NULL, 'Sri Lanka Itinerary', 'sri-lanka-itinerary-2018-10-31', NULL, 'Colombo\r\nKandy - Pinnawala Elephant Orphanage\r\nDambulla\r\nWasgamuwa National Park\r\nYala National Park (South)\r\n\r\nKANDY \r\n\r\nDambulla cave temple.  Wasgamuwa National Park\r\n\r\nColombo  Nuwara Eliya (tea estates)  Yala National Park\r\n\r\nSRI LANKA\r\n\r\nMain highlights of Sri Lanka:\r\nSinharaja\r\nKandy\r\nNuwara Eliya\r\nYala \r\nGalle\r\n\r\n[Best National Parks](https://www.wanderlust.co.uk/content/sri-lanka-national-parks/)\r\n\r\nPidurangala Rock and Lions Rock (Sigiriya, Sri Lanka)\r\n\r\nWeligama stilt fisherman - Near Galle (Map Location: 5.985492, 80.329155).\r\n\r\nPinnawala Elephant Orphanage\r\n\r\nTravel Itinerary: 8 Days in Sri Lanka\r\n\r\nGetting around Colombo. Tuktuk is everywhere. Try it once or twice but be aware that when heat and dust are combined, its not glamorous.  The best way to get around is to take an Uber. It can be way cheaper than taking a tuktuk because drivers would charge you more since youre a tourist.\r\n\r\nCost of hiring a car with a driver. You can get a car with a driver for $50-60 a day. That already includes his own accommodation and food. You dont have to worry about that but you should book your own hotel or hostel. Give him your itinerary and be flexible about it. He might know something that is worth seeing along the way. Keep an open mind. Where can you rent a car? There are many of them online  google it.\r\n\r\nDay 1  Colombo \r\n\r\nI landed at 2:30 in the morning and arrived at my fabulous guest house at 3:30. I started my tour of the city at 11:00. The driver picked me up on time and I told him to show me the city. In other words, I let him, the local, showed me around  and he didnt disappoint me.\r\n\r\nPlaces we visited: Independence Memorial Museum Park, Saleem Malaka Buddhist Temple, The Fort, and some other markets and crowded places. Then, at 4 in the afternoon, I told him to drop me off at Peetah where I had my own walking tour. This is a place where Buddhist temples, Hindu temples and Christian churches are all within reach to each other. Peetah is a huge and crowded market and I managed to see these places: Jami-Ul-Alfar Mosque, Asokaramaya Buddhist and Hindu Temple, Old and New Kathiresan Hindu Temple and Wolvendaal Church.\r\n\r\nWhere to stay in Colombo. I had a fabulous stay at Mahazen by Foozoo. The place feels like home and welcoming. If only I had known that they could help me in renting a car and driver, too, I would have done that. So, when you book, ask them if they could help you with the itinerary.\r\n\r\nDay 2  Colombo to Sigiriya\r\n\r\nFrom Colombo to Pinnnnawala Elephant Orphanage is about less than 90 kilometers  but guess what  it took us almost 4 hours to reach there! Aside from the fact that our tiny van was slow, the road was also narrow and traffic was really terrible! Then, before sunset, we hiked up to Dambulla Cave Temple. We arrived in my accommodation in Sigiraya at around 7 in the evening.\r\n\r\nWhere to stay in Sigiriya. I stayed at Darshani Lodge because its just less than two kilometres away to and from Sigiriya Rock and Pidurangala Rock. Its clean and the room was spacious. The staff are very hospitable, too.\r\n\r\nDay 3  Sigiriya to Kandy\r\n\r\nI woke up early in the morning and by 7:30, I was already at the entrance of Sigiriya Rock. To avoid the heat, morning time is the best time to climb the countrys famous rock. By 10:30 oclock, I was on my way to Pidurangala Rock. Amazingly, with a good night sleep, I wasnt that tired climbing two rocks one after the other. We left Sigiriya at 2:30 in the afternoon and arrived at Kandy at 6:30 PM (90 kilometres). And oh, in Matale, we stopped at this really amazing and mind-blowing Hindu Temple called Arulmidu Sri Muthumariamman Thevasthanam.\r\n\r\nWhere to stay in Kandy. I slept in a room with a fantastic view of Kandy  at Kandyan View Holiday Bungalow. I even had my own veranda from my room. The dining tables have an amazing view of the city, too.\r\n\r\nDAY 4  Kandy to Nuwara Eliya\r\n\r\nWe checked out early and went straight to Kandys most famous tourist attraction  The Temple of the Tooth. I walked around the lake and the town until I got tired. I told the driver to just go wherever he wanted to go and Id call him when I was ready to go.\r\n\r\nOn our way to Nuwara Eliya, we stopped in some of places where the hill views where fantastic. Weve seen and passed by cascading waterfalls, panoramic tea plantations, a narrow and zigzag road that can be dangerous. We stopped by for an hour at Blue Field Tea Plantation to learn about tea and for the amazing photo shoot  of myself!  As we snaked our way up the hills, valleys and mountains, the temperature got chilly, too.\r\n\r\nWe arrived at Nuwara Eliya at 3 pm. I walked around Victoria Park and the small city on my own while the driver had his long lunch break.  I actually didnt mind it.\r\n\r\nWhere to stay in Nuwara Eliya. The House of Leisure is an amazing place to stay in. The place itself is overlooking the emerald tea plantation  and its stunning! Stay here not just for its incredible view but also for its amazing staff and nice dinner.\r\n \r\nDAY 5  By Train from Nuwara Eliya to Ella and to Udawalawe National Park\r\n\r\nI woke up early to go down to San Pedro Tea Estate. I was the only one exploring it while I was blanketed by the morning mists. Its so serene and calm. After breakfast, the driver dropped me off at the train station before 9:30 to catch a slow train to Ella for 4 hours. I told him to pick me up at Ella Train Station.\r\n\r\nTrain from Nuwara Eliya to Ella. Theres a slow train that leaves at 9:30 AM (4 hours). The fast train (2 hours and a half) leaves at 10:30. I chose to ride a train for the stunning views along the way. And of course, to experience how the locals move on a train. It was crowded and passengers are allowed to sit anywhere. I literally sat on the trains open door, with my legs comfortably hanging outside. Cool experience. But, yeah, can be dangerous, too.\r\n\r\nWhen I arrived at Ella Train Station, the driver had already been waiting for two hours. He whisked me right away to Liptons Seat. And boy, the drive going up there was the best ride / drive ever! Its indescribable! Youve got to see and experience it yourself  to believe it!\r\n\r\nWe arrived at Udawalawe National Park at 8:30 in the evening. Yes, it was loooong drive!\r\n\r\nWhere to stay at Udawalawe National Park. Visitors come here because they want to do safari. And the best place to stay here is at Kottawata Village Hotel. Its real good value for your bucks. Nice rooms, fabulous food, hammocks, swimming pool, landscaping, etc They can also arrange a safari for you  riding on a jeep.\r\n\r\nDAY 6  To Galle \r\n\r\nOur ride from the National Park to Galle was less traffic and road conditions were better. We had a couple of stops but mostly buying fresh coconut juice and a few temples. We finally arrived in Galle at 1 in the afternoon. I met a friend of mine Ive never seen for 6 years and we had lunch together. We had our own walking tour around Galle Fort before we wrapped up our day at 7 in the evening\r\n\r\nWhere to stay in Weligama. Instead of staying at Galle, I chose to book a hostel in Weligama (30 minutes from Galle). However, the hostel I chose was not the one I expected it to be. There are, of course, many options in the area. Weligama Bay is known for its surfing activities (though the waves arent really that impressive) and beaches. Along the bay, youll find some fishermen on stilts, too  doing nothing but posing or fishing for money.\r\n\r\nDAY 7  WELLIGAMA  GALLE  COLOMBO  NEGOMBO\r\n\r\nEarly in the morning, I walked for two hours along Weligama Bay (aka beach) where a lot of surfing boards and lessons were going on. It felt so good to have my feet drowned in sea salt and fine sand. A number of good and trying hard surfers were busy frolicking with the unimpressive waves. Fishermen were keeping their fish nets and pushing their fishing boats away from the shore. I sat for a while and when the heat burned my skin, I decided to go back to my hotel.\r\n\r\nOn our way back to Colombo, we had a stop at the Turtle Conservation Center and the Mask Museum. I was too tired when we finally arrived in Negombo  known for its beach resorts and golden sand. I didnt have time to explore the place though, except going into two bars and a real good restaurant  Lords  for dinner.\r\n\r\nWhere to stay in Negombo. Gomez Place is a fabulous place to stay! The rooms are so spacious and well-decorated. I love their huge bathroom, too! And, oh, theyve got a swimming pool, too!\r\n\r\nDAY 8  GOODBYE SRI LANKA\r\nThe reason why I stayed at Negombo on my last night in Sri Lanka is that its just 15 minutes to the airport. And since I flew on a weekend, traffic was easy breezy  so we got in at the airport in less than 15 minutes!\r\n\r\nAnd thats how my sojourn in Sri Lanka ended.', 1, 5, 1, 0, 0, 1, '2018-10-31', NULL, NULL, '2018-10-31 06:25:31', '2018-10-31 07:57:19'),
(450, 1, 52, 105, 1940, 'Monday, Flew from Kathmandu to Delhi', 'monday-flew-from-kathmandu-to-delhi-2018-10-29', NULL, 'Packed up and checked out of the hotel around 12:00.  Went across the street for a final Dal Bhat lunch.  Also exchanged most of my remaining Nepal Rupees to USD and a few Indian Rupees for the taxis to the airport hotel.  I found that the exchange places have different rates and they will negotiate.\r\n\r\nTook a taxi to the airport for 500 rupees.  The airport is tiny with only 5 gates so I got in pretty fast.  The flight was delayed a few hours and the airport was packed with people.  Our gate assignment wasn\'t on the monitor so everyone stood around and watched for it.\r\n\r\nNice and smooth flight to New Delhi.  I didn\'t even know we were close to landing until we touched down.  I took a pre-paid taxi to the airport hotel for 250 rupees.  The main highway next to the airport screws up traffic.  We had to go way up to the next exit and come back just to get on the correct side of the highway where the hotel was.', 1, 4, 66, 1, 1, 0, '2018-10-29', NULL, NULL, '2018-10-31 06:51:49', '2019-02-25 16:42:40');
INSERT INTO `entries` (`id`, `site_id`, `location_id`, `parent_id`, `photo_id`, `title`, `permalink`, `description_short`, `description`, `user_id`, `type_flag`, `view_count`, `published_flag`, `approved_flag`, `deleted_flag`, `display_date`, `color_foreground`, `color_background`, `created_at`, `updated_at`) VALUES
(451, 1, 46, 105, NULL, 'Tuesday, Flew from Delhi to Colombo, Sri Lanka', 'tuesday-flew-from-delhi-to-colombo-sri-lanka-2018-10-30', NULL, 'Took an Uber from the airport hotel to Terminal 3 for 220 INR.  Security was tight and would have really been backed up if there were more people.  There was even a final security check on the tarmac as as we got on the plane.\r\n\r\nThe flight was delayed about an hour.  It was a smooth 3.5 hour trip to Colombo.  Had an empty seat next to me which is such a luxury and almost never happens these days.\r\n\r\nIn Colombo, they didn\'t even ask for my e-visa that cost me 35 USD online.  Maybe it was linked to my passport on their computer.  Once I got to the immigration counter, it only took about 90 seconds to get a stamp and move on through.\r\n\r\nI took the City Express bus to the Central Bus Station in Colombo, Map Location: 6.935068, 79.854528, for only 150 LKR (less than 1 USD).  Then took a TukTuk the rest of the way to the hotel in the Fort area of Colombo for 300 LKR.  \r\n\r\nThe TukTuk driver played the game where he said he didn\'t have change for a 500 LKR note.  I went into the hotel without paying him and he finally admitted that he had change so I paid him and he went on his way.  This is why I no longer get them a big note unless they show me the change first.\r\n\r\nIt was already dark when I got to the hotel.  After checking in, I took a long walk along the main road which is lined with markets.  I bought a little souvenir and looked for a Sri Lanka SIM card.', 1, 4, 71, 1, 1, 0, '2018-10-30', NULL, NULL, '2018-10-31 06:53:02', '2019-02-23 00:14:15'),
(452, 1, 57, 105, 2202, 'Wednesday, Spent All Day Exploring Colombo, Sri Lanka', 'wednesday-spent-all-day-exploring-colombo-sri-lanka-2018-10-31', NULL, 'Up early and had a homemade cold coffee in the room since breakfast wasn\'t until 07:00.  For breakfast, I had scrambled eggs, chicken sausage and more coffee.  The dining room was full of people.\r\n\r\nAfter breakfast, I walked over to the Red Mosque (Map Location: 6.938463, 79.851768) which was only about 20 minutes away.  It is near the market area so there was a lot of activity.  I also went to the New Kathiresan Kovil Hindu Temple (Map Location: 6.942124, 79.854621) and looked around.\r\n\r\nI walked back through the Peetah Market and then over to get a better look at the Colombo Lotus Tower.  Next I went to the train station and bought a ticket on the express train to Kandy for the next day, leaving at 10:35. \r\n\r\nOutside of the train station I negotiated with a Tuk Tuk to take me to several temples that were farther out, the Seema Malaka Buddhist Temple and the Ashokaramaya Buddhist Temple.  We covered both of those in about an hour and he dropped me off at the hotel.  I went to KFC near the hotel for lunch.  \r\n\r\nLater in the afternoon, I negotiated a 600 per hour rate with another Tuk Tuk driver to take me to Independence Square, Gangaramaya Temple, and Galla Face Green.  I should have included these on the first Tuk Tuk tour since they are in the same area.  After the other stops, he dropped me off at Galla Face Green and I walked along the seaside promenade and then back to the hotel at dusk.\r\n\r\nThere were a lot of soldiers around.  I\'m not sure if that is normal or it is because of the current political problem where they have two guys who both think that they are the Prime Minister.   \r\n\r\nOn the walk back I found a BK and had beef hamburgers for the first time in about a month.  They were glorious.', 1, 4, 91, 1, 1, 0, '2018-10-31', NULL, NULL, '2018-10-31 12:28:21', '2019-02-25 16:34:15'),
(453, 1, 57, NULL, NULL, 'Colombo, Sri Lanka', 'colombo-sri-lanka', NULL, NULL, 1, 8, 126, 1, 1, 0, '2018-10-31', NULL, NULL, '2018-10-31 14:00:15', '2019-02-21 23:38:59'),
(454, 1, 57, NULL, NULL, 'CityRest Fort Hostel', 'cityrest-fort-hostel-2018-10-30', NULL, '46 Hospital Street, Fort, Colombo, Sri Lanka\r\n\r\n+94 112 339 340\r\n\r\nIt\'s expensive for the tiny rooms and shared bathroom.  Good A/C, Hot Water, WiFi, and good free breakfast.  Good location in the Fort area of Colombo.  Lots of restaurants in the area and tuk-tuks all over the place.  200 - 300 rupee tuk-tuk ride to the Central Bus Station and Train Station.', 1, 5, 87, 1, 1, 0, '2018-10-30', NULL, NULL, '2018-10-31 21:04:25', '2019-02-23 17:32:14'),
(455, 1, 58, NULL, NULL, 'Sarvodaya Samma Vaasa Residence', 'sarvodaya-samma-vaasa-residence--2018-11-01', NULL, 'No 12, Anagarika Dharmapala Mawatha, Kandy, Sri Lanka\r\n\r\nPhone: +94 77 330 5505\r\n\r\nMap Location: 7.291103, 80.644309.\r\n\r\nMid-range hotel with big affordable rooms, 20 USD for a double room.  Good A/C, WiFi, breakfast NOT included.  Located near the lake, about a 15 minute walk to the center of Kandy.\r\n\r\n[Check Availability and Reserve on Booking.com](https://www.booking.com/hotel/lk/samma-vasa-by-sarvodaya.en.html?aid=1535306&no_rooms=1&group_adults=2)', 1, 5, 75, 1, 1, 0, '2018-11-01', NULL, NULL, '2018-11-01 15:56:12', '2019-02-16 00:17:20'),
(456, 1, 58, 105, 2216, 'Thursday, Took the Train from Colombo to Kandy, Sri Lanka', 'thursday-took-the-train-from-colombo-to-kandy-sri-lanka-2018-11-01', NULL, 'Had breakfast at the hotel. Very nice mainly because I was the only one in the dining room.\r\n\r\nIt was raining so thought it might be hard to get a tuk-tuk but no problemo. Got to the station super early. There was no security or even a ticket check to get to the platforms.  The train station was really busy with trains coming and going every few minutes with people hustling on and off.\r\n\r\nIt was a slow, rough, stop and go train ride to Kandy. The last part was through the mountains with epic views of the forested slopes.  It took about four hours to make the trip.\r\n\r\nIn Kandy, I took a tuk-tuk to the hotel which was quite a ways from the train station because of the one way road around the luck.  It\'s only about a 15 minute walk to the center, mostly along the lake.\r\n\r\nWalking along the lake I saw huge bats hanging in the tops of the trees and a couple of big pelicans sleeping on some wide branches.', 1, 4, 62, 1, 1, 0, '2018-11-01', NULL, NULL, '2018-11-01 16:07:09', '2019-02-19 17:44:27'),
(457, 1, 58, NULL, NULL, 'Kandy, Sri Lanka', 'kandy-sri-lanka', NULL, NULL, 1, 8, 132, 1, 1, 0, '2018-11-01', NULL, NULL, '2018-11-01 18:20:48', '2019-02-25 05:41:58'),
(458, 1, 59, NULL, NULL, 'The Nilmini Lodge, Sigiriya, Sri Lanka', 'the-nilmini-lodge-sigiriya-sri-lanka-2018-11-03', NULL, 'Map Location: 7.951695, 80.753780\r\n\r\nSigiriya, Sri Lanka\r\n\r\nPhone: +94665670469\r\n\r\nBudget hotel with horrible WiFi, good A/C, good Hot Water, and a great location right in the middle of Sigiriya near many restaurants and shops and close to the road that goes to the entrances of Sigiriya Rock and Pidurangula Rock.', 1, 5, 81, 1, 1, 0, '2018-11-03', NULL, NULL, '2018-11-02 18:48:33', '2019-02-23 23:19:56'),
(460, 1, 58, 105, 2231, 'Friday, Spent All Day Exploring Kandy, Sri Lanka', 'friday-spent-all-day-exploring-kandy-sri-lanka-2018-11-02', NULL, 'In the morning, walked over to the Udawatta Kele Sanctuary and hiked around in the woods.  There were lots of macaques at the entrance but only saw a little deer (barking deer?) after that.\r\n\r\nThere were nice views of the city and the big Buddha on the hilltop at Bahirawakanda Temple.\r\n\r\nI had the park to myself from about 09:00 to 10:00 then I started running into other people including a huge group of schoolgirls in uniform.\r\n\r\nAfter the park, I walked up the hill to the Bahirawakanda Temple.  It was okay but the big white Buddha is best viewed from a distance.\r\n\r\nFor lunch I went to the Muslim Hotel Restaurant and had a delicious Basmathi with fried chicken.  That\'s just a big plate of rice with a few vegetables and a boiled egg mixed in .\r\n\r\nI felt like they were trying to get rid of me and then the waiter said that they were closing for prayers since it was Friday at 13:00.  They open again at 16:00.\r\n\r\nIn the afternoon I went to find where the buses to Dambulla and Sigiriya leave from.  \r\n\r\nFor dinner I had another Basmathi at the Devon Restaurant because that was all that they had that I recognized.', 1, 4, 62, 1, 1, 0, '2018-11-02', NULL, NULL, '2018-11-03 05:31:52', '2019-02-25 03:48:01'),
(461, 1, 59, NULL, NULL, 'Sigiriya, Sri Lanka', 'sigiriya-sri-lanka', NULL, NULL, 1, 8, 126, 1, 1, 0, '2018-11-03', NULL, NULL, '2018-11-03 19:04:58', '2019-02-25 10:46:50'),
(462, 1, 59, 105, 2238, 'Saturday, Bus from Kandy to Sigiriya and Minneriya National Park', 'saturday-bus-from-kandy-to-sigiriya-and-minneriya-national-park-2018-11-03', NULL, 'Left the hotel at 06:30. I had paid the night before because the hotel people are usually sleeping somewhere in the early morning. \r\n\r\nI walked the two kms to the Central Bus Station which is right by the train station, Map Location: 7.290085, 80.631245. There were a lot of people in the street for early Saturday morning.\r\n\r\nThe bus left at 07:35 and cost 160 LKR, less than 1 USD for the 3 hour trip. We arrived in Sigiriya at about 10:00. The bus stopped to let someone off right in front of the hotel that I booked so I hustled off too.\r\n\r\nAfter getting my room I headed to Minneriya National Park for an afternoon elephant safari. The hotel guy told me how to get there by 14:00 but I got there at 12:30 and it was raining a little.\r\n\r\nThere were a bunch of safari jeep drivers outside waiting for customers. I negotiated them down a little then took off into the park. The safari was about 23 USD and the park entry fee was about 28 USD after all the taxes were added in so it wasn\'t cheap.\r\n\r\nWe saw a lot of birds including eagles, some big water monitors, and the usual spotty dears. When we got to the huge lake we saw groups of elephants way off on the far side. \r\n\r\nOn the the way back we stopped at a viewing tower and right on cue a big bull elephant walked into view out in the lake. He walking along, splashing around in the water and eating the grass growing in the lake.\r\n\r\nBack in the jeep we saw another big bull elephant with a broken leg who could barely and it looked like he was going to fall over with every step. The driver that he probably was the one who got hit by a train.\r\n\r\nThe safari guy dropped me off back in Sigiriya and I had an extra spicy curry chicken for lunch / dinner. The main street in Sigiriya is lined with tourist restaurants that have nice open balconies.', 1, 4, 84, 1, 1, 0, '2018-11-03', NULL, NULL, '2018-11-03 19:39:06', '2019-02-20 23:21:57'),
(463, 1, 59, 105, NULL, 'Sunday, Cave Temple in Dambulla, Biking Around Sigiriya', 'sunday-cave-temple-in-dambulla-biking-around-sigiriya-sri-lanka-2018-11-04', NULL, 'In the morning took the bus from Sigiriya to Dambulla and went to the famous Cave Temples, map location: 7.855904, 80.64678.\r\n\r\nThe bus station, 7.870392, 80.651412, is a few kilometers from the temple entry so I took a tuk-tuk for 150 LKR. It\'s off of the main road and down a dirt road.\r\n\r\nThe caves are at the top of a hill with steps up to the entrance. There are four or five caves filled with murals and buddhas of all sizes.\r\n\r\nIt is possible to go down a different way to the Golden Temple which has a big outdoor Buddha and is on the main road.\r\n\r\nBuses go back and forth between Dambulla and Sigiriya and Kandy every hour or so it\'s an connection.\r\n\r\nBack in Sigiriya I rented a cheap bike and took  a nice long ride out on the little dirt roads.  I rode for about two hours around Lion\'s Peak and Pedurangula and returned on the bigger road that goes along the elephant fence on the boundary of Minneriya National Park.', 1, 4, 67, 1, 1, 0, '2018-11-04', NULL, NULL, '2018-11-04 18:33:45', '2019-02-24 06:11:07'),
(464, 1, 58, NULL, NULL, 'Kandy City Rooms & Hostel', 'kandy-city-rooms-hostel-sri-lanka-2018-11-05', NULL, '281 Peradeniya Road, Kandy, Sri Lanka\r\n\r\nPhone: +94759527265\r\n\r\nWiFi: \r\n\r\n302 Deluxe Room / 12345302room\r\n\r\n303DELUXE / 12345303room\r\n\r\nComfortable hostel with dormitory and deluxe private rooms near the Kandy Train Station and Central Bus Station.  Good A/C, WiFi, Hot Water, also has a shared kitchen and dining area with balcony.', 1, 5, 87, 1, 1, 0, '2018-11-05', NULL, NULL, '2018-11-05 17:04:00', '2019-02-24 08:37:08'),
(465, 1, 59, 105, 2286, 'Monday, Climbed Pedurangula Rock, Took the Bus to Kandy', 'monday-climbed-pedurangula-rock-took-the-bus-to-kandy-sri-lanka-2018-11-05', NULL, 'Up and out by 05:45. There were no tuk-tuks around so I walked for 45 minutes to the entrance to Pedurangula Rock. It was nice and cool on the dirt road and there weren\'t many people around.\r\n\r\nI hiked up to the top as the people who went for the sunset were coming down. At one bottleneck I had wait for about 20 people to crawl down the rocks.\r\n\r\nThere is a big famous reclining buddha near the top. At the very top it is pretty flat with great views of the misty rice patties and the hills in the distance shrouded in wispy fog.\r\n\r\nAfter the rock climb, I took the long way back to the town. I had a nice long walk through the countryside of small hamlets, fields, rice patties, and farmers starting to work. There were a lot of big birds around making a plenty of noise, especially the wild peacocks with their distinct calls.  They look huge up in the trees.\r\n\r\nBack in town on the main road I came across a mahout giving his elephant a bath in the big creek.  Later on I saw them walking down the road by the hotel but they were gone before I could get out to take a good picture.  Elephants lumbering down the road always look cool.\r\n\r\nI had breakfast at the place next to the hotel because they have the best WiFi. They brought me a pot of black coffee and I savored every cup.\r\n\r\nI packed up and checked out of the hotel around 11:00. The electricity went out and I had to use my trusty powerful flashlight in the dark room.\r\n\r\nI caught the bus to Dambulla and then the express microbus with A/C to Kandy. The hotel I booked for one night was closer to the train and bus stations so it was an easy walk.\r\n\r\nAfter checking in I went back to the train station to buy a ticket to Ella for the next morning. The reservable seats in the observation car were sold out so I had to wait until same day to buy a ticket.\r\n\r\nIt srarted pouring rain so I jumped into a tuk-tuk and went to BK for a late lunch.  It rained the rest of the day so I laid low in my very cozy hotel room with great internet for a change.\r\n\r\nIt rained pretty hard all night and the roof was leaking so there was a big puddle in the nice room.', 1, 4, 70, 1, 1, 0, '2018-11-05', NULL, NULL, '2018-11-05 17:39:18', '2019-02-24 19:46:33'),
(466, 1, 58, NULL, NULL, 'How to go by Bus from Kandy to Sigiriya, Sri Lanka', 'how-to-go-by-bus-from-kandy-to-sigiriya-sri-lanka-2018-11-03', NULL, 'The direct bus from Kandy to Sigiriya leaves from the Central Bus Station in Kandy, map location: 7.290085, 80.631245, at 07:35 and costs 160 LKR, less than 1 USD.  It takes about 2 hours to get to Dambulla and then another 45 minutes to get to Sigiriya.  The final stop is at Map Location: 7.951692, 80.755905.\r\n\r\nThere are also buses that leave every hour from Kandy to Dambulla and then every 30 minutes from Dambulla to Sigiriya.', 1, 5, 80, 1, 1, 0, '2018-11-03', NULL, NULL, '2018-11-05 20:19:51', '2019-02-25 00:12:05'),
(467, 1, NULL, NULL, NULL, 'Dambulla, Sri Lanka', 'dambulla-sri-lanka', NULL, NULL, 1, 8, 124, 1, 1, 0, '2018-11-04', NULL, NULL, '2018-11-05 21:00:45', '2019-02-25 20:18:40'),
(468, 1, 60, NULL, NULL, 'Ella, Sri Lanka', 'ella-sri-lanka', NULL, NULL, 1, 8, 142, 1, 1, 0, '2018-11-06', NULL, NULL, '2018-11-06 18:48:15', '2019-02-25 20:56:58'),
(469, 1, 60, 105, 2288, 'Tuesday, Took the Scenic Train from Kandy to Ella, Sri Lanka', 'tuesday-took-the-scenic-train-from-kandy-to-ella-sri-lanka-2018-11-06', NULL, 'It was still raining in the morning. I went to the train station at 07:30 since the ticket counter was supposed to open then. There was already a line of tourists. The window didn\'t actually start selling tickets until 07:45 but the line went pretty quickly. I got my ticket for 2nd class at 08:45 and hustled back to the hotel to pack up and check out and carry my gear back to the train station which was about a 15 minute walk away.\r\n\r\nThe train boarding was a cluster screw. There were no seats available and the doors were clogged with people trying to get in. I went to a 3rd class car because the door was clear and some nice Sri Lankan ladies made room for me and wanted to know my story. They didn\'t go all the way to Ella so I had more space for the last third of the trip.\r\n\r\nThe journey took seven hours which was a lot more than I expected. A lot of people had to stand for a long time. \r\n\r\nThe scenary was spectacular with hills covered with green tea fields and a few rice patties and other crops. The tourists were hanging out the doors as the train went around curves so their friends could take action photos of them.\r\n\r\nIn Ella, I stopped for lunch / dinner before going to the hotel and had a nice beef burger and some green tea at a restaurant with good WiFi. After that I walked the rest of the way to the hotel which wasn\'t far but had some steep ups and downs on some tiny, muddy, slippery roads. After seeing the scenery around Ella I decided to stay another night and worked it out with the hotel guy.\r\n\r\nAfter checking in, I found and followed the trail to the famous Nine Arches Railroad Bridge. There were a lot of tourists there taking photos and flying drones around. There were a bunch of tuk-tuks there and I didn\'t realize that there was a road. I stayed for about 15 minutes and then hustled back to town before it got dark.', 1, 4, 78, 1, 1, 0, '2018-11-06', NULL, NULL, '2018-11-06 19:28:36', '2019-02-22 04:24:58'),
(470, 1, 60, NULL, NULL, 'Rock Side Inn Ella', 'rock-side-inn-ella-sri-lanka-2018-11-06', NULL, 'Sapumal Tenna , Wellawaya Road, Ella, Sri Lanka\r\n\r\nMap Location: 6.870528, 81.050871 (shown on some maps as Raveena Guesthouse).\r\n\r\nWiFi only works in the kitchen area\r\n\r\nExcellent views of Ella Rock from the property', 1, 5, 109, 1, 1, 0, '2018-11-06', NULL, NULL, '2018-11-06 19:43:08', '2019-02-24 05:32:47'),
(471, 1, 60, 105, 2306, 'Wednesday, Hiked up to Little Adam\'s Peak', 'wednesday-hiked-up-to-little-adams-peak-2018-11-07', NULL, 'It was still raining in the morning so I had to wait until about 09:00 to leave the hotel. I walked over to the Little Mount Adam\'s trail and hiked up to the peak. There were a lot of tourists doing the same thing. The trail wasn\'t very long and there were excellent views from the top. I came down a different way and walked over to the road to the other side of Nine Arches Bridge. \r\n\r\nThere was a little rustic restaurant right on the trail with a great view of the bridge. A lot of people waited there for a train to come by so we could take pictures of it crossing the scenic bridge.\r\n\r\nAfter that I went the rest of the way down to the bridge, crossed it and walked through the tunnel. I followed the train tracks back to the Ella Train Station like the hotel guy told me to do. One more short train came along so I had to hug the edge of the clearing by the tracks as it passed. \r\n\r\nFor lunch, I had another delicious and spicy curry. The curries come with a big pile of rice and little bowls with different types of curries, some hotter than the others. They usually give me the hiccups and cause a lot of sweat and watering of the eyes.', 1, 4, 86, 1, 1, 0, '2018-11-07', NULL, NULL, '2018-11-07 18:07:10', '2019-02-24 18:41:55'),
(472, 1, 61, NULL, NULL, 'Sanoga Holiday Resort', 'sanoga-holiday-resort-tissamaharama-sr-lanka-2018-11-08', NULL, 'No.12, Punchiakurugoda, Tissamaharama, Sri Lanka\r\n\r\nPhone: +94718181857\r\n\r\nWiFi: ZTE / ranjinilu\r\n\r\nBudget Hotel located near the lake in Tissa.  Good A/C and WiFi, comfortable beds.\r\n\r\nThey arrange affordable safaris to Yala National Park.', 1, 5, 86, 1, 1, 0, '2018-11-08', NULL, NULL, '2018-11-08 12:15:25', '2019-02-18 05:11:51'),
(473, 1, 60, NULL, 2348, 'From Ella to Tissamaharama by Bus', 'from-ella-to-tissamaharama-by-bus-2018-11-08', NULL, 'Getting from Ella to Tissamaharama by bus is fairly straightforward.  Buses in Ella stop at Map Location: 6.872456, 81.049334.  At the bus stop there are many touts for shared minibuses so they may not give the correct information about the public buses.\r\n\r\nShared minibuses are a good option since they make the trip in only two hours and there are no connections.  They may also stop for photos by request.  They charge from 1500 to 3000 LKR depending on the circumstances and the bargaining skill of the passenger.  If a minibus is leaving and they have space then the price is more negotiable.  Make sure that they drop you off in Tissa and not in the surrounding area.  The center of Tissa is around map location: 6.277315, 81.287465.', 1, 5, 149, 1, 1, 0, '2018-11-08', NULL, NULL, '2018-11-08 13:00:07', '2019-02-24 18:03:19'),
(474, 1, 61, NULL, NULL, 'Tissa, Sri Lanka', 'tissamaharama-sri-lanka', NULL, NULL, 1, 8, 151, 1, 1, 0, '2018-11-08', NULL, NULL, '2018-11-08 13:03:01', '2019-02-25 20:35:30'),
(475, 1, 61, NULL, 2325, 'Tissa to Yodha Wewa Lake Loop', 'tissa-to-yodha-wewa-lake-loop', 'Large numbers of colorful waterbirds and scenic rice paddies.', 'Yodha Wewa is a large, scenic body of water located a little east of Tissamaharama, Sri Lanka. It is full of waterbirds of all shapes and sizes including white pelicans, cormorants, painted storks, and innumerable smaller birds. \r\n\r\nThere is a lot of activity in the area with the farmer working in the rice fields and the fishermen working in their outrigger canoes on the lake.\r\n\r\nThe loop takes you through scenic rice paddies and along the edge of the lake. From the lake to Tissa, it goes through a little neighborhood full of friendly people. It also passes the entrance to the massive, white Tissamaharama Stupa.', 1, 2, 209, 1, 1, 0, '2018-11-08', NULL, NULL, '2018-11-08 18:48:17', '2019-02-24 20:01:46'),
(476, 1, 61, 105, 2347, 'Thursday, Took a Minibus from Ella to Tissa, Sri Lanka', 'thursday-took-a-minibus-from-ella-to-tissa-sri-lanka-2018-11-08', NULL, 'Had coffee and breakfast at the hotel at 06:30.  They were ready for me this time and had everything done on time.  Then I paid, checked out, and walked to the bus stop in the middle of Ella. \r\n\r\nThere was a group of guys at the bus stop and they all turned out to be touts for the shared minibuses.  I was going to take the regular big bus but I negotiated them down from 3000 to 1200 LKR which is about 7 USD and it was leaving right then.\r\n\r\nThere were two guys from Singapore in the minibus and the touts told me not to tell them how much I was paying.  The minibus made a few photo stops for us along the way and we got to Tissa in about two hours.  The driver tried to drop me off in the next town over but I made him take me all the way to the center of Tissa.  \r\n\r\nIt was blazing hot so I took a tuk-tuk to my hotel which was out a ways near the lake.  Nobody was at the hotel but the gate was open so I hid my big bag behind the building and walked down to the corner store.  They knew the hotel people and called them for me.  The hotel guy showed up in his tuk-tuk in about 5 minutes and we went back to the hotel and I checked in.\r\n\r\nI was the only one at the hotel so I got their full attention.  At one point the guy knocked on my door just to tell me that he was going to town for 30 minutes.  Not sure why I needed to know that.  \r\n\r\nI worked out an all day safari in Yala National Park for the next day with the hotel lady with a pickup time of 04:45.  The tour goes until 5 in the afternoon and includes lunch and water.\r\n\r\nIn the afternoon, it poured rain for about 30 minutes and then afterwards I walked back to town for lunch.  I had another almost too spicy curry buffet and it was very tasty.\r\n\r\nLater on I went for a walk in the neighborhood and ended up out in the rice paddies and then on a path along a huge lake full of water birds and fishermen in outrigger canoes.  On the other side of the path there were lots of farmers getting the rice fields ready to plant.', 1, 4, 86, 1, 1, 0, '2018-11-08', NULL, NULL, '2018-11-08 19:33:46', '2019-02-25 20:33:19'),
(477, 1, 61, 105, 2337, 'Friday, Yala National Park All Day Safari', 'friday-yala-national-park-all-day-safari-sri-lanka-2018-11-09', NULL, 'Got up at 04:30 for my 04:45 jeep safari pickup at the hotel.  It rained all night and was still raining hard.  The jeep was buttoned up but there was still a lot of water coming in.  There were two people already in the jeep and we picked up one more guy after me and headed to the park entrance where all of the jeeps were lined up.\r\n\r\nBy the time we drove over there and the guide bought our tickets, it was 06:00 and the park was open.  We had a full day of rushing around from one site to another looking for elusive animals.  We saw the rare sight of a leopard eating a dead water buffalo right by the road.  We had a good look at him for about 5 minutes and then too many jeeps came along and got too close and spooked him. \r\n\r\nIn addition to the leopard we saw many elephants, wild boar, water buffalo, monitor lizards, crocodiles, gray langur monkeys, spotted deer, peacocks, horn-bills, many little colorful birds, and thousands of water birds including storks, ibis, cranes, ducks, pelicans, etc.\r\n\r\nWe had a two hour lunch at the beach and the tour ended at about 17:00 making it an excellent and very long day.', 1, 4, 72, 1, 1, 0, '2018-11-09', NULL, NULL, '2018-11-09 21:40:41', '2019-02-17 10:54:15'),
(478, 1, 62, NULL, NULL, 'Track Fun Guesthouse, Galle, Sri Lanka', 'track-fun-guesthouse-galle-sri-lanka-2018-11-10', NULL, 'No. 5 Templers Rd, Kaluwella, Galle, Sri Lanka\r\n\r\nMap Location: 6.034669, 80.212516\r\n\r\nPhone: +94761887958\r\n\r\nBudget Hostel with a great location near the train and bus stations and a short walk to the Galle Fort.  A/C is good, WiFi is horrible, Hot Water is limited, breakfast not included.  \r\n\r\nThe private rooms are way overpriced for what they offer.  The big private room has holes in the outer door, no real lock, no window in the bathroom and it is full of mosquitoes and possibly other animals based on the sounds at night.', 1, 5, 81, 1, 1, 0, '2018-11-10', NULL, NULL, '2018-11-11 11:05:16', '2019-02-18 19:06:14'),
(479, 1, 62, 105, 2360, 'Saturday, Went from Tissa to Galle by Tuk-tuk', 'saturday-went-from-tissa-to-galle-by-tuk-tuk-2018-11-10', NULL, 'Tried to sleep in and made it to 06:00.  Had breakfast and coffee at the hotel while the Sammy the hotel guy stood around and watched me.  I only had 110 LKR so offered that to a tuk-tuk and he took me to an ATM near the bus station.  \r\n\r\nAt the bus station, I went in the bathroom for a second and that\'s when the bus to Galle came and went.  They don\'t pull in to the bus station they just make a quick stop on the main road in front of the bus station.  A tuk-tuk driver came over and talked me into going with him to Galle for 4500 LKR.  It was a beautiful sunny day so it sounded like a good idea.  \r\n\r\nWe took off and made a few stops on the way.  We went by some nice beaches and stopped at a big temple.  We got to Galle about about 15:30 and he dropped me off at my hotel.\r\n\r\nLater in the afternoon, I went for a walk through the fort area and it\'s like a different country with nice little clean streets full of restaurants and tourist shops.  At sunset the electricity went off and it started raining.  I had dinner in the dark at a Sri Lankan restaurant and then used my flashlight and rain gear to walk back to the hotel.', 1, 4, 72, 1, 1, 0, '2018-11-10', NULL, NULL, '2018-11-11 11:28:57', '2019-02-24 13:02:14'),
(480, 1, 62, NULL, NULL, 'Galle, Sri Lanka', 'galle-sri-lanka', NULL, NULL, 1, 8, 127, 1, 1, 0, '2018-11-10', NULL, NULL, '2018-11-11 11:32:41', '2019-02-24 22:17:43'),
(481, 1, NULL, 105, NULL, 'Sunday, Galle to Colombo by Train', 'sunday-galle-to-colombo-by-train--2018-11-11', NULL, 'Stayed at the hotel until one minute before checkout time. Checked out and left my big bag there while I went to lunch and killed time at KFC until 14:00.\r\n\r\nThe train to Colombo left a little before 15:00 and arrived at Colombo Fort station at 17:30. \r\n\r\nI found the airport buses at map location: 6.934312, 79.848812, and confirmed that they ran all night.\r\n\r\nI walked over to the BK about a kilometer away and had dinner and killed a few hours there.\r\n\r\nA little after 19:00 I took a tuk-tuk back to the airport buses and headed to the airport.  The bus took almost two hours to get to the airport', 1, 4, 71, 1, 1, 0, '2018-11-11', NULL, NULL, '2018-11-12 06:18:20', '2019-02-25 14:54:25'),
(482, 1, 64, NULL, NULL, 'Smore Sala Deang Hostel, Bangkok, Thailand', 'smore-sala-deang-hostel-bangkok-thailand-2018-11-12', NULL, '5/10 Saladaeng Road, Bang Rak, Bangkok, Thailand\r\n\r\nMap Location: 13.727326, 100.536557\r\n\r\nPhone: +66 63 905 2175\r\n\r\nWiFi Login: Smore2017 / smore510 \r\n\r\nBudget Hostel with great location near Si Lom / Sala Daeng subway stations.  Many restaurants and bars are in the area and Lumpini Park is a few blocks away.  It has good prices and good WiFi, Hot Water, and A/C and very compact rooms.', 1, 5, 83, 1, 1, 0, '2018-11-12', NULL, NULL, '2018-11-12 17:56:45', '2019-02-25 16:23:52'),
(483, 1, 64, NULL, NULL, 'Bangkok, Thailand', 'bangkok-thailand', NULL, NULL, 1, 8, 121, 1, 1, 0, '2018-11-12', NULL, NULL, '2018-11-12 19:20:26', '2019-02-22 00:02:21'),
(484, 1, 64, 105, 2377, 'Monday, Flew from Colombo to Bangkok', 'monday-flew-from-colombo-sri-lanka-to-bangkok-thailand-2018-11-12', NULL, 'My 3.5 hour flight on Thai Airlines left Colombo at 01:30 and arrived in Bangkok at 06:30 with a 2 hour time loss.  Everything was smooth and there weren\'t any long lines.  \r\n\r\nWhen I checked in for the flight they asked for an onward ticket.  The guy was carefully examining my onward ticket so I forgot to ask for an aisle seat.  He gave me a middle seat but the plane was only about half full so I moved to a row with an empty seat next to me.\r\n\r\nIn Bangkok, I killed a little time at the airport in a coffee shop since my hostel room wouldn\'t be ready until the afternoon.  I took the airport train to the MRT and then got off at Silom and walked over to the hostel and left my big bag there.  \r\n\r\nThen I took the MRT to the Chao Phraya river to ride the river boats and see the sights.  There were tons of tourists filling up the river boats.  I don\'t remember the river boats being so popular when I was in BKK five years ago but maybe it was the time of year or the time of day.\r\n\r\nFinally got my room at around 14:00 and slept a few hours.  Then went out in the evening first to Lumphini Park and then messed around in Silom and Phat Pong.  The hostel is at a great location right in the middle of everything on Silom Road.', 1, 4, 58, 1, 1, 0, '2018-11-12', NULL, NULL, '2018-11-12 20:12:50', '2019-02-20 11:06:05'),
(485, 1, 64, 105, 2392, 'Tuesday, Went to Grand Palace and Wat Arun in Bangkok', 'tuesday-went-to-grand-palace-and-wat-arun-in-bangkok-2018-11-13', NULL, 'Up at 05:30 and out by sunrise at 06:15. Walked down Silom all the way to the river at Saphon Taksin. Took the river boat to the Grand Palace and got in line at about 08:15.  That was the perfect time to beat the crowd so there was no line at the ticket office.\r\n\r\nThe Grand Palace was good but there was a lot of construction. Also the sun was on the wrong side of half of the good stuff so the photos are back lit. \r\n\r\nNext I went across the river to Wat Arun. They no longer let people climb to the top of the towers like they did five years ago. Too many people probably fell down the very steep stairs.\r\n\r\nAfter that I took the river boat backpast Saphon Taksin to the end of the line where I used to get on the boats as soon as they started at 06:00. I looked for the hotel that I used to stay at but couldn\'t find it.\r\n\r\nI had pork noodles and shrimp dim sum for lunch at a street food place and then walked back to the BTS and went back to Silom.', 1, 4, 67, 1, 1, 0, '2018-11-13', NULL, NULL, '2018-11-13 19:56:26', '2019-02-22 00:32:02'),
(486, 1, 66, NULL, NULL, 'Mandalay, Myanmar', 'mandalay-myanmar', NULL, NULL, 1, 8, 118, 1, 1, 0, '2018-11-14', NULL, NULL, '2018-11-14 20:22:52', '2019-02-21 23:16:38'),
(487, 1, 66, NULL, NULL, 'Hotel Boss', 'hotel-boss-mandalay-myanmar-2018-11-14', NULL, 'No.16, 26th Street Between 91st Street x 92nd Street, Mandalay, Myanmar\r\n\r\nMap Location: 21.983795, 96.066798\r\n\r\nPhone: +95 92014205\r\n\r\nVery comfortable Mid-level hotel with rooftop restaurant and Asian breakfast included.  Very modern rooms with good A/C, WiFi, and Hot Water.  It\'s a little too far away from the center of Mandalay and the Royal Palace for walking.', 1, 5, 92, 1, 1, 0, '2018-11-14', NULL, NULL, '2018-11-14 20:53:42', '2019-02-24 22:48:22'),
(488, 1, 66, 105, 2407, 'Wednesday, Flew from Bangkok to Mandalay, Myanmar', 'wednesday-flew-from-bangkok-to-mandalay-myanmar-2018-11-14', NULL, 'Used the Grab app to book a ride to Don Muang Airport for my flight from Bangkok to Mandalay, Myanmar.  The Air Asia check-in was a big mess as usual with huge lines.  All of the other airline counters were almost empty.\r\n\r\nThe flight went smoothly and it only took about two hours.  In Mandalay I took a shared taxi which is actually a minibus that filled up pretty quickly with European backpackers.  On the ride from the airport we saw tons of temples and stupas and monks in pink robes and cone hats everywhere.\r\n\r\nAfter checking into Hotel Boss, I took a tuk-tuk to the Royal Palace and walked around the walls.  I didn\'t realize how long the walls are so I had to grab a motorcycle taxi just to get to the other side.  It got dark pretty early so I took some night shots of the walls, moat, and the temples on Mandalay Hill.', 1, 4, 59, 1, 1, 0, '2018-11-14', NULL, NULL, '2018-11-14 20:59:14', '2019-02-17 14:18:08'),
(489, 1, 66, 105, 2439, 'Thursday, Went up Mandalay Hill and Sandar Muni Pagoda', 'thursday-went-up-mandalay-hill-and-sandar-muni-pagoda-mandalay-myanmar-2018-11-15', NULL, 'After the all Asian breakfast at the hotel, I hopped into the back of a truck bus (benches in the back of a truck) to get closer to the center where I could get a motorcycle taxi.  Took the motorcycle the bottom of Mandalay Hill.  \r\n\r\nThey don\'t allow shoes on the climb up the thousands of stairs so I left mine there and went up in my socks.  There were different buddhas along the way and a lot of small shops and restaurants.  At the top they made me take my socks off too.\r\n\r\nThere were some nice views at the top but a lot of the views were obstructed by trees.  It\'s also possible to go to the top by tuk-tuk and an elevator and most of the people did it that way.\r\n\r\nI walked back down and got my shoes.  There was a tuk-tuk driver at the bottom who sold me on an afternoon trip to the surrounding sites.  I made plans for him to pick me up at noon but he never showed up so I didn\'t get to go.\r\n\r\nIn the afternoon I went to the Sandar Muni Pagoda which has the thousands of white stupas each covering a page of Buddha\'s teachings engraved in granite.  All of the granite pages create a huge book.', 1, 4, 65, 1, 1, 0, '2018-11-15', NULL, NULL, '2018-11-15 19:01:58', '2019-02-23 20:12:14'),
(490, 1, 67, NULL, NULL, 'Mya Sabai Inn', 'mya-sabai-inn-kalaw-myanmar-2018-11-16', NULL, 'No.1/91-92, Union Road (Main Highway), Kalaw, Myanmar\r\n\r\nMap Location: 20.636599, 96.563903\r\n\r\nPhone: +9595283329\r\n\r\nMid-range hotel with big comfortable rooms, good A/C, decent WiFi, and good Hot Water, Breakfast included.  Good location near the center of Kalaw and the intercity bus stops nearby.', 1, 5, 87, 1, 1, 0, '2018-11-16', NULL, NULL, '2018-11-16 20:18:23', '2019-02-25 21:44:26'),
(491, 1, 67, 105, NULL, 'Friday, Went from Mandalay to Kalaw by Bus', 'friday-went-from-mandalay-to-kalaw-myanmar-by-bus-2018-11-16', NULL, 'I used [Book A Way](https://bookaway.com) to book a luxury bus from Mandalay to Kalaw for about 12 USD.  The JJ Express bus left from the big bus station that is about 6 km from the center of Mandalay at map location: 21.924320, 96.088294.  I went by tuk-tuk to the bus station and it took at least 30 minutes with all of the morning traffic.\r\n\r\nOn the way to the bus station, the tuk-tuk passed an area where they create white Buddha statues of all sizes.  They had thousands of statues in many little shops, in various degrees of completion, some with blocks for heads.  It looks like they carve the head and face last.  It would have been fun to walk through there but I could only take photos as the tuk-tuk sped by the many shops. \r\n\r\nThe bus left right on time and it was very comfortable with huge seats because there were only three seats per row.  They also had snacks and a personal music and video device for every seat.  I watched \'The Shawshank Redemption\' and it was delightful after many months of almost no TV or movies.\r\n\r\nWe had a 30 minute lunch break at the half way point and another 10 minute bathroom break in the afternoon.  The trip on the little roads was about 6 hours from 09:00 to 15:00.\r\n\r\nIn Kalaw, the Mya Sabai Inn was only a few blocks down the main highway from where the bus dumped us out.  I checked in and went for a late lunch at a tourist restaurant and then walked up a hill to a temple that had a nice view of the town and the valley.  There were also a few temples in the center of town that I went through.\r\n\r\nLater I went to a motorcycle and bicycle rental place and reserved a motorbike for the next day, 10 USD all day, not including gasoline.  They don\'t open until 08:30 so I can\'t leave extra early like I prefer to do.', 1, 4, 81, 1, 1, 0, '2018-11-16', NULL, NULL, '2018-11-17 06:30:20', '2019-02-24 08:31:19'),
(492, 1, 67, NULL, NULL, 'Kalaw, Myanmar', 'kalaw-myanmar', NULL, NULL, 1, 8, 191, 1, 1, 0, '2018-11-16', NULL, NULL, '2018-11-17 06:40:16', '2019-02-24 14:34:00'),
(493, 1, NULL, NULL, NULL, 'page-about', 'page-about', NULL, 'Copyright\r\n\r\nAll Images, Photos, Graphics, and Content on this site  1998-2018 [[site-name]].  All Rights Reserved. Do not copy, archive or re-post without written permission from the author.  For more information, please contact [[site-email]].\r\n\r\nTechnical Specifications\r\n\r\nThis web site uses PHP 7, MySQL 5.7, Laravel 5.4, Bootstrap 3.3.5, and jQuery 2.1.4.\r\n\r\nHow to use Map Locations\r\n\r\nMap locations are provided as GPS coordinates in Decimal Degree (DD) format, for example: Map Location: 43.264753, 76.953360.  \r\n\r\nA map location can be clicked or pressed to open the location in Google Maps.  Also, the coordinates can be copied by clicking on or pressing the clipboard icon to the right of the coordinates and then pasting them into other mapping applications such as [Maps.me](https://maps.me/), [Bing Maps](https://www.bing.com/maps), or [Baidu Maps ](https://map.baidu.com/).', 1, 99, 0, 0, 0, 1, NULL, NULL, NULL, '2018-11-17 07:24:25', '2018-12-31 10:45:27'),
(494, 1, 67, 105, 2478, 'Saturday, Went from Kalaw to Inle Lake by Motorbike', 'saturday-went-from-kalaw-to-inle-lake-by-motorbike-2018-11-17', NULL, 'Nyaung Ohak Stupa Site\r\nInthein village\r\nShwe Inn Dein Pagoda\r\n\r\nAt 08:30, I went to pick up the motorbike that I had reserved and headed out on the highway.  I had to go on the big highway for about 10 km.  There were a lot of truck and buses which make me nervous but the highway was nice and wide.\r\n\r\nI turned off the main road at the town of Aungpan.  The road was paved but very narrow so passing oncoming traffic was harrowing.  Luckily there were mostly motorcycles and not many four wheel vehicles which took up most of the road.  The pavement eventually ran out and so did the traffic.  I was mostly alone on the road except for occasional motorcycles and a few pedestrians.\r\n\r\nThe scenery was very nice with colorful fields and green hills.  I pulled off to enter a few temples and pagodas.  I went to one place with pagodas on the top of a hill.  I thought there would be a good view of the fields from the top so I attempted to climb up to the top.  The steep, narrow, and slippery path was covered with spiderwebs full of big spiders.  I made it almost to the top and then there was about 10 meters of path left that was covered in spider webs and big spiders up high in the trees.  It looked like something out of Indiana Jones.  I had a stick to clear the webs with but I was afraid that all of the spiders would drop down and be all over the place so I aborted and went back down the hill defeated.  I don\'t think that I\'ve ever been thwarted by spiders before.\r\n\r\nI continued on the motorbike in the direction of Inle Lake.  The road was so bad that I was worried about blowing a tire so I took it easy.  I passed one guy who had blown out a tire.  I stopped along the way for photo opps and finally got to the little village of Inlein (or Inn Dein or Indein).  The village was on a creek with boat access to Inle Lake but I didn\'t have time to take a boat ride and get the motorbike back to Kalaw by 17:30.  There was a good view from a hill of the lake and all the houses around it.\r\n\r\nIn the village, I went to the famous Nyaung Ohak Stupa site and the Shwe Inn Dein Pagoda at the top.  There are thousands of stupas at this place, some crumbling and some in good shape.  There are also souvenir stalls all the way up to the pagoda.\r\n\r\nThe ride back to Kalaw at about 16:00 was fun because of all the farmers were heading home.  There were trucks full of ladies in their traditional garb, oxcarts, and farmers walking their water buffaloes home with the kids riding on them. \r\n\r\nBack in Kalaw I turned in the motorcycle.  One of the mirrors had fallen off and the lady noticed it immediately.  I told her that it shook off and I had it in my backpack so she was okay with that.  The other big hassle with the motorbike was that the fuel gauge didn\'t work so I couldn\'t tell how much fuel there was.  I filled it up twice just in case.  In the countryside, there aren\'t gas stations but the little stores have gasoline in liter-sized liquor bottles.  Luckily all the gasoline only cost about 2 USD.', 1, 4, 76, 1, 1, 0, '2018-11-17', NULL, NULL, '2018-11-17 19:40:06', '2019-02-25 18:29:04'),
(495, 1, 68, 105, 2484, 'Sunday, Kalaw to Nyaung Shwe and Afternoon Boat Tour of Inle Lake', 'sunday-kalaw-to-nyaung-shwe-and-afternoon-boat-tour-of-inle-lake-2018-11-18', NULL, 'At 08:30 I took a minibus from Kalaw to Nyaung Shwe.  I had arranged it the day before.  The minibus actually only went as far as the turn off to Nyaung Shwe at Shwenyaung.  The driver let us out there and we took a taxi the rest of the way.  A Korean girl was doing the same thing that I was doing so we shared a taxi for 4000 MMK each.\r\n\r\nAfter checking into the Royal Nuaung Shwe Hotel, I booked an afternoon boat tour of Inle lake with them from 12:00 to 18:00.  That gave me time to eat lunch and then meet the boat driver in the lobby. We walked over to one of the many river canals to get into his boat.\r\n\r\nWe had a nice afternoon of speeding around the lake and going to different temples and shopping places.  He kept taking me to shopping places where he would get a commission if I bought anything which I didn\'t as usual.  There were also tons of souvenir stalls at each temple or pagoda that we stopped at.  We stopped at a big restaurant on stilts with great views for lunch.  I had a hot and spicy fish curry that was probably fresh out of the lake. \r\n\r\nThe lake was full of speeding boats both with tourists and locals doing their business.  It was very scenic with villages full of stilt houses.  The famous leg-rowing fisherman who paddle with one leg and hold a big basket to catch fish with were around.  Mostly it was a show for the tourists like the stilt fishermen in Sri Lanka.  I did see that some of them were doing it for real off in the distance by themselves.\r\n\r\nAt sunset all the tourist boats gathered around at one end of the lake and the fisherman did their show for tips.  Then all the boats sped back into town to dump us out.', 1, 4, 72, 1, 1, 0, '2018-11-18', NULL, NULL, '2018-11-18 19:51:42', '2019-02-25 16:45:34'),
(496, 1, NULL, NULL, NULL, 'Lago Inle, Myanmar', 'inle-lake-myanmar', NULL, NULL, 1, 8, 156, 1, 1, 0, '2018-11-18', NULL, NULL, '2018-11-18 20:10:41', '2019-02-23 05:42:49'),
(497, 1, 68, NULL, NULL, 'Royal Nyaung Shwe Hotel', 'royal-nyaung-shwe-hotel-2018-11-18', NULL, 'No.33, Paung Daw Pyan Road Mingalar Quater, Nyaung Shwe, Myanmar\r\n\r\nMap Location: 20.657568, 96.930035\r\n\r\nPhone: +9595022594\r\n\r\nHigh End Hotel with Mid Range prices.  Good WiFi, Hot Water, A/C, and Breakfast is included.  Good location right in the middle of Nyaung Shwe.  They can book tours, buses, special events.', 1, 5, 94, 1, 1, 0, '2018-11-18', NULL, NULL, '2018-11-18 20:33:36', '2019-02-21 15:02:01'),
(515, 1, 71, 105, 2645, 'Monday, All Day Exploring the Hpa An Area', 'monday-all-exploring-the-hpa-an-area-2018-11-26', NULL, 'I rented a motorbike from the hotel in the morning for 10K, all day.  The first stop was Mount Zwegabin.  I climbed the million steps to the top for the spectacular 360 degree view of the entire area.  It was a hard climb up even though it was cement stepss all the way and everybody was gassed.  There are a couple of pagoda stupas at the top as well as the band of macaques that try to steal everything.  It took about an hour and a half to go up and an hour to come back down.  I was soaked in sweat and wiped out at the end of it.\r\n\r\nNext I took the back roads as much as possible to the Saddan Cave.  The back roads had some nice scenery of the bright green rice paddies in front of the karst mountains that rise dramatically out of the flat plain.  There were a few other tourists on motorbikes trying to find their way around.  We have to stop at almost every intersection to check the map on our phones.\r\n\r\nAt Saddan Cave, access to the road to return to Npa An on the other side of the mountain was closed.  I had to go back along the main road and then cut through the mountains.  \r\n\r\nI crossed the river on the big bridge that was full of trucks and buses to go to the bat cave.  The bat cave was closed and no one was around so I went on down the road to the KawGon (KawGon) Cave and took a look.', 1, 4, 63, 1, 1, 0, '2018-11-26', NULL, NULL, '2018-11-28 13:04:26', '2019-02-20 02:11:19'),
(498, 1, 68, 105, 2502, 'Monday, Biking Around Inle Lake and Taunggyi Balloon Festival', 'monday-biking-around-inle-lake-and-taunggyi-balloon-festival-2018-11-19', NULL, 'Rented a bike in the morning and rode down to the long wooden bridge at Maing Thauk.  Stopped at a few pagodas and temples along the way.  Most of the ride was on the main road so there was a little traffic.  The walk along the wooden walkway at Maing Thauk is very scenic. \r\n\r\nAt Maing Thauk, I took a boat across the lake to the other side at Kaung Daing to ride back up to Nyaung Shwe from there.  I found a Spanish couple who were doing the same route so we shared a boat for 4000 kyat per person and our bikes.  For a boat just for me it would have been 10000 kyats.\r\n\r\nI stopped in some more pagodas on the way back.  Once I got on the smaller road heading east into the town it was along the lake so the scenery was a lot nicer.  I stopped to watch two water buffalo fighting and locking horns.\r\n\r\nIn the evening, I went to the Taunggyi Hot Air Balloon Festival that is held once a year.  There were thousands of people there but it was a huge area.  It was like a state fair with big amusement park rides and many food stalls.  The locals were getting drunk and rowdy.\r\n\r\nThe balloons were made by teams who came in with their trucks to great fanfare with drum pounding  and singing and dancing.  The team would assemble the large balloons in the field with the crowd gathered around them.  Then they would partial inflate it and hang little candles in cups in a design all around the outside of the balloon.  Then the guy with the big torch would light the main thing in the center and the balloon would take off and show it\'s design.  The balloon that went the highest would win something.\r\n\r\nThe last few balloons were loaded with fireworks so they would go up and start shooting rockets in all directions.  It was a spectacular sight.', 1, 4, 74, 1, 1, 0, '2018-11-19', NULL, NULL, '2018-11-20 07:22:40', '2019-02-22 11:36:28'),
(499, 1, NULL, NULL, NULL, 'Taunggyi, Myanmar', 'taunggyi-myanmar', NULL, NULL, 1, 8, 157, 1, 1, 0, '2018-11-19', NULL, NULL, '2018-11-20 18:03:51', '2019-02-25 10:23:30'),
(500, 1, NULL, NULL, NULL, 'Bagan, Myanmar', 'bagan-myanmar', NULL, NULL, 1, 8, 173, 1, 1, 0, '2018-11-21', NULL, NULL, '2018-11-21 07:46:58', '2019-02-24 12:25:50'),
(502, 1, NULL, NULL, NULL, 'Must See Temples in Bagan', 'must-see-temples-in-bagan-2018-11-22', NULL, 'Gadawt Palin Temple, 21.170051, 94.856505', 1, 5, 1, 0, 0, 1, '2018-11-22', NULL, NULL, '2018-11-22 10:53:27', '2018-12-08 18:27:09');
INSERT INTO `entries` (`id`, `site_id`, `location_id`, `parent_id`, `photo_id`, `title`, `permalink`, `description_short`, `description`, `user_id`, `type_flag`, `view_count`, `published_flag`, `approved_flag`, `deleted_flag`, `display_date`, `color_foreground`, `color_background`, `created_at`, `updated_at`) VALUES
(503, 1, 70, NULL, NULL, 'Check In @ Downtown Yangon', 'check-in-downtown-yangon-2018-11-23', NULL, 'No.69, 14 Street Middle Block (Between Anawrahtar Road & Maharbandoola Road), Yangon downtown, Yangon, Myanmar\r\n\r\nMap Location: 16.775336, 96.14575.\r\n\r\nPhone: +951224470', 1, 5, 82, 1, 1, 0, '2018-11-23', NULL, NULL, '2018-11-23 07:35:49', '2019-02-16 00:17:16'),
(504, 1, 69, 105, 2557, 'Thursday, Sunrise over the Pagodas, Night Bus to Yangon', 'thursday-sunrise-over-the-pagodas-night-bus-to-yangon-myanmar-2018-11-22', NULL, 'Got up at 05:00 and rented a electric scooter from the hotel again and took off into the darkness.  This time at least I knew how to turn on the motorbike lights.  I went to a different location (Map Location: 21.150101, 94.861391) and there were already a few people there.  This location was farther away from the balloons but it had a nice clear view with a zoom lens.\r\n\r\nWatched the nice sunset and balloons crossing the horizon and then went back to the hotel for breakfast.  I packed and checked out and left my big backpack at the hotel and headed out for the rest of the day on the scooter.  I went to all of the popular pagodas and tried to take the back roads as much as possible to avoid the heavy bus and truck traffic.  The back roads are usually just little dirt paths and a lot of fun on the motorbike. \r\n\r\nI went back to the hotel at 19:00 and the bus company picked me up in a truck.  We all sat on some mats in the back of the truck as they picked up the rest of the people and then drove the 15 km or so to the bus station.  The overnight bus ride was very comfortable and I slept really well.  I had an empty seat next to me so that was a luxury.', 1, 4, 84, 1, 1, 0, '2018-11-22', NULL, NULL, '2018-11-23 15:01:57', '2019-02-23 22:29:46'),
(505, 1, 69, 105, 2539, 'Wednesday, All Day Exploring the Pagodas at Bagan Myanmar', 'wednesday-all-day-exploring-the-pagodas-at-bagan-myanmar-2018-11-21', NULL, 'Got up at 05:00 for the sunset.  Went across the street to the electric motorbike place that I had arranged a rental with.  No one was there so I went back to the hotel and rented one for slightly more money.  I couldn\'t figure out how to turn on the lights on the motorbike so I used my heavy duty flashlight for headlights.\r\n\r\nI went to a small pagoda (map location: 21.145138, 94.882221) with roof access next to the huge Dhammayazaka Pagoda.  There were already a few people on the roof and a local guy had lit up the inside of the pagoda with candles.  I climbed up to a high spot and stayed there until it got pretty light.  Most of the people were on a bigger pagoda down the road about 100 meters (map location: 21.145909, 94.883118) so I went over there and got the best photos.\r\n\r\nAfter the sun came up a little, the hot air balloons took off and passed right over us for fantastic photo ops.   It was quite a sight.  Later that day I checked into the balloon rental and they charge a little over 300 USD for the entire balloon so you have to put your own group together.  They were all booked up for about a week so you have to book in advance.\r\n\r\nI spent the rest of the day exploring all of the best pagodas on my motorbike.  It was very fun having the scooter.  I went to see the sunset at the Lawka Nanda Pagoda Stupa which has a nice view of the river.  The sunset wasn\'t very interesting though.', 1, 4, 81, 1, 1, 0, '2018-11-21', NULL, NULL, '2018-11-23 15:17:01', '2019-02-23 06:40:44'),
(506, 1, 68, 105, 2563, 'Tuesday, Nyaung Shwe to Bagan Bus', 'tuesday-nyaung-shwe-to-bagan-bus-2018-11-20', NULL, 'Left the beautiful Inle Lake area and took the bus to Bagan.  The bus left at 8:30 and arrived around 15:30.  It was the normal routine, a 10 minute bathroom stop and a 30 minute lunch stop.  I had a timid Burmese lady sitting next to me.\r\n\r\nIn Bagan we had the normal confusion and arguing with the taxi drivers.  There was a big sign that gave the price but they wanted more.  I shared a taxi with two haggard, chain-smoking French ladies and we paid 4000 kyat apiece.\r\n\r\nIt was too late to do anything by the time I got checked in to the hotel.  I went around the corner to a local place for dinner and ate a lot of unidentifiable vegetables and dried fish curry.  I made arrangements with an electric bike guy for sunrise the next day.  He told me where the best view point was on top of a pagoda.  Only a few pagodas are open for roof access in the mornings.  A lot of them have been closed due to damage by the tourists.', 1, 4, 58, 1, 1, 0, '2018-11-20', NULL, NULL, '2018-11-23 20:12:54', '2019-02-16 10:05:37'),
(507, 1, 70, 105, 2565, 'Friday, First Day in Yangon, Myanmar', 'friday-first-day-in-yangon-myanmar-2018-11-23', NULL, 'The bus arrived earlier than expected at about 05:00.  I could have slept comfortably for a few more hours.  The driver made a bathroom stop about 15 minutes before we got to the station so we were all confused about where we were.\r\n\r\nI waited in the bus station until sunrise a little after 06:00 and took a taxi to downtown Yangon.  The guy wanted the money up front because he had stopped at a gas station and filled up and he didn\'t have any money on him.  I refused for awhile and he got pretty excited and was showing me his empty wallet and waving it around frantically.  We had to pull away from the pumps while the gas station lady stood there waiting for her money.  I gave her enough to pay the bill but not all of my fare.  I held some back to make sure he didn\'t throw me out somewhere before we got to the hotel.\r\n\r\nLuckily the hotel had a room ready at 07:30 so I didn\'t have to do the tired zombie walk around the city until the 14:00 check-in time.  I snoozed for a few hours and then walked to KFC for lunch and then over to the huge Shwedagon Pagoda.  The massive stupa is surrounded by many temples and and hundreds of Buddhas and many other figures.  There were a lot of tourist monks around taking selfie.  I walked around it a few times to get my steps in and then took the bus back to my neighborhood.', 1, 4, 62, 1, 1, 0, '2018-11-23', NULL, NULL, '2018-11-23 20:24:42', '2019-02-22 10:53:13'),
(508, 1, 70, NULL, NULL, 'Yangon, Myanmar', 'yangon-myanmar', NULL, NULL, 1, 8, 183, 1, 1, 0, '2018-11-23', NULL, NULL, '2018-11-23 20:47:20', '2019-02-24 16:52:04'),
(509, 1, 70, 105, 2580, 'Saturday, All Day in Yangon, Myanmar', 'saturday-all-day-in-yangon-myanmar-2018-11-24', NULL, 'In the morning, I got my laundry back from the hotel so I have clean clothes for the first time in about a month \r\n\r\nWalked from the hotel to the big Bogyoke Aung San Market (Map location: 16.780346, 96.155725).  It is full of souvenir, jewelry, and fabric shops.  I bought a Myanmar tee shirt and some other small stuff.\r\n\r\nIn the afternoon, I took a few buses over to the big park, Bogyoke Park, that has Kandawgi Lake.  It wasn\'t very nice so I didn\'t stay long.  There was a lot of construction and the lake wasn\'t very clean.', 1, 4, 61, 1, 1, 0, '2018-11-24', NULL, NULL, '2018-11-24 12:16:57', '2019-02-24 01:56:51'),
(510, 3, NULL, NULL, NULL, 'Welcome', 'section-welcome', NULL, NULL, 1, 7, 0, 0, 0, 1, NULL, NULL, NULL, '2018-11-24 18:56:14', '2018-11-24 19:06:39'),
(511, 1, 71, NULL, NULL, 'Hpa An, Myanmar', 'hpa-an-myanmar', NULL, NULL, 1, 8, 141, 1, 1, 0, '2018-11-25', NULL, NULL, '2018-11-25 19:17:00', '2019-02-21 21:46:57'),
(512, 1, 71, NULL, NULL, 'Hpa-An River View Motel', 'hpa-an-river-view-motel-2018-11-25', NULL, '4/12 Kan Nar Street 4 (Main Road), Hpa-an, Myanmar\r\n\r\nMap Location: 16.885536, 97.626644\r\n\r\nPhone: +95 9 793 000045\r\n\r\nComfortable Mid-Range hotel with good A/C, WiFi, and Hot Water.  Location is about 1 km from the center of the town.  The river view is now partially blocked my new construction across the street along the river.', 1, 5, 85, 1, 1, 0, '2018-11-25', NULL, NULL, '2018-11-25 19:38:23', '2019-02-21 01:36:14'),
(513, 1, 71, 105, 2611, 'Sunday, Went from Yangon to Hpa An by Bus', 'sunday-went-from-yangon-to-hpa-an-by-bus-2018-11-25', NULL, 'Up and out by 07:00.  Took a taxi to the bus station from Downtown Yangon.  The bus to Hpa An left at 09:00 and arrived at around 15:00.  It was another VIP bus with only three big seats in every row each with their own entertainment system.  I watched the movie \"Lucy\" again.  I think I saw it for the first time in Asia in 2014.\r\n\r\nThe bus dropped me off right in front of the River View Motel.  After checking in, I walked to the boat dock in town about a 1 km away.  I took the little ferry boat across the river with a few locals.  I walked up Hpa Pu mountain which is really just a hill.  The monk made me take my shoes off on the rough path so it was grueling coming down with bare feet.  It was rocky and not cement steps like usual so it was pretty rough on my delicate feet.\r\n\r\nGot some great sunset photos of the area.  I didn\'t make it to the top of the hill because I was worried about getting back to the river before 18:00 to catch the last ferry back across.', 1, 4, 66, 1, 1, 0, '2018-11-25', NULL, NULL, '2018-11-25 20:15:59', '2019-02-23 08:55:47'),
(598, 1, NULL, NULL, NULL, 'Czech Republic', 'czech-republic', NULL, NULL, 1, 8, 39, 1, 1, 0, '2010-04-28', NULL, NULL, '2019-01-27 08:08:07', '2019-02-25 19:11:58'),
(514, 1, 73, NULL, NULL, 'AV Hotel', 'av-hotel-vientiane-laos-2018-11-28', NULL, 'Samsenthai Road,Vientiane, Laos\r\n\r\nMap Location: 17.964529, 102.611325\r\n\r\nTelephone Number: +856 021 265 085', 1, 5, 86, 1, 1, 0, '2018-11-28', NULL, NULL, '2018-11-28 11:48:09', '2019-02-19 09:35:46'),
(516, 1, 71, 105, NULL, 'Tuesday, Went from Hpa An Myanmar to Phitsanulok Thailand', 'tuesday-went-from-hpa-an-myanmar-to-phitsanulok-thailand-2018-11-27', NULL, 'Traveled all day to get from Myanmar to Vientiane, Laos as soon as possible.  I didn\'t want to spend anymore time in Thailand because my time is running out.  I wasn\'t sure how far I could make it because I didn\'t know if there were going to be any night buses.\r\n\r\nI took a shared taxi that I arranged through the hotel from Hpa An to Myawaddy at the border between Myanmar and Thailand.  The taxi was just a private car that left at 09:00 and then arrived in Myawaddy at around 13:00.  He dropped us off right near the border.\r\n\r\nI changed all of my kyat to baht and then walked through the border and across the bridge to Thailand.    The was an easy crossing with almost no lines.  For the Myanmar border exit, there were no signs and the border guy came out of the office to call me in to the right place.  It was on the left side and there were some sliding glass windows that were smoked and closed.\r\n\r\nOn the Thai side, there are different windows for different passports.  I went to Window 14 for \"Foreign Passport\".  I filled out the entry form and got right through.  There were 2 or 3 people in line.\r\n\r\nAt the Thai immigration exit there was a motorbike taxi stand.  I told them I needed to go to the bus to Phitsanulok and a lady taxi driver took me.  She had to hold my big backpack between her legs while I wore the little backpack because it is a lot heavier and has all of my delicate stuff in it, computer, camera etc.\r\n\r\nAt the bus station, I bought the ticket for minibus to Phitsanulok which is about a 4 or 5 hour trip.  The bus left within an hour and was full.  There were multiple police passport checks along the way.  On the second passport check about an hour into the trip, half of the people on the minibus got pulled off for some kind of visa problem.  After that we had plenty of space on the bus until we picked up more people toward the end of the trip.  We arrived in Phitsanulok after dark at about 19:00.\r\n\r\nAt the Phitsanulok bus station, they told me that the night bus to Khon Kaen leaves from a different bus terminal about 10 km away.  The minibus that I was on probably went on to there but I had no way to know and the driver couldn\'t speak any English.  I took a taxi to the other station and bought a ticket for the 21:10 overnight bus.', 1, 4, 75, 1, 1, 0, '2018-11-27', NULL, NULL, '2018-11-28 13:50:43', '2019-02-25 21:45:43'),
(517, 1, 73, 105, NULL, 'Wednesday, Went from Kohn Kaen, Thailand to Vientiane, Laos', 'wednesday-went-from-kohn-kaen-thailand-to-vientiane-laos-2018-11-28', NULL, 'The night bus from Phitsanulok to Khon Kaen Thailand left late at about 22:00 and arrived at about 03:15 in the morning.  Luckily there was a quick connection to a night bus to Nong Khai and I only had to wait about 15 minutes.  I slept pretty well next to a warm and chubby Thai lady.  I had to put the armrest down so she wouldn\'t encroach so much on my seat.  When the armrests are up, the big people tend to naturally expand into both seats.\r\n\r\nWe arrived at Nong Khai at about 06:30.  There were a few other tourists on the bus.  I thought about trying to share a tuk-tuk but it was only 100 baht for the trip to the Friendship Bridge.\r\n\r\nAt the border crossing, there was some confusion by the backpackers as to whether or not we needed photos for the Laos visa on arrival.  I already had some old ones so I went on through.  It turned out that photos aren\'t needed because they take photos of everyone.\r\n\r\nThe Thai exit was easy and there was a 20 baht bus to shuttle people across the bridge because walking is not allowed. \r\n\r\nThe Laos visa on arrival required several similar forms to be filled out and a payment of 1500 baht or 35 USD.  There were quite a few people going through but no lines since they just took a quick photo and then took the money, passports, and papers and processed them inside the office while we waited in a group for our stamped passports to come out.\r\n\r\nOutside of immigration I found the only money exchange place that was open at 08:00 and changed all of my Thai Baht to Lao Kip.  Then I took a truck taxi to the center for 40000 Kip directly to the AV hotel.  I didn\'t have a reservation because I didn\'t think that I would make it this far in one day and one night.  \r\n\r\nThe hotel had rooms that were ready so I got right in and also had the excellent buffet breakfast for an additional charge.  I took the biggest room since I had money left over for the month.  It was massive with a balcony and a seating area with leather couches.\r\n\r\nIn the evening, I walked down to the Mekong River promenade park.  It was nice but the actual river was a long way away.  In monsoon season it is probably a lot closer.  There is a big night market and many open air bars and restaurants along the promenade.', 1, 4, 74, 1, 1, 0, '2018-11-28', NULL, NULL, '2018-11-28 14:11:37', '2019-02-23 04:47:24'),
(518, 1, 74, NULL, NULL, 'Myawaddy Myanmar to Mae Sot Thailand Border Crossing', 'myawaddy-myanmar-to-mae-sot-thailand-border-crossing--2018-11-27', NULL, 'Crossing the border from Myawaddy Myanmar to Mae Sot Thailand is very easy and straightforward.\r\n\r\nOn the Myanmar side, the exit office is on the left side of the road.  There are no signs on the sliding glass windows but they can be opened to get the attention of the border agents.\r\n\r\nAfter getting the exit stamp there is final check and then it is possible to walk across the bridge which is only about 500 meters.\r\n\r\nOn the Thai side there are different lines depending on nationality.  There are separate lines for Myanmar and Chinese citizens.  Window 14 is for all other foreign passports.', 1, 5, 69, 1, 1, 0, '2018-11-27', NULL, NULL, '2018-11-28 15:19:20', '2019-02-24 18:58:15'),
(519, 1, 73, NULL, NULL, 'Vientiane, Laos', 'vientiane-laos', NULL, NULL, 1, 8, 142, 1, 1, 0, '2018-11-28', NULL, NULL, '2018-11-29 13:03:41', '2019-02-25 01:47:09'),
(520, 1, 73, NULL, NULL, 'Nong Khai, Thailand to Vientiane, Laos Border Crossing', 'nong-khai-thailand-to-vientiane-laos-border-crossing-2018-11-29', NULL, 'The border is open from 06:00 to 22:00 daily.\r\n\r\nTo get from the Nong Khai bus station (map location: 17.884875, 102.75491) to the Friendship Bridge Border Crossing, tuk-tuks charge around 100 baht.\r\n\r\nThe Thai exit is simple and quick.  After getting the exit stamp, there is a bus to shuttle people across the bridge to the Lao side for 20 baht.  Walking across is not allowed.\r\n\r\nThe Laos visa on arrival requires several similar forms to be filled out and a payment of 1500 baht or 35 USD.  They give out the forms from office.  Once the forms are ready, the process is fairly quick and the lines are short.  They just take a quick photo and then take the payment, passports, and papers and process them in bulk inside the office.  Once a passport has been processed and stamped, it comes out the other side at another window where everyone is waiting.\r\n\r\nThere are currency exchange offices on the Lao side of the border.  They open around 08:30 or 09:00.  There may be one or two open a little earlier.\r\n\r\nThere are mobs of motorcycle taxi, tuk-tuk and truck taxi drivers that will start harassing people as they are going through immigration.  The fare to downtown Vientiane is around 40K kip minimum.', 1, 5, 95, 1, 1, 0, '2018-11-29', NULL, NULL, '2018-11-29 18:06:53', '2019-02-25 18:28:42'),
(521, 1, 73, 105, 2677, 'Thursday, All Day Exploring Vientiane, Laos', 'thursday-all-day-exploring-vientiane-laos-2018-11-29', NULL, 'In the morning, I walked over to the central bus station and found bus 14 to the Buddha Park.  It also stops at the border crossing to Thailand at the Friendship Bridge.  The bus is slow but cheap and better than having to deal with the tuk-tuk drivers.  The bus drivers know that foreigners are either getting off at the border or at the Buddha Park.  The park is 20 to 25 km from downtown Vientiane.\r\n\r\nThe Buddha Park is purely for tourists and has little or no cultural value but it is still fun, impressive, photogenic, and worth a visit.  The park isn\'t very big so it doesn\'t take long to go through it and take nice photos.  The bus stop to return to Vientiane is right across the street and there is a sign.\r\n\r\nAfter returning from the Buddha Park, I negotiated a tuk-tuk ride for 20k to the Wat That Luang area to see the temples and big stupa.  The area is nice with all the typical stuff including a lot of souvenir stalls.  I had an excellent hot curry at an upscale restaurant across the street from the complex, next to the bus stop.  I took the bus back to downtown.\r\n\r\nIn the afternoon, I walked to the Wat Sisakit temple.  It\'s a small place and hardly worth a visit or the 10k entry fee.  After that I walked up the main street, Avenue Lane Xang, to the Patuxay Park which has the huge, impressive arch which is an Asian version of the Arc de Triomphe in Paris.\r\n\r\nOn the way back, I went to a tour office and bought a bus ticket to Luang Prabang for the next day.  The hotel pick up will be at 07:00 for the 12 hour bus ride.', 1, 4, 60, 1, 1, 0, '2018-11-29', NULL, NULL, '2018-12-01 08:39:48', '2019-02-25 00:03:39'),
(522, 1, NULL, 105, 2683, 'Friday, All Day Bus Ride from Vientiane to Luang Prabang, Laos', 'friday-all-day-bus-ride-from-vientiane-to-luang-prabang-laos-2018-11-30', NULL, 'The bus people picked me up at the hotel in a pickup taxi a little after 07:00 to go to the Northern Bus Station.  The crappy VIP bus left right before 09:00, almost an hour late.  It was a long, slow, 12 hour trip to go the 330 kms to Luang Prabang.  The trip is mostly through very scenic mountains but the roads were horrible and there was a lot of slow, barely crawling truck traffic.\r\n\r\nIn Luang Prabang, there was a shared truck taxi from the bus station to downtown.  The prices were all fixed at 20k per person.  The driver took us to a hotel on the far side of downtown and tried to make us get out.  It looked like he had a deal with that hotel because a lady came out.  I made him go to a more central location where the other people who didn\'t have hotel reservations got out.  He then took took me and one other tourist to our hotels.', 1, 4, 62, 1, 1, 0, '2018-11-30', NULL, NULL, '2018-12-01 09:02:01', '2019-02-25 03:42:20'),
(523, 1, 75, NULL, NULL, 'Luang Prabang, Laos', 'luang-prabang-laos', NULL, NULL, 1, 8, 149, 1, 1, 0, '2018-12-01', NULL, NULL, '2018-12-02 14:20:11', '2019-02-25 15:40:37'),
(524, 1, 75, 105, 2710, 'Saturday, All Day in Luang Prabang, Laos', 'saturday-all-day-in-luang-prabang-laos-2018-12-01', NULL, 'Took it easy today and just looked around in Luang Prabang.  Went to the temples around downtown and climbed up to the top of Mount Phousi which is right in the middle of town.\r\n\r\nIn the evening went to the night market and had some excellent street food.  Also walked along the part of town that overlooks the Mekong River.  There are restaurants set up all along the bluff overlooking the river.  It\'s a nice sunset spot.', 1, 4, 58, 1, 1, 0, '2018-12-01', NULL, NULL, '2018-12-02 14:59:12', '2019-02-19 22:17:56'),
(525, 1, 75, 105, 2692, 'Sunday, Biked from Luang Prabang to Kuang Si Waterfall', 'sunday-biked-from-luang-prabang-to-kuang-si-waterfall-2018-12-02', NULL, 'Rented a mountain bike and rode the 30 kilometers to the majestic Kuang Si Waterfall.  The ride is along the main road without much scenery.  The road follows the Mekong River and there are other attractions along the way such an Elephant conservation center, a water buffalo dairy, and a farm-stay resort.  There was quite a bit of tourist traffic in vans, taxi trucks, and motorbikes.  I only saw one other tourist on a bike.\r\n\r\nThe trip took about two hours each way and really gave my legs a workout.  There was only one major hill that was a little painful and the rest was just gentle slopes.\r\n\r\nThe waterfalls were fantastic and a nice blue color from the minerals in the water.  Some people were swimming in the pools but it was pretty chilly and overcast.\r\n\r\nOn the way back I stopped at a restaurant with great views of the Mekong river and had some coconut water.', 1, 4, 62, 1, 1, 0, '2018-12-02', NULL, NULL, '2018-12-02 15:07:09', '2019-02-24 04:09:57'),
(526, 1, 75, NULL, NULL, 'Jasmine Luangprabang Hotel', 'jasmine-luangprabang-hotel-luang-probang-laos-2018-11-30', NULL, 'Ban thong chaleurn, Luang Prabang, Laos\r\n\r\nMap Location: 19.887397, 102.133651\r\n\r\nPhone: +8562099547007\r\n\r\nHigh-end hotel with good hot water, A/C, WiFi, and a central location.', 1, 5, 66, 1, 1, 0, '2018-11-30', NULL, NULL, '2018-12-02 19:37:59', '2019-02-18 19:13:04'),
(527, 1, 76, NULL, NULL, 'Amandra Villa', 'amandra-villa-luang-namtha-2018-12-03', NULL, 'Ban NongBuaVieng\r\nLuang Namtha, Laos\r\n\r\nMap Location: 20.999127, 101.410221\r\n\r\nPhone: +8562098088878\r\n\r\nMid-range, older hotel with good WiFi, Hot Water, and Breakfast.  Good location on the main road, a few blocks from the night market.', 1, 5, 76, 1, 1, 0, '2018-12-03', NULL, NULL, '2018-12-03 17:55:10', '2019-02-18 18:09:37'),
(528, 1, NULL, NULL, NULL, 'Things to do in Luang Namtha', 'things-to-do-in-luang-namtha-2018-12-04', NULL, '1. Walk five minutes out of town to the Nam Tha river, cross the bamboo bridge (washed out in the middle of wet season but rebuilt a few months later) and visit the traditional Tai Dam villages with their charming local crops on the riverbanks.  The Tai Dam minority tribe are well known in Laos for their weaving abilities, and you can often see them weaving in the village, or sometimes even getting the silk off their silkworms.  Walk out further to the left and explore some nearby sticky rice paddies.\r\n\r\n2. Walk about 10-15 minutes (5 minute cycle) to the new golden stupa on the hill behind the town. It has some cool Buddha statues behind it and gives an amazing view of the rice filled valley surrounded by mountains.  If you get up early enough this is the best place to watch the sunrise, and in winter the mist rise off the mountains.  There is a trail at the back right of the stupa that goes up through rubber plantations and villagers crops to a very high mountain that rewards the climb with panoramic views of the town, rice paddies and surrounding mountains and jungle.  You can also bike the newly sealed road in front of the temple (at the foot of the stupa) out into the countryside to the old ruined stupa; a very scenic trip.\r\n\r\n3. Rent a scooter or bicycle and travel 6 km out of town to the Lanten minority village of Ban Nam Dee.  Explore the village with its thatched bamboo houses and traditionally dressed residents who hand make their indigo blue clothing.  If you are lucky the women will be making bamboo paper in the river by hand which can also be purchased.  Take the 10 minute walk on a good path through the jungle up to the nearby small waterfall; which is pleasant and worth the trip.\r\n\r\n4. Travel 2 km north out of town, cross the roundabout and ride 5km out on the main road to be in the middle of a huge ocean of rice paddies bordered on all sides by mountains.  This stunning scene is dotted with bamboo huts made by the rice farmers and you can follow the little trails out to them and chill out in the huts and witness the peace and the wildlife rich rice paddy ecosystem.  Insects and birds are found out there in abundance.  A great place to read a book, take a picnic and watch the sunset over the mountains.\r\n\r\n5. Do a minority village trail; get a map then on scooter or bicycle go out to visit some different minority villages on your own as a cultural trail.  You can visit the different ethnic minorities of Ahka, Black Tai, Khmu, Lanten, Tai Lue and Pounoy villages all in one day, thus witnessing first hand their different cultures, traditions, style of housing and clothing, cooking methods and languages.  All of these tribes co-exist peacefully together in Luang Namtha.\r\n\r\n6. Take a scooter or motorbike 60 km north towards Muang Sing.  You will pass through the stunning, densely jungle-clad mountains of the Namha NPA, where you can walk a few km through the jungle to a beautiful little waterfall.  This you will find about 10 km before you reach Muang Sing, on the right hand side of the road, clearly signposted.  There is little traffic on this road and many scenic spots to stop including some ethnic minority villages.\r\n\r\n7. There are various little trails down from around Luang Namtha town to get to the river where it is not only beautiful but a good place to take a dip and a wander along its banks.\r\n\r\nAlso another must do in the town is to chill out in the soft chairs of Forest Retreat Laoss Bamboo Lounge using the super-fast Wifi with a good cocktail, sweet tunes and an authentic wood-fired pizza.', 1, 5, 2, 0, 0, 1, '2018-12-04', NULL, NULL, '2018-12-04 05:09:36', '2018-12-08 18:26:46'),
(529, 1, 76, 105, NULL, 'Monday, Luang Prabang to Luang Namtha by Bus', 'monday-luang-prabang-to-luang-namtha-by-bus-2018-12-02', NULL, 'Spent all day on the minibus from Luang Prabang to Luang Namtha.  The mountain scenery was spectacular and the roads weren\'t too bad.  \r\n\r\nThe bus company picked me up at the hotel a little after 07:00.  The bus left at 08:00 and arrived at about 17:00 with the usual bathroom and lunch stops.\r\n\r\nThe driver picked up some locals along the way.  One old couple hacked, wheezed and vomited the whole way and then the old lady laid on the floor of the minibus and blocked the door so we had to step carefully over her to get in and out.\r\n\r\nAs usual the final stop was not close to the town.  It was at the long distance bus station at Map Location: 20.927847, 101.403124 which is about 9 kms from the town.  All the tourists on the bus had a take a shared truck taxi the rest of the way.\r\n\r\nAfter checking in to the hotel, I had a delicious dinner at the night market including sausage, duck, and a plate of noodles.  Afterwards I was having tea and cake at a coffee shop at there was a terrific crash between a motorbike and a pick up truck right outside.  The poor motorbike driver couldn\'t get up and the people were trying to stand him up.  That\'s about all I could watch and a few minutes later he was gone so I guess they took him to the hospital.  The police came later and did a full investigation.', 1, 4, 54, 1, 1, 0, '2018-12-02', NULL, NULL, '2018-12-04 05:49:32', '2019-02-24 18:52:33'),
(530, 1, 76, 105, 2731, 'Tuesday, Exploring the Luang Namtha Laos Countryside by Bike', 'tuesday-exploring-the-luang-namtha-laos-countryside-by-bike-2018-12-04', NULL, 'Took a free one-speed cruiser bike from the Amandra Villa hotel and headed off for a long ride in the countryside around Luang Namtha.  It was overcast, cool and a little drizzly when I started before 08:00.  As usual by around midday the sun was out and blazing hot.\r\n\r\n[Here\'s the 26 mile / 42 km trail on Wikiloc](https://www.wikiloc.com/cycling-trails/the-ultimate-luang-namtha-bike-loop-31061181)\r\n\r\nFirst I went north-east to the Nam Dee Waterfall.  The waterfall was pretty lackluster probably since it\'s not monsoon season.  The road beyond the waterfall however had spectacular mountain scenery even though the rice had just been harvested so the paddies weren\'t lush and green.  I took the lower road and not the trail that goes almost straight up the hill.  The upper trail goes to a village 5 kms away.  The lower road was very mountainous and I had to walk the bike up and down the steepest parts since the bike had weak brakes.  There was one small creek crossing where I would have gotten my feet wet if I hadn\'t had the bike to plow through the water.\r\n\r\nAfter that I continued the loop that parallels the main road for a ways and then joins it for awhile and then splits off again.  The section that takes a little trail through the rice paddies to the east of the town is the roughest part.  Besides the trail beyond the waterfall it\'s mostly flat.\r\n\r\nAll along the way there were little villages with friendly kids all over the place yelling hello and stray dogs and farm animals everywhere, chickens, ducks, goats, cows, water buffalo, etc.  There were also little stores and restaurants for water and snacks.\r\n\r\nLater in the afternoon in town an old lady from one of the hill tribes cornered me and tried to sell me some illicit drugs.  First she pulled out a bag of weed then some little brown packets out of her bra that were probably heroin.', 1, 4, 63, 1, 1, 0, '2018-12-04', NULL, NULL, '2018-12-04 12:22:22', '2019-02-25 18:55:00'),
(531, 1, 76, NULL, 2728, 'The Ultimate Luang Namtha Laos Bike Loop', 'the-ultimate-luang-namtha-laos-bike-loop', 'Forest Covered Mountains, Rice Paddies, Villages, Farm Animals, Friendly People.', 'The area around Luang Namtha, Laos is wild, mountainous, cultural and very beautiful.  This bike loop takes you through the countryside, nearby villages, mountains and rice paddies.\r\n\r\nThe north-east side past the Nam Dee Waterfall is the most scenic.  The long ride through the rice paddies on the east side of Luang Namtha is also spectacular.', 1, 2, 181, 1, 1, 0, '2018-12-04', NULL, NULL, '2018-12-04 14:06:24', '2019-02-25 02:23:22'),
(532, 1, 76, NULL, NULL, 'Luang Namtha, Laos', 'luang-namtha-laos', NULL, NULL, 1, 8, 174, 1, 1, 0, '2018-12-04', NULL, NULL, '2018-12-04 14:31:45', '2019-02-23 15:50:14'),
(533, 1, 76, 105, 2746, 'Wednesday, From Luang Namtha to Muang Sing by Motorbike', 'wednesday-from-luang-namtha-to-muang-sing-by-motorbike-2018-12-05', NULL, 'Rented a motorbike for the day for 50000 kip and took off. They gave it to me empty so I had to fuel it up immediately.\r\n\r\nHeaded north out of town and followed the winding mountain road through the Nam Ha National Biodiversity Conservation Area for about two hours. It was cloudy, cool, and misty through the mountains and then the sun came out around 09:00. There was a little car and truck traffic but mostly just motorbikes.\r\n\r\nIn the valleys there are some scenic rice paddies and the road follows a small river for awhile.\r\n\r\nThis trip is mostly done for the journey and not the destination. Muang Sing isn\'t anything special and I didn\'t see any tourist stuff.\r\n\r\nThere is one tourist attraction, Pha Yeung Waterfall, about 10 km before Muang Sing. It\'s not too exciting but it\'s a nice 1 km or so walk through the jungle.  Beware of leeches.  In the evening I found two leech holes and my lower leg was a bloody mess.\r\n\r\nOn the way back to Luang Namtha I had a flat tire on the motorbike.  I flagged down a local and he used sign language to tell me to ride it slowly back to the last village, Nammat-Kao.  I didn\'t want to destroy the tire but I rode it very slowly about a kilometer back to the village and found the repair shop.\r\n\r\nAt the shop an old guy was looking at it and then a group of kids came in and started taking it apart.  The flat was on the back tire so it was much more complicated since they had take off the chain and brakes and all of that stuff.\r\n\r\nIt took about an hour for the repair and then I was on my way.  The tire was good but something was rubbing on the back wheel but it ran okay and I made it the 25 km back to Luang Namtha.', 1, 4, 57, 1, 1, 0, '2018-12-05', NULL, NULL, '2018-12-05 17:51:47', '2019-02-20 10:27:41'),
(534, 1, 77, 105, NULL, 'Thursday, Luang Namtha, Laos to Jinghong, China by Bus', 'thursday-luang-namtha-laos-to-jinghong-china-by-bus-2018-12-06', NULL, 'Checked out of the hotel at 07:00 and walked a few blocks down to the tour office where the taxi to the bus station was supposed to pick me up.  The bus to Jinghong left a little late at about 08:20.  The border crossing was fast and efficient.  There were a lot of buses arriving but they processed the people very quickly.  There was one extra line to scan luggage on the Chinese side.\r\n\r\nWe got to Jinghong at about 17:30 China time.  We lost one hour due to the time change.  The distance is pretty short but the bus made stops at about every village along the way to pick up and drop off people.\r\n\r\nIn Jinghong I had a terrible time finding the hotel because it\'s map location on Maps.me and Booking.com was wrong.  I had to go into another hotel and borrow their WiFi in order to call and send messages to the hotel I had reserved.  The guy came to get me and I berated him about the map location and his instructions.  He said the hotel was West of Walmart but it was straight North.  I sent him the correct map coordinates so he could get his map location fixed.\r\n\r\nOnce I got to the hotel they gave me tea from a 500 year old tea bush and then gave me some gifts.  I think that is normal and wasn\'t just done because of the hassle finding the place.\r\n\r\nAfter dark, I took a walk around Jinghong which is very nice, clean, and modern.  It\'s small for a Chinese city but it is really bustling and the air seems pretty clean.', 1, 4, 61, 1, 1, 0, '2018-12-06', NULL, NULL, '2018-12-06 19:05:18', '2019-02-19 23:53:54'),
(535, 1, 77, NULL, NULL, 'Doudou Meilan Fengqing Inn', 'doudou-meilan-fengqing-inn-jinghong-china-2018-12-06', NULL, 'Room 6002, Floor 6, Block D, West Shuangshier Cheng, Jinghong, China\r\n\r\nMap Location: 22.005272, 100.806963\r\n\r\nPhone: +86 159 7494 1848\r\n\r\nHigh-end spacious apartments for around 60 USD.  Good WiFi, A/C, Hot Water, and lots of bars, restaurants, shops, and a night market in the area.', 1, 5, 81, 1, 1, 0, '2018-12-06', NULL, NULL, '2018-12-06 19:10:30', '2019-02-23 02:32:23'),
(536, 1, 78, NULL, NULL, 'Holiday Inn Kunming City Centre ', 'holiday-inn-kunming-city-centre-2018-12-07', NULL, 'No. 29 Dongfeng East Road, Panlong, Kunming, China\r\n\r\n29, , ()\r\n\r\nMap Location: 25.037962, 102.725057\r\n\r\nPhone: +86 871 6316 5888\r\n\r\nA High-end hotel in the center of Kunming which has 293 air-conditioned rooms with refrigerators, flat-screen televisions, WiFi, security safes, and ample hot water.  It also features several restaurants, an indoor pool and a fitness center.', 1, 5, 70, 1, 1, 0, '2018-12-07', NULL, NULL, '2018-12-08 05:42:52', '2019-02-22 08:22:39'),
(537, 1, 77, 105, NULL, 'Friday, Jinghong to Kunming China by Bus', 'friday-jinghong-to-kunming-china-by-bus-2018-12-07', NULL, 'Spent another full day on the bus.  Left Jinghong at 08:30 and arrived in Kunming at 17:30.  The bus was pretty comfortable and I had an empty seat next to me.  The guy at the apartment where I stayed, Doudou Meilan Fengqing Inn, gave me a ride to the bus station which was about 10 minutes away.\r\n\r\nThe scenery was pretty nice as we went through the mountains.  There were some rice paddies, tea plantations, and a lot of vegetable farms.\r\n\r\nThere were a couple of police checks along the way.  The police were very stern and serious but never seemed very interested in me.  I didn\'t see any other tourists all day except for one backpacker who was sleeping at the bus station in Jinghong.\r\n\r\nIn Kunming the bus stopped at the Southern Bus Station (Map Location: 24.931776, 102.774787) which is a long way from the center where my hotel was.  I took a long taxi ride and traffic was backed up.  There is a subway next to the bus station which would have been better.', 1, 4, 68, 1, 1, 0, '2018-12-07', NULL, NULL, '2018-12-08 07:52:51', '2019-02-20 03:53:10'),
(538, 1, 73, NULL, 2662, 'Things To Do in Vientiane, Laos', 'things-to-do-in-vientiane-laos-2018-11-29', NULL, 'The center of Vientiane has a good vibe and has a small town feel to it.  There are plenty of little coffee shops and restaurants for tourists.  In addition, here are some popular places to visit:\r\n\r\nMekong River Park and Walk Way (Map Location: 17.960936, 102.608801) - A nice park and walkway near the river.  In the evening a large night market with food stalls and many souvenir shops is open.  There is also a sunset view point at Map Location: 17.963488, 102.601492.\r\n\r\nBuddha Park (Map Location: 17.912278, 102.765176) - An iconic, must visit attraction outside of Vientiane.  The Buddha Park is a tourist attraction and not an authentic religious sight but still fun to visit and very photogenic.  It is 20 to 25 km from downtown Vientiane.  To get there, take Bus 14 from near the Central Bus Station at Map Location: 17.962799, 102.615756.  The bus also stops at the border crossing to Thailand at the Friendship Bridge. The bus is slow but cheap and better than having to deal with the tuk-tuk drivers. The bus drivers know that foreigners are either getting off at the border or at the Buddha Park. \r\n\r\nPatuxay Park and Arch (Map Location: 17.970634, 102.618614) - A park with the huge Asian version of the Arc de Triomphe in Paris.  The arch has some nice decoration and a fountain in front of it.  It is an easy walk from center of the city near the river.\r\n\r\nWat That Luang Temple area (Map Location: 17.97666, 102.636492) - A complex with multiple temples and a big golden stupa. The area is nice with all the typical sites including a lot of souvenir stalls.  It is a little outside of the city center.  A tuk-tuk ride will cost about 20000 kip each way.  There is also a bus stop to return to the city center at map location: 17.974584, 102.634142.\r\n\r\nWat Sisaket Temple (Map Location: 17.963123, 102.611215) - A little temple in the center of Vientiane.  Not very impressive but may be worth a visit.', 1, 5, 85, 1, 1, 0, '2018-11-29', NULL, NULL, '2018-12-08 13:27:13', '2019-02-25 21:11:16'),
(564, 1, NULL, 561, NULL, 'Sunday, January 13, 2019', 'sunday-2019-01-13', NULL, 'Stayed in the hotel most of the day to watch the NFL playoffs.  Before they started I went to Walmart and Arby\'s to stock up on food. In the afternoon Mom needed a book so went to her house to get one and rushed back.\r\n\r\nAt the house, the remod guys had put in a new white tile floor in the kitchen and bathrooms.  Mom keeps saying that she\'s getting a black tile floor.  I\'m sure that she\'ll be complaining about that for years to come.', 1, 4, 2, 0, 0, 0, '2019-01-13', NULL, NULL, '2019-01-14 19:35:54', '2019-01-14 20:50:58'),
(539, 1, 78, 105, 2796, 'Sunday, Went hiking in Western Hills Park in Kunming, China', 'sunday-went-hiking-in-western-hills-park-in-kunming-china-2018-12-09', NULL, 'Took the metro to the last stop on line 3 which is the Western Hills Park stop.  I just followed the big crowd through the park.  Most of the walking is on the main road in park.  It is only open to the big shuttle buses which came along frequently.\r\n\r\nThe hike which is more of a walk is about 10 kms each way.  I walked to the end and then opted to take the shuttle bus back to the subway station.  There are several temples along the way and the main one is the Dragon\'s Gate temple on the far end.  It costs 30 CNY to enter the final stretch that goes to the Dragon\'s Gate and more if you use the electric shuttle.  The best views of Kunming and the lake are from that temple.', 1, 4, 58, 1, 1, 0, '2018-12-09', NULL, NULL, '2018-12-09 16:53:07', '2019-02-21 19:26:44'),
(540, 1, NULL, NULL, NULL, 'Kunming, China', 'kunming-china', NULL, NULL, 1, 8, 174, 1, 1, 0, '2018-12-07', NULL, NULL, '2018-12-09 17:06:10', '2019-02-25 15:30:21'),
(541, 1, 79, NULL, NULL, 'Sheraton Guilin Hotel', 'sheraton-guilin-hotel-china-2018-12-10', NULL, '15 Bin Jiang Road, Li Riverside, Close to Elephant Trunk, Guilin, China\r\n\r\nMap Location: 25.273943, 110.299404.\r\n\r\nPhone: +867732825588\r\n\r\nLarge, upscale hotel across the street from the Li River in Guilin, China.  The hotel has good A/C, WiFi, and Hot Water.  The rooms also feature a flat-screen TV, desk, and comfortable beds.  The property has a bar, restaurant, coffee shop, and swimming pool.', 1, 5, 85, 1, 1, 0, '2018-12-10', NULL, NULL, '2018-12-11 05:11:33', '2019-02-25 17:02:38'),
(542, 1, 79, NULL, NULL, 'Guilin, China', 'guilin-china', NULL, NULL, 1, 8, 184, 1, 1, 0, '2018-12-10', NULL, NULL, '2018-12-12 08:23:41', '2019-02-24 14:19:50'),
(543, 1, 78, 105, 2840, 'Monday, Went from Kunming to Guilin by Train', 'monday-went-from-kunming-china-to-guilin-china-by-train-2018-12-10', NULL, 'Had breakfast and then checked out of the hotel before 07:00.  It was still dark outside as I walked the two long blocks to the Metro Station.  I took the subway to the last stop which is Kunming South Railway Station.  The subway was full but not crazy packed like in other Chinese cities during rush hour.  The secret is to always go to the first or last car and get near the wall with the luggage.  There is usually more space in that area.\r\n\r\nAt the train station, I had a coffee at McDonald\'s and then the gate to the platform was already open with hardly any lines so I strolled onto the train.  I had an empty seat next to me for the 4 hour trip and it went by really fast.  I bought a 6 USD coffee during the trip without realizing how expensive it was.\r\n\r\nIn Guilin, I took a taxi to the hotel but Maps.me and Booking.com\'s map both let me down again and the hotel wasn\'t at the map location.  I had to take another taxi to the real location once I found another entry for it on the map.\r\n\r\nGuilin is a beautiful and clean city along the river.  It is one of the top tourist destinations in China because of the spectacular scenery along the Li River.  Even in the winter there are a lot of Chinese tourists around and even a few Anglo\'s.\r\n\r\nI had a fiery but good hot lunch of beef and peppers.  I have to look at the menu pictures more closely.  I just thought the green stuff was vegetables but they were pure peppers.  I can eat the ones with no seeds but there aren\'t many like that.\r\n\r\nAfter the meal I went to a travel agency to book an all day boat trip for the next day.  There were two really young girls helping me book the trip and then I think their mother came in and finished it for me.', 1, 4, 62, 1, 1, 0, '2018-12-10', NULL, NULL, '2018-12-12 08:29:45', '2019-02-25 20:51:34'),
(544, 1, 79, 105, 2829, 'Tuesday, Guilin to Yangshuo Li River Boat Tour', 'tuesday-china-guilin-to-yangshuo-li-river-boat-tour-2018-12-11', NULL, 'The tour bus picked me up at the hotel at about 08:00 and then we drove to the pier which was between Guilin and Yangshuo.  There were a lot of boats and many tourists on this cold, grey, and rainy day in December.  I was the only westerner so the tour guide had to give her speech in English just for me on the boat of about 100 people.  I couldn\'t hear most of it.\r\n\r\nThe scenery was amazing as the boat wound through the Karst Mountains on the four hour cruise.  The Chinese were running from side to side and front to back in order to get the best photos.  The highlight was the spot on the river that is depicted on the 20 yuan note.  At this point everybody held up a 20 yuan note and took a picture of it with the matching mountain scenery.  I didn\'t have one so a Chinese guy let me take a picture of his while he held it in front of my camera.  We had a pretty good lunch of rice and something else halfway through the trip.\r\n\r\nIn Yangshuo we had a few hours of free time to walk from the pier to the meeting point at a hotel a few kilometers away.  The main road, West Street, was all bright and shiny souvenir shops, bars and restaurants for the tourists.  There was also a McDonald\'s and KFC in the little town.\r\n\r\nThe second part of the tour was a ride on a little boat that went through a cave and then wound around on a little branch of the river.  They had a fake indigenous village set up with musicians pounding drums and dancing around.\r\n\r\nThe tour bus took us back to the Guilin and the final drop off spot was at my hotel at about 19:00.  Nobody was hassling me for tips which was a nice change.', 1, 4, 84, 1, 1, 0, '2018-12-11', NULL, NULL, '2018-12-12 08:34:02', '2019-02-25 09:55:43'),
(545, 1, 78, NULL, 2840, 'Kunming to Guilin by Train', 'kunming-china-to-guilin-china-by-train-2018-12-10', NULL, 'The high-speed bullet train from Kunming to Guilin leaves from the Kunming South Railway Station (Kunmingnan) at Map Location: 24.873364, 102.860323 which is the last stop on the southern end of the Kunming Metro Line 1-2.  The south railway station is about 35 kms from the center of Kunming.\r\n\r\nThe train takes about four hours and arrives at the Guilin West Railway Station (Guilinxi), Map Location: 25.357449, 110.262318.  The railway station is about 15 kms from the center of Guilin.', 1, 5, 71, 1, 1, 0, '2018-12-10', NULL, NULL, '2018-12-12 08:36:42', '2019-02-19 01:10:03'),
(546, 1, 79, NULL, 2847, 'Guilin to Nanjing by Train', 'guilin-china-to-nanjing-china-by-train-2018-12-13', NULL, 'The high-speed bullet train from Guilin to Nanjing leaves from the Guilan Railway Station at Map Location: 25.263934, 110.278184.  \r\n\r\nThe trip takes almost nine hours and makes stops at all the major cities along the way.  The train arrives at the Nanjing South Railway Station (Nanjingnan) at Map Location: 31.970714, 118.79314.  The entrance to the Nanjing Metro is inside the railway station.', 1, 5, 79, 1, 1, 0, '2018-12-13', NULL, NULL, '2018-12-12 08:38:55', '2019-02-24 06:27:24'),
(547, 1, 80, NULL, NULL, 'Jinling Hotel', 'jinling-hotel-nanjing-china-2018-12-13', NULL, '2 Han Zhong Road, Xin Jie Kou Square, Gu Lou, Nanjing\r\n2, \r\n\r\nMap Location: 32.044718, 118.77805, right next to the Xinjiekou metro stop, exit 6.\r\n\r\nPhone: +86 25 8471 1888\r\n\r\nA comfortable high-end hotel with dated rooms in the center of Nanjing.  Good A/C, Hot Water, and slow Internet.', 1, 5, 77, 1, 1, 0, '2018-12-13', NULL, NULL, '2018-12-14 06:12:32', '2019-02-24 01:27:16'),
(548, 1, 80, NULL, 2867, 'Zhongshan Mountain National Park', 'zhongshan-mountain-national-park-2018-12-14', NULL, 'Zhongshan Mountain National Park is in Nanjing, China and contains Ming Dynasty Tombs.  It is easily accessible in the suburbs of Nanjing.  \r\n\r\nThe most popular area is the Ming Tomb Scenic Area which has the Sacred Way of the Ming Tombs and the Dr. Sun Yat-sen\'s Mausoleum Scenic Area with large blue mausoleum complex.\r\n\r\nHow to get there:\r\n\r\nTake the Nanjing Metro to the Muxuyuan stop and follow the signs to the park entrance.  \r\n\r\nEntry Fee:\r\n\r\nThere are several entry options which contain access to the different areas ranging from 70 to 100 yuan.\r\n\r\nWithin the park, there are electric shuttles available to the different attractions.', 1, 5, 61, 1, 1, 0, '2018-12-14', NULL, NULL, '2018-12-14 12:46:56', '2019-02-25 18:26:14'),
(549, 1, 80, NULL, NULL, 'Nanjing China Subway Metro Map', 'nanjing-china-subway-metro-map', NULL, 'The Nanjing Metro is cheap, fast and efficient.  It is large and extensive with 10 different lines.  \r\n\r\nThe ticket machines accept both coins and bank notes and the lines are usually pretty short.', 1, 5, 91, 1, 1, 0, '2018-12-14', NULL, NULL, '2018-12-14 12:48:48', '2019-02-23 17:01:11'),
(550, 1, 80, NULL, NULL, 'Nanjing, China', 'nanjing-china', NULL, NULL, 1, 8, 234, 1, 1, 0, '2018-12-14', NULL, NULL, '2018-12-14 13:24:03', '2019-02-25 15:18:21'),
(551, 1, 10, NULL, NULL, 'Grand Hyatt Beijing ', 'grand-hyatt-beijing-china-2018-12-15', NULL, 'No.1 East Chang An Avenue, Dongcheng, Beijing, China\r\n1, \r\n\r\nMap Location: 39.908357, 116.408271\r\n\r\nPhone: +86 10 8518 1234\r\n\r\nThe Grand Hyatt is a high-end hotel located in the main tourist area of Beijing.  It is near the Wangfujing Pedestrian Street and is accessible from the \"Malls at Oriental Plaza\" mall.', 1, 5, 100, 1, 1, 0, '2018-12-15', NULL, NULL, '2018-12-15 19:18:33', '2019-02-23 11:34:44');
INSERT INTO `entries` (`id`, `site_id`, `location_id`, `parent_id`, `photo_id`, `title`, `permalink`, `description_short`, `description`, `user_id`, `type_flag`, `view_count`, `published_flag`, `approved_flag`, `deleted_flag`, `display_date`, `color_foreground`, `color_background`, `created_at`, `updated_at`) VALUES
(552, 1, NULL, NULL, NULL, 'Mircoles, pas todo el da explorando Colombo, Sri Lanka', 'miercoles-pase-todo-el-dia-explorando-colombo-sri-lanka-2018-10-31', NULL, 'Me levant temprano y tom un caf fro hecho en casa en la habitacin, ya que el desayuno no era hasta las 07:00. Para el desayuno, tuve huevos revueltos, salchichas de pollo y ms caf. El comedor estaba lleno de gente.\r\n\r\nDespus del desayuno, camin hacia la Mezquita Roja (Ubicacin del mapa: 6.938463, 79.851768) que estaba a solo 20 minutos de distancia. Est cerca de la zona del mercado, por lo que haba mucha actividad. Tambin fui al Nuevo Templo Hind Kathiresan Kovil (Ubicacin del Mapa: 6.942124, 79.854621) y mir alrededor.\r\n\r\nVolv a caminar por el mercado de Peetah y luego me acerqu para ver mejor la Colombo Lotus Tower. Luego fui a la estacin de tren y compr un boleto en el tren expreso a Kandy para el da siguiente, saliendo a las 10:35.\r\n\r\nFuera de la estacin de tren negoci con un tuk-tuk para que me llevara a varios templos que estaban ms alejados, el templo budista Seema Malaka y el templo budista Ashokaramaya. Cubrimos ambos en aproximadamente una hora y me dej en el hotel. Fui a KFC cerca del hotel para almorzar.\r\n\r\nMs tarde en la tarde, negoci una tarifa de 600 por hora con otro conductor de Tuk Tuk para que me llevara a la Plaza de la Independencia, al Templo de Gangaramaya y a Galla Face Green. Debera haber incluido esto en la primera gira de Tuk Tuk ya que estn en la misma rea. Despus de las otras paradas, me dej en Galla Face Green y camin por el paseo martimo y luego de regreso al hotel al atardecer.\r\n\r\nHaba muchos soldados alrededor. No estoy seguro de si eso es normal o es debido al problema poltico actual en el que tienen dos tipos que piensan que son el Primer Ministro.\r\n\r\nEn el camino de vuelta encontr un Burger King y com hamburguesas de carne por primera vez en aproximadamente un mes. Eran gloriosos.', 1, 5, 4, 0, 0, 1, '2018-12-16', NULL, NULL, '2018-12-16 05:24:10', '2019-01-01 06:42:19'),
(553, 1, 10, NULL, 2884, 'Beijing Panjiayuan Flea Market', 'china-beijing-panjiayuan-flea-market-2018-12-16', NULL, 'Panjiayuan Flea Market is a large outdoor market with hundreds of vendors selling all kinds of antiques, stones, art work, furniture, political souvenirs, and much more.\r\n\r\nBe prepared to bargain as the first quoted price is usually very high and negotiable.  When making a counter offer, make sure that room is left for more negotiation.  The final price could be as much as 50% of the first quote.  Be prepared to walk away.  Another good strategy is to take the amount of your final offer out in cash and wave it around and try to hand it to the seller. \r\n \r\nTo get to Beijing Panjiayuan Flea Market:\r\n- Take Subway Line 10 to the Panjiayuan stop and use Exit B.\r\n- The market entrance is about 50 meters west of the exit (the opposite direction of the highway overpass).', 1, 5, 109, 1, 1, 0, '2018-12-16', NULL, NULL, '2018-12-16 05:51:05', '2019-02-24 21:05:05'),
(554, 1, 80, NULL, 2879, 'Nanjing to Beijing by Train', 'china-nanjing-to-beijing-by-train-2018-12-15', NULL, 'The high-speed bullet train from Nanjing to Beijing leaves from the Nanjing South Railway Station (Nanjingnan) at Map Location: 31.970243, 118.79361. \r\n\r\nThe trip takes about four hours and makes stops at a few cities along the way. The train arrives at the Beijing South Railway Station (Beijingnan) at Map Location: 39.862767, 116.373839.  The entrance to the Beijing Metro is inside the railway station.', 1, 5, 79, 1, 1, 0, '2018-12-15', NULL, NULL, '2018-12-16 11:05:25', '2019-02-19 23:05:42'),
(555, 1, 79, 105, NULL, 'Wednesday, Took it Easy in Guilin', 'wednesday-took-it-easy-in-guilin-china-2018-12-12', NULL, 'It was a rainy and cold day.  I walked over to the Elephant Trunk Hill which is near the center of town.  They have it completely blocked off since you have to buy ticket to get into the view area along the river.\r\n\r\nOther than that I just messed around all day.', 1, 4, 2, 0, 1, 0, '2018-12-12', NULL, NULL, '2018-12-17 02:45:26', '2019-01-26 22:54:55'),
(556, 1, 79, 105, 2848, 'Thursday, Guilin to Nanjing by Train', 'thursday-guilin-china-to-nanjing-china-by-train-2018-12-13', NULL, 'Took a taxi to the Guilin Train Station which was only a few kilometers away.  It was a long eight hour train ride but uneventful.  The high-speed train made a lot of stops along the way.\r\n\r\nIn Nanjing, we arrived at the Nanjing South Railway Station (Nanjingnan).  I took the metro to the Jinling hotel.  Nanjing is a huge city with lots of tall buildings that are lit up at night.  The high-rise hotel was easy to find right behind the subway station in the center of the city.', 1, 4, 55, 1, 1, 0, '2018-12-13', NULL, NULL, '2018-12-17 02:50:25', '2019-02-25 12:33:58'),
(557, 1, 80, 105, 2865, 'Friday, All Day in Nanjing', 'friday-all-day-in-nanjing-china-2018-12-14', NULL, 'In the morning, I took the metro to the Zhongshan Mountain National Park which has some ming tombs.  I walked along the Sacred Way of the Ming Tombs see the big rock sculptures of lions, camels and elephants.', 1, 4, 78, 1, 1, 0, '2018-12-14', NULL, NULL, '2018-12-17 02:59:37', '2019-02-24 00:18:02'),
(558, 1, 80, 105, 2879, 'Saturday, Nanjing to Beijing by Train', 'saturday-nanjing-china-to-beijing-china-by-train-2018-12-15', NULL, 'I checked out of the hotel pretty late since my train wasn\'t until noon.  I took the metro to the train station and killed time in Starbucks.  It was an easy four hour train trip to Beijing.  I had an aisle seat so I got up and walked around a lot.\r\n\r\nThe train arrived at the Beijing South Railway Station.  I still had my Beijing metro card from the last time and I was surprised that it still worked after about five months.  The hotel was easy to find and it was a few long blocks from the subway station.\r\n\r\nIn the evening I walked over to Wangfujing night market food street and had some crappy duck meat that was mostly fat.  It was really cold in Beijing but the air was pretty clear for a change.', 1, 4, 81, 1, 1, 0, '2018-12-15', NULL, NULL, '2018-12-17 03:07:06', '2019-02-25 03:43:37'),
(559, 1, 10, 105, 2881, 'Sunday, Souvenir Shopping in Beijing', 'sunday-souvenir-shopping-in-beijing-china-2018-12-16', NULL, 'It was the last day of my six month trip so I bought some heavy souvenirs which I had been delaying since I didn\'t want to add weight to my load.  \r\n\r\nFirst I went to a few stores on Wangfujing street and then took the metro to the Panjiayuan Flea Market.  Once I arrived I realized that I had been there before.\r\n\r\nThe flea market is huge.  It\'s mainly for locals instead of tourists so there aren\'t any normal souvenir stores but lots of souvenir type stuff.  I bought a big metal silver Buddha and a copper dragon each weighing a few pounds.  I had to do some hard negotiating to get good prices.  I had to do the \"walk away\" and then went back later to try again with the same guy.  The statues weighed enough that I had to take them back to the hotel before continuing on.  \r\n\r\nNext I went to Qianmen Street where there are a few large souvenir stores.  I didn\'t buy anything on the main street but found some little stores in one of the hutongs nearby (map location: 39.893301, 116.385806).  I did some hard bargaining there too with a sweet young lady who really wanted to make some sales and kept grabbing my arm to keep me in the store.  I bought some little expensive stuff from her for about 20 USD.', 1, 4, 81, 1, 1, 0, '2018-12-16', NULL, NULL, '2018-12-17 03:19:42', '2019-02-24 21:03:53'),
(560, 1, NULL, NULL, NULL, 'Camera / Graphics', 'notas-2018-12-26', NULL, 'Color Fixes: \r\n- sun sky alt color\r\n- sky color is too close to border color\r\n- bikini color\r\n- text color\r\n\r\nSony DSC-RX10 III\r\n\r\nAperture - controls light and depth of field (background blur/sharp).  f16 - small to f2.4 - widest\r\n\r\nShutter Speed - controls light exposure and motion blur.  1/32000 to 30 seconds.  Faster for less motion blur.\r\n\r\nISO - controls exposure by making the sensor more sensitive to light.  High ISO is brighter but creates more grain.\r\n\r\nExample: What to use for an action shot in low light?\r\n\r\n- Aperture: F2.4 (widest for maximum light, creates shallow depth of field and background blur).\r\n\r\n- Shutter Speed: 1/10000 (to prevent foreground motion blur).\r\n\r\n- ISO: 640 or higher.  (Because of the low light conditions, the above settings need more light so the ISO must be high).\r\n\r\nPhotoshop \r\nGraduated Filter\r\nRadial Filter', 1, 1, 4, 0, 0, 0, '2018-12-26', NULL, NULL, '2018-12-26 20:41:44', '2019-02-22 05:38:20'),
(563, 1, NULL, 561, NULL, 'Saturday, January 12, 2019', 'saturday-january-12-2019', NULL, 'We changed hotels so we had to pack up and check out by noon and we barely made it.  Mom bought so much stuff that I had to take a load to the house.  The tbird\'s trunk will only hold her two suitcases.\r\n\r\nWe stopped at McDonald\'s on the way to have lunch and kill time since check in at the new hotel wasn\'t until 15:00.\r\n\r\nFor the rest of the day we watched the NFL playoffs.  I used Grubhub to bring her some KFC which of course she hated.  She also hates the new hotel.\r\n\r\nOn a lighter note, here\'s a message that she was trying to send to me but accidentally sent to cousin DD in Wichita:\r\n\r\nDeeDee: I got this text from Glenda at 11:30 am....Scott, I need potassium tablets,  my feet are cramping hurry!!  or i\'m running down the street, naked and bellowing!!!', 1, 4, 0, 0, 0, 0, '2019-01-12', NULL, NULL, '2019-01-13 20:20:24', '2019-01-13 20:22:13'),
(567, 1, NULL, 561, NULL, 'Wednesday, January 9, 2019', 'wednesday-2019-01-09', NULL, 'Went to Java Dave\'s for a few hours and then took Mom to the denture place at 14:30. We found out that she has to have all of her teeth pulled out.  She also has to get some implants so we have to get a test done for osteoporosis.', 1, 4, 0, 0, 0, 0, '2019-01-09', NULL, NULL, '2019-01-15 04:44:48', '2019-01-17 19:32:00'),
(566, 1, NULL, 561, NULL, 'Thursday, January 10, 2019', 'thursday-2019-01-10', NULL, 'Went Starbucks and Academy in the morning to look at backpacks.  Later picked up Mom and went to lunch at Arby\'s before going to the hearing aid place in okc.  We have started eating in the car for privacy.\r\n\r\nThe hearing aid guy was from Thailand and he was interested in my big Asia trip.  He showed us pictures of where he was from in Krabi on his computer.\r\n\r\nIn the evening, Mom had to start a 12 hour fast for an osteoporosis blood test that she has to get to see if she can get the tooth implants for her full dentures.  I hid all of the cokes and chocolate.  She was in a foul mood.\r\n\r\nWe had to write down all of the details of her dental plan because she was asking me about it every 5 minutes.  Then when she asked I would tell her to read the paper.', 1, 4, 0, 0, 0, 0, '2019-01-10', NULL, NULL, '2019-01-14 19:48:41', '2019-01-14 19:48:41'),
(565, 1, NULL, 561, NULL, 'Friday, January 11, 2019', 'friday-2019-01-11', NULL, 'In the we went to get an Osteoporosis test to see if Mom can get teeth implants.\r\n\r\nWe had lunch at Denny\'s. While we were there, Barkley called and then came over. Later he took us to a Walmart close to the hotel that we didn\'t know about.\r\n\r\nIn the evening we met Brent and Kandy for dinner at a nearby Mexican restaurant, Los Arcos.', 1, 4, 0, 0, 0, 0, '2019-01-11', NULL, NULL, '2019-01-14 19:45:29', '2019-01-17 19:30:04'),
(568, 1, NULL, 561, NULL, 'Monday, January 14, 2019', 'monday-2019-01-14', NULL, 'Went to the mall to buy pants for Mom.  She did well and then we had lunch at El Chico.  She ordered a pia colada and drank about half of it.\r\n\r\nLater in the afternoon I fled the hotel and hung out at target for awhile.  Mom couldn\'t get the microwave open so I had to go back to hotel and open it for her.', 1, 4, 0, 0, 0, 0, '2019-01-14', NULL, NULL, '2019-01-15 22:01:20', '2019-01-15 22:05:53'),
(569, 1, NULL, 561, NULL, 'Wednesday, January 16, 2019', 'wednesday-january-2019-01-16', NULL, 'Had to get Mom up at 07:00.  I turned on all the lights in her room and turned on the TV.  She barely bot ready in time to leave at 09:00 to go to Dr. Stout\'s office.  The doctor said that her leg is healed and everything else was good.\r\n\r\nIn the afternoon I went to Target to go to Starbucks and ran into Kandy.', 1, 4, 0, 0, 0, 0, '2019-01-16', NULL, NULL, '2019-01-17 04:07:21', '2019-01-17 06:43:04'),
(570, 1, NULL, NULL, NULL, 'Asia Photo Blog 2015', 'asia-photo-blog-2015-03-31', NULL, NULL, 1, 3, 0, 0, 0, 0, '2015-03-31', NULL, NULL, '2019-01-17 06:26:08', '2019-01-17 06:26:08'),
(571, 1, NULL, 561, NULL, 'Thursday, January 17, 2019', 'thursday-january-2019-01-17', NULL, 'Barkley came to the hotel early and then we went to meet Keith for lunch at City Bites.  Later we took Mom to the dentist to pay for her dentures and make the big appointment and then the ear place to get her new hearing aid.  It was the usual chaos as she freaked out every few minutes and Barkley argued with her.\r\n\r\nI felt the flu coming on.  It was probably from the visit to the doctor\'s office the day before.  In the evening I went to Walmart and got some NyQuil so I could knock myself out.  I went to sleep at about 8 pm and slept pretty well.\r\n\r\nNow that we\'ve seen the doctor about her leg, she has started complaining about it again.  I told her that she didn\'t say anything to the doctor and acted like everything was okay.', 1, 4, 0, 0, 0, 0, '2019-01-17', NULL, NULL, '2019-01-18 22:46:27', '2019-01-18 22:46:27'),
(572, 1, NULL, NULL, NULL, 'Bali, Indonesia', 'bali-indonesia', NULL, NULL, 1, 8, 57, 1, 1, 0, '2015-04-01', NULL, NULL, '2019-01-18 23:07:12', '2019-02-25 19:12:18'),
(576, 1, NULL, NULL, NULL, 'Brunei', 'brunei', NULL, NULL, 1, 8, 50, 1, 1, 0, '2014-10-04', NULL, NULL, '2019-01-20 21:51:50', '2019-02-25 19:12:36'),
(573, 1, NULL, 561, NULL, 'Friday, January 18, 2019', 'friday-2019-01-18', NULL, 'Mom\'s helper came to the hotel at 09:00 so I went to Java Dave\'s for a few hours.  I had lunch at Uptown Grocery\'s deli since it\'s the closest thing to real food.', 1, 4, 0, 0, 0, 0, '2019-01-18', NULL, NULL, '2019-01-19 20:49:47', '2019-01-19 20:49:47'),
(574, 1, NULL, 561, NULL, 'Tuesday, January 1, 2019', 'tuesday-2019-01-01', NULL, 'Got up at 07:30 and walked over to Walmart to buy a car battery charger. Got one and walked back. It didn\'t have enough charge to turn over the car. Steve came over later and jumped the car and we took it to Walmart to buy a new battery and change the oil.\r\n\r\nWhen we got home, Mom freaked out and had a panic attack because of the cold weather. I took her to the urgent care place because she said she couldn\'t breathe and thought she would pass out. She made the usual crazy spectacle at the clinic and tried to argue with everybody. They measured her blood oxygen and she didn\'t have a breathing problem. She said that she stopped taking her meds so that may have been the problem. She calmed down after we got home so I didn\'t have to fill the prescription for knock-out pills to calm her down and put her to sleep.', 1, 4, 0, 0, 0, 0, '2019-01-01', NULL, NULL, '2019-01-19 20:52:03', '2019-01-19 20:52:03'),
(575, 1, NULL, 561, NULL, 'Saturday, January 19, 2019', 'saturday-2019-01-19', NULL, 'Freezing cold day so we went to B&N briefly and then spent the rest of the day in the room.', 1, 4, 0, 0, 0, 0, '2019-01-19', NULL, NULL, '2019-01-20 06:20:06', '2019-01-20 06:20:06'),
(578, 1, NULL, 561, NULL, 'Sunday, January 20, 2019', 'sunday-2019-01-20', NULL, 'In the morning we went to Target for a long time so Mom could load up on more crap.\r\n\r\nThe NFL playoffs started at 2 pm so I got to watch two great games.  Rams and Patriots are heading to the Superbowl.', 1, 4, 0, 0, 0, 0, '2019-01-20', NULL, NULL, '2019-01-21 23:50:18', '2019-01-21 23:50:18'),
