(587, 1, NULL, NULL, NULL, 'Enable WebServer on MacBook Mojave', 'enable-webserver-on-macbook-mojave', NULL, '1. sudo vi /etc/apache2/httpd.conf\r\n- uncomment line 177: LoadModule php7_module libexec/apache2/libphp7.so\r\n- uncomment line 174: LoadModule userdir_module libexec/apache2/mod_userdir.so\r\n- uncomment line 511: Include /private/etc/apache2/extra/httpd-userdir.conf\r\n- save and quit\r\n\r\n2. sudo vi /etc/apache2/extra/httpd-userdir.conf\r\n- uncomment line 16: Include /private/etc/apache2/users/*.conf\r\n\r\n3. mkdir ~/Sites (creates in user folder: /users/[your short name]/)\r\n\r\n4. sudo vi /etc/apache2/users/[your short user name].conf\r\n\r\n[Directory \"/Users/[your short user name]/Sites/\"]\r\n    Options Indexes MultiViews FollowSymLinks ExecCGI\r\n    AllowOverride All\r\n    Require all granted\r\n[/Directory]\r\n\r\n5. apachectl configtest\r\n\r\nIf this command returns \"Syntax OK\" then you are ready to go. It may also print a warning saying \"httpd: Could not reliably determine the server\'s fully qualified domain name\". You could fix this by setting the ServerName directive in /etc/apache2/httpd.conf and adding a matching entry into /etc/hosts. But for a development server, you don\'t need to do anything. You can just ignore that warning. You can safely ignore other warnings too.\r\n\r\n6. Start/Stop the Service:\r\n\r\nsudo launchctl load -w /System/Library/LaunchDaemons/org.apache.httpd.plist\r\nsudo launchctl unload -w /System/Library/LaunchDaemons/org.apache.httpd.plist\r\n\r\n7. navigate to the site: \r\n\r\nhttp://localhost/~scottwilkinson', 1, 1, 0, 0, 0, 0, NULL, NULL, NULL, '2019-01-24 23:10:23', '2019-01-24 23:31:01'),
(588, 1, NULL, 561, NULL, 'Wednesday, January 23, 2019', 'wednesday-2019-01-23', NULL, 'Went to B&N for a few hours and then went to Cabelas to kill more time.\r\n\r\nLater ay the hotel we got a call from the alarm company because they got a fire alert from the house.  We went over to check it out and the painters had taken down the smoke alarm.', 1, 4, 0, 0, 0, 0, '2019-01-23', NULL, NULL, '2019-01-25 00:14:16', '2019-01-25 00:14:16'),
