(597, 1, NULL, 561, NULL, 'Friday, January 25, 2019', 'friday-2019-01-25', NULL, 'Library in the morning and Uptown Grocery for lunch.\r\n\r\nWe found out that the house won\'t be ready for another week.\r\n\r\nWent to dinner at Panda Express and Mom hated it.  \r\n\r\nOverall she\'s doing a lot better, not much crying and not so much rage.', 1, 4, 0, 0, 0, 0, '2019-01-25', NULL, NULL, '2019-01-26 21:16:33', '2019-01-26 21:16:33'),
