(601, 1, NULL, NULL, NULL, 'Finland', 'finland', NULL, NULL, 1, 8, 48, 1, 1, 0, '2010-04-19', NULL, NULL, '2019-01-31 23:58:37', '2019-02-25 19:12:16'),
(602, 1, NULL, 561, NULL, 'Sunday, January 27, 2019', 'sunday-2019-01-27', NULL, 'We went to the animal shelter to look at dogs and cats.  Mom really liked a blind and deaf dog.\r\n\r\nLater in the afternoon, Barkley called and invited us to dinner at Olive Garden.  We met them and Steve\'s crew at 5:30 pm.', 1, 4, 0, 0, 0, 0, '2019-01-27', NULL, NULL, '2019-02-01 03:26:30', '2019-02-01 03:26:30'),
(603, 1, NULL, 561, NULL, 'Monday, January 28, 2019', 'monday-2019-01-28', NULL, 'Took Mom to the dentist at 1:30 to get all of her teeth removed and to get her dentures.  I went to Starbucks for a few hours.  When I got back they called me to the back because Mom was freaking down.  She was throwing a fit and everybody was looking at her.  I calmed her down so they could finish and then we got out of there.  Her top dentures were hanging out as we walked out of there.\r\n\r\nWe picked up a prescription for pain pills and antibiotics and then went to the hotel to recover.  She did better than expected with the pain.', 1, 4, 0, 0, 0, 0, '2019-01-28', NULL, NULL, '2019-02-01 03:30:43', '2019-02-01 03:30:43'),
(604, 1, NULL, 561, NULL, 'Tuesday, January 29, 2019', 'tuesday-2019-01-29', NULL, 'We went back to the dentist for the post-op check and adjustments.  This time I went back with her and kept her calm.  Everything went a lot better.', 1, 4, 0, 0, 0, 0, '2019-01-29', NULL, NULL, '2019-02-01 03:31:51', '2019-02-01 03:31:51'),
(605, 1, NULL, 561, NULL, 'Wednesday, January 30, 2019', 'wednesday-2019-01-30', NULL, 'Brianna and I accidentally double-dosed Mom with her dentist pills.  The home healthcare guy called me and told me about it.  I shouldn\'t have left the extra pills laying around since I was administering them.  I watched Mom closely for signs of overdose and respiratory distress.  She was just real drowsy but never went to sleep.', 1, 4, 0, 0, 0, 0, '2019-01-30', NULL, NULL, '2019-02-01 03:34:45', '2019-02-01 03:34:45'),
(606, 1, NULL, 561, NULL, 'Thursday, January 31, 2019', 'thursday-2019-01-31', NULL, 'I finished enough of my taxes so that I could send the form to the Washington insurance agency to continue to get the cheap insurance.\r\n\r\nWe went to the house at 4:30 for the big reveal.', 1, 4, 0, 0, 0, 0, '2019-01-31', NULL, NULL, '2019-02-01 03:36:06', '2019-02-01 03:44:00'),
(607, 1, NULL, NULL, NULL, 'France', 'france', NULL, NULL, 1, 8, 50, 1, 1, 0, '2010-06-21', NULL, NULL, '2019-02-02 19:14:32', '2019-02-25 19:11:57'),
(608, 1, NULL, 561, NULL, 'Friday, February 1, 2019', 'friday-2019-02-01', NULL, 'Up at 0600 since we have to check out of the hotel and move the furniture back into the house.\r\n\r\nI left instructions for Brianna to help Mom pack and then bring her to the house.\r\n\r\nI met the alarm guys at 0900 and Ismael and his guy at 0930.  We moved everything in about 2 hours.\r\n\r\nThe rest of the day was spent setting things up and listening to Mom complain about everything.', 1, 4, 0, 0, 0, 0, '2019-02-01', NULL, NULL, '2019-02-02 20:59:40', '2019-02-02 20:59:40'),
(609, 1, NULL, 561, NULL, 'Sunday, February 3, 2019', 'sunday-2019-02-03', NULL, 'Messed around all day and then watched the Superbowl, Patriots beat the Rams, 10 to 3.  I set up a TV and lounge chair in the empty bedroom to watch it.\r\n\r\nWe didn\'t go anywhere all day.  I cleaned the garage up enough to get the car into it.', 1, 4, 0, 0, 0, 0, '2019-02-03', NULL, NULL, '2019-02-04 09:26:15', '2019-02-04 09:26:51'),
(610, 1, NULL, 561, NULL, 'Tuesday, February 5, 2019', 'tuesday-2019-02-05', NULL, 'Brent dropped in on us in the morning and then we went to see his property on Waterloo Road where he has his RV parked.', 1, 4, 0, 0, 0, 0, '2019-02-05', NULL, NULL, '2019-02-06 00:42:54', '2019-02-06 00:42:54'),
(611, 1, NULL, NULL, NULL, 'Gilbraltar', 'gilbraltar', NULL, NULL, 1, 8, 25, 1, 1, 0, '2016-04-03', NULL, NULL, '2019-02-06 05:56:56', '2019-02-25 19:12:37'),
(612, 1, NULL, NULL, NULL, 'Greece', 'greece', NULL, NULL, 1, 8, 35, 1, 1, 0, '2010-05-12', NULL, NULL, '2019-02-08 02:18:09', '2019-02-25 19:12:18'),
(613, 1, NULL, NULL, NULL, 'Holanda', 'holland', NULL, NULL, 1, 8, 44, 1, 1, 0, '2010-04-13', NULL, NULL, '2019-02-08 08:14:33', '2019-02-25 19:12:00'),
(614, 1, NULL, NULL, NULL, 'Hungary', 'hungary', NULL, NULL, 1, 8, 29, 1, 1, 0, '2010-05-01', NULL, NULL, '2019-02-08 08:37:42', '2019-02-25 19:11:50'),
(615, 1, NULL, 561, NULL, 'Saturday, February 9, 2019', 'saturday-2019-02-09', NULL, 'Barkley came over in the afternoon and we took Mom to Walmart.\r\n\r\nI\'m trying to get Mom to eat something besides ice cream.  We got her some breakfast drinks and some baby food but she doesn\'t like any of it.\r\n\r\nShe was full OCD and kept wanting to argue about the stuff in the notebook that I made for her.  It has all the info about her dentures, medical, etc.', 1, 4, 0, 0, 0, 0, '2019-02-09', NULL, NULL, '2019-02-10 19:13:01', '2019-02-10 19:13:01'),
(616, 1, NULL, NULL, NULL, 'Irlanda', 'ireland', NULL, NULL, 1, 8, 17, 1, 1, 0, '2010-04-09', NULL, NULL, '2019-02-13 22:13:02', '2019-02-19 23:55:42'),
(617, 1, NULL, NULL, NULL, 'Vatican City', 'vatican-city', NULL, NULL, 1, 8, 14, 1, 1, 0, '2010-05-27', NULL, NULL, '2019-02-15 23:17:23', '2019-02-23 06:36:11'),
(618, 1, NULL, NULL, NULL, 'Savannah Giraffe', 'savannah-giraffe', NULL, NULL, 1, 1, 0, 0, 0, 0, NULL, NULL, NULL, '2019-02-17 19:10:07', '2019-02-17 19:10:07'),
(619, 1, NULL, 561, NULL, 'Sunday, February 17, 2019', 'sunday-2019-02-17', NULL, 'Drove to Watonga at 11:45 and got there by 1 pm.  Brent and Barkley drove us out to the farm and we looked around.  Found our great grandparents graves at Mt. Pleasant cemetery.  Went to see their deer stand and we climbed into it.  Also went to the old homesite and saw the observatories that were built out there.\r\n\r\nWe got home at about 6 pm and Mom was wiped out.  Traffic was light and it was a sunny day.', 1, 4, 0, 0, 0, 0, '2019-02-17', NULL, NULL, '2019-02-19 07:08:43', '2019-02-20 00:04:17'),
(620, 1, NULL, 561, NULL, 'Tuesday, February 19, 2019', 'tuesday-2019-02-19', NULL, 'Went to PetCo on NW Expressway to try to find more cats to adopt for Mom.  They only had a few and didn\'t have the young ones that I saw online.', 1, 4, 0, 0, 0, 0, '2019-02-19', NULL, NULL, '2019-02-20 00:00:39', '2019-02-20 00:05:17'),
(621, 1, NULL, 561, NULL, 'Monday, February 18, 2019', 'monday-2019-02-18', NULL, 'President\'s Day so some stuff is closed and there is no school so everybody is out and about just like on the week-end.  I went to Walmart and bought Mom a huge amount of stuff, mainly kleenex, TP, and paper towels.', 1, 4, 0, 0, 0, 0, '2019-02-18', NULL, NULL, '2019-02-20 00:02:14', '2019-02-20 00:02:14'),
(622, 1, NULL, NULL, NULL, 'Italy', 'italy', NULL, NULL, 1, 8, 11, 1, 1, 0, '2010-06-08', NULL, NULL, '2019-02-20 00:48:17', '2019-02-23 22:49:59'),
(623, 1, NULL, NULL, NULL, 'SA Oval Flag Examples', 'sa-oval-flag-examples-2019-02-20', NULL, NULL, 1, 1, 0, 0, 0, 0, '2019-02-20', NULL, NULL, '2019-02-20 21:57:11', '2019-02-20 23:52:48'),
(624, 1, NULL, NULL, NULL, 'The List of Newest Samples', 'the-list-of-newest-samples-2019-02-20', NULL, NULL, 1, 1, 0, 0, 0, 0, '2019-02-20', NULL, NULL, '2019-02-20 23:23:28', '2019-02-20 23:23:28'),
(625, 1, NULL, 561, NULL, 'Wednesday, February 20, 2019', 'wednesday-2019-02-20', NULL, 'Took Mom to Pier 1 and Bed Bath to buy stuff for the house.  Later I did some paint touch up in the house.', 1, 4, 0, 0, 0, 0, '2019-02-20', NULL, NULL, '2019-02-21 09:51:56', '2019-02-21 09:51:56'),
(626, 1, NULL, 561, NULL, 'Sunday, February 24, 2019', 'sunday-2019-02-24', NULL, 'Took Mom to Ashley Furniture by Quail Springs to look for a big chair for her room.  We got some lunch at Arby\'s then messed around the rest of the day.  Watched the Oscars that night.', 1, 4, 0, 0, 0, 0, '2019-02-24', NULL, NULL, '2019-02-25 20:35:08', '2019-02-25 20:35:08');
INSERT INTO `entries_v1` (`id`, `title`, `description`, `description_language1`, `user_id`, `type_flag`, `view_count`, `map_link`, `is_template_flag`, `uses_template_flag`, `created_at`, `updated_at`) VALUES
(8, 'Day Trip: Barcelona to Montserrat', 'Santa Maria de Montserrat is a Benedictine abbey located on the mountain of Montserrat, in Monistrol de Montserrat, in Catalonia, Spain. It is notable for enshrining the image of the Virgin of Montserrat. The monastery was founded in the 11th century and rebuilt between 19th and 20th centuries, and still functions to this day.', NULL, 1, -1, 0, NULL, 0, 0, '2018-04-15 22:32:10', '2018-04-16 09:21:33'),
(33, 'May 29th, Tues', 'Up at about 5:30 am, headed downtown to do the Queen Anne Loop in reverse.  Lovely hike in the cool weather.  Was pretty chilly at first.\r\n\r\nAfterwards, went to the Macs by the Space Needle for coffee and a Sausage McMuffin.  Then caught the bus to Pacific Place and went to B&N to read China travel books.  Found some excellent info in the Lonely Planet and made a list.\r\n\r\nGot home at about noon for lunch and stayed inside the rest of the day.  Started packing up some stuff to get the condo ready to abandon.', NULL, 1, -1, 0, NULL, 0, 0, '2018-05-30 09:21:11', '2018-05-30 09:21:11'),
(11, 'Home of the Big Stalin Head', 'Ulan-Udes Lenin was unveiled in 1971 and you might think that by this time, there was nowhere left to go in terms of design.  But father and son team Georgy and Yuri Neroda succeeded in their monument which consists of just a giant Lenin head. With its pedestal it stands at 7.7m and you cant help but be impressed, or at least amused!  Locals often arrange to meet friends at The Head. Note that many people believe that Lenins Asian features appear to have been emphasised especially due to its location in Buryatia, although there is no evidence that this was intentional.', NULL, 1, -1, 0, NULL, 0, 0, '2018-04-14 22:48:39', '2018-04-16 09:22:37'),
(12, 'Olympic National Park Hikes', 'Port Angeles\r\n- Marymere Falls nature trail, 1.8 miles\r\n- Sol duc falls trail, 1.6 miles, 1 hr from Port Angeles\r\n\r\n- Hoh Rain Forest Visitor Center / approximately 31 miles south of Forks off Highway 101 / 2018 Season: Open Friday - Sunday March 2 - May 24; Open Daily May 25 - September 4. Closed September 5 - mid October, Open Friday - Sunday in mid October - December 2018.\r\n\r\n- July: Staircase day hike\r\n- July: Mount Walker\r\n\r\nCoast\r\n- Wedding Rock Petroglyphs: From Ozette, 4.5 miles to Petroglyphs one way, (3 miles to the beach, one way)\r\n- Ruby Beach, .5 miles\r\n- Shi Shi Beach and Point of the Arches, 8 miles r/t\r\n- Mount Ellinor', NULL, 1, -1, 0, NULL, 0, 0, '2018-04-15 01:20:54', '2018-05-29 23:03:28'),
(34, 'China To Do', '- set up emergency info\r\n-', NULL, 1, -1, 0, NULL, 0, 0, '2018-05-30 20:24:53', '2018-05-30 20:24:53'),
