(1, 'entries', 1, 'es', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'Paseo Martimo de Seattle al Lago Unin a Travs del Ship Canal', 'Seattle-Waterfront-to-Lake-Union-via-Ship-Canal', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'Este circuito de 8,5 millas de caminata o bicicleta comienza en el Olympic Sculpture Park en la entrada a Myrtle Edwards Park (Broad Street y Elliot Avenue). Desde Elliot Bay Trail hay un sendero para bicicletas protegido que se conecta con South Ship Canal Trail y luego se une al Lake Union Loop Trail.', 'Fantsticas vistas del centro de Seattle, Elliott Bay, Puget Sound, y las montaas olmpicas.', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 0, 0, '2018-12-22 08:48:10', '2018-12-31 10:04:53'),
