(24, 'entries', 553, 'es', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'Mercado de Pulgas de Panjiayuan de Beijing', 'china-beijing-panjiayuan-flea-market-2018-12-16', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'El mercado de pulgas de Panjiayuan es un gran mercado al aire libre con cientos de vendedores que venden todo tipo de antigedades, piedras, obras de arte, muebles, recuerdos polticos y mucho ms.\r\n\r\nEst preparado para negociar, ya que el primer precio cotizado suele ser muy alto y negociable. Cuando haga una contraoferta, asegrese de que haya espacio para ms negociacin. El precio final podra ser de hasta el 50% de la primera cotizacin. Est preparado para alejarse. Otra buena estrategia es sacar la cantidad de su oferta final en efectivo y agitarla e intentar drsela al vendedor.\r\n\r\nPara llegar al mercado de pulgas de Panjiayuan de Beijing:\r\n- Tome la lnea 10 del metro hasta la parada de Panjiayuan y use la salida B.\r\n- La entrada al mercado est a unos 50 metros al oeste de la salida (en direccin opuesta al paso elevado de la autopista).', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 0, 0, '2018-12-27 22:44:14', '2018-12-27 22:47:58'),
(25, 'entries', 553, 'zh', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '', 'china-beijing-panjiayuan-flea-market-2018-12-16', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '\r\n\r\n  50  \r\n\r\n\r\n - 10B\r\n - 50', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 0, 0, '2018-12-27 22:46:27', '2018-12-27 22:46:27'),
(26, 'entries', 554, 'es', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'Nankn a Pekn en Tren', 'china-nanjing-to-beijing-by-train-2018-12-15', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'El tren bala de alta velocidad de Nankn a Beijing sale de la estacin de tren de Nankn South (Nanjingnan) en Map Location: 31.970243, 118.79361.\r\n\r\nEl viaje dura aproximadamente cuatro horas y hace paradas en algunas ciudades a lo largo del camino. El tren llega a la estacin de tren del sur de Beijing (Beijingnan) en Map Location: 39.862767, 116.373839. La entrada al metro de Beijing est dentro de la estacin de ferrocarril.', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 0, 0, '2018-12-27 22:59:35', '2018-12-29 00:48:02'),
(27, 'entries', 554, 'zh', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '', 'china-nanjing-to-beijing-by-train-2018-12-15', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'Map Location31.970243,118.79361\r\n\r\n Map Location: 39.862767,116.373839 ', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 0, 0, '2018-12-27 23:01:47', '2018-12-28 10:52:56'),
(28, 'entries', 551, 'es', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'Grand Hyatt Beijing', 'grand-hyatt-beijing-china-2018-12-15', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'No.1 Avenida East Chang An, Dongcheng, Beijing, China\r\n\r\nMap Location: 39.908357, 116.408271 \r\n\r\nTelfono: +86 10 8518 1234', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 0, 0, '2018-12-28 23:33:13', '2018-12-28 23:33:13'),
(29, 'entries', 549, 'es', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'Mapa del Metro de Nankn China', 'nanjing-china-subway-metro-map', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'El metro de Nankn es barato, rpido y eficiente. Es grande y extenso con 10 lneas diferentes.\r\n\r\nLas mquinas expendedoras de billetes aceptan tanto monedas como billetes, y las lneas suelen ser bastante cortas.', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 0, 0, '2018-12-28 23:38:17', '2018-12-28 23:44:18'),
