(31, 'entries', 548, 'zh', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '', 'zhongshan-mountain-national-park-2018-12-14', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '\r\n\r\n\r\n\r\n\r\n\r\nMuxuyuan\r\n\r\n\r\n\r\n70100\r\n\r\n', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 0, 0, '2018-12-28 23:53:28', '2018-12-28 23:53:28'),
(32, 'entries', 559, 'zh', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '', 'sunday-souvenir-shopping-in-beijing-china-2018-12-16', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 0, 0, '2018-12-29 00:08:00', '2018-12-29 00:08:00'),
(33, 'entries', 559, 'es', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'Domingo, Comprando Recuerdos en Beijing', 'sunday-souvenir-shopping-in-beijing-china-2018-12-16', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'Era el ltimo da de mi viaje de seis meses, as que compr algunos recuerdos pesados que haba estado retrasando ya que no quera agregar peso a mi equipaje.\r\n\r\nPrimero fui a unas pocas tiendas en la calle Wangfujing y luego tom el metro hasta el Mercado de Pulgas de Panjiayuan. Una vez que llegu me di cuenta de que haba estado all antes.\r\n\r\nEl mercado de pulgas es enorme. Es principalmente para locales, no para turistas, por lo que no hay tiendas de souvenirs tpicas, sino muchas cosas de tipo souvenir. Compr un gran Buda de metal plateado y un dragn de cobre que pesaban unos cuantos kilos. Tuve que hacer algunas negociaciones difciles para conseguir buenos precios. Tuve que hacer el \"alejamiento\" y luego volv para intentarlo de nuevo con el mismo chico. Las estatuas pesaban lo suficiente como para tener que llevarlas de regreso al hotel antes de continuar.\r\n\r\nLuego fui a la calle Qianmen, donde hay algunas grandes tiendas de recuerdos. No compr nada en la calle principal, pero encontr algunas tiendas pequeas en uno de los hutongs cercanos (map location: 39.893301, 116.385806). Hice algunas negociaciones difciles all tambin con una jovencita dulce que realmente quera hacer algunas ventas y sigui agarrando mi brazo para mantenerme en la tienda. Le compr algunas cosas caras por unos 20 USD.', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 0, 0, '2018-12-29 00:11:59', '2019-01-12 19:14:17'),
(34, 'entries', 558, 'es', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'Sbado, Nankn a Pekn en Tren', 'saturday-nanjing-china-to-beijing-china-by-train-2018-12-15', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'Sal del hotel bastante tarde ya que mi tren no era hasta el medioda. Tom el metro hasta la estacin de tren y mat el tiempo en Starbucks. Fue un fcil viaje de cuatro horas en tren a Pekn. Tena un asiento en el pasillo, as que me levant y camin mucho.\r\n\r\nEl tren lleg a la estacin de tren del sur de Pekn. Todava tena mi tarjeta de metro de Pekn de la ltima vez y me sorprendi que an funcionara despus de unos cinco meses. El hotel fue fcil de encontrar y estaba a pocas cuadras de la estacin de metro.\r\n\r\nPor la noche, me acerqu a la calle de comida del mercado nocturno de Wangfujing y com un poco de carne de pato que estaba mayormente gorda. Haca mucho fro en Pekn, pero el aire era bastante claro para variar.', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 0, 0, '2018-12-29 00:20:00', '2018-12-29 00:22:21'),
