(36, 'entries', 548, 'es', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'Parque Nacional de la Montaa Zhongshan', 'zhongshan-mountain-national-park-2018-12-14', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'El Parque Nacional de la Montaa Zhongshan est en Nanjing, China, y contiene las tumbas de la dinasta Ming. Es fcilmente accesible en los suburbios de Nanjing.\r\n\r\nEl rea ms popular es el rea Escnica de la Tumba Ming, que tiene la Va Sagrada de las Tumbas Ming y el rea Escnica del Mausoleo del Dr. Sun Yat-sen con un gran complejo de mausoleos azules.\r\n\r\nCmo llegar all:\r\n\r\nTome el Metro de Nanjing hasta la parada Muxuyuan y siga las indicaciones hasta la entrada del parque.\r\n\r\nCuota de entrada:\r\n\r\nHay varias opciones de entrada que contienen acceso a las diferentes reas que van desde 70 a 100 yuanes.\r\n\r\nDentro del parque, hay lanzaderas elctricas disponibles para las diferentes atracciones.', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 0, 0, '2018-12-29 00:57:33', '2018-12-29 00:57:33'),
