(38, 'entries', 557, 'es', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'Viernes, Todo el Da en Nanjing', 'friday-all-day-in-nanjing-china-2018-12-14', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'Por la maana, tom el metro hasta el Parque Nacional de la Montaa Zhongshan, que tiene algunas tumbas Ming. Camin por el Camino Sagrado de las Tumbas Ming para ver las grandes esculturas de roca de leones, camellos y elefantes.', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 0, 0, '2018-12-29 01:06:39', '2018-12-29 01:07:44'),
