(40, 'entries', 547, 'es', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'Jinling Hotel', 'jinling-hotel-nanjing-china-2018-12-13', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '2 Han Zhong Road, Xin Jie Kou Square, Gu Lou, Nanjing\r\n\r\nMap Location: 32.044718, 118.77805, Junto a la parada de metro Xinjiekou, salida 6..\r\n\r\nTelfono: +86 25 8471 1888\r\n\r\nUn cmodo hotel de alta gama con habitaciones antiguas en el centro de Nanjing. Buena A/C, agua caliente, e Internet lento.', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 0, 0, '2018-12-29 05:03:09', '2018-12-29 05:03:09'),
(42, 'entries', 546, 'es', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'Guilin a Nanjing en Tren', 'guilin-china-to-nanjing-china-by-train-2018-12-13', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'El tren bala de alta velocidad de Guilin a Nanjing sale de la estacin de trenes de Guilan en la Map Location: 25.263934, 110.278184.\r\n\r\nEl viaje dura casi nueve horas y hace paradas en todas las ciudades importantes en el camino. El tren llega a la estacin de tren de Nanjing Sur (Nanjingnan) en la Map Location: 31.970714, 118.79314. La entrada al metro de Nanjing est dentro de la estacin de tren.', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 0, 0, '2018-12-31 05:53:21', '2018-12-31 05:53:55'),
(43, 'entries', 546, 'zh', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '', 'guilin-china-to-nanjing-china-by-train-2018-12-13', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, ' Map Location25.263934,110.278184\r\n\r\n9 Map Location31.970714,118.79314 ', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 0, 0, '2018-12-31 05:53:21', '2018-12-31 05:53:21'),
(44, 'entries', 545, 'es', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'Kunming a Guilin en Tren', 'kunming-china-to-guilin-china-by-train-2018-12-10', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'El tren bala de alta velocidad de Kunming a Guilin sale de la estacin de tren de Kunming Sur (Kunmingnan) en la Map Location: 24.873364, 102.860323, que es la ltima parada en el extremo sur de la lnea 1-2 del metro de Kunming. La estacin de tren del sur est a unos 35 kms del centro de Kunming.\r\n\r\nEl tren tarda aproximadamente cuatro horas y llega a la estacin de tren de Guilin Oeste (Guilinxi), Map Location: 25.357449, 110.262318. La estacin de tren est a unos 15 kms del centro de Guilin.', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 0, 0, '2018-12-31 05:56:17', '2018-12-31 05:56:17'),
(45, 'entries', 545, 'zh', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '', 'kunming-china-to-guilin-china-by-train-2018-12-10', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, ' Map Location: 24.873364,102.8603231-2 35\r\n\r\n4Map Location: 25.357449,110.262318 15', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 0, 0, '2018-12-31 05:56:17', '2018-12-31 05:57:32'),
(46, 'entries', 541, 'es', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'Sheraton Guilin Hotel', 'sheraton-guilin-hotel-china-2018-12-10', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '15 Bin Jiang Road, Li Riverside, cerca de Tronco de elefante, Guilin, China\r\n\r\nMap Location: 25.273943, 110.299404.\r\n\r\nTelfono: +867732825588\r\n\r\nUn hotel grande y exclusivo frente al ro Li en Guilin, China. El hotel tiene buen aire acondicionado, WiFi y agua caliente. Las habitaciones tambin cuentan con TV de pantalla plana, escritorio y camas cmodas. La propiedad tiene un bar, restaurante, cafetera y piscina.', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 0, 0, '2018-12-31 06:00:54', '2018-12-31 06:00:54'),
(47, 'entries', 541, 'zh', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '', 'sheraton-guilin-hotel-china-2018-12-10', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '15\r\n\r\nMap Location: 25.273943,110.299404\r\n\r\n+867732825588\r\n\r\n WiFi     ', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 0, 0, '2018-12-31 06:00:55', '2018-12-31 06:00:55'),
(48, 'entries', 538, 'es', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'Cosas que hacer en Vientiane, Laos', 'things-to-do-in-vientiane-laos-2018-11-29', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'El centro de Vientiane tiene un buen ambiente y tiene un ambiente de ciudad pequea. Hay un montn de pequeas cafeteras y restaurantes para los turistas. Adems, aqu hay algunos lugares populares para visitar:\r\n\r\nMekong River Park and Walk Way (Map Location: 17.960936, 102.608801) - Un bonito parque y pasarela cerca del ro. Por la noche est abierto un gran mercado nocturno con puestos de comida y muchas tiendas de recuerdos. Tambin hay un punto de vista de la puesta de sol en la Map Location: 17.963488, 102.601492.\r\n\r\nBuddha Park (Map Location: 17.912278, 102.765176) - Un lugar emblemtico, debe visitar la atraccin fuera de Vientiane. El Buddha Park es una atraccin turstica y no es una vista religiosa autntica, pero es divertido de visitar y es muy fotognico. Est a 20 a 25 km del centro de Vientiane. Para llegar all, tome el autobs 14 desde cerca de la estacin central de autobuses en Map Location: 17.962799, 102.615756. El autobs tambin se detiene en el cruce de la frontera a Tailandia en el Puente de la Amistad. El autobs es lento pero barato y mejor que tener que lidiar con los conductores de tuk-tuk. Los conductores de autobuses saben que los extranjeros se bajan en la frontera o en el Parque de Buda.\r\n\r\nParque Patuxay y Arco (Map Location: 17.970634, 102.618614) - Un parque con la enorme versin asitica del Arco del Triunfo en Pars. El arco tiene una bonita decoracin y una fuente enfrente. Es un paseo fcil desde el centro de la ciudad cerca del ro.\r\n\r\nrea del templo Wat That Luang (Map Location: 17.97666, 102.636492) - Un complejo con varios templos y una gran estupa dorada. El rea es agradable con todos los sitios tpicos, incluyendo una gran cantidad de puestos de souvenirs. Es un poco fuera del centro de la ciudad. Un viaje en tuk-tuk costar alrededor de 20000 kip por trayecto. Tambin hay una parada de autobs para regresar al centro de la ciudad en la Map Location: 17.974584, 102.634142.\r\n\r\nTemplo Wat Sisaket (Map Location: 17.963123, 102.611215) - Un pequeo templo en el centro de Vientiane. No es muy impresionante pero puede valer la pena una visita.', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 0, 0, '2018-12-31 06:04:59', '2018-12-31 06:07:26'),
