(73, 'entries', 134, 'es', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'Sobre el Sitio', 'page-about', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'Derechos de autor\r\n\r\nTodas las imgenes, fotos, grficos y contenido de este sitio  1998-2019 [[site-name]]. Todos los derechos reservados. No copie, archive ni vuelva a publicar sin el permiso por escrito del autor. Para obtener ms informacin, pngase en contacto con [[site-email]].\r\n\r\nEspecificaciones tcnicas\r\n\r\nEste sitio web utiliza PHP 7, MySQL 5.7, Laravel 5.4, Bootstrap 3.3.5 y jQuery 2.1.4.\r\n\r\nCmo utilizar las ubicaciones de mapas\r\n\r\nLas ubicaciones del mapa se proporcionan como coordenadas GPS en formato de Grado decimal (DD), por ejemplo: Map Location: 47.543370, -122.386878.\r\n\r\nSe puede hacer clic o presionar una ubicacin en el mapa para abrir la ubicacin en Google Maps. Adems, las coordenadas se pueden copiar haciendo clic o presionando el cono del portapapeles a la derecha de las coordenadas y luego pegndolos en otras aplicaciones de mapeo como [Maps.me] (https://maps.me/), [Bing Maps ] (https://www.bing.com/maps), o [Baidu Maps ] (https://map.baidu.com/).', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 0, 0, '2018-12-31 10:46:46', '2019-01-25 20:24:45'),
