(75, 'entries', 556, 'es', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'Jueves, Guilin a Nanjing en tren', 'thursday-guilin-china-to-nanjing-china-by-train-2018-12-13', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'Tom un taxi hasta la estacin de tren de Guilin, que estaba a solo unos kilmetros de distancia. Fue un largo viaje en tren de ocho horas pero sin incidentes. El tren de alta velocidad hizo muchas paradas en el camino.\r\n\r\nEn Nanjing, llegamos a la estacin de tren de Nanjing Sur (Nanjingnan). Tom el metro hasta el hotel Jinling. Nanjing es una ciudad enorme con muchos edificios altos que se iluminan por la noche. El hotel de gran altura fue fcil de encontrar justo detrs de la estacin de metro en el centro de la ciudad.', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 0, 0, '2018-12-31 20:18:23', '2018-12-31 20:18:23'),
(76, 'entries', 556, 'zh', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, ' ', 'thursday-guilin-china-to-nanjing-china-by-train-2018-12-13', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, ' 8 \r\n\r\n   ', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 0, 0, '2018-12-31 20:18:23', '2018-12-31 20:18:23'),
(77, 'entries', 544, 'es', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'Martes, Guilin a Yangshuo Li en un Paseo en Barco', 'tuesday-china-guilin-to-yangshuo-li-river-boat-tour-2018-12-11', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'El autobs turstico me recogi en el hotel aproximadamente a las 08:00 y luego nos dirigimos al muelle que estaba entre Guilin y Yangshuo.  Hubo muchos barcos y muchos turistas en este da fro, gris y lluvioso de diciembre.  Yo era el nico occidental, por lo que el gua turstico tuvo que dar su discurso en ingls solo para m en el barco de unas cien personas. No pude escuchar la mayor parte de eso.\r\n\r\nEl paisaje fue asombroso cuando el bote recorri las montaas Karst en el crucero de cuatro horas. Los chinos corran de lado a lado y de adelante hacia atrs para obtener las mejores fotos. Lo ms destacado fue el lugar en el ro que se muestra en la nota de 20 yuanes. En este punto, todos levantaron una nota de 20 yuanes y se tomaron una foto con el paisaje montaoso a juego. No tena uno, as que un chico chino me dej tomarle una foto mientras la sostena frente a mi cmara. Tenamos un buen almuerzo de arroz y algo ms a mitad del viaje.\r\n\r\nEn Yangshuo tuvimos algunas horas de tiempo libre para caminar desde el muelle hasta el punto de encuentro en un hotel a pocos kilmetros de distancia. La calle principal, Calle West, era todas tiendas de recuerdos, bares y restaurantes brillantes para los turistas. Tambin haba un McDonald\'s y un KFC en la pequea ciudad.\r\n\r\nLa segunda parte del tour fue un paseo en un pequeo bote que atraves una cueva y luego gir en una pequea rama del ro. Tenan un pueblo indgena falso con msicos tocando tambores y bailando.\r\n\r\nEl autobs de tour nos llev de regreso a Guilin y el punto de entrega final fue en frente de mi hotel a las 19:00. Nadie me estaba molestando por propinas, lo que fue un cambio agradable.', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 0, 0, '2018-12-31 20:33:10', '2018-12-31 20:33:10'),
(78, 'entries', 544, 'zh', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '', 'tuesday-china-guilin-to-yangshuo-li-river-boat-tour-2018-12-11', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '08:00100\r\n\r\n2020\r\n\r\n\r\n\r\n\r\n\r\n19:00', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 0, 0, '2018-12-31 20:33:10', '2018-12-31 20:33:10'),
(79, 'entries', 543, 'es', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'El lunes, fui de Kunming a Guilin en tren', 'monday-went-from-kunming-china-to-guilin-china-by-train-2018-12-10', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'Desayun y luego me fui del hotel antes de las 7:00. Todava estaba oscuro afuera mientras caminaba las dos largas cuadras hasta la estacin de Metro. Tom el metro hasta la ltima parada, que es la estacin de tren de Kunming Sur.  El metro estaba lleno, pero no estaba tan lleno como en otras ciudades chinas durante la hora pico. El secreto es ir siempre al primer o ltimo vagn del tren y acercarse a la pared con el equipaje. Generalmente hay ms espacio en esa rea.\r\n\r\nEn la estacin de tren, tom un caf en McDonald\'s y luego la entrada de la plataforma ya estaba abierta, casi sin lneas, as que me dirig directo al tren. Tuve un asiento vaco a mi lado para el viaje de 4 horas y el viaje pas muy rpido. Compr un caf de 6 USD durante el viaje sin darme cuenta de lo caro que era.\r\n\r\nEn Guilin, tom un taxi hasta el hotel, pero el mapa de Maps.me y Booking.com me decepcionaron nuevamente y el hotel no estaba en la ubicacin del mapa. Tuve que tomar otro taxi hasta la ubicacin real una vez que encontr otra entrada para l en el mapa.\r\n\r\nGuilin es una ciudad hermosa y limpia a la par del ro. Es uno de los principales destinos tursticos de China debido a los espectaculares paisajes a lo largo del ro Li. Incluso en el invierno hay muchos turistas chinos alrededor e unos pocos anglosajones.\r\n\r\nTuve un almuerzo caliente pero picante de carne y pimientos. Tengo que mirar las fotos del men ms de cerca. Solo pens que las cosas verdes eran verduras pero eran puros chiles picantes. Puedo comer los que no tienen semillas, pero no hay muchos as.\r\n\r\nDespus de la comida, fui a una agencia de viajes para comprar un viaje en barco de todo el da para el da siguiente. Haba dos chicas muy jvenes que me ayudaron a reservar el viaje y luego creo que su madre lleg y lo termin por m.', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 0, 0, '2018-12-31 20:43:12', '2018-12-31 20:43:12'),
(80, 'entries', 543, 'zh', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '', 'monday-went-from-kunming-china-to-guilin-china-by-train-2018-12-10', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '07:00\r\n\r\n46\r\n\r\nMaps.meBooking.com\r\n\r\n\r\n\r\n\r\n\r\n', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 0, 0, '2018-12-31 20:43:12', '2018-12-31 20:43:12'),
(81, 'entries', 536, 'es', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'Holiday Inn Kunming City Centre', 'holiday-inn-kunming-city-centre-2018-12-07', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'No. 29 Dongfeng East Road, Panlong, Kunming, China\r\n\r\nMap Location: 25.037962, 102.725057\r\n\r\nTelfono: +86 871 6316 5888\r\n\r\nUn hotel de alta categora en el centro de Kunming que cuenta con 293 habitaciones con aire acondicionado, refrigeradores, televisores de pantalla plana, Wi-Fi, cajas de seguridad y abundante agua caliente. Tambin cuenta con varios restaurantes, una piscina cubierta y un gimnasio.', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 0, 0, '2019-01-01 06:47:39', '2019-01-01 06:47:39'),
